            { 10013, new TwewyItem(10013, 13, @"tile769", @"3-for-1 Sock Pak", @"３足セットくつした", @"Calcetines 3x1", @"Set di calzini 3x1", @"3er-Pack Socken", @"3 paires de chaussettes", @"襪子３雙組", @"袜子3双组", @"Wacky-colored socks now on clearance. Sold in packs of three, these socks are another regular in Mus Rattus's bargain bins.", @"売れ残りのすごい色の靴下　３足セット\nムース・ラットゥス名物のワゴンセールで\n山積みになって売られている", @"Calcetines de colorines, de oferta por liquidación. Se venden en paquetes de tres y son ya un elemento habitual en los cestos de chollos de Mus Rattus.", @"Calzini di colore bizzarro ora in liquidazione. Queste calze, vendute in pacchi da tre, sono un altro articolo tipico del reparto occasioni di Mus Rattus.", @"Socken in krassen Farben, jetzt im Sonderangebot. Werden in Dreierpacks verkauft und sind häufig auf den Wühltischen von Mus Rattus vertreten.", @"Des chaussettes aux couleurs farfelues actuellement en soldes. Vendues par paquets de trois, ces chaussettes sont d'autres habituées des bacs de soldes de Mus Rattus.", @"賣剩的古怪顏色襪子，以３雙組合販售，\n在Mus Rattus的促銷推車裡堆積如山。", @"卖剩的古怪颜色袜子（3双组合销售） \n在Mus Rattus知名的\n促销推车里堆积如山。") },
            { 10014, new TwewyItem(10014, 14, @"tile770", @"Mowzy", @"ネズミー君", @"Mowzy", @"Mowzy", @"Mowzy", @"Mowzy", @"鼠鼠弟", @"鼠鼠弟", @"Mus Rattus mascot Mowzy in stuffed animal form. A bunch were made, but zero sold, leaving them to sleep in storage...", @"ブランドキャラクター・ネズミー君のぬいぐるみ\n大規模キャラ展開の為に作られたが全く売れず\n倉庫で眠っていた過去をもつ", @"Peluche de Mowzy, la mascota de Mus Rattus. Se fabricaron unos cuantos, pero no se vendió ni uno. Están en el almacén, cogiendo polvo.", @"Mowzy, la mascotte di Mus Rattus, sotto forma di peluche. Ne sono stati realizzati un mucchio... ma non ne è stato venduto nessuno. Questi pupazzi dormono ancora beati in magazzino...", @"Das Maskottchen von Mus Rattus, Mowzy, als Stofftier. Es wurden einige gemacht, aber genau null Stück verkauft, und jetzt schlummern sie im Lager ...", @"Une peluche de Mowzy, la mascotte de Mus Rattus. Beaucoup ont été fabriquées, mais aucune n'a été vendue, elles ont donc été reléguées en réserve...", @"品牌吉祥物──鼠鼠弟的布偶，\n為了大規模拓展角色知名度而製造，\n但卻完全賣不出去，只能放在倉庫裡生灰塵。", @"品牌吉祥物──鼠鼠弟的布偶 \n为了大规模拓展角色知名度而制造，\n但却完全卖不出去，只能放在仓库里生灰尘。") },
            { 10015, new TwewyItem(10015, 15, @"tile771", @"Backpack", @"リュックサック", @"Mochila", @"Zaino", @"Rucksack", @"Sac à dos", @"背包", @"背包", @"This simple nylon backpack accommodates everything from drinks to posters to action figures, making it a popular item.", @"シンプルなナイロンリュック\nペットボトルからポスター、フィギュアまで\n何でも入るので一部の客にとっても人気☆", @"En esta sencilla mochila de nailon puedes meter cualquier cosa, desde bebidas hasta pósteres o figuras de acción. Por eso es un artículo tan popular.", @"Questo semplice zaino di nylon può contenere di tutto, dalle bevande, ai poster, ai pupazzetti: questo lo rende un articolo molto amato.", @"In diesen einfachen Nylonrucksack passt alles von Getränken über Poster bis hin zu Actionfiguren, weshalb er auch so beliebt ist.", @"Ce sac à dos simple en nylon peut contenir des boissons aux posters en passant par les figurines, ce qui en fait un accessoire très populaire.", @"樣式簡單的尼龍背包，\n從寶特瓶、海報到公仔都能放進去，\n因此極受一部分的顧客喜愛☆", @"样式简单的尼龙背包 \n从水筒、海报到公仔都能放进去，\n因此极受一部分的顾客喜爱☆") },
            { 10016, new TwewyItem(10016, 16, @"tile772", @"Canvas Tote", @"キャンパストート", @"Bolsa de lona", @"Borsa di tela", @"Segeltuch-Tragetasche", @"Cabas en toile", @"帆布托特包", @"帆布托特包", @"You could shove a year's worth of manga into this durable tote bag...which might explain the surge in sales every August and December.", @"頑丈なキャンパス地のトートバッグ\nうすい本なら１００冊は余裕で入りそう\nなぜか夏と年末になると需要が高まる", @"En esta resistente bolsa de tela puedes meter todo el manga de un año... lo que explicaría la explosión de ventas en los meses de agosto y diciembre.", @"Potresti stipare questa resistentissima borsa di tela con tutti i manga usciti in un anno... il che spiega perché ad agosto e a dicembre fanno la fila per acquistarne una.", @"In diese robuste Tragetasche könnte man ein Jahresabo an Mangas stopfen ... Was wohl auch erklärt, warum sie sich im August und Dezember so gut verkauft.", @"Vous pourriez fourrer une année entière de mangas dans ce sac en toile durable... ce qui pourrait expliquer les hausses des ventes systématiques en août et en décembre.", @"堅固的帆布托特包，\n能夠輕鬆裝入１００本漫畫，\n不知為何到了夏季與年底需求就會增加。", @"坚固的帆布托特包 \n能够轻松装入100本小薄本，\n不知为何到了夏季与年底需求就会增加。") },
            { 10017, new TwewyItem(10017, 17, @"tile773", @"Nylon Waist Pack", @"ナイロンウエストポーチ", @"Riñonera de nailon", @"Marsupio di nylon", @"Nylon-Hüfttasche", @"Sac-banane en nylon", @"尼龍腰包", @"尼龙腰包", @"These extremely handy hip pouches hold a lot more than you'd think. Definitely a handy item when August and December roll around.", @"扱いやすさ抜群のナイロンウエストバッグ　　\n見かけによらず大容量でとっても便利\nこれまた、なぜか夏と年末になると需要が高まる", @"En estas prácticas riñoneras cabe mucho más de lo que crees. Sin duda, un objeto práctico en los meses de agosto y diciembre.", @"Questo pratico marsupio è molto più capiente del previsto, e può tornare decisamente utile ad agosto e dicembre.", @"Diese extrem praktischen Hüfttaschen bieten mehr Platz, als man meint. Kann man im August und Dezember besonders gut gebrauchen.", @"Ces bananes extrêmement fonctionnelles peuvent contenir bien plus de choses que vous ne l'imaginez. Un accessoire particulièrement pratique en août et en décembre.", @"超好用的尼龍腰包，\n出乎意料的大容量實在方便到不行，\n這個也不知為何到了夏季與年底需求就會增加。", @"超好用的尼龙腰包 \n出乎意料的大容量，十分方便，\n这个也不知为何到了夏季与年底需求就会增加。") },
            { 10018, new TwewyItem(10018, 18, @"tile774", @"Stronger Cap", @"強めキャップ", @"Gorra reforzada", @"Berretto tosto", @"Robustere Kappe", @"Casquette renforcée", @"硬漢帽", @"硬汉帽", @"A cap decked out in patches and studs. Hard-edged enough to make you seem a little bad, not to mention 30% more stylish.", @"ワッペンやスタッズの飾りつきキャップ\nかぶるだけでハードな印象を演出できる\nいつものスタイルでも、これでオシャレ度３割増し", @"Gorra decorada con parches y tachuelas. Tiene un diseño duro que da aires de malote y un 30% más de estilo.", @"Un cappellino rivestito di pezze e borchie. Tosto abbastanza da farti sembrare un vero figo... per non parlare del 30% di stile in più.", @"Eine Kappe mit Aufnähern und Nieten. Krass genug, damit man ein bisschen verwegen aussieht, und natürlich auch 30 % stylisher.", @"Une casquette recouverte de patchs et de clous. De quoi vous donner un petit air rebelle et augmenter votre coolitude de 30 %.", @"附有刺繡與鉚釘裝飾的鴨舌帽，\n光是戴在頭上就能讓人留下硬派的印象，\n以平常的穿搭風格，加上這頂就多時髦３成。", @"附有刺绣与铆钉装饰的鸭舌帽 \n光是戴在头上就能让人留下硬派的印象，\n以平常的穿搭风格，\n加上这顶也会增加30%的时髦度。") },
            { 10019, new TwewyItem(10019, 19, @"tile775", @"Star Cap", @"スターキャップ", @"Gorra estrella", @"Berretto da star", @"Sternen-Kappe", @"Casquette étoile", @"星星帽", @"星星帽", @"This pink cap features extreme stitching bold enough to stand up to the hot summer sun. Simple, but stylish!", @"派手なししゅう飾りのピンク色キャップ\n夏の日差しに負けないビビッドカラーで\nシンプルスタイルもインパクトＵＰ！", @"Esta gorra rosa tiene unas costuras exageradas, lo bastante fuertes como para protegerte del sol. Sencillez y estilo.", @"Questo cappellino rosa ha delle cuciture abbastanza grosse da poter resistere al sole estivo più cocente. Semplice, ma super trendy!", @"Diese pinke Kappe ist mit extremen Stickereien versehen und damit auch der heißen Sommersonne gewachsen. Einfach, aber stilvoll!", @"Cette casquette rose aux coutures extrêmes vous protègera efficacement du soleil estival. Simple, mais stylée !", @"具備顯眼刺繡裝飾的粉紅色鴨舌帽，\n以不輸給夏日陽光的活潑色彩，\n為簡約風格帶來深刻印象！", @"具备显眼刺绣装饰的粉红色鸭舌帽 \n以不输给夏日阳光的活泼色彩，\n为简约风格带来深刻印象！") },
            { 10020, new TwewyItem(10020, 20, @"tile776", @"Knit Casquette", @"ニットキャスケット", @"Gorro de punto", @"Cappello di maglia", @"Strickkappe", @"Casquette tricotée", @"針織帽", @"针织帽", @"A loose-knit casquette that frames the face perfectly. Warm enough for winter, breathes enough for summer!", @"ニットのキャスケット\nツバ付きなので小顔効果が期待できそう！\nざっくりニットだから、オールシーズン使える", @"Gorro tejido y holgado que resalta las facciones. Es lo bastante cálido para el invierno y suficientemente transpirable para el verano.", @"Un cappello di maglia che incornicia perfettamente il viso. Adeguatamente caldo per l'inverno, ma assai traspirante in estate!", @"Eine lockere Strickkappe, die das Gesicht perfekt einrahmt. Warm genug für den Winter und atmungsaktiv genug für den Sommer!", @"Cette casquette à larges mailles encadrera parfaitement votre visage. Elle est assez chaude pour l'hiver, mais assez aérée pour l'été !", @"針織的報童帽，\n附有帽簷，似乎可以期待小臉效果！\n因為是較粗的針織款，適合各種季節。", @"针织的报童帽 \n附有帽檐，似乎可以期待小脸效果！\n因为是织得不密的针织款，适合各种季节。") },
            { 10021, new TwewyItem(10021, 21, @"tile777", @"Svelte Parka", @"タイトパーカー", @"Parka esbeltina", @"Parka sfiancato", @"Schlanker Parka", @"Parka fine", @"緊身連帽衫", @"紧身连帽衫", @"A simple yellow parka. The slim silhouette and extra-long sleeves will make you look chic...or clownish.", @"シンプルな黄色いパーカー\nタイトなシルエットかつ長めのそで丈なので\nスタイルがよくみえる…かもしれない", @"Sencilla parka amarilla. La figura entallada y las mangas extralargas te darán un toque chic... o ridículo.", @"Un parka giallo molto semplice. La silhouette sfiancata e le maniche extra lunghe ti faranno apparire decisamente chic... o un po' ridicola.", @"Ein einfacher gelber Parka. Dank der schmalen Silhouette und den extralangen Ärmeln siehst du besonders schick aus ... oder wie ein Clown.", @"Une parka jaune simple. Sa silhouette moulante et ses manches extra-longues vous donneront un air chic... ou clownesque.", @"樣式簡單的黃色連帽衫，\n緊身版型與較長的袖子，\n能讓你看起來更帥氣……也說不定。", @"样式简单的黄色连帽衫 \n紧身版型与较长的袖子\n能让你看起来更帅气……也说不定。") },
            { 10022, new TwewyItem(10022, 22, @"tile778", @"Denim Blouse", @"Ｇジャン", @"Camisa vaquera", @"Camicia di jeans", @"Jeans-Bluse", @"Blouse en denim", @"牛仔夾克", @"牛仔夹克", @"Made of vintage-esque distressed denim, this item is never out of style. It's comfy, but tougher to match than you'd think...", @"ビンテージ加工のＧジャン\n昔も今も人気の高いアイテム\n使い勝手はいいがコーディネイトが意外と難しい", @"Este artículo de tela vaquera y aire vintage nunca pasa de moda. Es cómodo, pero más difícil de combinar de lo que parece...", @"Questo articolo, fatto di jeans sdrucito in stile vintage, non passa mai di moda. È molto comodo, ma è più difficile da abbinare di quanto pensi.", @"Dieses Jeansteil im Vintage-Used-Look kommt nie aus der Mode. Sehr bequem, aber irgendwie passt kaum etwas anderes dazu ...", @"Cette blouse à l'aspect vieilli vintage ne passe jamais de mode. Elle est confortable, mais parfois un peu difficile à assortir...\n", @"仿舊的牛仔夾克，\n是絕不退流行的商品，\n雖然好穿卻意外地不好搭配。", @"仿旧加工的牛仔夹克 \n从不过时的道具，\n虽然好穿却意外地不好搭配。") },
            { 10023, new TwewyItem(10023, 23, @"tile779", @"Cupid Tee", @"キューピットＴ", @"Camiseta de Cupido", @"Maglietta Cupido", @"Amor-T-Shirt", @"T-shirt Cupidon", @"邱比特T", @"丘比特T恤", @"Bold graphic meets vivid color on this tee, guaranteed to stand out in a crowd! The heart print is just adorable.", @"ビビッドカラーのプリントＴシャツ\n色とグラフィックで誰よりも目立っちゃおう！\nハートのプリントがとってもキュート", @"El dibujo atrevido se combina con los colores vivos de esta camiseta, ¡que sin duda te hará llamar la atención! El estampado del corazón es una monada.", @"Questa maglietta è un tripudio di grafiche e colori vivaci, e ti farà risaltare senza dubbio in mezzo alla folla! Il cuore stampato è semplicemente adorabile.", @"Dieses Shirt vereint prägnante Grafik mit knalligen Farben, so ragst du aus jeder Menge heraus! Der Herzdruck ist einfach zu putzig.", @"Avec ce T-shirt à la couleur vive et au motif audacieux, vous êtes certain de vous faire remarquer ! Et ce cœur est vraiment adorable.", @"高彩度的印刷Ｔ恤，\n靠顏色與圖案成為最顯眼的人吧！\n愛心的圖案超可愛。", @"鲜艳的印刷T恤 \n靠颜色与图案成为最显眼的人吧！\n爱心的图案超可爱。") },
            { 10024, new TwewyItem(10024, 24, @"tile780", @"Satin Camisole", @"サテンキャミソール", @"Corpiño de satén", @"Canottiera di raso", @"Satin-Trägertop", @"Caraco en satin", @"綢緞吊帶背心", @"绸缎吊带背心", @"D+B's most popular cami, featuring a weave of satin and ribbon at the chest that whispers romance while roaring sex appeal.", @"Ｄ＋Ｂ一番人気のリボンつきキャミソール\n胸元のリボンとサテンが織りなすディテールが\nロマンティックかつセクシー", @"Es el corpiño más popular de D+B, con encaje de satén ribeteado en el pecho que susurra romanticismo a la vez que emana sex appeal.", @"La canottiera più famosa di D+B, che sfoggia onde di raso e un bel fiocchetto al centro, ispira romanticismo e una forte carica di sex appeal.", @"Das beliebteste Trägertop von D+B verbindet Satin und Schleifchen für einen Hauch von Romantik und eine dicke Portion Sex-Appeal.", @"Le caraco le plus populaire de D+B, avec une bande de satin et un ruban sur la poitrine alliant romantisme et sex-appeal.", @"Ｄ＋Ｂ最受歡迎的吊帶背心，\n胸口的緞帶和緞子交織出的細節\n既浪漫又性感。", @"D+B最受欢迎的吊带背心 \n胸口的缎带和缎子交织出的细节\n既浪漫又性感。") },
            { 10025, new TwewyItem(10025, 25, @"tile781", @"Vest-Blouse Combo", @"ベストつきブラウス", @"Conjunto chaleco-blusa", @"Camicetta e gilet", @"Bluse mit Weste", @"Combo veste-corsage", @"附背心上衣", @"附背心上衣", @"The vest covering this lustrous blouse slims up the body line while enhancing your feminine assets. It's all the rage!", @"光沢あるブラウスとベストのセット\nボディラインを強調し女度ＵＰ間違いなし！\n今シーズン大ブレイク中のアイテム", @"El chaleco que cubre esta lustrosa blusa acentúa la figura y potencia tu lado femenino. ¡Último grito en moda!", @"Questo gilet che copre la camicia sottostante assottiglia la linea del corpo, facendo risultare al contempo le tue forme femminili. È di gran moda!", @"Die Weste über dieser schimmernden Bluse verschlankt die Konturen des Körpers und betont die weiblichen Rundungen. Absolut angesagt!", @"Le gilet recouvrant ce chemisier chatoyant amincit la silhouette et met en valeur vos atouts féminins. Cette tenue fait fureur !", @"具有光澤感的上衣和背心組合，\n強調身體線條，能夠提升女性魅力！\n本季的爆紅商品。", @"具有光泽感的上衣和背心组合 \n强调身体线条，能够提升女性魅力！\n本季的爆红道具。") },
            { 10026, new TwewyItem(10026, 26, @"tile782", @"Leather Shorts", @"レザーショートパンツ", @"Shorts de cuero", @"Short in pelle", @"Leder-Shorts", @"Short en cuir", @"皮短褲", @"皮短裤", @"Made of faux leather ('cause cows are cute!), these shorts plus knee-high boots equals one hot, long-legged lady lieutenant!", @"フェイクレザーのショートパンツ\nニーハイをあわせれば脚長効果抜群\nややミリタリーな雰囲気が活躍度↑↑", @"Estos shorts de polipiel (porque las vacas son monísimas) conjuntados con unas botas de caña son el atuendo perfecto para una teniente de piernas kilométricas.", @"Abbina questi short in finta pelle (perché noi amiamo le mucche!) a stivali alti oltre il ginocchio, e otterrai una ragazza da urlo con gambe super lunghe!", @"Diese Shorts aus Kunstleder (weil Kühe einfach so niedlich sind!) kombiniert mit kniehohen Stiefeln machen einen heißen, langbeinigen Lady-Leutnant aus dir!", @"Cet ensemble short et bottes cavalières en simili cuir (parce que les vaches sont adorables) vous transformera en une lieutenant sexy avec des jambes qui n'en finissent plus.", @"仿皮短褲，\n搭配過膝襪讓腳更顯修長，\n些微的軍事風格讓妳看起來更加幹練迷人。", @"仿皮短裤 \n搭配过膝袜让脚更显修长，\n淡淡的军事风格让你看起来更加干练迷人。") },
            { 10027, new TwewyItem(10027, 27, @"tile783", @"Skinny Jeans (Black)", @"ブラックスキニー", @"Vaqueros ceñidos (negros)", @"Jeans skinny (neri)", @"Hautenge Jeans (schwarz)", @"Jean slim (noir)", @"黑色緊身褲", @"黑色紧身裤", @"Skinny jeans for slim, looong legs! The black wash has a slimming effect, making you look a full size smaller, and goes with anything!", @"足が細く長く見えるブラックスキニー\nブラックの引き締め効果で、見た目１サイズダウン\nどんなトップスもスキニーとコーデすればＯＫ", @"¡Vaqueros ceñidos para piernas delgadas y kilométricas! El tejido negro lavado estiliza el cuerpo y hace que parezcas una talla menos. Y va con todo.", @"Jeans skinny per gambe luuunghe lunghe! Il colore nero dona un effetto snellente, facendoti apparire più magra di una taglia... e in più stanno bene con tutto!", @"Hautenge Jeans für schlanke, laaange Beine! Die schwarze Tönung macht schlank, sodass du eine ganze Größe kleiner aussiehst, und passt einfach zu allem!", @"Un jean skinny pour des jambes longues et fines ! Son tissu délavé noir a un effet amincissant qui donnera l'impression que vous faites une taille de moins, et il va avec absolument tout !", @"讓腳看起來更加修長的黑色緊身褲，\n黑色的修身效果讓身形外觀變小一號，\n適合搭配任何上衣。", @"让脚看起来更加修长的黑色紧身裤 \n黑色的修身效果让身形外观变小一号，\n适合搭配任何上衣。") },
            { 10028, new TwewyItem(10028, 28, @"tile728", @"Denim Miniskirt", @"デニムミニスカート", @"Minifalda vaquera", @"Minigonna di jeans", @"Jeans-Minirock", @"Mini-jupe en denim", @"牛仔迷你裙", @"牛仔迷你裙", @"This micro-mini sports distressed denim for a look somewhere between cute and sexy, perfect for a stylin' teen on the scene.", @"ダメージ加工デニムのマイクロミニ\nセクシーかつキュートなテイストなので\n１０代のオシャレな女の子に大人気のアイテム", @"Esta minifalda está hecha de tela vaquera desgastada para dar una imagen dulce a la vez que sexi, perfecta para adolescentes con estilo.", @"Questa minigonna di jeans consunto dona un look tra il carino e il sexy... perfetta per una teenager sempre sotto ai riflettori.", @"Dieser Mikro-Mini aus Jeansstoff im Used-Look liegt irgendwo zwischen niedlich und sexy – perfekt für einen stilbewussten Szene-Teenager.", @"Cette microjupe en jean vieilli vous donnera un look mignon et sexy, parfait pour une ado à la mode.", @"刷破加工的牛仔迷你裙，\n既性感又可愛，\n在十多歲的時髦女孩子們之間相當熱門。", @"破洞的牛仔迷你裙 \n既性感又可爱， \n在十多岁的时髦女孩子们之间相当热门。") },
            { 10029, new TwewyItem(10029, 29, @"tile700", @"Plaid Miniskirt", @"チェックミニスカート", @"Minifalda a cuadros", @"Minigonna scozzese", @"Karo-Minirock", @"Mini-jupe écossaise", @"格紋迷你裙", @"格纹迷你裙", @"A traditional plaid makes this micro-mini an easy match with a white shirt and V-neck sweater. Achieve the perfect prep look!", @"トラッドなチェック柄のマイクロミニ\n白シャツＶネックセーターとあわせれば\nスクールガールスタイルはカンペキ", @"El estampado escocés tradicional hace que esta minifalda se pueda conjuntar con una camisa blanca o un suéter de pico. ¡Perfecta imagen de colegiala!", @"La tradizionale fantasia scozzese rende questa minigonna perfetta da abbinare a una camicetta bianca e a un maglioncino con scollo a \x22V\x22. Per sfoggiare un classico stile da scolaretta!", @"Dank des traditionellen Karomusters passt dieser Mikro-Mini perfekt zu einer weißen Bluse und einem Pulli mit V-Ausschnitt. Der perfekte Preppy-Look!", @"Cette microjupe en tissu écossais s'harmonisera parfaitement avec une chemise blanche et un pull à col V. De quoi obtenir le look BCBG parfait !", @"傳統的格紋迷你裙，\n搭配白襯衫與Ｖ領毛衣，\n就是完美的校園甜心風格。", @"传统的格纹迷你裙 \n搭配白衬衫与V领毛衣，\n就是完美的校园甜心风格。") },
            { 10030, new TwewyItem(10030, 30, @"tile672", @"Knee-high Boots", @"二ーハイブーツ", @"Botas de caña", @"Stivali alti", @"Kniehohe Stiefel", @"Cuissardes", @"過膝長靴", @"过膝长靴", @"These boots mix cloth and leather, but keep the classic black color that makes them easy to match. Killer with a miniskirt!", @"布とレザーのコンビ素材ロングブーツ\n定番の黒色型なのでシンプルで使いやすい\nミニスカートと合わせられる心強いアイテム", @"Estas botas combinan tela y cuero, pero conservan el clásico color negro que hace que vayan con todo. ¡Van de miedo con una minifalda!", @"Questi stivali mischiano tessuto e pelle, sfoggiando un classico colore nero che li rende facilissimi da abbinare. Sono spaziali assieme a una minigonna!", @"Diese Stiefel kombinieren Stoff und Leder, behalten dabei aber das klassische Schwarz bei, damit sie zu allem passen. Perfekt zu einem Minirock!", @"Ces bottes allient le tissu et le cuir dans de sobres nuances de noir, ce qui les rend très facile à porter. Idéales avec une minijupe !", @"由布與皮革複合材質製成的長靴，\n經典黑色款簡單又好搭，\n是能夠搭配迷你裙的優秀單品。", @"由布与皮革的复合材料制成的长靴 \n经典黑色款简单又好搭，\n是能够搭配迷你裙的优秀道具。") },
            { 10031, new TwewyItem(10031, 31, @"tile644", @"Cowboy Boots (Red)", @"レッドウエスタンブーツ", @"Botas de cowboy (rojas)", @"Stivali da cowboy (rossi)", @"Cowboystiefel (rot)", @"Bottes cow-boy (rouges)", @"紅色牛仔靴", @"红色牛仔靴", @"These red cowboy boots will not be ignored. Coordinating with them is a bit of a fuss, but they absolutely shout personality.", @"存在感のある赤のウエスタンブーツ\n服のコーディネイトが少し難しいけど\n個性を強調したいあなたにオススメ", @"Estas botas de vaquero rojas no pasarán desapercibidas. Son difíciles de combinar, pero tienen mucha personalidad.", @"Questi stivali da cowboy rossi non passeranno certo inosservati. È un po' complicato abbinarli ad altri accessori, ma trasudano personalità da tutti i pori.", @"Diese roten Cowboystiefel kann man gar nicht übersehen. Es ist nicht ganz einfach, den Rest des Outfits darauf abzustimmen, aber sie sind der Inbegriff von Persönlichkeit.", @"Ces bottes de cowboy rouges ne laisseront personne indifférent. Elles sont un peu difficiles à porter, mais elles feront ressortir votre personnalité.", @"存在感強烈的紅色牛仔靴，\n雖然不太容易與衣服搭配，\n但很適合展現個人特色。", @"存在感强烈的红色牛仔靴 \n虽然不太容易与衣服搭配，\n但很适合展现个人特色。") },
            { 10032, new TwewyItem(10032, 32, @"tile616", @"Purple Bikini", @"パープルビキニ", @"Bikini morado", @"Bikini viola", @"Lila Bikini", @"Bikini violet", @"紫色比基尼", @"紫色比基尼", @"Swimwear meets street fashion. Little details accent the charming purple base, making it a great suit to let peek out.", @"街着としても使える水着\nパープルの色使いとディテールがポイント\n水着なら安心してチラ見せスタイルができる", @"El encuentro entre moda de calle y ropa de baño. Los pequeños detalles enfatizan la preciosa base morada: un traje perfecto para acentuar las formas.", @"Lo stile da spiaggia abbraccia la moda urbana. Piccoli dettagli accentuano l'affascinante viola di base, facendo di questo bikini un completo perfetto da lasciar intravedere sotto i vestiti.", @"Die Kombination von Badesachen und Streetstyle. Kleine Details akzentuieren den bezaubernden lilafarbenen Grundton. Dieses Teil darfst du gern mal hervorblitzen lassen.", @"Quand la plage rencontre la ville. De petits détails accentuent sa charmante base violette, ce qui en fait une pièce parfaite à laisser entrevoir.", @"能夠當成外出服的泳衣，\n著重紫色的配色與小細節設計，\n既然是泳衣就不怕讓人看了。", @"能够当成外出服的泳衣 \n着重紫色的配色与小细节设计，\n既然是泳衣就不怕让人看了。") },
            { 10033, new TwewyItem(10033, 33, @"tile588", @"Black Bikini", @"ブラックビキニ", @"Bikini negro", @"Bikini nero", @"Schwarzer Bikini", @"Bikini noir", @"黑色比基尼", @"黑色比基尼", @"Swimwear meets street fashion. Chic black plus white lace makes for maximum contrast and extreme sexiness in this hot suit!", @"街着としても使える水着\nシックなブラックとキュートな白レースの\nコントラストがセクシーさを演出！！", @"Encuentro entre moda de calle y ropa de baño. El negro más chic con el encaje blanco produce un contraste máximo y una sensualidad extrema.", @"Lo stile da spiaggia abbraccia la moda urbana. L'elegante stoffa nera e il pizzo bianco creano un contrasto assolutamente sexy in questo costume!", @"Die Kombination von Badesachen und Streetstyle. Schickes Schwarz plus weiße Spitze sorgen für maximalen Kontrast und machen diesen Zweiteiler besonders anziehend!", @"Quand la plage rencontre la ville. Ce maillot allie un textile noir chic et de la dentelle blanche pour un contraste maximum et une sensualité extrême !", @"能夠當成外出服的泳衣，\n穩重的黑色與可愛白色蕾絲的對比，\n襯托出性感美貌！！", @"能够当成外出服的泳衣 \n稳重的黑色与可爱白色蕾丝的对比，\n衬托出性感美貌！！") },
            { 10034, new TwewyItem(10034, 34, @"tile560", @"Studded Belt", @"バックルベルト", @"Cinturón con tachuelas", @"Cintura borchiata", @"Nietengürtel", @"Ceinture à clous", @"大扣環皮帶", @"大扣环皮带", @"A big buckle adorns this classic belt, creating an image that's a little wild without being too butch.", @"大きなバックルのついたベルト\nベルト使いはもはや定番の型\nハードになりすぎないカッコ良さを演出できる", @"Una gran hebilla adorna este cinturón clásico y provoca una imagen ligeramente salvaje sin ser excesivamente atrevida.", @"Questa cintura classica è rifinita con una grossa fibbia, per un risultato finale di personalità, ma mai troppo mascolino.", @"Dieser klassische Gürtel ist gekrönt mit einer großen Schnalle ... ein bisschen wild, aber noch nicht zu Macho.", @"Cette ceinture classique est ornée d'une grosse boucle lui donnant un petit aspect sauvage et néanmoins très féminin.", @"有著大大皮帶扣環的皮帶，\n是必備經典款，\n野性卻不失優雅。", @"有着大大皮带扣的皮带 \n是皮带的必备经典款，\n野性却不失优雅。") },
            { 10035, new TwewyItem(10035, 35, @"tile532", @"D+B Ring", @"Ｄ＋Ｂリング", @"Anillo D+B", @"Anello D+B", @"Ring von D+B", @"Anneau D+B", @"D＋B戒指", @"D+B戒指", @"This limited edition ring broadcasts the brand logo loud and clear. Last year's version sold out in an hour.", @"ブランドロゴをあしらった、存在感ある限定リング\n発売１時間でソールドアウトした昨年のモデルを\nさらに改良してカムバック", @"Este anillo de edición limitada exhibe sin complejos el logotipo de la marca. La versión del año pasado se vendió en una hora.", @"Questo anello in edizione limitata grida forte e chiaro il logo del brand. La versione dell'anno scorso è andata esaurita in un'ora.", @"Dieser limitierte Ring zeigt das Markenlogo mehr als deutlich. Die letztjährige Version war in einer Stunde ausverkauft.", @"Cette bague en édition limitée arbore le logo de la marque haut et fort. La version de l'année dernière s'est épuisée en à peine une heure.", @"使用品牌標誌，具有存在感的限量戒指。\n去年的款式開賣一小時就售罄，\n今年度改良之後再次販售。", @"使用品牌标志，具有存在感的限量戒指 \n去年的款式开卖一小时售罄，\n今年进一步改良后再次发售。") },
            { 10036, new TwewyItem(10036, 36, @"tile504", @"Biker Jacket", @"ライダースジャケット", @"Chupa de motero", @"Giacca da motociclista", @"Motorradjacke", @"Veste de motard", @"騎士夾克", @"骑士夹克", @"A 100% authentic leather motorcycle jacket. Even a beginner can rock this reissue of the original punk classic.", @"本革のライダースジャケット\n歴代のパンクロッカーたちが愛したデザインを復刻\nライダース初心者なら迷わずコレを買え", @"Chaqueta de motorista de cuero auténtico. Hasta un novato puede lucir con orgullo esta reedición del clásico punk original.", @"Una giacca da motociclista in vera pelle al 100%. Persino un principiante può indossare con stile questa riedizione del classico punk originale.", @"Eine absolut authentische Motorradjacke aus Leder. Auch Anfänger können dieses Neuauflage des Punkklassikers tragen.", @"Une veste de motard en cuir 100 % authentique. Même un débutant peut avoir l'air cool avec ce classique punk réinventé.", @"真皮的騎士夾克，\n重現了歷代龐克搖滾樂手喜愛的設計，\n騎士夾克初學者不必猶豫，買就對了。", @"真皮的骑士夹克 \n重现了历代朋克摇滚乐手喜爱的设计，\n初学者不必犹豫，买就对了。") },
            { 10037, new TwewyItem(10037, 37, @"tile476", @"Patchy Biker Jacket", @"ワッペンライダース", @"Chupa motero parcheada", @"Giacca da motociclista estro", @"Motorradjacke mit Aufnähern", @"Veste de motard avec patchs", @"紋章騎士夾克", @"纹章骑士夹克", @"Studs and patches cover this custom jacket. It's a perfect replica of designer Tora Ana Yamazaki's brand-pioneering model.", @"スタッズとワッペンのスペシャルライダース\nデザイナー山崎虎穴がブランド立ち上げ時に\n最初に作ったデザインをそのまま再現", @"Esta chaqueta customizada va adornada con parches y tachuelas. Una réplica perfecta del modelo pionero de la diseñadora Tora Ana Yamazaki.", @"Questa giacca personalizzata è ricoperta di borchie e pezze: si tratta della replica del modello di punta della stilista Tora Ana Yamazaki.", @"Nieten und Aufnäher zieren diese individuell gestaltete Jacke, die eine perfekte Replik des Modells war, mit dem Designerin Tora Ana Yamazaki die Marke ins Leben gerufen hat.", @"Des patchs et des clous recouvrent cette veste personnalisée. C'est une réplique parfaite du modèle emblématique de la marque par le designer Tora Ana Yamazaki.", @"附有鉚釘與紋章的騎士夾克。\n完整重現設計師山崎虎穴創立品牌時\n第一號設計款式。", @"附有铆钉与纹章的骑士夹克 \n完整重现设计师山崎虎穴创立品牌时\n最初设计的款式。") },
            { 10038, new TwewyItem(10038, 38, @"tile448", @"Cotton Biker Vest", @"綿ライダースベスト", @"Chaleco motero (algodón)", @"Gilet da motociclista cotone", @"Baumwoll-Motorradweste", @"Veste de motard en coton", @"棉製騎士背心", @"棉制骑士背心", @"A biker vest made from tartan plaid cotton. The clash between the traditional pattern and biker cut screams punk.", @"タータンチェックの綿素材ライダース風ベスト\nチェックのトラッド感とライダースのハードさの\nコントラストがパンクだ", @"Chaleco de motero hecho de tartán y algodón. El choque entre el estampado tradicional y el corte motero exuda estilo punk por los cuatro costados.", @"Un gilet da motociclista in cotone, con fantasia scozzese. L'incontro tra il motivo tradizionale e il taglio da biker creano un effetto super punk.", @"Eine Motorradweste aus Baumwolle mit Karomuster. Der Kontrast aus dem traditionellen Muster und dem Bikerschnitt ist Punk pur.", @"Une veste de motard en coton tartan. Ce choc entre un motif traditionnel et une coupe biker est assurément punk.", @"蘇格蘭紋的棉質騎士風格背心，\n格紋的傳統感覺與騎士風格的硬派感產生對比，\n這正是龐克精神。", @"苏格兰纹的棉质骑士风格背心 \n格纹的传统感觉与骑士风格的硬派感产生对比，\n这正是朋克精神。") },
            { 10039, new TwewyItem(10039, 39, @"tile420", @"Tiger Biker Vest", @"虎ライダースベスト", @"Chaleco motero tigre", @"Gilet da motociclista tigrato", @"Tiger-Motorradweste", @"Veste de motard tigre", @"虎紋騎士背心", @"虎纹骑士背心", @"The furry material this tiger-striped biker vest is fashioned from boldly defies the heat of summer. Another Tora Ana Yamazaki triumph.", @"タイガー柄の起毛素材ライダース風ベスト\n暑い日に起毛素材を着る、ミスマッチ感がパンク\nブランドデザイナー山崎虎穴の自信作", @"El forro de piel de este chaleco de motero estilo tigre desafía al calor del verano. Otro triunfo de Tora Ana Yamazaki.", @"La pelliccia tigrata di questo gilet da motociclista sfida coraggiosamente il caldo dell'estate. Un altro trionfo di Tora Ana Yamazaki.", @"Das kuschlige Material dieser Motorradweste mit Tigermuster bietet der Sommerhitze die Stirn. Ein weiterer Triumph von Tora Ana Yamazaki.", @"La fourrure tigrée de cette veste de motard défie la chaleur estivale. Un autre triomphe de Tora Ana Yamazaki.", @"虎紋刷毛材質的騎士風格背心，\n在夏天穿刷毛材質的不協調感正是龐克精神，\n品牌設計師山崎虎穴的自信之作。", @"虎纹刷毛材料的骑士风格背心 \n在热天穿刷毛材料的不协调感正是朋克精神，\n品牌设计师山崎虎穴的自信之作。") },
            { 10040, new TwewyItem(10040, 40, @"tile392", @"Fitted Coat", @"切り替えコート", @"Chaquetón entallado", @"Cappotto aderente", @"Taillierter Mantel", @"Manteau ajusté", @"拼接大衣", @"拼接大衣", @"A host of detailing makes this plaid darted coat a piece of punk fashion every rocker can get behind.", @"チェック生地切りかえコートジャケット\n手のこんだディテールであらゆるパンクロッカーが\nナットクする仕上がり", @"La multitud de detalles de este abrigo a cuadros hacen de esta prenda una auténtica declaración de intenciones para todo roquero que se precie.", @"La quantità di dettagli diversi di questo cappotto sfiancato in stile scozzese lo rendono un articolo punk nel quale tutti i rocker possono avvolgersi con orgoglio.", @"Die Vielzahl von Details macht diesen figurbetonten Karomantel zu einem Stück Punkmode, das jedem Rocker steht.", @"Une multitude de détails fait de ce manteau à motif écossais une véritable pièce punk que tous les rockers vont adorer.", @"拼接布料的格紋大衣，\n講究的細節設計\n讓所有龐克搖滾樂手都著迷不已。", @"拼接布料的格纹大衣 \n讲究的细节设计\n让所有朋克摇滚乐手都着迷不已。") },
            { 10041, new TwewyItem(10041, 41, @"tile364", @"Tartan Coat", @"タータンコート", @"Chaquetón de tartán", @"Cappotto tartan", @"Karomantel", @"Manteau écossais", @"花呢格紋大衣", @"花呢格纹大衣", @"The hems on this plaid bondage jacket are unfinished and frayed. The punk is in taking the traditional and tearing it apart.", @"タータンチェックのボンデージジャケット\nすそ処理はしておらず、ほつれている\nトラッドをあえて着崩して使うのがパンク", @"Las costuras de esta chaqueta a cuadros están sin rematar y aparecen deshilachadas. El punk visita el estilo tradicional y lo reinventa.", @"Gli orli di questa giacca scozzese in stile bondage sono tagliati a vivo e sfilacciati. Il punk si è appropriato della tradizione e l'ha fatta a brandelli.", @"Der Saum dieser Jacke aus Karostoff ist unbearbeitet und ausgefranst. Punk nimmt das Traditionelle und zerfetzt es.", @"Les ourlets de cette veste tartan à sangles sont inachevés et effilochés. Le principe du punk est de prendre la tradition et de la mettre en pièces.", @"蘇格蘭紋的綁帶夾克，\n沒有縫邊的綻線風格，\n刻意違背傳統穿法就是龐克精神。", @"苏格兰纹的绑带夹克 \n没有缝边的绽线风格，\n刻意违背传统穿法就是朋克精神。") },
            { 10042, new TwewyItem(10042, 42, @"tile336", @"Pink Gauze Shirt", @"ピンクガーゼシャツ", @"Camisa de gasa rosa", @"Camicia rosa di mussola", @"Pinkes Stoffshirt", @"Chemise de gaze rose", @"粉紅紗織襯衫", @"粉红纱织衬衫", @"An old-school punk staple, the gauze shirt. The sprightly pink offers a fun blend of cute with hard-edged punk.", @"パンクの伝統的ファッション、ガーゼシャツ\nピンクのキュートさとパンクのハードさの\nコントラストが楽しめる", @"La camisa de gasa es un clásico de la vieja escuela punk. La alegría del rosa presenta un divertido contraste de dulzura y punk duro.", @"Questa maglia di mussolina è un articolo punk vecchia scuola. Il rosa sgargiante le dà un tocco di dolcezza, che si mescola a sfumature punk.", @"Das Stoffshirt ist ein Eckpfeiler des Punk, und das aufgeweckte Pink bietet eine lustige Kombination aus Niedlich und Krass.", @"La chemise en gaze est une pièce centrale de toute garde-robe punk. Un rose vif rajoute ici un petit côté mignon.", @"龐克的傳統時尚──紗織襯衫，\n可體會粉紅色的可愛與龐克硬派風格的\n強烈對比。", @"朋克的传统时尚──纱织衬衫 \n可体会粉红色的可爱与朋克硬派风格的\n强烈对比。") },
            { 10043, new TwewyItem(10043, 43, @"tile308", @"Grey Gauze Shirt", @"グレイガーゼシャツ", @"Camisa de gasa gris", @"Camicia grigia di mussola", @"Graues Stoffshirt", @"Chemise de gaze grise", @"灰色紗織襯衫", @"灰色纱织衬衫", @"An old-school punk staple, the gauze shirt. Its low-key, neutral color lets the skull graphic really jump out.", @"パンクの伝統的ファッション、ガーゼシャツ\nシックな色でドクロの存在感を最大限に\nきわだたせている", @"La camisa de gasa es un clásico de la vieja escuela punk. Su color discreto y neutro resalta más el dibujo de la calavera.", @"Questa maglia di mussolina è un articolo punk vecchia scuola. Inoltre, il suo colore tenue e neutro fa risaltare il disegno del teschio.", @"Das Stoffshirt ist ein Eckpfeiler des Punk. Die unaufdringliche, neutrale Farbe dieser Version betont den aufgedruckten Schädel.", @"La chemise en gaze est une pièce centrale de toute garde-robe punk. Sa couleur neutre et discrète fait vraiment ressortir la tête de mort.", @"龐克的傳統時尚──紗織襯衫，\n時髦色彩將骷髏的存在感烘托至極致。", @"朋克的传统时尚──纱织衬衫 \n时髦色彩将骷髅的存在感\n烘托至极致。") },
            { 10044, new TwewyItem(10044, 44, @"tile280", @"Black Raglan Tee", @"ブラックラグランシャツ", @"Camiseta de raglán negra", @"Maglietta raglan nera", @"Schwarzes Raglan-T-Shirt", @"T-shirt raglan noir", @"黑色插肩袖襯衫", @"黑色插肩袖衬衫", @"This two-tone shirt sports 3/4-length sleeves and a slim silhouette that works with any bottom. Simple enough for everyday wear.", @"ツートンに色分けされた七分そでシャツ\n細身の形なので、どんなボトムにもよくあう\n普段着としても使えるので人気が高い", @"Esta camiseta bicolor lleva mangas de tres cuartos. Su diseño entallado combina con cualquier cosa. Una prenda sencilla para el día a día.", @"Questa maglietta bicolore presenta maniche a tre quarti e una forma sfiancata che si abbina a qualsiasi pantalone. Abbastanza semplice da poter essere indossata tutti i giorni.", @"Dieses zweifarbige T-Shirt mit 3/4-Ärmeln und einer schlanken Silhouette passt zu jedem Unterteil. Schlicht genug für den Alltag.", @"Cette chemise bicolore présente des manches trois quarts et une silhouette moulante qui s'harmonisera avec n'importe quel bas. Un vêtement de tous les jours, simple et efficace.", @"分為兩種色調的七分袖襯衫，\n版型較窄，跟各種褲子都很搭，\n由於能當成便服穿，因此相當受歡迎。", @"分为两种色调的七分袖衬衫 \n版型较窄，跟各种裤子都很搭，\n由于能当成便服穿，因此相当受欢迎。") },
            { 10045, new TwewyItem(10045, 45, @"tile252", @"Blue Raglan Tee", @"ブルーラグランシャツ", @"Camiseta de raglán azul", @"Maglietta raglan blu", @"Blaues Raglan-T-Shirt", @"T-shirt raglan bleu", @"藍色插肩袖襯衫", @"蓝色插肩袖衬衫", @"This two-tone shirt sports 3/4-length sleeves and a slim silhouette that works with any bottom. Sister to the black raglan tee.", @"ツートンに色分けされた七分そでシャツ\n細身の形なので、どんなボトムにもよくあう\nブラックラグランシャツの姉妹品", @"Esta camiseta bicolor lleva mangas de tres cuartos. Su diseño entallado combina con cualquier cosa. Prima hermana de la camiseta de raglán negra.", @"Questa maglietta bicolore presenta maniche a tre quarti e una forma sfiancata che si abbina a qualsiasi pantalone. È la sorella della maglietta raglan nera.", @"Dieses zweifarbige T-Shirt mit 3/4-Ärmeln und einer schlanken Silhouette passt zu jedem Unterteil. Eng verwandt mit dem schwarzen Raglan-T-Shirt.", @"Cette chemise bicolore présente des manches trois quarts et une silhouette moulante qui s'harmonisera avec n'importe quel bas. C'est la pièce jumelle du T-shirt raglan noir.", @"分為兩種色調的七分袖襯衫，\n版型較窄，跟各種褲子都很搭，\n是黑色插肩袖襯衫的同款商品。", @"分为两种色调的七分袖衬衫 \n版型较窄，跟各种裤子都很搭，\n黑色插肩袖衬衫的关联商品。") },
            { 10046, new TwewyItem(10046, 46, @"tile224", @"Bondage Pants (Black)", @"黒ボンデージパンツ", @"Pantalón con correas (negro)", @"Pantaloni bondage (neri)", @"Bondage-Hose (schwarz)", @"Pantalon bondage (noir)", @"黑色綁帶褲", @"黑色绑带裤", @"Black bondage pants are a punk classic--a fundamental fundamental. Any punk fan worth his salt owns a pair or two.", @"黒のボンデージパンツ\nパンクの伝統的ファッションで、基本中の基本\nパンクファンなら１本は持っておきたい", @"Los pantalones con correas son todo un clásico punk, una prenda imprescindible. Cualquier punk que se precie tiene uno o dos pares.", @"I pantaloni bondage neri sono un classico dello stile punk, anzi... sono proprio un must! Qualunque fan del punk degno di questo nome ne possiede almeno un paio.", @"Schwarze Bondage-Hosen sind ein Punk-Klassiker, an dem man einfach nicht vorbeikommt. Jeder Punk, der seinen Namen verdient, hat ein oder zwei Stück davon.", @"Ce pantalon noir à sangles est un classique du punk – une pièce essentielle. N'importe quel punk digne de ce nom en possède un ou deux.", @"黑色綁帶褲，\n龐克傳統時尚裡的超級基本款，\n龐克愛好者都該有一條。", @"黑色绑带裤 \n朋克传统时尚里的超级基本款， \n朋克爱好者都该有一条。") },
            { 10047, new TwewyItem(10047, 47, @"tile196", @"Skirt Bondage Combo", @"スカート付きボンデージ", @"Pantifalda con correas", @"Gonna e combo bondage", @"Rock-Bondage-Kombi", @"Combo jupe-bondage", @"綁帶褲（附裙子）", @"绑带裙", @"Bondage pants, meet miniskirt. It's canonical punk, while also being the style's ultimate evolution.", @"スカート付きのボンデージパンツ\nパンクの伝統的ファッションであり\nパンクスタイルの完成形", @"Fusión del pantalón con correas y la minifalda. Un clásico punk que, al mismo tiempo, declara la evolución de este estilo.", @"I pantaloni bondage si uniscono alla minigonna. Un classico del punk, ma anche la più recente evoluzione dello stile.", @"Bondage-Hose plus Minirock. Traditioneller Punk und zugleich die ultimative Evolution der Stilrichtung.", @"Un pantalon à sangles et une minijupe. Un style punk classique, mais avec une touche d'originalité.", @"附裙子的綁帶褲，\n龐克的傳統時尚，\n龐克風格的完成品。", @"附裙子的绑带裤 \n朋克的传统时尚，\n朋克风格的完成品。") },
            { 10048, new TwewyItem(10048, 48, @"tile168", @"Bondage Half-pants", @"ボンデージハーフパンツ", @"Bermudas con correas", @"Pinocchietti bondage", @"Bondage-Capri", @"Pantacourt bondage", @"綁帶五分褲", @"绑带五分裤", @"Faux-leather bondage capris with red accent stitching. Add accessories to keep these fun for the long run.", @"フェイクレザーのボンデージハーフパンツ\n赤いラインなど、細部にまでこだわったアイテム\nアクセサリーで、遊べるので持っていると便利", @"Pantalones pirata de polipiel con correas y llamativas costuras en rojo. Combínalos con complementos para darles un toque divertido muy duradero.", @"Pinocchietti bondage in finta pelle con rifiniture rosse. Aggiungici qualche accessorio perché il tuo outfit sia sempre al top dello stile.", @"Bondage-Caprihose aus Kunstleder mit roten Akzenten. Kombiniert mit Accessoires wirst du ewig Spaß an ihr haben.", @"Un corsaire à sangles en simili cuir avec des coutures rouges. Rajoutez quelques accessoires pour encore plus de fun.", @"仿皮的綁帶五分褲，\n包含紅色線條在內，連細部也很講究的單品，\n可搭配飾品變化，有一件就很方便。", @"仿皮的绑带五分裤 \n包含红色线条在内，连细节也很讲究的单品， \n可搭配饰品变化，有一件就很方便。") },
            { 10049, new TwewyItem(10049, 49, @"tile140", @"Work Boots", @"ワークブーツ", @"Botas de trabajo", @"Stivali da lavoro", @"Arbeitsstiefel", @"Bottes de chantier", @"工作靴", @"工作靴", @"Uber-punk lace-up work boots, great with tucked-in pant legs or matched with capris. As versatile as they are durable.", @"パンクテイストあふれる編上げワークブーツ\nフルレングスのパンツをインにしたり\nハーフパンツにあわせたりと大活躍", @"Botas de trabajo punk con cordones, perfectas con los pantalones metidos por dentro o pantalón pirata a juego. Tan versátiles como duraderas.", @"Stivali da lavoro con lacci ultra-punk, di gran effetto se abbinati a un paio di pinocchietti o con i pantaloni infilati dentro. Sono tanto versatili quanto resistenti.", @"Arbeitsstiefel mit Schnürung – geht überhaupt noch mehr Punk? Passen perfekt zu hineingestopften Hosen oder Capris. So vielseitig wie robust.", @"Des rangers hautes ultra-punks, idéales avec un pantalon moulant ou un corsaire assorti. Aussi polyvalentes que durables.", @"充滿龐克風格的高筒工作靴，\n搭配長褲或五分褲能充分展現魅力。", @"充满朋克风格的高筒工作靴 \n搭配长裤\n或五分裤能充分展现魅力。") },
            { 10050, new TwewyItem(10050, 50, @"tile112", @"Purple Sneaks", @"パープルスニーカー", @"Deportivas moradas", @"Scarpe da tennis viola", @"Lila Sneaker", @"Baskets violettes", @"紫色帆布鞋", @"紫色帆布鞋", @"Sneakers made of a purple enamel. Nice and simple, these are the perfect start to your next punked-out outfit.", @"紫色のエナメル素材スニーカー\nシンプルでシックなスタイルも、これさえあれば\nパンクテイストに仕上げられる", @"Deportivas con esmalte morado. Bonitas y sencillas, perfectas para iniciarte en tu nuevo conjunto postpunk.", @"Scarpe da tennis verniciate di viola. Belle e semplici, sono la base perfetta del tuo prossimo outfit in stile punk.", @"Sneaker aus lila Lack. Der einfach gehaltene Ausgangspunkt für dein nächstes Punk-Outfit.", @"Des baskets vernies violettes. Jolies et simples, c'est le point de départ idéal pour votre prochaine tenue punk.", @"紫色漆皮的帆布鞋，\n就算是簡單優雅的風格穿搭，\n加上這雙就會具備龐克魅力。", @"紫色漆皮的帆布鞋 \n就算是简单优雅的风格穿搭，\n加上这双就会具备朋克魅力。") },
            { 10051, new TwewyItem(10051, 51, @"tile084", @"Custom Sneaks", @"カスタムスニーカー", @"Deportivas customizadas", @"Scarpe da tennis custom", @"Individuelle Sneaker", @"Baskets custom", @"特製帆布鞋", @"特制帆布鞋", @"These mismatched sneakers flip the bird to conventional wisdom in the grand tradition of punk design.", @"左右の色が違うカスタムスニーカー\n常識の概念をぶち壊すパンク精神を\n正しく受け継ぐスニーカー", @"Estas deportivas desiguales derivan de la sabiduría convencional en la gran tradición del diseño punk.", @"Queste scarpe da tennis spaiate mandano a quel paese il senso comune e abbracciano la stupenda tradizione dello stile punk.", @"Diese ungleichen Sneaker zeigen ganz im Stil des Punks allen Konventionen den Mittelfinger.", @"Ces baskets dépareillées envoient valser les conventions dans la grande tradition de la mode punk.", @"左右顏色不同的特製帆布鞋，\n正確繼承龐克精神，\n打破常識的帆布鞋。", @"左右颜色不同的特制帆布鞋 \n正确继承朋克精神，\n打破常识的帆布鞋。") },
            { 10052, new TwewyItem(10052, 52, @"tile056", @"White Rubbersoles", @"ホワイトラバーソール", @"Bambas blancas", @"Scarpe bianche", @"Schuhe mit Gummisohle", @"Creepers blanches", @"白色厚底鞋", @"白色厚底靴", @"Every punk rocker needs one pair of white rubber-soled shoes; let these be yours. Designer Tora Ana Yamazaki's favorites.", @"パンクロッカー必須の白色ラバーソールシューズ\n定番中の定番！　最初の１足にオススメ\nブランドデザイナー山崎虎穴も愛用している", @"Todo roquero punk necesita unas bambas blancas. ¿Por qué no estas? Son las favoritas de la diseñadora Tora Ana Yamazaki.", @"Tutti i punk devono possedere almeno un paio di scarpe bianche con la suola di gomma: cosa aspetti a farle tue? Sono le preferite di Tora Ana Yamazaki.", @"Jeder Punkrocker braucht ein Paar weiße Schuhe mit Gummisohle, und diese hier sollten deine sein. Ein Lieblingsstück von Designerin Tora Ana Yamazaki.", @"Un vrai punk se doit de posséder une paire de chaussures blanches avec semelles en caoutchouc. Le modèle préféré du designer Tora Ana Yamazaki est fait pour vous !", @"龐克搖滾樂手必備的白色厚底鞋， \n經典到不行！推薦必買一雙。 \n品牌設計師山崎虎穴也愛不釋手。", @"朋克摇滚乐手必备的白色厚底靴 \n经典到不行！推荐必买一双。\n品牌设计师山崎虎穴也爱不释手。") },
            { 10053, new TwewyItem(10053, 53, @"tile028", @"Double-spiked Cuff", @"ダブルトゲブレス", @"Muñequera pinchos doble", @"Polsino borchiato", @"Doppelstachel-Armband", @"Bracelet double à clous", @"雙層尖刺手環", @"双层尖刺手环", @"Two rows of sharp spikes line this 1.5\x22 thick leather cuff. Hard-ass punks should try not to cry when they poke themselves.", @"するどいトゲが２段ついたブレスレット\n幅３．５ｃｍのしっかりした本革でこれさえあれば\nハードに仕上がる…けど、ときどき痛い", @"Dos filas de pinchos afilados adornan esta muñequera de cuero grueso de casi 4 centímetros. Los punks más duros deberán contener las lágrimas si se pinchan.", @"Due file di borchie appuntite decorano questo polsino di pelle spessa. Anche i punk più estremi trattengono le lacrime quando si punzecchiano a vicenda.", @"Dieses knapp 4 cm breite Lederarmband ist mit zwei Reihen spitzer Stacheln versehen. Hartgesottene Punks sollten ihre Tränen zurückhalten, wenn sie sich damit selbst stechen.", @"Deux rangées de pics acérés ornent ce bracelet en cuir épais de 4 cm de largeur. Les vrais durs n'ont pas le droit de pleurer lorsqu'ils se piquent avec.", @"擁有2排尖刺的手環，\n寬3.5cm的厚實真皮，\n戴上這個就會有硬派感……不過常會刺到自己。", @"拥有2排尖刺的手环 \n宽3.5 cm的厚实真皮，\n戴上这个就会有硬派感……不过常会刺到自己。") },
            { 10054, new TwewyItem(10054, 54, @"tile000", @"Spiked Choker", @"トゲチョーカー", @"Gargantilla de pinchos", @"Strangolino borchiato", @"Stachelhalsband", @"Collier à clous", @"尖刺頸圈", @"尖刺颈圈", @"Pointy spikes ring this half-inch red leather choker. At a full inch tall, they mean business, and so will you.", @"するどいトゲのついたチョーカー\nトゲの高さは２．３ｃｍ　幅は１．８ｃｍ\nレザー部分が赤なのでワンポイントに使える", @"Unos afilados pinchos adornan esta gargantilla roja de cuero. Con una longitud de más de 2 centímetros, son una auténtica declaración de intenciones.", @"Borchie appuntite circondano questo strangolino in pelle rossa. Grazie al loro centimetro di lunghezza, tutti sapranno che fai sul serio.", @"Spitze Stacheln umringen dieses einen guten Zentimeter breite rote Lederhalsband. Mit mehr als zwei Zentimetern Länge meinen sie es ernst, und du auch.", @"Des pics pointus ornent ce collier en cuir rouge. Longs de 3 cm, ces pics ne rigolent pas, et vous non plus.", @"有著尖刺的頸圈，\n刺長2.3cm，寬1.8cm，\n紅色的皮革部分能當成穿搭亮點。", @"有着尖刺的颈圈 \n刺长2.3 cm，宽1.8 cm，\n红色的皮革部分能当成穿搭亮点。") },
            { 10055, new TwewyItem(10055, 55, @"tile729", @"Red Mohawk Set", @"レッドモヒカンセット", @"Conjunto mohawk rojo", @"Set cresta rossa", @"Rotes Irokesenset", @"Ensemble crête rouge", @"紅色莫霍克頭套組 ", @"红色莫西干头套组", @"Unleash your inner punk with this strap-on mohawk and shades set. Fun, but hard to find the right occasion to wear it...", @"パンク気分になれるショートモヒカンウィッグと\nサングラスのセット\nなかなか使いどころの難しいアイテム", @"Saca al punk que llevas dentro con este conjunto de cresta y gafas de sol. Divertido, pero difícil de encontrar la ocasión para llevarlo.", @"Libera il punk che c'è in te con un set composto da cresta in stile moicano e occhiali da sole. È super divertente, ma è difficile trovare l'occasione giusta per indossarlo...", @"Entfessle den Punk in dir mit diesem Set aus Irokesenschnitt und Sonnenbrille. Sehr lustig, aber irgendwie findet man nie den richtigen Anlass dafür ...", @"Libérez le punk qui est en vous avec cette crête détachable et ces lunettes. Un ensemble amusant, mais il n'est pas idéal pour toutes les occasions...", @"解放內心龐克感的莫霍克頭假髮 \n與太陽眼鏡的組合， \n難以找到適當場合使用的穿搭道具。", @"解放内心朋克感的短莫希干头假发\n与太阳眼镜的组合 \n难以找到适当场合使用的穿搭道具。") },
            { 10056, new TwewyItem(10056, 56, @"tile730", @"Gold Padlock Necklace", @"金の錠前ネックレス", @"Collar candado dorado", @"Collana con lucchetto d'oro", @"Kette mit Vorhängeschloss", @"Collier à cadenas en or", @"金鎖項鍊", @"金锁项链", @"This chain bears a golden padlock. Designer Tora Ana Yamazaki created this item in honor of that legendary punk rocker.", @"錠前のゴールドネックレス\nブランドデザイナー山崎虎穴が\n伝説のパンクロッカーにささげたアイテム", @"Esta cadena lleva un candado dorado. La diseñadora Tora Ana Yamazaki la creó en honor de ese legendario roquero punk.", @"Questa catena ha un lucchetto d'oro come ciondolo. La stilista Tora Ana Yamazaki ha creato questo articolo in onore di un leggendario rocker punk.", @"Diese Kette ist mit einem goldenen Vorhängeschloss versehen. Designerin Tora Ana Yamazaki hat dieses Objekt zu Ehren eines legendären Punkrockers entworfen.", @"Une chaîne avec un cadenas doré. Le designer Tora Ana Yamazaki a conçu cet accessoire en l'honneur d'un punk légendaire.", @"附有鎖頭的金項鍊，\n這是品牌設計師山崎虎穴\n為傳說中的龐克搖滾樂手所設計。", @"附有锁头的金项链 \n这是品牌设计师山崎虎穴，\n为传说中的朋克摇滚乐手所设计。") },
            { 10057, new TwewyItem(10057, 57, @"tile731", @"Custom Waist Pack", @"カスタムウエストバッグ", @"Riñonera customizada", @"Marsupio personalizzato", @"Individuelle Hüfttasche", @"Sac-banane custom", @"特製腰包", @"特制腰包", @"Marked with studs and patches, this waist pack offers a splash of pink to offset the black-heavy punk wardrobe.", @"スタッズ＆ワッペンのカスタムウエストバッグ\n黒にかたよりがちなパンクスタイルに\nさし色としても使えるピンクがポイント", @"Los tonos rosas de esta riñonera, decorada con parches y tachuelas, compensan la oscuridad del fondo de armario punk.", @"Questo marsupio, decorato con borchie e toppe, dà un tocco di rosa per compensare il nero del guardaroba punk.", @"Diese Hüfttasche mit Nieten und Aufnähern bietet einen pinkfarbenen Farbspritzer, der das Schwarz der Punkgarderobe ein wenig auffrischt.", @"Ornée de clous et de patchs, cette banane présente une touche de rose pour contrebalancer le noir omniprésent dans la garde-robe punk.", @"帶有鉚釘＆紋章的特製腰包，\n在以黑色為底的龐克風格中\n增添粉紅色的亮點。", @"带有铆钉＆纹章的特制腰包 \n在以黑色为底的朋克风格中，\n增添粉红色的亮点。") },
            { 10058, new TwewyItem(10058, 58, @"tile732", @"Tiger Waist Pack", @"タイガーウエストバッグ", @"Riñonera tigre", @"Marsupio tigrato", @"Tiger-Hüfttasche", @"Sac-banane tigre", @"虎紋腰包", @"虎纹腰包", @"Made of a bold, tiger-striped fur, this waist pack can help tie an outfit together. Designer Tora Ana Yamazaki-recommended.", @"起毛素材のタイガー柄ウエストバッグ\nタイガー柄がコーディネイトのアクセントにもなる\nブランドデザイナー山崎虎穴のイチオシ", @"Esta riñonera, con un atrevido estampado de tigre, puede ser el elemento clave para rematar un conjunto. Recomendado por la diseñadora Tora Ana Yamazaki.", @"Questo marsupio fatto di pelliccia tigrata può aiutarti a completare un outfit. Consigliato da Tora Ana Yamazaki.", @"Diese Hüfttasche aus imposantem Fell mit Tigermuster ist das perfekte i-Tüpfelchen für jedes Outfit. Mit Empfehlung von Designerin Tora Ana Yamazaki.", @"Avec sa fourrure tigrée audacieuse, cette banane peut vous aider à harmoniser votre look. Recommandée par le designer Tora Ana Yamazaki.", @"刷毛材質的虎紋腰包，\n虎紋能夠成為穿搭的重點，\n品牌設計師山崎虎穴大力推薦。", @"刷毛材料的虎纹腰包 \n虎纹能够成为穿搭的重点，\n品牌设计师山崎虎穴大力推荐。") },
            { 10059, new TwewyItem(10059, 59, @"tile733", @"Lace Bonnet", @"レースヘッドドレス", @"Diadema con encaje", @"Cuffia di pizzo", @"Rüschenhaube", @"Serre-tête de dentelle", @"蕾絲頭飾", @"蕾丝头饰", @"An ebon bonnet rimmed with an ivory frill. Even alone, it generates an air of romance. It's quite simple, and easily worn.", @"白いフリルがついた黒のヘッドドレスですの\nこれだけでロマンティックな気分を演出できます\n意外とシンプルなので使いやすいですのよ", @"Diadema negra con el ribete adornado en tonos marfil. Produce un aura de romance y es bastante simple y fácil de combinar.", @"Una cuffietta color ebano bordata con fronzoli avorio. Anche da sola genera un'aura di romanticismo. È molto semplice e di facile vestibilità.", @"Eine schwarze Haube mit weißen Rüschen. Sorgt ganz allein für einen Hauch Romantik. Ziemlich simpel und unglaublich komfortabel.", @"Une charlotte bordée d'un froufrou blanc. Même seule, elle inspire la romance. Elle est assez simple et se porte facilement.", @"擁有白色褶邊的黑色頭飾，\n本身就散發著浪漫氣氛，\n比想像中更簡樸好搭配。", @"拥有白色褶边的黑色头饰 \n本身就散发着浪漫气氛，\n比想像中更简朴好搭配。") },
            { 10060, new TwewyItem(10060, 60, @"tile734", @"Ribbon Bonnet", @"リボンヘッドドレス", @"Diadema con cintas", @"Cuffia con fiocchetti", @"Bänderhaube", @"Serre-tête à rubans", @"緞帶頭飾", @"缎带头饰", @"Crimson ribbon adorns this hairband-style bonnet, lined with simple but elegant frills. Stunning, isn't it?", @"赤いリボンのついたカチューシャタイプです\nフリルがシンプルかつエレガントに\nあしらわれておりますの　ステキでしょ？", @"Esta diadema va adornada con cintas y forrada con sencillos a la par que elegantes adornos. Impresionante, ¿verdad?", @"I fiocchetti cremisi decorano questa cuffia-cerchietto rifinita con fronzoli semplici ma eleganti. Incantevole, non è vero?", @"Diese Haube im Stil eines Haarbands ist mit roten Bändern sowie einfachen, aber eleganten Rüschen verziert. Einfach atemberaubend, nicht wahr?", @"Cette charlotte en serre-tête est ornée d'un ruban écarlate et doublée de volants simples mais élégants. Superbe, n'est-ce pas ?", @"有著紅緞帶的髮箍類型，\n褶邊既簡樸又典雅，\n是不是很棒呢？", @"有着红缎带的发箍类型 \n褶边既简朴又典雅，\n是不是很棒呢？") },
            { 10061, new TwewyItem(10061, 61, @"tile735", @"Ribbon Mini-hat", @"リボンミニハット", @"Sombrerito con cintas", @"Cappellino con fiocchetto", @"Schleifen-Minihut", @"Mini-chapeau à rubans", @"緞帶迷你帽", @"缎带迷你帽", @"A miniature hat ribboned in vermillion. Princess K loves hers, and is sure you would love one too.", @"赤いリボンつきのミニハットですわ\n姫子店員も愛用の一品ですの\nあなたもいかがかしら？", @"Sombrero en miniatura con cintas bermellón. La Princesa K tiene uno y le encanta. Seguro que a ti también.", @"Un cappellino in miniatura decorato con un fiocco scarlatto. La Principessa K lo adora, ed è certa che anche a te piacerebbe molto.", @"Ein Minihut mit zinnoberroten Schleifen. Princess K liebt ihren, und du hättest sicher auch zu gerne einen davon.", @"Un chapeau miniature à rubans rouge vif. La Princesse K adore le sien et elle est persuadée que vous adorerez le vôtre.", @"這是有著紅緞帶的小帽子，\n姬子店員也相當喜愛這頂帽子，\n要不要也買一頂呢？", @"这是有着红缎带的小帽子 \n姬子店员也相当喜爱这顶帽子，\n要不要也买一顶呢？") },
            { 10062, new TwewyItem(10062, 62, @"tile736", @"Mini-crown", @"クラウンミニハット", @"Minicorona", @"Coroncina", @"Minikrone", @"Mini-couronne", @"皇冠迷你帽", @"皇冠迷你帽", @"This miniature hat is a royal crown, yielding an air of both class and sophistication. With this, you are truly a princess.", @"王冠タイプのミニハットですわ\nクラシカルで上品な印象を演出いたします\nこれをつければ本当のお姫様ですわ", @"Este sombrero en miniatura es una corona que confiere un aire de elegancia y sofisticación. Serás una princesa de los pies a la cabeza.", @"Questo mini-cappello è una corona regale e dona un tocco di classe e sofisticatezza. Con questo addosso sarai una vera principessa.", @"Dieser Minihut ist eine Krone, die sowohl Klasse als auch Anspruch ausstrahlt. Damit bist du wahrlich eine Prinzessin.", @"Ce chapeau miniature est une couronne royale, inspirant la classe et la sophistication. Avec lui, vous deviendrez une véritable princesse.", @"皇冠類型的小帽子，\n給人的印象既古典又高雅，\n戴上它就是真正的公主了。", @"皇冠类型的小帽子 \n给人的印象既古典又高雅，\n戴上它就是真正的公主了。") },
            { 10063, new TwewyItem(10063, 63, @"tile737", @"Goth Bondage Coat", @"ゴスボンデージコート", @"Chaquetón gótico", @"Cappotto bondage gotico", @"Goth-Bondage-Mantel", @"Manteau gothique", @"哥德綁帶大衣", @"哥德绑带大衣", @"A long coat, bound tight in belt straps. This garment is all you need to bring gothic flair into the coldest of winter days.", @"ベルトで束縛したイメージのロングコート\n寒い冬でもこれさえはおれば\nカンペキなゴススタイルが完成します", @"Chaquetón largo con cinturón. Es todo lo que necesitas para darles a tus fríos inviernos ese toque gótico que necesitas.", @"Un cappotto lungo avvolto in tante cinture strette. Questo indumento è tutto ciò che ti serve per mostrare il tuo stile gotico anche nei giorni più freddi.", @"Ein langer Mantel, der mit Schnallen eng gegürtet ist. Mit diesem Kleidungsstück bringst du Gothic-Flair in die kältesten Wintertage.", @"Un manteau long, resserré par des lanières. À lui seul, ce vêtement apportera une touche gothique aux journées hivernales les plus froides.", @"以皮帶捆綁為意象的長大衣，\n在寒冬中只要有這一件\n就能秀出完美的哥德風格。", @"以皮带捆绑为意象的长大衣 \n在寒冬中只要有这一件\n就能秀出完美的哥德风格。") },
            { 10064, new TwewyItem(10064, 64, @"tile738", @"Asymmetric Jersey", @"アシメカットソー", @"Suéter asimétrico", @"Casacca asimmetrica", @"Asymmetrisches Jersey", @"Chandail asymétrique", @"不對稱紗織上衣", @"不对称纱织上衣", @"The asymmetric hemline lends this gauzy top a uniquely vertiginous allure, delicate and airy as a ghost.", @"アシンメトリーデザインの長そでカットソー\nガーゼのような素材で繊細な仕上がりです\n着るだけでゴシックな雰囲気になれます", @"Con su costura asimétrica, este suéter liso despierta una fascinación vertiginosa, delicada y etérea como un fantasma.", @"L'orlo asimmetrico della gonna dà a questo vestito leggero un fascino vertiginoso... delicato e arioso come un fantasma.", @"Der asymmetrische Saum verleiht diesem hauchdünnen Oberteil einen einzigartig wirbelnden Look, zart und vergänglich wie ein Geist.", @"L'ourlet asymétrique de ce haut transparent lui donne une allure vertigineuse, délicate et aussi légère qu'un fantôme.", @"不對稱設計的長袖剪裁，\n配上以紗織材質製作出細膩的品質。\n光是穿在身上就能散發哥德氣息。", @"不对称设计的长袖剪裁 \n配上以纱织材料制作出细腻的品质。\n光是穿在身上就会散发哥德气氛。") },
            { 10065, new TwewyItem(10065, 65, @"tile739", @"Spiderweb Jersey", @"くもの巣カットソー", @"Suéter telaraña", @"Casacca ragnatela", @"Spinnweben-Jersey", @"Chandail toile d'araignée", @"蜘蛛巢紗織上衣", @"蜘蛛巢纱织上衣", @"Slashed to complement the fine spiderweb motif, this gossamer jersey's exquisite detailing is a cut above.", @"裂け目がたれたクールなカットソー\n全面に繊細なクモの巣があしらわれた\n凝ったディテールが特徴です", @"Los cortes complementan el motivo telaraña de este suéter de gasa con un exquisito nivel de detalle.", @"Realizzata al fine di completare un outfit in stile ragnatela, questa casacca in tessuto leggero con eleganti dettagli ha una marcia in più.", @"Die Details dieses leichten Oberteils sind einzigartig, und der Schnitt betont das feine Spinnennetzmotiv.", @"Tailladé pour mettre en valeur son motif de toiles d'araignée, ce pull très léger présente des détails vraiment exceptionnels.", @"有著網狀垂墜風格的特殊剪裁，\n主要是表現出蜘蛛網概念的講究細節。", @"有着流苏下垂的帅气剪裁 \n主要特征是表现出蜘蛛网概念的\n考究细节。") },
            { 10066, new TwewyItem(10066, 66, @"tile740", @"Bunny Parka", @"ウサ耳パーカー", @"Parka conejito", @"Parca coniglietto", @"Häschen-Parka", @"Parka lapin", @"兔耳連帽衫", @"兔耳连帽衫", @"One parka later, you're a darling bunny! The shoulders are cut away to show a titillating bit of skin.", @"キュートな子うさぎに変身できちゃうパーカー\n肩が穴あきで、ちらっと見える肩が\nちょっぴりセクシーです", @"¿Qué es, una parka o un conejito? Los hombros están cortados para enseñar un poco de sugerente piel.", @"Indossi un bel parka... e ti trasformi in una coniglietta! Le spalline sono state tagliate per mostrare uno stuzzicante pezzetto di pelle.", @"Einen Parka später bist du ein zauberhaftes Häschen! Die Schultern sind ausgeschnitten, um ein kleines bisschen Haut zu zeigen.", @"Cette parka fera de vous un adorable lapin ! Et ses épaules dénudées sont particulièrement émoustillantes.", @"能夠變身為可愛小兔子的連帽衫，\n肩膀上有開洞，稍微露出一點肩膀，\n能表現出小性感。", @"能够变身为可爱小兔子的连帽衫 \n肩膀上有开洞，稍微露出一点肩膀，\n能表现出小性感。") },
            { 10067, new TwewyItem(10067, 67, @"tile741", @"Shirt & Arm Warmers", @"アームカバーつきシャツ", @"Camisa con calientabrazos", @"Maglia e scaldamuscoli", @"Hemd und Armwärmer", @"Chemise et manchettes", @"襯衫（附臂套）", @"衬衫（附臂套）", @"A goth classic, the black button-down shirt with matching arm warmers, set off by the contrast of the daring sanguine necktie.", @"アームカバーつきのシャツ\n赤ネクタイと黒シャツのコントラストが特徴の\n定番の人気アイテムです", @"Esta camisa abotonada negra es todo un clásico gótico con sus calientabrazos a juego. Fascinante el atrevido contraste con la corbata rojo sangre.", @"Camicia a bottoni con scaldamuscoli abbinati per le braccia: un classico dello stile gotico, accentuato dal contrasto con l'audace cravatta color sangue.", @"Das schwarze Hemd mit passenden Armwärmern ist ein Gothic-Klassiker, und die gewagte blutrote Krawatte stellt einen gelungenen Kontrast dazu dar.", @"Dans la plus pure tradition goth, cette chemise noire accompagnée de manchettes est mise en valeur par une cravate rouge sang contrastante.", @"附臂套的襯衫，\n紅領帶與黑襯衫的對比非常搶眼，\n經典熱門商品。", @"附臂套的衬衫 \n红领带与黑衬衫的对比非常抢眼，\n经典热门商品。") },
            { 10068, new TwewyItem(10068, 68, @"tile742", @"Bandage Pants", @"包帯パンツ", @"Pantalones vendaje", @"Pantaloni bondage", @"Bandagen-Hose", @"Pantalon bandage", @"繃帶褲", @"绷带裤", @"The black of the slacks and the white of the bandages stand in excruciating contrast. Princess K's latest infatuation is horror.", @"包帯がまきつけられたパンツです\n黒と白のコントラストが痛々しさ倍増です\n姫子店員も最近注目のホラーテイストです", @"El negro de las perneras contrasta osadamente con el blanco de las vendas. La última fascinación de la Princesa K con el terror.", @"Il nero dei pantaloni e il bianco delle fascette creano un contrasto lancinante. L'ultima infatuazione della Principessa K è l'horror.", @"Das Schwarz der Hose und das Weiß der Bandagen bildet einen qualvollen Kontrast. Aktuell ist Princess K total in Horror verschossen.", @"Le noir du pantalon et le blanc des bandages offrent un contraste insoutenable. En effet, la dernière lubie de la Princesse K est l'horreur.", @"纏上繃帶的褲子，\n黑色與白色的對比讓人看起來更加痛苦，\n是姬子店員最近也相當關注的恐怖風格。", @"缠上绷带的裤子 \n黑色与白色的对比让人看起来更加心痛，\n是姬子店员最近也相当关注的恐怖风格。") },
            { 10069, new TwewyItem(10069, 69, @"tile743", @"Red Two-tier Skirt", @"赤ティアードスカート", @"Falda roja doble capa", @"Gonna a frappe rossa", @"Roter Zweistufen-Rock", @"Jupe à deux pans rouge", @"紅色蛋糕裙", @"红色蛋糕裙", @"Grand frills line this fetching miniskirt, splashed with a passionate ruby red. Princess K's blog spot sent sales skyrocketing.", @"大きなフリルがついたミニスカート\n情熱的な赤との組み合わせがキュート\n姫子店員のブログで紹介して予約殺到中です", @"Los exagerados volantes adornan esta atractiva minifalda decorada en un apasionado tono rojo rubí. La entrada en el blog de la Princesa K disparó las ventas.", @"Questa affascinante minigonna presenta due frappe ed è di un ardente colore rosso rubino. La recensione nel blog della Principessa K ha fatto schizzare alle stelle le vendite.", @"Dieser betörende Minirock überzeugt mit grandiosen Rüschen und leidenschaftlichem Rubinrot. Dank dem Blog von Princess K ein absoluter Verkaufsschlager.", @"De gros volants bordent cette ravissante minijupe, éclaboussée d'un rouge rubis passionné. L'article de la Princesse K à son sujet a fait monter les ventes en flèche.", @"有著大褶邊的迷你裙，\n搭配熱情的紅色相當可愛，\n在姬子店員的部落格介紹後訂單如雪片般飛來。", @"有着大褶边的迷你裙 \n搭配热情的红色相当可爱，\n在姬子店员的博客介绍后订单如雪片般飞来。") },
            { 10070, new TwewyItem(10070, 70, @"tile744", @"Double-breasted Suit", @"クラシカルダブルスーツ", @"Traje cruzado", @"Doppiopetto", @"Zweireiher", @"Costume croisé", @"古典雙排扣襯衫", @"古典双排扣衬衫", @"A classic men's double-breasted suit, tinged with a dark, princely air. Horror-lover Princess K says yes, yes, yes.", @"クラシカルなダブルえりのスーツ\nホラーテイストの王子スタイルはコレで決まりです\n姫子店員もホラーテイストに注目中です", @"Clásico traje de caballero con un aura oscura y principesca. La Princesa K dice sí, sí y sí.", @"Un classico doppiopetto da uomo dall'aria macabro-principesca. La Principessa K, amante dell'horror, dice: assolutamente sì!", @"Dieser Zweireiher für Herren ist ein Klassiker und verleiht den Flair eines finsteren Prinzen. Princess K meint: Ja, ja, ja!", @"Un costume croisé classique pour homme, teinté d'un air princier et ténébreux. La fan d'horreur qu'est la Princesse K approuve.", @"經典雙領襯衫，\n就用這件營造恐怖王子風格，\n姬子店員也相當關注的恐怖風格。", @"经典双领衬衫 \n就用这件营造恐怖王子风格，\n姬子店员也相当关注的恐怖风格。") },
            { 10071, new TwewyItem(10071, 71, @"tile745", @"Lace-up Dress", @"あみあげドレス", @"Vestido de encaje", @"Vestito con laccetti", @"Schnürkleid", @"Robe à lacets", @"繫帶連身裙", @"系带连身裙", @"Every gothic lolita wardrobe needs a goth doll dress; Princess K waived her employee discount to do this one justice.", @"ドール風のゴスドレス\nゴスロリの定番ファッション\n姫子店員も社員割引なしで購入しました", @"Toda lolita gótica que se precie necesita un vestido de muñeca gótica. La Princesa K usó el descuento para empleados para hacerse con uno.", @"Ogni guardaroba da gothic lolita che si rispetti ha almeno un vestito da bambolina: la Principessa K ha rinunciato al proprio sconto dipendenti per rendere giustizia a questo must.", @"Jede Gothic-Lolita braucht in ihrer Garderobe ein Goth-Püppchen-Kleid. Für dieses grandiose Teil hat Princess K sogar auf ihren Angestelltenrabatt verzichtet.", @"La garde-robe d'une lolita gothique digne de ce nom se doit de comprendre une robe de poupée goth. La Princesse K a renoncé à son tarif préférentiel d'employée pour lui rendre justice.", @"娃娃風格的哥德服裝，\n哥德蘿莉的必備時尚，\n姬子店員也不靠店員折扣買了一件。", @"人偶风格的哥德服装 \n哥德萝莉的必备时尚，\n姬子店员也不靠店员折扣买了一件。") },
            { 10072, new TwewyItem(10072, 72, @"tile746", @"Ribbon-laced Dress", @"リボン通しドレス", @"Vestido de lazos", @"Vestito infiocchettato", @"Schleifen-Schnürkleid", @"Robe à rubans", @"緞帶連身裙", @"缎带连衣裙", @"A goth maid dress, sister garment to the doll dress. The careful use of purple ribbon makes this item sing.", @"メイド風のゴスドレス\nドール風ゴスドレスの姉妹品で\nパープルのリボン使いがポイントですわ", @"Traje gótico de criada, primo hermano del vestido de muñeca. El uso acertado de los lazos morados lo convierten en el último grito en moda.", @"Uniforme da cameriera in stile gotico, della stessa serie del vestito da bambolina. L'uso saggio dei fiocchi viola rende prefetto questo capo d'abbigliamento.", @"Ein Goth-Dienstmädchen-Kleid, eng verwandt mit dem Goth-Püppchen-Kleid. Besonders zauberhaft ist der präzise Einsatz von lila Schleifen.", @"Une robe de servante goth, allant de pair avec la robe de poupée. L'utilisation minutieuse du ruban violet rend cette pièce exceptionnelle.", @"女僕風格的哥德服裝，\n是娃娃風格哥德服裝的相關商品，\n紫色的緞帶可說是神來一筆。", @"女仆风格的哥德服装 \n人偶风格哥德服装的关联商品，\n紫色的缎带可说是神来一笔。") },
            { 10073, new TwewyItem(10073, 73, @"tile747", @"Vampire Dress", @"ヴァンパイアドレス", @"Vestido de vampiresa", @"Vestito da vampira", @"Vampirkleid", @"Robe de vampire", @"吸血鬼連身裙", @"吸血鬼连身裙", @"A goth dress placed in bondage. Sister garment to the doll dress, this item offers great atmosphere for its simplicity.", @"ボンデージ風のゴスドレス\nドール風ゴスドレスの姉妹品でシンプルに\nまとめたいあなたにオススメですわ", @"Vestido gótico anudado. Este artículo, primo hermano del vestido de muñeca, genera una atmósfera fantástica gracias a su sencillez.", @"Un abito gotico in perfetto stile bondage, della stessa serie del vestito da bambolina. Questo articolo crea una fantastica atmosfera nonostante la sua semplicità.", @"Ein Goth-Kleid im Bondage-Stil. Dieses Teil ist eng verwandt mit dem Püppchen-Kleid und verleiht trotz seiner Einfachheit eine tolle Ausstrahlung.", @"Une robe à sangles goth. Pièce jumelle de la robe de poupée, cette pièce sait mettre l'ambiance malgré sa simplicité.", @"綁帶風格的哥德服裝，\n是娃娃風格哥德服裝的相關商品，\n提供給想要簡單穿搭的妳。", @"绑带风格的哥德服装 \n人偶风格哥德服装的关联商品，\n提供给想要简单穿搭的你。") },
            { 10074, new TwewyItem(10074, 74, @"tile748", @"Ribbon Shoes", @"リボンシューズ", @"Zapatos de cintas", @"Scarpe con fiocchetti", @"Schuhe mit Schnürung", @"Chaussures à rubans", @"緞帶鞋", @"缎带鞋", @"No lolita's ensemble is complete without a pair of these pink lace-up shoes. Rest assured, Princess K owns a pair.", @"ロリータスタイルに欠かせない\nピンクの編み上げシューズです\n店員姫子ももちろん購入しました", @"Todo conjunto de lolita necesita un par de zapatos rosa con cintas. No sufras, la Princesa K los tiene.", @"Nessun outfit da lolita può definirsi completo senza un paio di scarpette rosa con i fiocchetti. Di sicuro non mancano nel guardaroba della Principessa K.", @"Kein Lolita-Outfit ist komplett ohne diese rosa Schnürschuhe. Und ja, Princess K hat natürlich auch ein Paar.", @"Un ensemble de lolita ne peut être complet sans une paire de ces chaussures roses à lacets. Vous pouvez être sûre que la Princesse K en a une paire.", @"蘿莉塔風格不可或缺的粉紅高筒鞋，\n姬子店員當然也買了一雙。", @"洛丽塔风格不可或缺的\n粉红高筒鞋 \n姬子店员当然也买了一双。") },
            { 10075, new TwewyItem(10075, 75, @"tile749", @"Platform Shoes", @"厚底シューズ", @"Zapatos de plataforma", @"Scarpe con la zeppa", @"Plateauschuhe", @"Chaussures compensées", @"厚底鞋", @"厚底鞋", @"Perfect with either a dress or pants. Any prospective princess would do well to pick up a pair of this footwear.", @"厚底のシューズ\nドレスにもパンツにも合わせられる優れもの\n姫候補生ならぜったいに持っていたいアイテム", @"Perfectos con vestido o pantalones. Cualquier aspirante a princesa debería tener un par como este.", @"Perfette sia sotto un vestito, sia sotto i pantaloni. Ogni potenziale principessa farebbe bene ad appropriarsi di un paio di calzature come queste.", @"Passt perfekt zu einem Kleid oder Hosen. Jede aufstrebende Prinzessin sollte zu solchen Schuhen greifen.", @"Parfaites avec une robe ou un pantalon, ces chaussures sont un accessoire essentiel pour toute aspirante princesse.", @"厚底的鞋子，\n能夠搭配連身裙與褲子的優秀單品，\n公主候選人都該有一雙。", @"厚底的鞋子 \n能够搭配连衣裙与裤子的优秀单品，\n公主候选人都该有一双。") },
            { 10076, new TwewyItem(10076, 76, @"tile750", @"Cape", @"マント", @"Capa", @"Mantello", @"Umhang", @"Cape", @"披風", @"披风", @"A very continental collared cape, classic and regal. If you can work this, you are truly a goth among goths.", @"ヨーロッパ調のエリ付きマントです\nクラシカルでロイヤルな雰囲気たっぷり\nこれを着こなせたら真のゴスですわ", @"Capa con cuello de aire continental, clásico y regio. Si sabes llevarla, serás todo un gótico entre góticos.", @"Un mantello con colletto molto continentale, classico e regale. Se saprai indossarlo con stile, sarai il più gotico tra i gotici.", @"Ein sehr kontinental gehaltener Umhang mit Kragen, klassisch und königlich. Wenn du das tragen kannst, bist du ein echter Goth.", @"Une cape à col très européenne pour une touche classique et royale. Si vous arrivez à porter ça, vous êtes vraiment goth parmi les goths.", @"附有歐洲風格衣領的披風，\n充滿古典皇家氣氛，\n若能完美搭配，真正的哥德當之無愧。", @"附有欧洲风格衣领的披风 \n充满古典皇家气息，\n若能完美搭配，真正的哥德当之无愧。") },
            { 10077, new TwewyItem(10077, 77, @"tile751", @"Frilly Parasol", @"フリルパラソル", @"Parasol con volantes", @"Parasole decorato", @"Sonnenschirm mit Rüschen", @"Ombrelle à dentelle", @"褶邊傘", @"褶边伞", @"Frilled and ribboned, this antique umbrella is a magical key to grand romance. A sensible princess would keep it at hand.", @"フリルとリボンのアンティークなアンブレラ\nロマンティックな気分を演出できますよ\n姫ならば常に持ち歩いてくださいね", @"Esta sombrilla antigua decorada con cintas y volantes es la clave mágica para disfrutar de un gran romance. Toda princesa que se precie debería tenerla a mano.", @"Questo ombrellino pieno di fronzoli e fiocchetti è la chiave dell'ultra-romanticismo. Qualsiasi principessa di buon senso ne ha sempre uno a portata di mano.", @"Dieser antike Sonnenschirm mit Rüschen und Schleifchen ist der magische Schlüssel zu wahrer Romantik. Jede vernünftige Prinzessin sollte einen in petto haben.", @"Avec ses volants et ses rubans, cette ombrelle ancienne est la clé magique pour une romance exceptionnelle. Une princesse avisée en a toujours une à portée de main.", @"有著褶邊與緞帶的古典風格傘， \n能夠帶來浪漫氣息， \n請公主隨時帶在身邊。", @"有着褶边与缎带的古典风格伞 \n能够带来浪漫气氛，\n请公主随时带在身边。") },
            { 10078, new TwewyItem(10078, 78, @"tile752", @"Blond Wig", @"ブロンドウィッグ", @"Peluca rubia", @"Parrucca bionda", @"Blonde Perücke", @"Perruque blonde", @"金色假髮", @"金色假发", @"This divine platinum blond wig is regal from roots to tips, and an object of adulation among all prospective princesses.", @"お姫様気分たっぷりな\n輝くプラチナブロンドのウィッグです\n姫候補生たちの憧れです", @"Esta divina peluca rubio platino es regia desde las raíces hasta las puntas, y motivo de adulación entre todas las aspirantes a princesa.", @"Questa divina parrucca biondo platino trasuda regalità dalla testa ai piedi, ed è oggetto di adulazione tra le potenziali principesse.", @"Diese göttliche platinblonde Perücke ist royal bis in die Spitzen und ein echtes Statussymbol unter angehenden Prinzessinnen.", @"Cette perruque d'un blond platine divin est royale des pointes à la racine et vaut l'adulation de toutes les futures princesses.", @"充滿公主氛圍的\n閃耀白金色假髮，\n公主候選人們所憧憬的樣貌。", @"充满公主气息的\n闪耀的白金色假发 \n公主候选人们所憧憬的样貌。") },
            { 10079, new TwewyItem(10079, 79, @"tile753", @"M'sieur Lapin", @"らぱんちゃん", @"M'sieur Lapin", @"Monsieur Lapin", @"M'sieur Lapin", @"M'sieur Lapin", @"小兔", @"小兔", @"A stuffed version of brand icon M'sieur Lapin. All good Angelique Freaques elect him as their escort while out and about.", @"ブランドマスコットのらぱんちゃん人形\nラパンアンジェリークフリークは\nらぱんちゃんと一緒にお出かけが基本ですわ", @"Peluche del icono de la marca M'sieur Lapin. Todos los seguidores de Angelique lo eligen de acompañante cuando salen de marcha.", @"La versione in peluche di Monsieur Lapin. Nessun devoto di Angelique esce più di casa senza.", @"Ein Stofftier des Markenmaskottchens M'sieur Lapin. Alle echten Angelique-Fans haben ihn unterwegs als Begleiter dabei.", @"L'icône de la marque, M'sieur Lapin, en version peluche. Les fans d'Angelique ne sortent jamais sans lui.", @"品牌吉祥物──小兔的布偶，\n和它一起出門是\nLapin Angelique愛好者的基本守則。", @"品牌吉祥物的小兔玩偶 \n和它一起出门是\nLapin Angelique爱好者的基本守则。") },
            { 10080, new TwewyItem(10080, 80, @"tile754", @"White Dragon", @"白竜衣", @"Dragón blanco", @"Dragone bianco", @"Weißer Drache", @"Dragon blanc", @"白龍衣", @"白龙衣", @"This elegant sleeveless shirt cuts a bold silhouette that is well suited to solo wear or to a more layered look.", @"ワイルドシルエットなノースリーブシャツ\n１枚でもレイヤードスタイルでも\nエレガントに決まる便利なアイテム", @"Esta elegante camisa sin mangas marca la figura con contundencia. Se puede llevar sola o con un atuendo más elaborado.", @"Quest'elegante smanicato conferisce una figura molto snella ed è adatto ad essere portato da solo o abbinato a qualcos'altro per un look a strati.", @"Dieses elegante, ärmellose Hemd sorgt für eine imposante Silhouette. Trage es allein oder kombiniert mit mehreren Schichten.", @"Cette chemise sans manches élégante sculpte une silhouette audacieuse et peut se porter seule ou en superposition.", @"大膽剪裁的無袖襯衫，\n無論單穿或多層次穿搭\n都能營造優雅風格。", @"粗野版型的无袖衬衫 \n无论单穿或多层次穿搭\n都能营造优雅风格。") },
            { 10081, new TwewyItem(10081, 81, @"tile755", @"Light and Shadow", @"白黒龍衣", @"Luz y sombra", @"Luci e ombre", @"Licht und Schatten", @"Ombre et lumière", @"白黑龍衣", @"白黑龙衣", @"Sporty and slim, this tank top showcases the latest line's athletic sensibilities while still preserving the brand's elegance.", @"スポーティデザインタンクトップ\nスポーツテイストはブランドの新ライン\nタイトなシルエットがカジュアルになりすぎない", @"Fina y deportiva, esta camiseta de tirantes exhibe la nueva línea atlética al tiempo que preserva la elegancia de la marca.", @"Questa canotta attillata e sportiva sfoggia le ultime tendenze dell'atletica, mantenendo al contempo l'eleganza del brand.", @"Dieses sportliche und schlanke Tanktop kombiniert den neuen sportlichen Touch der Marke mit ihrer traditionellen Eleganz.", @"Sportif et moulant, ce débardeur met en valeur le côté athlétique de la nouvelle collection tout en préservant l'élégance de la marque.", @"運動風格設計的無袖上衣，\n該品牌的運動風格新嘗試，\n貼身剪裁不會流於休閒。", @"运动风格设计的无袖上衣 \n该品牌的运动风格新尝试，\n贴身剪裁不会流于休闲。") },
            { 10082, new TwewyItem(10082, 82, @"tile701", @"Yin Blazer", @"革衣", @"Chaqueta yin", @"Giacca Yin", @"Yin-Blazer", @"Blazer yin", @"皮衣", @"皮衣", @"Dragon Couture's take on the classic single-breasted leather blazer sees the modest garment lined with an ardent red.", @"シングルレザージャケット\nふとした時に裏地の情熱的な深紅が見える\nこのこだわりがドラゴンクチュール流", @"La versión de Dragon Couture para el clásico blazer de cuero decora esta modesta prenda con un tono rojo candente.", @"La classica giacca di pelle monopetto di Dragon Couture, foderata di un tessuto rosso acceso.", @"Dragon Coutures Variante des klassischen einreihigen Lederblazers wertet das schlichte Kleidungsstück mit leidenschaftlichem Rot auf.", @"La version Dragon Couture d'un blazer droit en cuir classique agrémenté d'une doublure d'un rouge ardent.", @"單領皮夾克，\n偶爾可以看見內裡熱情的深紅色，\n這就是屬於Dragon Couture的講究。", @"单领皮夹克 \n偶尔可以看见内里热情的深红色，\n这就是属于Dragon Couture的讲究。") },
            { 10083, new TwewyItem(10083, 83, @"tile673", @"Midnight Thoughts", @"夜三蔵衣", @"Reflexión nocturna", @"Pensieri di mezzanotte", @"Mitternächtliche Gedanken", @"Pensées de minuit", @"夜三藏衣", @"夜三藏衣", @"The simplicity of this sleeveless top is balanced by its rich and powerful black hue. It stands alone, and you stand out.", @"シンプルなノースリーブカットソー\n１枚で主役になれるブラックだから\nシックな着こなしを", @"La sencillez de esta camiseta sin mangas contrasta con su intenso y poderoso color negro. Brilla por sí sola y te hace brillar a ti.", @"La semplicità di questo smanicato è bilanciata da intense tinte scure. È semplicemente perfetta... e ti rende perfetta.", @"Dieses ärmellose Top ist schlicht, aber das elegante und kraftvolle Schwarz macht das wieder wett. Es spricht für sich selbst, und damit auch für dich.", @"La simplicité de ce haut sans manches est compensée par sa teinte noire riche et puissante. Ce sera la pièce centrale de votre tenue et vous serez au centre de tous les regards.", @"簡單的無袖剪裁，\n單穿就能展現氣勢的黑色，\n能夠打造出時尚穿搭。", @"简单的无袖剪裁 \n单穿就能展现气势的黑色，\n能够打造出时尚穿搭。") },
            { 10084, new TwewyItem(10084, 84, @"tile645", @"Plum Blossom", @"紅梅絹衣", @"Flor del ciruelo", @"Fior di pruno", @"Pflaumenblüte", @"Fleurs de prunier", @"紅梅絹衣", @"红梅绢衣", @"The floral pattern and spring green base of this long-sleeve shirt may limit the people who can pull it off to fashion gurus.", @"黄緑地の花柄長そでシャツ\n着こなしが難しい色なので着る人を選ぶ\nこれを着こなせればオシャレ上級者", @"El estampado floral sobre el verde primaveral de esta camisa de manga larga podría limitarla a los auténticos gurús de la moda.", @"Secondo i guru della moda, sono in pochi a potersi permettere di indossare la fantasia floreale e la base verde pisello di questa camicia a maniche lunghe.", @"Das Blumenmuster und die frühlingsgrüne Grundfarbe dieses langärmligen Hemds schränken die Zielgruppe, die es tragen kann, möglicherweise auf Modegurus ein.", @"Le motif floral sur fond vert printemps de ce T-shirt à manches longues en font une pièce que seuls les gourous de la mode arrivent à porter.", @"黃綠色的長袖花襯衫，\n顏色不易搭配，並非所有人都能駕馭，\n能穿得好看就是時尚大師。", @"黄绿色的长袖花衬衫 \n颜色不易搭配，并非所有人都能驾驭，\n能穿得好看就是时尚大师。") },
            { 10085, new TwewyItem(10085, 85, @"tile617", @"Vernal Equinox", @"春節絹衣", @"Equinoccio primaveral", @"Equinozio di primavera", @"Frühlingsgleiche", @"Équinoxe printanier", @"春節絹衣", @"春节绢衣", @"The floral pattern and aqua blue base of this long-sleeve shirt may limit the people who can pull it off to fashion gurus.", @"水色地の花柄長そでシャツ\n着こなしが難しい色なので着る人を選ぶ\nこれを着こなせればオシャレ上級者", @"El estampado floral sobre el azul agua de esta camisa de manga larga la constriñe a los auténticos gurús de la moda.", @"Secondo i guru della moda, sono in pochi a potersi permettere di indossare la fantasia floreale e la base verde acqua di questa camicia a maniche lunghe.", @"Das Blumenmuster und die meeresblaue Grundfarbe dieses langärmligen Hemds schränken die Zielgruppe, die es tragen kann, möglicherweise auf Modegurus ein.", @"Le motif floral sur fond turquoise de ce T-shirt à manches longues en font une pièce que seuls les gourous de la mode portent avec brio.", @"淡藍色的長袖花襯衫，\n顏色不易搭配，並非所有人都能駕馭，\n能穿得好看就是時尚大師。", @"淡蓝色的长袖花衬衫 \n颜色不易搭配，并非所有人都能驾驭，\n能穿得好看就是时尚大师。") },
            { 10086, new TwewyItem(10086, 86, @"tile589", @"Autumn Dragon", @"中秋龍", @"Dragón otoñal", @"Dragone d'autunno", @"Herbstdrache", @"Dragon d'automne", @"中秋龍", @"中秋龙", @"Fall foliage inspired the mature crimson of this sleeveless V-neck. A simple silhouette completes the slim, chic look.", @"ノースリーブのＶネックシャツ\n落ち着いた深紅は紅葉からヒントを得た新色\nシンプルなシルエットでスタイル良く見える", @"El follaje otoñal inspiró el tono carmesí de este suéter de pico sin mangas. Su forma sencilla le da un toque fino y muy chic.", @"Il fogliame autunnale ha ispirato il cremisi maturo di questo smanicato con scollo a \x22V\x22. Una semplice silhouette completa il look sfiancato ed elegante.", @"Das satte Rot dieses ärmellosen Teils mit V-Ausschnitt wurde von Herbstlaub inspiriert. Der schlichte Schnitt unterstreicht den schlanken, schicken Look.", @"La couleur pourpre de ce haut sans manches à col V s'inspire des feuillages d'automne. Une silhouette simple complètera ce look moulant et chic.", @"無袖Ｖ領襯衫，\n新顏色靈感取自紅葉，是沉穩的深紅色，\n簡單的剪裁讓身形更加俐落。", @"无袖V领衬衫 \n新颜色灵感取自红叶，是沉稳的深红色，\n简单的剪裁让身形更加俐落。") },
            { 10087, new TwewyItem(10087, 87, @"tile561", @"Sun Emperor", @"太平皇帝", @"Emperador del Sol", @"Imperatore del Sole", @"Sonnenkaiser", @"Empereur du soleil", @"太平皇帝", @"太平皇帝", @"This stylish three-button suit, made of a lustrous, lightweight material, is easily worn in either a casual or formal setting.", @"スタイリッシュなデザインの３ボタンスーツ\n光沢のある軽い素材　着こなし次第で\nカジュアルにもフォーマルにも対応", @"Este elegante traje de tres botones elaborado con una tela ligera y elegante sirve para ocasiones formales e informales.", @"Questo stilosissimo completo, realizzato con materiale lucido e leggero come una piuma, si indossa facilmente in occasioni sia casual, sia formali.", @"Dieser stilvolle Anzug mit drei Knöpfen ist aus schimmerndem, leichtem Material gefertigt und passt perfekt in jedes legere und formelle Ambiente.", @"Ce costume chic à trois boutons, fait d'un tissu léger et chatoyant, peut se porter de façon décontractée ou pour de grandes occasions.", @"時尚設計的３扣西裝，\n具有光澤的輕盈材質，\n休閒或正式場合都可搭配。", @"时尚设计的3扣西装 \n具有光泽的轻盈材料，\n休闲或正式场合都可搭配。") },
            { 10088, new TwewyItem(10088, 88, @"tile533", @"Dragon Lady", @"熱烈礼服", @"Lady Dragón", @"Lady dragone", @"Drachenlady", @"Dame dragon", @"熱烈禮服", @"热烈礼服", @"A Dragon Couture classic, this Chinese-style one-piece dress blends yellows and reds into a melange of fiery spice.", @"チャイニーズデザインのミドルのワンピース\nドラゴンクチュールのオリジナル定番ドレス\n赤とイエローがスパイシーな印象を演出", @"Este vestido de corte chino de Dragon Couture fusiona amarillos y rojos para formar una mezcla picante y fogosa.", @"Questo vestito in stile cinese, un vero classico della Dragon Couture, mescola i gialli e i rossi per formare un mélange vivace e infuocato.", @"Dieses im chinesischen Stil gehaltene Kleid ist ein Klassiker von Dragon Couture. Hier werden Gelb- und Rottöne zu einer Melange feuriger Würze kombiniert.", @"Pièce emblématique de Dragon Couture, cette robe chinoise mélange les tons jaunes et rouges pour un résultat ardent et pimenté.", @"中華設計風格的中等長度連身裙，\nDragon Couture的原創招牌禮服，\n紅色與黃色營造出辛辣風格。", @"中华设计风格的中等长度连衣裙 \nDragon Couture的原创招牌礼服，\n红色与黄色营造出辛辣风格。") },
