            { 10090, new TwewyItem(10090, 90, @"tile477", @"One Man, No Equals", @"国士無双", @"Un hombre sin rival", @"Un uomo senza eguali", @"Ein Mann ohne Gleichen", @"Un homme, sans égal", @"國士無雙", @"国士无双", @"Boots, refined to their barest essence. The goat leather gains character with wear--the designer's boon to his peerless clients.", @"洗練されたデザインのブーツ　\nゴートレザーを使い、はくほどに味がでる\nデザイナーから国士無双へ愛をこめて贈る１足", @"Botas refinadas hasta su más profunda esencia. La piel de cabra gana carácter con el uso: un toque del diseñador para premiar a sus clientes especiales.", @"L'essenza stessa dello scarponcino. La pelle di capra acquista carattere con l'uso: il dono del designer ai suoi clienti senza eguali.", @"Diese Stiefel wurden auf das Allerwesentlichste reduziert. Das Ziegenleder gewinnt mit dem Tragen an Charakter. Das garantiert der Designer seinen noblen Kunden.", @"Des bottes dans leur plus pure essence. Le cuir d'agneau gagne en caractère avec le temps, et c'est ainsi que le designer remercie ses meilleurs clients.", @"風格俐落的靴子，\n使用山羊皮製成，越穿越有特色，\n是設計師放入自己對國士無雙的愛所設計出來的。", @"风格利落的靴子 \n使用山羊皮制成，越穿越有特色，\n是设计师放入自己对国士无双的爱所设计出来的。") },
            { 10091, new TwewyItem(10091, 91, @"tile449", @"Old Wisdom Made New", @"温故知新", @"Renovarse o morir", @"Antica saggezza aggiornata", @"Alte Weisheit, neuer Stil", @"Vieille sagesse renouvelée", @"溫故知新", @"温故知新", @"High heels, crafted from a vivid enamel material in a harmonious blend of tradition and trend that speaks for itself.", @"ビビッドカラーのエナメル素材のハイヒール\n伝統と流行が融合したデザインは主役の存在感\nまさに温故知新で生まれた１足", @"Zapatos de tacón fabricados con un colorido material esmaltado, con una armoniosa mezcla de tradición y moda que habla por sí misma.", @"Scarpe col tacco lucide e vivaci: la loro fusione armonica di tradizione e moda parla da sé.", @"Diese Stöckelschuhe aus prächtigem Lack stellen eine harmonische Kombination aus Tradition und Trend dar, die für sich selbst spricht.", @"Des talons hauts dans une matière brillante et colorée qui allient avec succès la tradition et la mode.", @"色彩鮮明的漆皮高跟鞋，\n融合傳統與流行的設計極具特色，\n可說是溫故知新後誕生的鞋子。", @"色彩鲜明的漆皮高跟鞋 \n融合传统与流行的设计极具特色，\n可说是温故知新后诞生的鞋子。") },
            { 10092, new TwewyItem(10092, 92, @"tile421", @"Typhoon", @"台風", @"Tifón", @"Tifone", @"Taifun", @"Typhon", @"颱風", @"台风", @"Sleek mules adorned with buckle accents. The delicate toe and slim heel serve to keep these shoes ever at the eye of the storm.", @"金具飾りのついたミュール\nストリートの台風の目になるようにと\nつま先やヒールの繊細さにこだわりぬいた品", @"Elegantes sandalias adornadas con hebillas. Su delicado tacón sirve para mantenerlas siempre en el candelero.", @"Ciabattine lucide con fibbie. La punta affusolata e il tacco sottile fanno in modo che queste scarpe siano sempre sotto i riflettori.", @"Elegante Pantoletten mit Schnallenakzenten. Die zarte Spitze und der schlanke Absatz sorgen dafür, dass diese Schuhe immer im Auge des Sturms stehen.", @"Des mules élégantes ornées d'une boucle. Grâce à leur pointe délicate et leur talon fin, ces chaussures ont une place assurée dans l'œil du cyclone.", @"帶有金屬飾品的女用涼鞋，\n講究腳尖與鞋跟的細緻設計，\n令其成為街頭的目光焦點。", @"带有金属饰品的凉鞋 \n讲究脚尖与鞋跟的细致设计，\n令其成为街头的目光焦点。") },
