            { 10098, new TwewyItem(10098, 98, @"tile253", @"North Wind Concerto", @"北風コンチェルト", @"Concierto del viento del norte", @"Concerto del vento del Nord", @"Nordwind-Konzert", @"Concerto du vent du nord", @"北風協奏曲", @"北风协奏曲", @"Made of distressed leather in an unusual, rich bordeaux sure to draw attention, this single-breasted jacket is warm, but light.", @"シワ加工シングルレザージャケット\n深みのあるボルドーが珍しく、人目をひく\n軽くカジュアルなのに北風も完全シャットアウト", @"Esta chaqueta cruzada de cuero desgastado tiene un original tono burdeos que llamará mucho la atención. Ligera, pero calentita.", @"Questa giacca monopetto calda ma leggera in pelle consunta di colore bordeaux intenso attira sicuramente l'attenzione.", @"Diese einreihige Lederjacke im Used-Look ist in ungewöhnlichem, sattem Bordeaux-Rot gehalten und lenkt alle Blicke auf sich. Sie ist warm, aber leicht.", @"Dans un cuir vieilli d'un original bordeaux profond, cette veste droite est chaude tout en restant légère.", @"抓皺加工的單領皮夾克，\n深沉的酒紅色罕見地吸引目光，\n輕便休閒，卻能完全阻隔寒冷的北風。", @"抓皱加工的单领皮夹克 \n深沉的酒红色罕见地吸引目光，\n轻便休闲，却能完全阻隔寒冷的北风。") },
            { 10099, new TwewyItem(10099, 99, @"tile225", @"Spring Breeze Rhapsody", @"春風ラプソディ", @"Rapsodia de brisa primaveral", @"Opera dell'aria primaverile", @"Frühlingsbrisen-Rhapsodie", @"Rhapsodie brise de printemps", @"春風狂想曲", @"春风狂想曲", @"The deep indigo of this antiqued overcoat shines, though the article feels warmly worn. It cuts a killer silhouette.", @"古着加工のカバーオールジャケット\n深みのあるインディゴがキレイ\n加工で出された使用感やシルエットが最高の一品", @"El color añil profundo de este abrigo envejecido brilla con fuerza, aunque el artículo se ve bastante gastado. Marca una figura perfecta.", @"Il color indaco intenso di questo soprabito anticato è splendente, anche se l'articolo è comodo come se fosse già stato indossato. Conferisce una silhouette da urlo.", @"Das tiefe Indigo dieses auf alt getrimmten Mantels glänzt, aber das Teil selbst fühlt sich herrlich eingetragen an. Und es verleiht eine unglaubliche Figur.", @"Le couleur indigo profond de ce pardessus vieilli est reluisante, mais on dirait une pièce vintage. La silhouette qui en résulte est vraiment mortelle.", @"仿舊的工裝夾克，\n深沉的靛色相當美麗，\n絕佳的剪裁創造利落的輪廓。", @"仿旧加工的工装夹克 \n深沉的靛色相当美丽，\n加工后的使用感与外观绝佳。") },
            { 10100, new TwewyItem(10100, 100, @"tile197", @"Sky Blue Paean", @"青空賛歌", @"Peán del cielo azul", @"Peana blu cielo", @"Lobgesang in Himmelblau", @"Péan bleu ciel", @"青空讚歌", @"青空赞歌", @"A 1970s staple, the retro polo. This one is calm and breezy as a blue sky and crowned by a rainbow.", @"７０’Ｓテイストのポロシャツ\n雨上がりの青空にレインボーが出たような\nハッピーでピースフルなアイテム", @"El polo retro es un clásico de los 70. Este es relajante y fresco como el cielo azul y va coronado por un arcoíris.", @"La polo retrò è il marchio distintivo degli anni '70. Questo esemplare è calmo e sbarazzino come un cielo azzurro ed è coronato da un arcobaleno.", @"Das Retro-Polohemd: mehr 70er-Jahre geht nicht. Dieses hier ist so ruhig und erfrischend wie der blaue Himmel und wird von einem Regenbogen gekrönt.", @"Le polo rétro est une pièce emblématique des années 70. Celui-ci est aussi calme et enjoué qu'un ciel bleu couronné d'un arc-en-ciel.", @"７０年代風格的Polo衫，\n彷彿雨過天晴的晴空出現彩虹般\n是快樂又和平的單品。", @"70年代风格的Polo衫 \n仿佛雨过天晴的晴空出现彩虹般\n是快乐又和平的单品。") },
            { 10101, new TwewyItem(10101, 101, @"tile169", @"High Sun Paean", @"太陽賛歌", @"Peán del mediodía", @"Peana di mezzogiorno", @"Lobgesang in Sonnengelb", @"Péan ensoleillé", @"太陽讚歌", @"太阳赞歌", @"Exceptionally rare, this vintage Hawaiian shirt is as yellow as the sun. It's guaranteed to brighten up your day.", @"レア度の高いビンテージアロハシャツ\nまるで太陽のようなイエローがポイント\n着るだけでハッピーな気分になれる", @"Esta clásica camisa hawaiana, tan amarilla como el sol, es excepcionalmente rara. Seguro que te alegra el día.", @"Questa camicia hawaiana in stile vintage, dall'eccezionale rarità, è di un giallo sgargiante come il sole. Illuminerà la tua giornata senza ombra di dubbio.", @"Dieses außergewöhnlich seltene Vintage-Hawaiihemd ist so gelb wie die Sonne. Damit erhellst du dir garantiert den Tag.", @"Exceptionnellement rare, cette chemise hawaïenne vintage est d'un jaune aussi éclatant que le soleil. De quoi illuminer votre journée à coup sûr !", @"罕見的仿舊夏威夷襯衫，\n特徵為有如太陽般的黃色，\n光是穿上心情就會愉快起來。", @"罕见的仿旧夏威夷衬衫 \n特征为有如太阳般的黄色，\n光是穿上心情就会愉快起来。") },
            { 10102, new TwewyItem(10102, 102, @"tile141", @"Sunflower", @"ひまわり", @"Girasol", @"Girasole", @"Sonnenblume", @"Tournesol", @"向日葵", @"向日葵", @"This tee's graphic serves as a bold reminder of that legendary band's \x22Free In '73\x22 tour. A lost gem, sold only on-site at the venues.", @"ナンバリングデザインのバンドＴシャツ\n７０年代伝説のバンド７３年ツアーＴシャツ\nライヴ会場でしか出回らなかったデッドストック", @"El dibujo de la camiseta recuerda la gira «Libres en el 73» de aquel legendario grupo. Una joya perdida que solo se vende en los conciertos.", @"Il disegno di questa maglietta è un ricordo sfacciato del tour \x22Free In '73\x22 di una leggendaria band. Una gemma andata perduta, venduta solo ai concerti.", @"Der Druck dieses T-Shirts erinnert an die Tour \x22Free in '73\x22 jener legendären Band. Ein verlorenes Juwel, das nur auf der Tour verkauft wurde.", @"Le motif de ce T-shirt est un souvenir de la tournée \x22Free In '73\x22 de ce groupe légendaire. Un petit joyau perdu, vendu uniquement lors des concerts.", @"編號設計的樂團Ｔ恤，\n７０年代的傳說樂團於７３年巡演的Ｔ恤，\n只在演唱會場販售的滯銷商品。", @"编号设计的乐团T恤 \n70年代的传说乐团于73年巡演的T恤，\n只在演唱会场贩售的滞销商品。") },
            { 10103, new TwewyItem(10103, 103, @"tile113", @"Hydrangea", @"あじさい", @"Hortensia", @"Ortensia", @"Hortensie", @"Hortensia", @"紫陽花", @"紫阳花", @"This tee's cuff 'n collar accents hearken back to that legendary band's \x22Alive In '75\x22 tour. A lost gem, sold only on-site at the venues.", @"リンガーデザインのバンドＴシャツ\n７０年代伝説のバンド７５年ツアーＴシャツ\nライヴ会場でしか出回らなかったデッドストック", @"El cuello y los puños de esta camiseta recuerdan la gira «Vivos en el 75» de aquel legendario grupo. Una joya perdida que solo se vende en los conciertos.", @"Il collo e i polsini accentuati di questa maglietta riportano con la mente al tour \x22Alive In '75\x22 di una leggendaria band. Una gemma andata perduta, venduta solo ai concerti.", @"Der Druck dieses T-Shirts erinnert an die Tour \x22Alive in '75\x22 jener legendären Band. Ein verlorenes Juwel, das nur auf der Tour verkauft wurde.", @"Les détails aux manches et au col de ce T-shirt sont un souvenir de la tournée \x22Alive In '75\x22 de ce groupe légendaire. Un petit joyau perdu, vendu uniquement lors des concerts.", @"滾邊設計的樂團Ｔ恤，\n７０年代的傳說樂團於７５年巡演的Ｔ恤，\n只在演唱會場販售的滯銷商品。", @"滚边设计的乐团T恤 \n70年代的传说乐团于75年巡演的T恤，\n只在演唱会场贩售的滞销商品。") },
            { 10104, new TwewyItem(10104, 104, @"tile085", @"Tulip", @"ちゅーりっぷ", @"Tulipán", @"Tulipano", @"Tulpe", @"Tulipe", @"鬱金香", @"郁金香", @"Raglan sleeves set this band tee apart. Sold on 4/4/2004, when that legendary band got back together for just one more gig.", @"ラグランスリーブのバンドＴシャツ\n７０年代伝説のバンドが２００４年４月４日に\nたった１日だけ再結成したときの記念Ｔシャツ", @"Las mangas de raglán diferencian a esta camiseta. Se vendió el 4/4/2004, cuando aquel legendario grupo volvió a juntarse para una última actuación.", @"Le maniche raglan danno un tocco di stile a questa maglietta della band. È stata venduta il 4/4/2004, quando la band leggendaria si è riunita per un ultimo concerto insieme.", @"Dieses Bandshirt zeichnet sich durch Raglanärmel aus. Es wurde am 4. 4. 2004 verkauft, als jene legendäre Band ihren einzigen Reunion-Gig spielte.", @"Ses manches raglan font de ce T-shirt une pièce unique. Vendu le 04/04/2004, lors de la réunion du groupe légendaire pour un dernier concert unique.", @"雙色式的樂團Ｔ恤，\n紀念７０年代的傳說樂團在２００４年４月４日\n僅限一天再次合體的紀念Ｔ恤。", @"双色式的乐团T恤 \n纪念70年代的传说乐团在2004年4月4日\n仅限一天再次合体的纪念T恤。") },
            { 10105, new TwewyItem(10105, 105, @"tile057", @"Sunshine One-piece", @"サンシャインワンピース", @"Vestido amanecer", @"Vestitino raggio di sole", @"Sonnenschein-Tunika", @"Robe soleil", @"陽光連身裙", @"阳光连身裙", @"Nothing says '70s like tie-dye. Vibrant color lends this tunic impact, but a pair of jeans can rope it in for a mellow hippie look.", @"７０’Ｓテイストなダイダイ染めのチュニック\nインパクトのあるカラーが魅力的\nデニムとあわせてヒッピースタイルを楽しもう", @"No hay nada tan setentero como el desteñido. La viveza del color hace que esta camisola resulte impactante, pero con unos vaqueros crea un suave estilo hippie.", @"Niente fa più anni '70 della tintura a nodi. I colori vibranti donano un forte impatto a questa maglietta, ma un paio di jeans sono ciò che serve per dare un vero tocco hippie all'outfit.", @"Nichts steht so sehr für die 70er wie Batik. Die leuchtenden Farben verleihen dieser Tunika Charakter, aber erst mit einer Jeans ist der gechillte Hippie-Look perfekt.", @"Rien n'évoque plus les années 70 qu'un bon motif tie-dye. Les couleurs vives de cette tunique en font une pièce vraiment percutante, mais vous pouvez l'associer à un jean pour un petit look hippie.", @"７０年代風格的紮染連身裙，\n令人印象深刻的顏色相當有魅力，\n搭配牛仔單品享受嬉皮風格吧。", @"70年代风格的扎染连衣裙 \n令人印象深刻的颜色相当有魅力，\n搭配牛仔单品享受嬉皮风格吧。") },
            { 10106, new TwewyItem(10106, 106, @"tile029", @"Flower One-piece", @"フラワーワンピース", @"Vestido floral", @"Vestitino floreale", @"Blumen-Tunika", @"Robe à fleur", @"花朵連身裙", @"花朵连衣裙", @"Psychedelic is '70s. This wildly patterned one-piece is pretty long, but you'll want to wear it over pants to complete the look.", @"７０’Ｓテイストのワンピース\nサイケデリックな色と柄がポイント\n丈は長めだが、あえてパンツとあわせたい", @"Psicodelia setentera. Esta prenda colorida y salvaje es bastante larga, pero puedes ponértela encima del pantalón para completar tu look.", @"Gli anni '70 erano psichedelici. Questo vestito dall'audace fantasia è piuttosto lungo, ma per indossarlo come si deve va abbinato ai pantaloni.", @"Die psychedelischen '70er. Dieses wild gemusterte Teil ist ziemlich lang, aber du solltest trotzdem eine Hose dazu tragen, damit der Look stimmt.", @"Les années 70 étaient psychédéliques. Cette robe au motif sauvage est assez longue, mais mieux vaut la porter avec un pantalon pour compléter le look.", @"７０年代風格的連身裙，\n特色為迷幻的顏色與花紋，\n雖然長度較長，但建議搭配褲子。", @"70年代风格的连身裙 \n特征为幻觉般的颜色与花样，\n虽然长度较长，但还是搭配裤子好。") },
            { 10107, new TwewyItem(10107, 107, @"tile001", @"Youth's March", @"青春行進曲", @"Marcha juvenil", @"Marcia della gioventù", @"Jugend-Statement", @"Marche de la jeunesse", @"青春進行曲", @"青春进行曲", @"Weathered denim bell-bottoms with a hint of stretch for a flattering fit. They look great with a folk guitar over the lap!", @"ビンテージ加工のデニムベルボトム\nストレッチが効いていてきれいにはける\nこれをはきフォークギターを抱え青春を謳歌せよ", @"Pantalones vaqueros desgastados y acampanados un poco elásticos para resaltar la figura. ¡Quedan geniales acompañados de una guitarra!", @"Jeans a campana effetto rovinato leggermente elastici per un comfort ideale. Stanno da favola con una chitarra folk portata a tracolla!", @"Schlaghosen im Used-Look mit einem Hauch Stretch, damit alles perfekt sitzt. Perfekt mit einer Westerngitarre auf dem Schoß!", @"Un jean vieilli à pattes d'éléphant dans un tissu un peu stretch pour mettre vos courbes en valeur. Parfait avec une guitare acoustique sur les genoux !", @"仿舊加工的牛仔喇叭褲，\n伸縮性佳，能夠漂亮地穿著，\n就穿上這條褲子，抱著民謠吉他歌頌青春吧。", @"仿旧加工的牛仔喇叭裤 \n伸缩性佳，能够漂亮地穿着，\n就穿上这条裤子，抱着民谣吉他歌颂青春吧。") },
            { 10108, new TwewyItem(10108, 108, @"tile702", @"Young Folks", @"若者たち", @"Juventud", @"Folk giovanile", @"Junge Leute", @"Jeunes gens", @"年輕人們", @"年轻人们", @"Vintage-style denim overalls, for the person who's tired of boring old jeans and wants to relive the passion of youth.", @"ビンテージ加工のデニムオーバーオール\n普通のデニムスタイルにあきたら、これ\n『若者たち』の熱い気持ちがよみがえる！", @"Clásico peto vaquero, para los que están hartos de los vaqueros de siempre y quieren volver a sentirse jóvenes.", @"Salopette di jeans in stile vintage, per chi è stufo di indossare i soliti vecchi jeans e vuole rivivere le gioie delle giovinezza.", @"Ein Jeans-Overall im Vintage-Look für alle, die langweilige Jeans satt haben und sich nach der Leidenschaft der Jugend sehnen.", @"Une salopette en jean de style vintage pour tous ceux qui en ont assez de leurs vieux jeans ennuyeux et qui rêvent de revivre la passion de leur jeunesse.", @"仿舊加工的牛仔罩衫，\n如果厭煩了普通的丹寧風格，\n就穿這件讓『年輕人們』的熱情甦醒！", @"仿旧加工的牛仔罩衫 \n如果厌烦了普通的丹宁风格，\n就穿这件让『年轻人们』的热情苏醒！") },
            { 10109, new TwewyItem(10109, 109, @"tile703", @"When You're in Love", @"恋におちたら", @"Amor enamorado", @"Amore a prima vista", @"Wenn du verliebt bist", @"Quand on est amoureux", @"若是墜入愛河", @"若是坠入爱河", @"Made of recycled denim with alternating seams. As versatile as a pair of blue jeans. Note: Won't necessarily win you a man.", @"リメイクで、１点ずつ風合いがちがうロングデニム\nデニム生地なので何にでも合わせやすい\n時々、商品名で勘違いをして購入する人がいる", @"Prenda de tela vaquera reciclada con costuras alternas. Tan versátil como unos vaqueros. Ojo: no te garantiza la conquista de un hombre.", @"Gonna di jeans in tessuto riciclato a cuciture alternate. È un capo molto versatile, ma attenzione: non è detto che ti aiuterà a rimorchiare.", @"Besteht aus wiederverwertetem Jeansstoff mit alternierenden Nähten. So vielseitig wie eine Jeanshose. Achtung: Damit angelst du dir nicht unbedingt einen Mann.", @"Un pantalon en denim recyclé avec des coutures alternantes. Aussi polyvalent qu'un jean. Remarque : ne vous aidera pas forcément à trouver l'homme de vos rêves.", @"回收再拼接而成的牛仔裙，\n使得每件觸感都不盡相同，\n丹寧布和任何材質都相當容易搭配，\n常常有人誤解商品名稱而購買。", @"重新制作后，每件触感都不同的牛仔长大衣 \n丹宁布和任何材质都相当容易搭配，\n常常有人搞错商品名称买到这件。") },
            { 10110, new TwewyItem(10110, 110, @"tile704", @"Love in a Heartbeat", @"恋はとつぜん", @"Amor en un latido", @"Cuore palpitante", @"Liebe im Handumdrehen", @"L'amour au premier regard", @"愛情來得突然", @"忽然到来的爱情", @"Made of recycled denim with alternating seams. As colorful and mellow as you are. Note: Won't actually find you true love.", @"リメイクで１点ずつ風合いがちがうロングデニム\nカラフルでピースフルなスカート\n時々、商品名で勘違いをして購入する人がいる", @"Prenda de tela vaquera reciclada con costuras alternas, tan colorida y suave como tú. Ojo: no te sirve para encontrar el amor verdadero.", @"Gonna di jeans in tessuto riciclato a cuciture alternate. Colorata e suadente come te, ma attenzione: non è detto che ti aiuterà a conquistare il vero amore.", @"Besteht aus wiederverwertetem Jeansstoff mit alternierenden Nähten. So farbenfroh und entspannt, wie du es bist. Achtung: Damit findest du nicht unbedingt die wahre Liebe.", @"Un pantalon en denim recyclé avec des coutures alternantes. Aussi coloré et doux que votre personnalité. Remarque : ne vous aidera pas nécessairement à trouver le grand amour.", @"回收再拼接而成的牛仔長裙，\n色彩豐富又沉穩的裙子，\n常常有人誤解商品名稱而購買。", @"重新制作后每件触感都不同的牛仔长裙 \n色彩丰富又沉稳的裙子，\n常常有人搞错商品名称买到这件。") },
            { 10111, new TwewyItem(10111, 111, @"tile705", @"Let's Dance", @"レッツダンス", @"Bailemos", @"Si balla!", @"Lass uns tanzen!", @"Dansons", @"我們跳舞吧", @"一起跳舞", @"Leather sandals which conform to your foot's natural contours the more you wear them. Dance the summer night away in these!", @"レザーサンダル\nはきこむごとに足にフィットする設計\nコレで夏の夜をおどり明かそう", @"Sandalias de cuero que se adaptan al contorno natural de tus pies a medida que las vas llevando. ¡Baila con ellas en las noches de verano!", @"Sandali in pelle che più li indossi, più acquistano la conformazione naturale del tuo piede. Infilali e scatenati in pista tutta la notte!", @"Ledersandalen, die sich an die natürliche Form deines Fußes anpassen, je mehr du sie trägst. Damit tanzt du den ganzen Sommer lang!", @"Des sandales en cuir qui épousent la forme naturelle de vos pieds plus vous les portez. De quoi danser jusqu'au bout de la nuit cet été !", @"皮製涼鞋，\n穿越久就越合腳的設計，\n就穿上這雙鞋在夏季夜晚跳舞到天明吧。", @"皮制凉鞋，\n穿越久就越合脚的设计 \n就穿上这双鞋在夏季夜晚跳舞到天明吧。") },
            { 10112, new TwewyItem(10112, 112, @"tile706", @"Young American", @"ヤングアメリカン", @"Joven americano", @"Sneakers americane", @"Junger Amerikaner", @"Jeune américain", @"美國青年", @"美国年轻人", @"Old-school high-tops, finished in bright red and pure white for maximum contrast. These really take you back.", @"ビンテージ加工のハイカットスニーカー\nビビッドな赤と白のコントラストがインパクト大\nなつかしさがしみこんでいるアイテム", @"Clásicas botas deportivas de color rojo chillón y blanco puro, un contraste impactante. Te traerán grandes recuerdos.", @"Sneakers vecchia scuola rosso fuoco con rifiniture bianche per il massimo contrasto. Queste sì che sono un vero tuffo nel passato.", @"Hohe Turnschuhe der alten Schule. Das knallige Rot und das reine Weiße bilden einen tollen Kontrast. Wie in den guten alten Zeiten.", @"Des baskets montantes old-school avec des touches de rouge vif et de blanc pur pour un contraste maximum. C'était le bon temps !", @"仿舊加工的高筒帆布鞋，\n鮮明的紅色與白色的對比非常搶眼，\n充滿懷舊感的單品。", @"仿旧加工的高筒帆布鞋 \n鲜明的红色与白色的对比非常抢眼，\n充满怀旧感的单品。") },
            { 10113, new TwewyItem(10113, 113, @"tile707", @"Funky Shades", @"ファンキーサングラス", @"Gafas de sol molonas", @"Occhiali eccentrici", @"Schicke Sonnenbrille", @"Lunettes de soleil funky", @"時髦眼鏡", @"时髦眼镜", @"These big red aviators are bold, funky, and a little mysterious. Walk on the wild side! Sing, dance, enjoy life!", @"７０’Ｓテイストの赤いおおきめのサングラス\nこれさえあればファンキーな気分になれる\nド派手にきめて歌いおどろう", @"Estas grandes gafas rojas de aviador son atrevidas, divertidas y un tanto misteriosas. ¡Pásate al lado salvaje! ¡Canta, baila y vive la vida!", @"Questi grandi occhiali rossi in stile aviator sono audaci, eccentrici e un po' misteriosi. Passa al lato selvaggio! Canta, balla e goditi la vita!", @"Diese große rote Pilotenbrille ist auffällig, funky, und ein wenig geheimnisvoll. Stürze dich ins Abenteuer! Singe, tanze und genieße das Leben!", @"Ces grosses lunettes d'aviateur rouges sont audacieuses, funky et même un peu mystérieuses. Libérez votre côté sauvage ! Chantez, dansez et profitez de la vie !", @"７０年代風格的紅色大太陽眼鏡，\n戴上就會覺得很酷，\n穿上超搶眼服裝唱歌跳舞吧。", @"70年代风格的红色大太阳眼镜 \n戴上就会觉得很酷，\n穿上超抢眼服装唱歌跳舞吧。") },
            { 10114, new TwewyItem(10114, 114, @"tile708", @"Love & Peace", @"愛と平和", @"Paz y amor", @"Pace e amore", @"Liebe und Frieden", @"Love & Peace", @"愛與和平", @"爱与和平", @"Crafted by hand, this studded leather cuff abounds in folky charm, and looks great when you're plunking at a steel-string guitar.", @"ハンドメイドスタッズブレスレット\nフォーキーな気分になれるレザーブレスレット\nギターを抱え街へ出て『愛と平和』を歌おう", @"Esta muñequera de cuero con tachuelas hecha a mano tiene cierto encanto folk y queda estupenda mientras rasgas la guitarra.", @"Questo polsino in pelle fatto a mano grida folk a pieni polmoni, e sta alla grande se portato pizzicando le corde di una chitarra.", @"Dieses handgefertigte Lederarmband mit Nieten fängt den Folk-Look ein und sieht toll aus, wenn du eine Gitarre mit Stahlsaiten zupfst.", @"Fabriqué à la main, ce bracelet en cuir clouté a un charme fou et il mettra votre main en valeur lorsque vous pincerez les cordes de votre guitare folk.", @"手工鉚釘手環，\n讓人變得友善的皮革手環，\n抱著吉他在城市裡高歌『愛與和平』吧。", @"手工铆钉手环 \n让人变得友善的皮革手环，\n抱着吉他在城市里高歌『爱与和平』吧。") },
            { 10115, new TwewyItem(10115, 115, @"tile709", @"Slogan Bandannas", @"スローガンバンダナ", @"Pañuelos protesta", @"Bandane slogan", @"Slogan-Bandanas", @"Bandanas à slogan", @"標語頭巾", @"标语头巾", @"A two-bandanna set, ideal for accessorizing your march on the Diet building to protest the ails of society and profess the sweet pain of love.", @"バンダナ２枚セット\n恋愛にまつわる悲しさや社会へのやるせなさ\nについて問題提起するときに使いたいアイテム", @"Conjunto de dos pañuelos, el complemento perfecto para manifestarse delante del Parlamento, protestar por los males de la sociedad y probar el sabor agridulce del amor.", @"Un set di due bandane, ideali da sfoggiare come accessorio durante le manifestazioni di protesta contro le sofferenze della società e per professare il dolce dolore dell'amore.", @"Ein zweiteiliges Bandana-Set, ideal als Accessoire für deinen Marsch zum Parlamentsgebäude, wo du gegen die Übel der Gesellschaft protestierst und den süßen Schmerz der Liebe verkündest.", @"Un lot de deux bandanas, parfait pour accessoiriser votre manifestation devant le bâtiment de la Diète nationale pour lutter contre les maux de la société et professer les doux tourments de l'amour.", @"包含２條頭巾的套組，\n最適合對戀愛感到悲傷或對社會不滿，\n想要提出控訴時使用。", @"包含2条头巾的套组 \n最适合对恋爱感到悲伤或对社会不满，\n想要提出控诉时使用。") },
            { 10116, new TwewyItem(10116, 116, @"tile710", @"Cocktail Queen", @"セレブリティドール", @"Reina del cóctel", @"Regina dei cocktail", @"Cocktail-Königin", @"Reine des cocktails", @"名媛淑女", @"名媛淑女", @"It takes a duchess to work this jaw-dropping party dress, crafted from a hypnotically shimmery fabric.", @"とっておきのパーティドレス\nセレブにしか着こなせない人気デザイン\nまばゆく光りかがやくドレス", @"Hace falta tener mucha clase para ponerse este despampanante vestido, hecho de una cautivadora tela brillante.", @"Serve una vera duchessa per indossare questo strabiliante vestito da sera, confezionato con un tessuto ipnoticamente scintillante.", @"Dieses atemberaubende Partykleid aus hypnotisch schimmerndem Stoff kann nur eine Herzogin tragen.", @"Seule une véritable duchesse pourrait rendre justice à cette robe de soirée époustouflante, faite d'un tissu chatoyant et hypnotisant.", @"珍藏的派對禮服，\n只有名流才能穿著得體的熱門設計，\n耀眼奪目的禮服。", @"珍藏的派对礼服 \n只有名流才能穿着得体的热门设计，\n耀眼夺目的礼服。") },
            { 10117, new TwewyItem(10117, 117, @"tile711", @"Regal Presence", @"リーガルプレゼンス", @"Presencia regia", @"Presenza regale", @"Königliche Präsenz", @"Présence royale", @"王者風格", @"王者风格", @"A glossy suede suit, cut along lines that appear orthodox at first glance, but reveal a host of details you'd only see from Pegaso.", @"光沢のあるスウェードのスーツ　\n一見オーソドックスな形だが細部にまで\nこだわりぬかれたペガッソならではの一品", @"Traje de ante brillante con un corte que, a primera vista, parece ortodoxo pero que cuenta con un sinfín de detalles que solo verás en Pegaso.", @"Un abito lucido scamosciato, tagliato seguendo le linee del corpo, che appare ortodosso a un primo sguardo, ma che poi rivela una moltitudine di dettagli particolari che solo Pegaso avrebbe saputo ideare.", @"Ein Anzug aus Veloursleder. Der Schnitt erscheint auf den ersten Blick konservativ, aber dann erkennt man die unzähligen Details, die es nur bei Pegaso gibt.", @"Un costume en daim brillant. Ses lignes peuvent sembler classiques à première vue, mais elles révèlent une multitude de détails que vous ne trouverez que chez Pegaso.", @"具有光澤感的麂皮西裝，\n乍看之下很正統的外觀，但連細部都極為講究，\n只有Pegaso才能做出這種商品。", @"具有光泽感的麂皮西装 \n乍看之下很正统的外观，但连细节都极为讲究， \n只有Pegaso才能做出这种商品。") },
            { 10118, new TwewyItem(10118, 118, @"tile712", @"Tweed Gentleman", @"セレブリティジェントル", @"Caballero tweed", @"Gentiluomo in tweed", @"Tweed-Gentleman", @"Gentleman en tweed", @"名流紳士", @"名流绅士", @"Any English gentleman would swear by this tweed suit, rendered in a brilliant white to match this winter season.", @"英国紳士を思わせるツィードスーツ\n冬だからこそ高級感あふれるホワイト系を\n着こなすのがペガッソ流", @"Un «gentleman» inglés haría cualquier cosa por este traje de tweed. Su tono blanco brillante refleja los colores de esta temporada de invierno.", @"Qualsiasi gentiluomo inglese indosserebbe questo abito di tweed senza pensarci due volte. Il tessuto bianco brillante si abbina alla stagione invernale.", @"Jeder englische Gentleman würde auf diesen Tweedanzug in strahlendem Weiß schwören, das perfekt zur Wintersaison passt.", @"Un costume en tweed digne des plus grands gentlemen anglais, dans un blanc brillant et hivernal.", @"讓人聯想到英國紳士的粗花呢西裝，\n因為是冬季，\n所以穿著充滿高級感的白色系服裝，\n這就是Pegaso的風格。", @"让人联想到英国绅士的粗花呢西装 \n因为是冬季，所以穿着充满高级感的白色系服装，\n这就是Pegaso的风格。") },
            { 10119, new TwewyItem(10119, 119, @"tile713", @"Lavender Lotus", @"シャイニーレディ", @"Loto lavanda", @"Loto lavanda", @"Lavendel-Lotos", @"Lotus de lavande", @"亮眼淑女", @"闪亮淑女", @"Chinese dress meets tailored suit. Pegaso's first attempt at an Oriental piece bears a sequined pegasus.", @"チャイニーズ風スーツドレス\nペガッソが手がける初のチャイニーズドレス\nスパンコールのペガサスをあしらった豪華な１着", @"Fusión entre vestido chino y traje a medida. El primer intento de Pegaso de crear una pieza oriental presenta un pegaso con lentejuelas.", @"Lo stile cinese incontra l'abito su misura. Il primo tentativo di Pegaso di avvicinarsi alla moda orientale è ornato da un cavallo alato di paillette.", @"Chinesisches Kleid trifft auf Maßanzug. Pegasos erster Entwurf eines orientalischen Stücks ziert ein Pailettenpegasus.", @"Un croisement entre une robe chinoise et un costume. La première tentative de tenue orientale de Pegaso est ornée d'un magnifique pégase en paillettes.", @"中華風套裝，\nPegaso首次發售的中華禮服，\n點綴飛馬亮片的豪華衣裳。", @"中华风套装 \nPegaso首次发售的中华礼服，\n点缀飞马亮片的豪华衣裳。") },
            { 10120, new TwewyItem(10120, 120, @"tile714", @"Classic Half-boots", @"トラッドブーツ", @"Botas clásicas de media caña", @"Tronchetti classici", @"Klassische Stiefeletten", @"Demi-bottes classiques", @"經典靴", @"经典靴", @"These classy half-boots are your key to a slimmer silhouette. Full interior zippers make them a cinch to put on.", @"高級感のあるショートブーツ\nシルエットを細く見せるキラーアイテム\nジップで開閉可能なので使いやすさも極上", @"Estas elegantes botas de media caña son la clave para mejorar tu figura. Se ponen y quitan fácilmente gracias a sus cremalleras interiores.", @"Questi eleganti tronchetti sono la chiave per ottenere una figura più slanciata. Le cerniere interne permettono di indossarli senza fare il minimo sforzo.", @"Diese klassischen halbhohen Stiefel sind der Schlüssel zu einer schlankeren Silhouette. Dank der Reißverschlüsse hast du sie auch im Nu angezogen.", @"Ces bottines élégantes sont la clé pour une silhouette amincie. Enfilez-les en un clin d'œil grâce à leurs fermetures éclair intérieures.", @"散發高級感的短靴，\n讓身形顯瘦的關鍵單品，\n加上拉鍊更方便穿脫。", @"散发高级感的短靴 \n让身形显瘦的关键道具，\n能以拉链开闭，超级方便。") },
            { 10121, new TwewyItem(10121, 121, @"tile715", @"Crimson Stilettos", @"クリムゾンハイヒール", @"Tacones carmesí", @"Tacchi a spillo rossi", @"Purpurrote Stöckelschuhe", @"Talons aiguille pourpres", @"深紅高跟鞋", @"深红高跟鞋", @"High heels for the mature woman. Gold piping sets off the provocative red, while the lamé shimmers hypnotically with every step.", @"大人の女性のためのハイヒール\n挑発的な赤とゴールドのパイピングがセクシー\n歩くたびにきらめくラメがまぶしい", @"Tacones para mujeres maduras. Los ribetes dorados acentúan el rojo provocador, mientras que el lamé cautiva con sus destellos a cada paso.", @"Tacchi a spillo per le donne mature! Le decorazioni dorate fanno da cornice al rosso provocante, mentre il lamé luccica in maniera ipnotica ad ogni passo.", @"Stöckelschuhe für die reifere Frau. Die goldene Paspelierung betont das provokante Rot, während das Lamé bei jedem Schritt hypnotisch schimmert.", @"Des talons hauts pour une femme mûre. Les détails dorés de ces chaussures se marient parfaitement avec leur rouge provocateur, et leur tissu lamé scintille de façon hypnotisante à chaque pas.", @"展現成熟女性的高跟鞋，\n挑逗人心的紅色與金色滾邊十分性感，\n耀眼的金色隨著每次跨出步伐而閃耀。", @"成熟女性用的高跟鞋 \n挑逗人心的红色与金色滚边十分性感，\n耀眼的金属箔随着跨出步伐而闪耀。") },
            { 10122, new TwewyItem(10122, 122, @"tile716", @"Silver Baron", @"リジットバレン", @"Barón de plata", @"Barone d'argento", @"Silberbaron", @"Baron d'argent", @"銀色男爵", @"银色男爵", @"A round-faced wristwatch made to Pegaso specifications. Easily matched to any outfit, this watch is the gentleman's best friend.", @"ラウンド型リストウォッチ\nブランド定番デザインで、どんなスタイルにも\nあわせやすいので１本は持っていたい", @"Reloj de pulsera redondo hecho siguiendo las especificaciones de Pegaso. Va con cualquier estilo y es el compañero perfecto para un caballero.", @"Orologio da polso con quadrante rotondo in pieno stile Pegaso. Siccome si abbina facilmente a qualsiasi outfit, questo orologio è il miglior amico di ogni gentiluomo.", @"Eine runde Armbanduhr, die nach den strengen Richtlinien von Pegaso entworfen wurde. Passt zu jedem Outfit und ist der beste Freund des Gentleman.", @"Une montre ronde conforme aux normes de Pegaso. S'accordant facilement avec n'importe quelle tenue, cette montre deviendra vite la meilleure amie de n'importe quel gentleman.", @"圓形腕錶，\n品牌的經典設計款，\n適合搭配各種風格，人人都該有一支。", @"圆形腕表 \n品牌的经典设计款，\n适合搭配各种风格，人人都该有一支。") },
            { 10123, new TwewyItem(10123, 123, @"tile717", @"Liberty Duke", @"リバティデューク", @"Duque de la libertad", @"Duca lussuoso", @"Freiheitsfürst", @"Duc de la liberté", @"自由公爵", @"自由公爵", @"A round-faced wristwatch made to Pegaso specifications. This season's fusion of beauty and function has drawn accolades.", @"ラウンド型リストウォッチ\nブランド定番モデルで、機能美を追求した今季新作\n発売前から問い合わせが殺到した一品", @"Reloj de pulsera redondo hecho siguiendo las especificaciones de Pegaso. La fusión de belleza y funcionalidad de esta temporada le ha granjeado muchos adeptos.", @"Orologio da polso con quadrante rotondo in pieno stile Pegaso. Questa fusione di bellezza e funzionalità gli è valsa molti encomi.", @"Eine runde Armbanduhr, die nach den strengen Richtlinien von Pegaso entworfen wurde. Die Kombination aus Schönheit und Funktion dieser Saison hat zahlreiche Preise eingeheimst.", @"Une montre ronde conforme aux normes de Pegaso. La fusion entre pratique et esthétique opérée par la marque cette saison lui a valu de nombreux éloges.", @"圓形腕錶，\n品牌的經典造型，追求功能美感的本季新作，\n從發售前就詢問度超高。", @"圆形腕表 \n品牌的经典造型，追求功能美感的本季新作，\n从发售前就询问度超高。") },
            { 10124, new TwewyItem(10124, 124, @"tile718", @"Royal Splendor", @"ロイヤルスプレンダー", @"Esplendor aristocrático", @"Splendore regale", @"Königliche Pracht", @"Splendeur royale", @"皇家光輝", @"皇家光辉", @"A wristwatch designed by last year's rising star designer. The bold graphic on the faceplate hints at the future of Pegaso.", @"昨年電撃起用した新デザイナーのリストウォッチ\n文字盤の大胆なグラフィックが印象的\nペガッソの新しい方向性を示している", @"Reloj de pulsera redondo creado por el diseñador estrella del pasado año. El atrevido dibujo del fondo insinúa el futuro de Pegaso.", @"Un orologio da polso disegnato dall'astro nascente della moda dello scorso anno. L'audace disegno al centro del quadrante allude al futuro di Pegaso.", @"Eine Armbanduhr, gestaltet vom letztjährigen Durchstarter am Designerhimmel. Die prägnante Grafik auf dem Ziffernblatt lässt die Zukunft von Pegaso erahnen.", @"Une montre conçue par le designer émergeant de l'an dernier. Le motif audacieux du cadran est une allusion à l'avenir de Pegaso.", @"由去年的新星設計師所設計的腕錶，\n錶面大膽的圖案令人印象深刻，\n展現了Pegaso品牌新的方向。", @"由去年闪电式录用的新设计师所设计的腕表 \n表面大胆的图案令人印象深刻，\n展现了Pegaso品牌新的方向性。") },
            { 10125, new TwewyItem(10125, 125, @"tile719", @"Revolution", @"レボリューション", @"Revolución", @"Rivoluzione", @"Revolution", @"Révolution", @"革命", @"革命", @"Distinctive for its buckle accent, this handbag is the follow-up to Pegaso's famous nylon bag, now in a bold new color.", @"ベルトバックルが個性的なハンドバッグ\n大ブレイクしたペガッソのナイロンバッグと\n同じモデルで今年の新色", @"El cierre acentúa el diseño de este bolso, heredero del famoso bolso de nailon de Pegaso, que llega ahora en un tono atrevido y novedoso.", @"Questa borsa, che si distingue per l'importante fibbia che l'adorna, è il secondo modello della famosa borsa in nylon di Pegaso, con un nuovo ed eccentrico colore.", @"Diese Handtasche mit ihrer unverwechselbaren Schnalle ist der Nachfolger der berühmten Nylontasche von Pegaso, jetzt in einer kräftigen neuen Farbe.", @"Doté d'une boucle caractéristique, ce sac à main est le successeur du célèbre sac en nylon de Pegaso, maintenant disponible dans une nouvelle couleur audacieuse.", @"皮帶扣很有特色的手提包，\n與Pegaso大爆紅的尼龍包同款式，\n今年的新顏色。", @"皮带扣很有特色的手提包 \n与Pegaso爆红的尼龙包款式相同， \n但是今年的新颜色。") },
            { 10126, new TwewyItem(10126, 126, @"tile720", @"Sparkling Flight", @"スパークリングフライト", @"Vuelo brillante", @"Volo scintillante", @"Funkelnder Flug", @"Vol étincelant", @"閃耀飛行", @"闪耀飞行", @"Made to commemorate the brand's 100th-year anniversary, this limited-edition nylon bag proudly displays the Pegaso logo.", @"ペガッソ１００周年記念の数量限定ハンドバッグ\n得意のナイロン素材にブランドロゴを大胆に\nあしらった存在感あるアイテム", @"Este bolso de nailon de edición limitada, diseñado para conmemorar el centenario de la marca, exhibe con gran orgullo el logotipo de Pegaso.", @"Questa borsa di nylon in edizione limitata, creata per festeggiare il 100° anniversario del brand, sfoggia con orgoglio il logo di Pegaso.", @"Diese limitierte Nylontasche anlässlich des 100. Jahrestags der Marke zeigt voller Stolz das Pegaso-Logo.", @"Conçu en l'honneur du centième anniversaire de la marque, ce sac en nylon en édition limitée est orné du logo de Pegaso.", @"紀念Pegaso１００週年的限量手提包，\n在拿手的尼龍材質上大膽放上品牌標誌，\n是充滿存在感的單品。", @"纪念Pegaso 100周年的限量手提包 \n在拿手的尼龙素材上大胆放上品牌标志，\n充满存在感的单品。") },
            { 10127, new TwewyItem(10127, 127, @"tile721", @"Darling Lock", @"キューティロック", @"Candado del amor", @"Lucchetto adorabile", @"Mein Schlösschen", @"Verrou bien-aimé", @"可愛搖滾", @"可爱摇滚", @"Distinctive for its padlock accent, this cute red bag went home with half the men who came in shopping before last Christmas.", @"錠前アクセントがかわいい赤いハンドバッグ\nクリスマス前に来店した大半の男性が買っていく\n働く女性が憧れる人気のバッグ", @"Este precioso bolso rojo con su característico cierre lo compraron la mitad de los hombres que pasaron por la tienda las Navidades pasadas.", @"Questa borsetta rossa, peculiare per il suo lucchetto in evidenza, è tornata a casa con la metà degli uomini che sono entrati per comprare un regalo di Natale.", @"Diese niedliche rote Tasche mit dem unverwechselbaren Vorhängeschloss wurde bei den letztjährigen Weihnachtseinkäufen von der Hälfte der Männer mit nach Hause genommen.", @"Doté d'un cadenas caractéristique, cet adorable sac rouge a fait fureur chez les hommes qui cherchaient un cadeau de Noël pour leur femme l'an dernier.", @"有著鎖型裝飾的可愛紅色手提包，\n在聖誕節前來店光顧的男性大多會買這款，\n職業婦女所憧憬的熱門包款。", @"有着锁型装饰的可爱红色手提包 \n在圣诞节前来店光顾的男性大多会买这款，\n职业妇女所憧憬的热门包款。") },
