            { 10129, new TwewyItem(10129, 129, @"tile723", @"Frilly Camisole", @"フリフリキャミ", @"Camisola con volantes", @"Canotta frou-frou", @"Rüschen-Trägertop", @"Caraco à dentelle", @"褶邊吊帶背心", @"褶边吊带背心", @"A camisole in Sheep Heavenly's trademark colors. Bonus points for the length: you can easily wear this as a one-piece or a tunic top.", @"シープ・ヘブンリーのテーマカラーキャミソール\n丈が長めでワンピースとしてもチュニック風にも\n使える便利でオトクなほめられアイテム", @"Camisola con los colores típicos de Sheep Heavenly. Lo mejor, el largo: te lo puedes poner de vestido o como camisa larga.", @"Una canotta con i colori caratteristici di Sheep Heavenly. Punti bonus per la lunghezza: puoi indossarla come vestitino o come top lungo.", @"Ein Trägertop in den charakteristischen Farben von Sheep Heavenly. Bonuspunkte für die Länge: Das hier kannst du problemlos als Kleidchen oder Tunika-Top tragen.", @"Un caraco aux couleurs emblématiques de Sheep Heavenly. Mention spéciale pour la longueur : vous pouvez le porter seul ou comme une tunique.", @"使用Sheep Heavenly主題色的小可愛，\n長度較長，可以當作連身裙\n或是長上衣進行搭配的實用單品。", @"使用Sheep Heavenly主题色的小可爱 \n长度较长，可以当作连衣裙\n或是长上衣进行搭配的实用单品。") },
            { 10130, new TwewyItem(10130, 130, @"tile724", @"Aqua Puffy Blouse", @"アクアパフブラウス", @"Blusa acuosa", @"Camicetta a palloncino", @"Wasserblaue Puffärmelbluse", @"Chemisier bleu clair", @"水色寬袖上衣", @"水色宽袖上衣", @"This girly blouse features cute puff sleeves in a mellow blue that's not too sweet. Guaranteed a spot on your short list.", @"パフスリーブがかわいいガーリィなブラウス\nさわやかなブルーで甘くなりすぎない\nヘビロで使えるアイテム", @"Esta blusa tan femenina lleva unas mangas anchas muy graciosas en tono azul, suave pero no excesivamente tierno. Seguro que está entre tus prendas preferidas.", @"Questa camicetta femminile sfoggia delle carinissime maniche a palloncino ed è di un azzurro soave, che al contempo non la fa sembrare un confettino. Merita un posto assicurato nella tua rosa dei candidati.", @"Diese mädchenhafte Bluse mit hübschen Puffärmeln ist in einem sanften Blauton gehalten, der nicht zu niedlich ist. Gehört unbedingt in die Liste deiner Lieblingsteile.", @"Ce chemisier féminin à manches bouffantes est d'un bleu doux mais pas trop gentillet. Il deviendra vite une pièce incontournable de votre garde-robe.", @"擁有可愛燈籠袖的女性化上衣，\n溫和的藍色不會太過甜美，\n一直穿也看不膩。", @"拥有可爱灯笼袖的女性化上衣 \n温和的蓝色不会太过甜美，\n一直穿也看不腻。") },
