            { 10138, new TwewyItem(10138, 138, @"tile562", @"Strawberry Chocolate", @"いちごチョコ", @"Fresa y chocolate", @"Fragola e cioccolato", @"Erdbeer-Schokolade", @"Chocolat framboise", @"草莓巧克力", @"草莓巧克力", @"A pink and cocoa striped tee, fifth in Sheep Heavenly's line. This is all you need to separate yourself from the pack.", @"ピンクとチョコレートブラウンのボーダーＴ\n他の子のマリンスタイルと差をつけられる\nシープ・ヘブンリーの人気Ｔシャツシリーズ０５", @"Camiseta a rayas de color rosa y marrón, quinto elemento de la colección de Sheep Heavenly. Justo lo que necesitas para diferenciarte del resto.", @"Una maglietta a righe rosa e marrone cioccolato: il quinto capo della linea di Sheep Heavenly. È tutto ciò che ti serve per distinguerti dalla massa.", @"Dieses rosa und schokobraun gestreifte T-Shirt ist die Nummer fünf in der Kollektion von Sheep Heavenly. Mehr brauchst du nicht, um dich von der Herde abzuheben.", @"Un T-shirt à rayures roses et chocolat, cinquième au classement de Sheep Heavenly. C'est tout ce qu'il vous faut pour sortir du lot.", @"粉紅色與巧克力褐色的橫條紋Ｔ恤，\n能夠與其他人的海軍風格分出差異，\nSheep Heavenly的熱門Ｔ恤系列０５。", @"粉红色与巧克力褐色的横条纹T恤 \n能够与其他人的海军风格分出差异，\nSheep Heavenly的热门T恤系列05。") },
