            { 10140, new TwewyItem(10140, 140, @"tile506", @"Angel Frill Skirt", @"天使のフリルスカート", @"Falda angelical", @"Gonnellina angelica", @"Engelsrüschenrock", @"Jupe à dentelle d'ange", @"天使的褶邊裙", @"天使的褶边裙", @"This flowy skirt is light as a feather! You'll feel like an angel the minute you don this adorable pastel pink number.", @"ふわふわパニエスカート\n着たただけで天使になった気分になれる\nパステルピンクがとってもキュート", @"¡Esta falda es ligera como una pluma! En cuanto te pongas esta adorable prenda rosa pastel, te sentirás como un ángel.", @"Questa gonna svolazzante è più leggera di una piuma! Ti sentirai come un angelo nel momento stesso in cui indosserai questo adorabile capo color pastello.", @"Dieser wallende Rock ist leicht wie eine Feder! Du fühlst dich wie ein Engel, sobald du dieses niedliche pastellrosa Teil angezogen hast.", @"Cette jupe fluide est aussi légère qu'une plume ! Vous aurez l'impression d'être un ange dès que vous aurez enfilé cette adorable pièce rose pastel.", @"輕飄飄的澎澎裙，\n穿上它就像變成了天使，\n淺粉紅色可愛極了。", @"轻飘飘的蓬蓬裙 \n穿上它就像变成了天使，\n浅粉红色可爱极了。") },
            { 10141, new TwewyItem(10141, 141, @"tile478", @"Citrus Shorts", @"ゆずショートパンツ", @"Shorts cítricos", @"Short limone", @"Zitrus-Shorts", @"Short agrume", @"柚子色短褲", @"柚子色短裤", @"Simple short pants, made loud and proud by the bombastic color of yuzu. Go all out and match it with other vibrant hues.", @"シンプルショートパンツ\nシンプルだけどこのカラーならインパクト大\nあえてビビッドな色と合わせるとオシャレ", @"Sencillos shorts que declaran su presencia con orgullo gracias al ampuloso tono yuzu. Combínalo con otros tonos llamativos.", @"Semplici short esaltati dall'altisonante colore dello yuzu. Metticela tutta e abbinali ad altre sfumature vibranti.", @"Eine einfache kurze Hose, die erst die bombastische Yuzu-Farbe zu etwas Besonderem macht. Gib alles und zieh dazu deine anderen grellen Farben an.", @"Un short simple rendu unique par son exceptionnelle couleur yuzu. Mettez le paquet et associez-le avec d'autres pièces colorées.", @"樣式簡單的短褲，\n雖然樣式簡樸但顏色卻相當具有力道，\n刻意搭配鮮艷顏色就很時尚。", @"样式简单的短裤 \n虽然样式简朴但颜色却相当具有力道，\n刻意搭配鲜艳颜色就很时尚。") },
            { 10142, new TwewyItem(10142, 142, @"tile450", @"Sparkling Capris", @"きらめきハーフパンツ", @"Capris brillantes", @"Short scintillanti", @"Glitzer-Capri", @"Corsaire étincelant", @"閃亮五分褲", @"闪亮五分裤", @"Simple capris in white, with a hint of sparkle to them. They work with any style, and are a cinch to coordinate with!", @"シンプルなハーフパンツ\nちょっぴりキラキラしているホワイト\nどんなスタイルでも使える便利なアイテム", @"Sencillos pantalones capri blancos con un toque brillante. Se amolda a cualquier estilo y es muy fácil de combinar.", @"Semplici pinocchietti di colore bianco, rifiniti con dettagli luccicanti. Stanno bene con qualsiasi stile e sono facilissimi da abbinare!", @"Einfache Caprihosen in Weiß mit einem Hauch Glitzer. Passen zu jedem Stil und vertragen sich problemlos mit jedem Outfit!", @"Un corsaire blanc simple avec quelques paillettes. Il s'harmonise sans mal avec n'importe quel style et va avec absolument tout !", @"樣式簡單的五分褲，\n有點閃亮亮的白色，\n能夠搭配各種風格的方便單品。", @"样式简单的五分裤 \n有点闪亮亮的白色，\n能够搭配各种风格的方便单品。") },
            { 10143, new TwewyItem(10143, 143, @"tile422", @"Ribbon Cargos", @"リボンカーゴパンツ", @"Multibolsillos con cintas", @"Pinocchietti cargo", @"Schleifen-Cargohose", @"Treillis à rubans", @"緞帶工作褲", @"缎带工作裤", @"Cargo capris done right. Brand designers Akihiro and Natsu busted out the ribbons, and the results are too cute.", @"ハーフ丈のカーゴパンツ\nブランドデザイナーのアキヒロとナツにかかれば\nカーゴパンツもリボンがついてこんなにキュート", @"Piratas multibolsillos con un toque alternativo. Los diseñadores Akihiro y Natsu sacaron las cintas y el resultado es, simplemente, encantador.", @"Pinocchietti cargo di altissima qualità. Gli stilisti del brand Akihiro e Natsu vi hanno aggiunto dei fiocchi, e il risultato è troppo carino!", @"Die perfekten Cargo-Caprihosen. Die Markendesigner Akihiro und Natsu haben tief in die Schleifchenkiste gegriffen, und das Ergebnis ist umwerfend putzig.", @"Pour faire court, c'est le corsaire parfait. Les designers de la marque, Akihiro et Natsu, se sont lâchés avec les rubans et le résultat est vraiment trop mignon.", @"五分長度的工作褲，\n經過品牌設計師明博與奈津的設計，\n工作褲搭配上緞帶也能變得如此可愛。", @"五分长度的工作裤 \n经过品牌设计师明博与奈津的设计，\n工作裤搭配上缎带也能变得如此可爱。") },
            { 10144, new TwewyItem(10144, 144, @"tile394", @"Flaming Knee-highs", @"めらめら二ーハイ", @"Medias rojo fuego", @"Calzettoni fiammanti", @"Flammend rote Kniestrümpfe", @"Cuissardes enflammées", @"燃燒過膝襪", @"燃烧过膝袜", @"Flaming red knee-high socks, ready to liven up any outfit. Perfect for adding punch to a miniskirt or capris.", @"ビビッドなレッドのニーハイソックス\nシンプルなミニスカートやハーフパンツと\n合わせれば存在感バッチリ！", @"Medias de color rojo fuego, para animar cualquier conjunto. Perfectas para darle chispa a una minifalda o a un pantalón capri.", @"Calze fiammeggianti alte fino al ginocchio che vivacizzano qualsiasi outfit. Perfette per dare un po' di brio a una minigonna o a un paio di pinocchietti.", @"Flammend rote Kniestrümpfe, die jedes Outfit aufpeppen. Perfekt zu Minirock oder Caprihose.", @"Des chaussettes montantes d'un rouge flamboyant, parfaites pour pimenter n'importe quelle tenue. Ajoutez du punch à tous vos corsaires et vos minijupes !", @"鮮艷紅色的過膝長襪，\n如果搭配樣式簡單的迷你裙或五分褲，\n就能成為全場焦點！", @"鲜艳红色的过膝长袜 \n如果搭配样式简单的迷你裙或五分裤，\n就能成为全场焦点！") },
            { 10145, new TwewyItem(10145, 145, @"tile366", @"Cloud Nine Scarf", @"ウキウキマフラー", @"Bufanda séptimo cielo", @"Sciarpa settimo cielo", @"Schal \x22Wolke sieben\x22", @"Écharpe rayée", @"迫不及待圍巾", @"迫不及待围巾", @"People will notice this striped scarf, guaranteed to keep you warm and snuggly even on the coldest winter days.", @"インパクトが大きいボーダーマフラー\n寒い冬でもこのマフラーでおでかけすれば\nポカポカしてきて自然とウキウキ", @"La gente se fijará en esta bufanda a rayas que te dará calorcito incluso en los días más gélidos del invierno.", @"Questa sciarpa a righe non passerà di certo inosservata, e ti terrà al caldo anche nelle più fredde giornate invernali.", @"Dieser gestreifte Schal zieht alle Blicke auf sich, und er hält dich auch an den kältesten Wintertagen kuschlig warm.", @"Tout le monde remarquera cette écharpe à rayures, et vous pourrez rester au chaud même pendant les journées les plus froides de l'hiver.", @"令人印象深刻的橫條紋圍巾，\n只要圍上這條圍巾，\n就算是寒冷冬季也能暖呼呼而自然開心起來。", @"令人印象深刻的横条纹围巾 \n只要围上这条围巾，\n就算是寒冷冬季也能暖呼呼而自然开心起来。") },
            { 10146, new TwewyItem(10146, 146, @"tile338", @"Lucky Rainbow Bracelets", @"ラッキーカラーブレス", @"Pulseras de la suerte", @"Bracciali arcobaleno", @"Glücks-Regenbogenarmreife", @"Bracelets arc-en-ciel", @"幸運色手環", @"幸运色手环", @"Each of the bracelets in this five-color set are filled with a glittery gel that's hypnotic to watch as it flows back and forth.", @"ポップでカラフルなブレス５本セット\n中身はゼリー状になっててゆっくり動くから\nながめているだけでも楽しいアイテム", @"Cada una de las cinco pulseras de este conjunto multicolor va rellena de un gel brillante cuyo movimiento resulta hipnótico a la vista.", @"Ciascuno dei braccialetti di questo set da cinque colori è decorato con una miriade di brillantini che incantano chi li guarda, mentre muovi il braccio avanti e indietro.", @"Jeder der fünf Armreifen in diesem fünffarbigen Set ist mit einem Glitzergel gefüllt, das hypnotisch hin und her fließt.", @"Chacun des bracelets de cet ensemble en cinq couleurs est rempli d'un gel pailleté qui vous hypnotisera avec ses va-et-vient.", @"時下流行的彩色手環５個組合，\n內部是會緩緩流動的果凍狀，\n用來純欣賞也很有意思。", @"时下流行的彩色手环5个组合 \n内部是会缓缓流动的果冻状，\n用来纯欣赏也很有意思。") },
            { 10147, new TwewyItem(10147, 147, @"tile310", @"Rounded Specs", @"まんまるメガネ", @"Gafas redondas", @"Occhiali ovali", @"Runde Brille", @"Lunettes arrondies", @"圓眼鏡", @"圆眼镜", @"These oval frames hold fake lenses...but that's our little secret. Designer Akihiro swears they make him look way smarter.", @"オーバルタイプの伊達めがね\nかけるだけでサブカルっぽくなる\nデザイナーのアキヒロが愛用している", @"Estas gafas ovaladas llevan cristales falsos, pero te guardaremos el secreto. El diseñador Akihiro dice que le dan un toque más intelectual.", @"Questa montatura ovale contiene delle lenti finte... ma sarà il nostro piccolo segreto. Lo stilista Akihiro giura che lo fanno sembrare più intelligente.", @"In diesem ovalen Gestell sitzt nur Fensterglas ... Aber das bleibt unser kleines Geheimnis. Designer Akihito schwört, dass er damit deutlich schlauer aussieht.", @"Les verres de ces lunettes ovales sont faux... mais ça restera notre petit secret. Le designer Akihiro jure qu'elles lui donnent l'air plus intelligent.", @"圓框的平光眼鏡，\n只要戴上就有次文化的感覺，\n設計師明博很愛戴這副眼鏡。", @"圆框的平光眼镜 \n只要戴上就有次文化的感觉，\n设计师明博很爱戴这副眼镜。") },
            { 10148, new TwewyItem(10148, 148, @"tile282", @"Shining Star Dangles", @"キラキラ星ピアス", @"Pendientes estrellados", @"Pendenti con stelle", @"Ohrring \x22blendender Stern\x22", @"Boucles d'oreille étoiles", @"閃亮星星耳環", @"闪亮星星耳环", @"Multi-colored star earrings, set to hang and sway as you strut across town. They're an easy way to add pizzazz to your style.", @"お星さまモチーフのピアス\n色違いのお星さまがゆらゆらゆれて\nポップなコーディネイトが演出できる", @"Pendientes de estrellas multicolor que cuelgan y se balancean durante tus paseos por la ciudad. Una forma sencilla de darle a tu estilo un toque especial.", @"Orecchini con stelle multicolore, fatti apposta per ondeggiare quando passeggi per la città. Sono il modo più semplice per dare un po' di brio al tuo stile.", @"Mehrfarbige Sternen-Ohrringe, die munter herumbaumeln, wenn du durch die Stadt stolzierst. So verleihst du deinem Stil zusätzlichen Pep.", @"Des boucles d'oreille multicolores en étoiles qui danseront alors que vous flânerez en ville. Un moyen facile de pimenter un peu votre style.", @"以星星為主題的耳環，\n顏色不同的星星輕輕搖曳，\n表現出流行穿搭風格。", @"以星星为主题的耳环 \n颜色不同的星星轻轻摇曳，\n表现出流行穿搭风格。") },
            { 10149, new TwewyItem(10149, 149, @"tile254", @"Princess Ring", @"お姫さまリング", @"Anillo de princesa", @"Anello da principessa", @"Prinzessinnenring", @"Anneau de princesse", @"公主戒指", @"公主戒指", @"The mega-huge, heart-shaped stone on this ring almost looks like candy. It's so sweet you'll want to eat it right up.", @"超特大のハートの石がついたリング\nキャンディーのようにカッティングされた石は\n思わずなめたくなるほどキュート", @"La gigantesca joya en forma de corazón de este anillo parece de caramelo. Es tan dulce que te darán ganas de comértela.", @"L'enorme pietra a forma di cuore su questo anello sembra quasi una caramella. È così dolce che vorresti mangiarla in un sol boccone.", @"Der gewaltige, herzförmige Stein dieses Rings sieht beinahe wie ein Bonbon aus. Er ist so süß, dass man ihn am liebsten verputzen würde.", @"L'énorme pierre en forme de cœur de cette bague ressemblerait presque à un bonbon. On aurait envie de le manger !", @"附有超特大心形石頭的戒指，\n看起來很像糖果的石頭\n可愛到讓人忍不住想舔一口。", @"附有超特大心形石头的戒指 \n看起来很像糖果的石头\n可爱到让人忍不住想舔一口。") },
            { 10150, new TwewyItem(10150, 150, @"tile226", @"Happy Necklace", @"ハッピーネックレス", @"Collar felicidad", @"Collana festosa", @"Glücks-Halskette", @"Collier joyeux", @"歡樂項鍊", @"欢乐项链", @"All of the fun charms on this necklace can be removed and played with in those little moments of downtime in your day.", @"おもちゃがたくさんついているネックレス\nおもちゃはぜんぶとりはずし可能だから\nヒマなときには遊べちゃう楽しいアイテム", @"Los divertidos colgantes de este collar se pueden sacar para juguetear con ellos en los momentos apáticos del día.", @"Tutti i ciondoli colorati e divertenti di questa collana possono essere tolti e rimessi a tuo piacimento, soprattutto quando hai un po' di tempo libero da impiegare.", @"Du kannst die herrlichen Anhänger dieser Kette abnehmen und mit ihnen spielen, wenn dir gerade mal langweilig ist.", @"Toutes les breloques amusantes de ce collier sont amovibles. De quoi vous divertir à n'importe quel moment de la journée !", @"有著很多玩具的項鍊，\n玩具全都可以拆卸下來，\n沒事做時就能拿來玩的有趣單品。", @"有着很多玩具的项链 \n玩具全都可以拆卸下来，\n没事做时就能拿来玩的有趣单品。") },
            { 10151, new TwewyItem(10151, 151, @"tile198", @"Heart Pochette", @"ハートポシェット", @"Minibolso corazón", @"Pochette a cuore", @"Herz-Pochette", @"Pochette cœur", @"心型小包包", @"心型小包包", @"A red, heart-shaped mini-bag crafted from eye-catching enamel. You'd be surprised at how much you can fit in there...", @"ハート型の赤いミニポシェット\nエナメル素材でインパクト大\n小さくても意外といろいろ入っちゃう", @"Minibolso rojo en forma de corazón fabricado con un atractivo esmaltado. Te sorprenderás de todo lo que cabe dentro.", @"Una borsetta rossa a forma di cuore colorata con una vernice appariscente. Ti sorprenderà scoprire quante cose puoi metterci dentro...", @"Mit diesem roten, herzförmigen Minibeutel aus Lack fällst du bestimmt auf. Und es ist unglaublich, was da alles hineinpasst ...", @"Un mini-sac rouge en forme de cœur en un tissu laqué qui ne passera pas inaperçu. Vous serez surpris de tout ce qu'il peut contenir...", @"心形的紅色迷你包，\n漆皮相當醒目，\n雖然小卻意外地能裝入不少東西。", @"心形的红色迷你包 \n漆皮相当醒目，\n虽然小却意外地能装入不少东西。") },
            { 10152, new TwewyItem(10152, 152, @"tile170", @"Polka Dot Bag", @"水玉バッグ", @"Bolso de lunares", @"Borsa a pois", @"Punktmuster-Handtasche", @"Sac à pois", @"點點包", @"点点包", @"The white-on-pink polka dots on this enamel handbag practically shout cute. Brand designer Natsu carries hers everywhere.", @"水玉模様のエナメルハンドバッグ\nピンク地に白の水玉が映えてとってもキュート\nブランドデザイナーのナツも愛用している", @"Los lunares blancos sobre rosa de este bolso esmaltado son una patente declaración de dulzura. La diseñadora Natsu lo lleva siempre.", @"Questa borsetta di vernice viola a pois bianchi è supercarina! La stilista Natsu la porta con sé ovunque vada.", @"Die weißen Punkte auf rosa Hintergrund dieser Lack-Handtasche sind unglaublich süß. Markendesignerin Natsu geht nirgendwo ohne diese Tasche hin.", @"Le motif à pois blancs sur fond rose de ce sac à main laqué est absolument adorable. La designer de la marque, Natsu, ne le quitte jamais.", @"水珠樣式的漆皮手提包，\n粉紅基底上配上白色水珠超級可愛，\n品牌設計師的奈津也很愛這款。", @"水珠样式的漆皮手提包 \n粉红基底上配上白色水珠超级可爱，\n品牌设计师的奈津也很爱这款。") },
            { 10153, new TwewyItem(10153, 153, @"tile142", @"Wadatsumi", @"ワダツミ", @"Wadatsumi", @"Wadatsumi", @"Wadatsumi", @"Wadatsumi", @"綿津見", @"绵津见", @"A simple sun visor, set in a marine blue that takes you right to the seashore. The perfect finish to your Jupiter ensemble.", @"シンプルなサンバイザー\n海を思わせるマリンブルーがさわやかさを演出\n同ブランド服で合わせるのがベター", @"Sencilla visera azul marino que te hará sentir como si estuvieras en alta mar. El toque perfecto para tu conjunto Jupiter of the Monkey.", @"Una semplice visiera color blu marino che ti porta dritto in spiaggia. Il dettaglio finale perfetto per il tuo outfit Jupiter.", @"Ein einfaches Sonnenvisier in Marineblau, mit dem du dich wie am Meer fühlst. Rundet dein Jupiter-Outfit perfekt ab.", @"Une visière simple bleu marine qui vous transporte instantanément à la mer. C'est l'accessoire parfait pour compléter votre ensemble Jupiter.", @"樣式簡單的遮陽帽，\n美麗的海藍色讓人想到海洋，\n搭配同品牌的服裝就更加完美。", @"样式简单的遮阳帽 \n美丽的海蓝色让人想到海洋，\n搭配同品牌的服装就更加完美。") },
            { 10154, new TwewyItem(10154, 154, @"tile114", @"Fudo", @"フドウ", @"Fudo", @"Fudo", @"Fudo", @"Fudo", @"不動", @"不动", @"The classic blue safari hat, now with a little stripe to it. Its muted hue will work with anyone's look. Unshakably popular.", @"ラインの入った定番の青サファリハット\n色もシックで誰でも取り入れやすいのでオススメ\nサルの木星で不動の人気を誇るアイテム", @"Clásico sombrero de safari azul, ahora con una pequeña raya. Su tono discreto se adapta a cualquier estilo. Nunca pasa de moda.", @"Il classico cappello da safari blu, adornato con un nastro bianco. La sua tinta pacata lo rende perfetto su chiunque. Un pezzo incrollabile.", @"Der klassische blaue Safarihut, jetzt mit einem kleinen Streifen. Die unaufdringliche Farbe passt zu jedem Look. Zeitlos beliebt.", @"Un chapeau de safari bleu classique avec une petite rayure. Sa couleur discrète s'accordera avec n'importe quel look. Indémodable.", @"帶有條紋的經典藍色旅行帽，\n有著適合任何人的時尚色彩，相當推薦，\n猴子木星中熱門程度難以撼動的商品。", @"带有条纹的经典蓝色旅行帽 \n有着适合任何人的时尚色彩，相当推荐，\n猴子木星中热门程度难以撼动的商品。") },
            { 10155, new TwewyItem(10155, 155, @"tile086", @"Dharma", @"ダルマ", @"Dharma", @"Dharma", @"Dharma", @"Dharma", @"達摩", @"达摩", @"This two-tone tank fashioned from space-age fabrics makes a bold statement. Neku's been wearing his nearly non-stop.", @"ハイテク素材のランニングシャツ\nシックなツートンカラーでもインパクトは十分\nネクが愛用しているモデル", @"Esta camiseta de tirantes de dos tonos, fabricada con tela espacial, supone toda una declaración de intenciones. Neku prácticamente no se la quita.", @"Questa canotta bicolore confezionata con tessuti all'avanguardia è da veri duri. Neku la indossa continuamente.", @"Dieses zweifarbige Tanktop aus hochmodernem Material ist ein unübersehbares Statement. Neku trägt seines fast ununterbrochen.", @"Ce débardeur bicolore en tissus futuristes aura un effet bœuf. Neku ne se lasse pas du sien.", @"使用高科技材質的無袖背心，\n優雅的雙色配色非常搶眼，\n音操愛穿的款式。", @"使用高科技材料的无袖背心 \n优雅的双色调色彩非常抢眼，\n音操爱穿的款式。") },
            { 10156, new TwewyItem(10156, 156, @"tile058", @"Suiten", @"スイテン", @"Suiten", @"Suiten", @"Suiten", @"Suiten", @"水天", @"水天", @"It's no coincidence this fun tee looks sporty--it's actually a parody of Iceland's national volleyball team uniforms.", @"ジャージ風デザインＴシャツ\nアイスランドのプロバレーボールチームの\nユニフォームのパロディ", @"No es casualidad que esta divertida camiseta tenga un aire deportivo. En realidad, es una parodia de la equipación de la selección nacional de voleibol de Islandia.", @"Non è un caso che questa maglietta sembri sportiva, infatti si tratta di una parodia dell'uniforme della nazionale islandese di pallavolo.", @"Es ist kein Zufall, dass dieses tolle T-Shirt so sportlich aussieht: Es ist eine Parodie der Uniformen der isländischen Volleyball-Nationalmannschaft.", @"Pas étonnant que ce T-shirt ait l'air sportif : c'est la réplique du maillot de l'équipe de volley nationale islandaise.", @"設計成運動服風格的Ｔ恤，\n致敬冰島職業排球隊的制服。", @"设计成运动服风格的T恤 \n致敬冰岛职业排球队\n的制服。") },
            { 10157, new TwewyItem(10157, 157, @"tile030", @"Haramitsu", @"ハラミツ", @"Haramitsu", @"Haramitsu", @"Haramitsu", @"Haramitsu", @"波羅密", @"波罗密", @"This sporty tee is a replica of a famous university ping pong team's jerseys. Even fashionistas need a sense of humor.", @"ジャージ風デザインＴシャツ\n有名大学の卓球チームのユニフォームのレプリカ\n真のおしゃれにはユーモアも必要だ", @"Esta camiseta deportiva es una réplica de la famosa equipación de un equipo de pimpón universitario. Hasta la moda tiene sentido del humor.", @"Questa maglietta sportiva è la riproduzione della casacca di una famosa squadra di ping pong universitaria. Anche ai più modaioli serve un po' di senso dell'umorismo.", @"Dieses sportliche T-Shirt ist eine Replik der Trikots der Tischtennismannschaft einer berühmten Universität. Auch Modefreaks brauchen einen Sinn für Humor.", @"Ce T-shirt sportif est la réplique du maillot de l'équipe de ping-pong d'une université célèbre. Même les fashionistas doivent avoir le sens de l'humour.", @"設計成運動服風格的Ｔ恤，\n著名大學桌球隊制服的複製品，\n真正的時尚也必須要有幽默感。", @"设计成运动服风格的T恤 \n知名大学桌球队制服的复制品，\n真正的时尚也必须要有幽默感。") },
            { 10158, new TwewyItem(10158, 158, @"tile002", @"Amida", @"アミダ", @"Amida", @"Amida", @"Amida", @"Amida", @"阿彌陀", @"阿弥陀", @"Made from high-tech nylon fibers, this warm parka is surprisingly slim, letting you show off your assets deep into winter.", @"ハイテク素材のナイロンパーカー\n意外と細身のシルエットでキレイに着こなせる\n周りから、いちもく置かれる着こなしが可能", @"Esta parka abrigada está hecha de fibras de nailon de alta tecnología. Es sorprendentemente fina para que marques figura incluso en invierno.", @"Questo morbido parka, fatto di fibre di nylon high-tech, è sorprendentemente sfiancato, permettendoti di sfoggiare le tue forme anche in pieno inverno.", @"Dieser warme Parka aus Hightech-Gewebe ist erstaunlich dünn. So kannst du deine Figur auch tief im Winter präsentieren.", @"En fibres de nylon high-tech, cette parka chaude est étonnamment moulante, ce qui permettra de mettre vos atouts en valeur même en plein hiver.", @"使用高科技材質的尼龍連帽衫，\n比想像中更顯瘦的外型，穿起來很好看，\n穿搭起來能讓周遭的人產生敬佩感。", @"使用高科技材料的尼龙连帽衫 \n比想像中更显瘦的外型，穿起来很好看，\n穿搭起来能让周遭的人佩服你。") },
            { 10159, new TwewyItem(10159, 159, @"tile675", @"Ashura", @"アシュラ", @"Ashura", @"Ashura", @"Ashura", @"Ashura", @"阿修羅", @"阿修罗", @"Sister product to the Amida, this sturdy, limited-edition nylon parka has been customized with distinctive patches.", @"限定ナイロンパーカー\nワッペンでカスタマイズしたスペシャルアイテム\nアミダモデルの姉妹品", @"Prima hermana de la Amida, esta resistente parka de nailon de edición limitada ha sido personalizada con unos parches muy característicos.", @"Questo parka di nylon super resistente in edizione limitata è il fratello del parka Amida, ed è personalizzato con toppe caratteristiche.", @"Dieser robuste, limitierte Nylonparka ist eng mit dem Amida verwandt und ist mit markanten Aufnähern versehen.", @"Petite sœur de l'Amida, cette parka en nylon résistante en édition limitée a été personnalisée avec des patchs distinctifs.", @"限定版尼龍連帽衫，\n縫有紋章的特殊單品，\n阿彌陀款式的關聯商品。", @"限定版尼龙连帽衫 \n缝有纹章的特殊单品，\n阿弥陀款式的关联商品。") },
