            { 10162, new TwewyItem(10162, 162, @"tile678", @"Togenkyo", @"トウゲンキョウ", @"Togenkyo", @"Togenkyo", @"Togenkyo", @"Togenkyo", @"桃源鄉", @"桃源乡", @"Still stylish despite generous cotton stuffing, this nylon zip-up offers a toasty paradise amid the dead of winter.", @"ナイロン素材のジップアップジャケット\n中綿がしっかり入っているのに美しいフォルム\nこれを着れば、冬でもトウゲンキョウのあたたかさ", @"Esta chaqueta de nailon y cremallera tiene mucho estilo, a pesar del relleno de algodón. Un paraíso calentito para el crudo invierno.", @"Molto stiloso nonostante l'abbondante imbottitura di cotone, questo giaccone ti avvolgerà in un caldo abbraccio nelle gelide giornate invernali.", @"Diese Nylonjacke ist trotz des großzügigen Futters stilvoll und bietet ihrem Träger ein kuschliges Paradies inmitten der Kälte des Winters.", @"Super classe malgré sa grosse doublure en coton, cette veste en nylon vous gardera au chaud au plus fort de l'hiver.", @"尼龍材質的拉鍊夾克，\n內裡紮實地塞入棉花，造型卻很優美，\n穿上它後，即使是冬季也有如世外桃源般溫暖。", @"尼龙材料的拉链夹克 \n内里扎实地塞入棉花，造型却很优美，\n穿上它后，即使是冬季也有如世外桃源般温暖。") },
