            { 10170, new TwewyItem(10170, 170, @"tile686", @"Gold Band", @"金のリング", @"Anillo de oro", @"Anello d'oro", @"Goldring", @"Bague en or", @"金戒指", @"金戒指", @"A simple gold band with lovely grooved detailing that catches the light just so, making the ring shine brilliantly.", @"シンプルなゴールドリング\nカッティングのディテールが凝っているので\nキラキラしていて存在感あり", @"Un sencillo anillo de oro con preciosos detalles grabados que atrapan la luz y lo hacen brillar con fuerza.", @"Un semplice anello d'oro con adorabili scanalature che riflettono la luce e fanno luccicare visibilmente l'accessorio.", @"Ein einfacher Goldring mit einer herrlichen Gravur, die das Licht perfekt einfängt und das Schmuckstück hell erstrahlen lässt.", @"Un anneau en or simple avec de jolis détails rainurés qui le font scintiller sous l'effet de la lumière.", @"樣式簡單的金戒指，\n十分講究車工的細節，\n散發閃亮亮的存在感。", @"样式简单的金戒指 \n十分讲究车工的细节，\n散发闪亮亮的存在感。") },
            { 10171, new TwewyItem(10171, 171, @"tile687", @"Coral Necklace", @"サンゴネックレス", @"Collar de coral", @"Collana di coralli", @"Korallen-Halskette", @"Collier en corail", @"珊瑚項鍊", @"珊瑚项链", @"This necklace makes lavish use of that understated natural beauty, coral. Luxurious, but never overpoweringly so.", @"サンゴをふんだんに使った\nゴージャスなネックレス\nサンゴなので豪華になり過ぎないところがうれしい", @"Este colgante saca buen partido a la belleza natural del coral. Un lujo nada exagerado.", @"Questa collana fa uso sfarzoso di una meraviglia naturale dal fascino discreto: il corallo. Lussuosa, ma mai soverchiante.", @"Diese Halskette nutzt die unaufdringliche Schönheit der Koralle. Luxuriös, aber nie übertrieben.", @"Ce collier utilise la beauté naturelle du corail de façon somptueuse. Le luxe, mais sans en faire trop.", @"大量使用珊瑚的豪華項鍊，\n由於是珊瑚，\n因此不會散發過度的奢侈感。", @"大量使用珊瑚的豪华项链 \n由于是珊瑚，\n因此不会散发过度的奢侈感。") },
            { 10172, new TwewyItem(10172, 172, @"tile688", @"Turquoise Necklace", @"ターコイズネックレス", @"Collar turquesa", @"Collana turchese", @"Türkis-Halskette", @"Collier turquoise", @"綠松石項鍊", @"绿松石项链", @"Unusual design details and plenty of turquoise make this captivating necklace a joy to look at.", @"ターコイズをふんだんに使った\n珍しいデザインのネックレス\nいつまで見ていても飽きないディテール", @"Sus peculiares detalles de diseño y una buena dosis de turquesa hacen de este cautivador colgante una delicia para los ojos.", @"I dettagli dal design originale e l'abbondanza del turchese fanno di questa collana accattivante una vera gioia per gli occhi.", @"Ungewöhnliche Design-Details und jede Menge Türkis machen es zu einem Vergnügen, diese bezaubernde Halskette anzusehen.", @"Des détails originaux et une tonne de turquoise font de ce collier fascinant un délice pour les yeux.", @"大量使用綠松石的罕見設計項鍊，\n精巧設計不論怎麼看都看不膩。", @"大量使用绿松石的罕见设计项链 \n精巧设计，\n不论怎么看都看不腻。") },
            { 10173, new TwewyItem(10173, 173, @"tile689", @"Garden Bracelet", @"フラワーガーデンブレス", @"Pulsera floral", @"Braccialetto a fiori", @"Garten-Armreif", @"Bracelet de jardin", @"花園手環", @"花园手环", @"Tiny flowers ornament this bracelet. Its cute, delicate design makes it perfect for younger ladies, too.", @"小さなお花がちりばめられたブレスレット\nきゃしゃでキュートなテイストなので\n若い女性に人気のアイテム", @"Esta pulsera va adornada con flores diminutas. Su encantador y delicado diseño la hace perfecta también para los más jóvenes.", @"Questo braccialetto è ornato da tanti piccoli fiorellini. Il suo design simpatico e delicato lo rendono un accessorio perfetto anche per le più giovani.", @"Dieser Armreif ist mit winzigen Blümchen verziert. Durch das putzige, zarte Design ist er auch perfekt für jüngere Damen geeignet.", @"De petites fleurs ornent ce bracelet. Son design mignon et délicat en fait un bijou idéal pour les plus jeunes filles.", @"鑲著小花的手環，\n纖細又可愛的風格，\n大受年輕女性歡迎。", @"镶着小花的手环 \n纤细又可爱的风格，\n大受年轻女性欢迎。") },
