            { 10175, new TwewyItem(10175, 175, @"tile691", @"Gold Bangle", @"金のブレス", @"Brazalete dorado", @"Braccialetto d'oro", @"Gold-Armspange", @"Jonc en or", @"金手環", @"金手环", @"An elegant Oriental motif decorates this voluminous show-stopper of a gold bangle--a tasteful accent to any ensemble.", @"ボリュームがあるゴールドブレスレット\nオリエンタルなイメージのゴージャスな一品\nコーディネイトにアクセントをつけられる", @"Un elegante motivo oriental decora este voluminoso brazalete dorado. Un complemento de buen gusto para cualquier conjunto.", @"Un elegante motivo orientale decora questa voluminosa bellezza d'oro: un elemento di gran classe adatto ad ogni outfit.", @"Dieser voluminöse Kracher von einer Gold-Armspange mit elegantem orientalischem Motiv ist ein geschmackvoller Akzent für jedes Outfit.", @"Un élégant motif oriental orne cet exceptionnel jonc en or. Un accessoire de goût pour embellir n'importe quelle tenue.", @"很有分量的金手環，\n傳達東方意象的豪華商品，\n能夠成為穿搭上的亮點。", @"很有分量的金手环 \n传达东方意象的豪华商品，\n能够成为穿搭上的亮点。") },
            { 10176, new TwewyItem(10176, 176, @"tile692", @"Pureheart Pendant", @"ピュアハートペンダント", @"Colgante pureza", @"Ciondolo cuore puro", @"Anhänger \x22Reines Herz\x22", @"Pendentif cœur pur", @"純潔之心墜子", @"纯洁之心坠子", @"Heart-cut rose quartz adorns this pendant, small enough to stay casual and cute. Just the right size for an everyday accent.", @"ローズクォーツのハート型ストーンを\nあしらったペンダント\n小ぶりでさりげない感じがかわいい", @"Una piedra de cuarzo rosa en forma de corazón adorna este colgante, lo bastante pequeño como para resultar informal y hermoso. El tamaño perfecto para tu día a día.", @"Questo ciondolo contiene un quarzo rosa a forma di cuore abbastanza piccolo da risultare informale e delicato. La giusta dimensione per un gioiello da indossare ogni giorno.", @"Dieser Anhänger ist mit einem Rosenquarz in Herzform verziert, der klein genug ist, um noch leger und süß zu wirken. Genau die richtige Größe für ein alltägliches Accessoire.", @"Un quartz rose en forme de cœur orne ce pendentif, assez petit pour rester désinvolte et mignon. La taille parfaite pour la vie de tous les jours.", @"點綴著粉水晶心形石的墜子，\n小巧簡約的造型十分可愛。", @"点缀着粉水晶心形石的坠子 \n小巧简约的造型，\n十分可爱。") },
            { 10177, new TwewyItem(10177, 177, @"tile693", @"Skull Pendant", @"スカルペンダント", @"Colgante calavera", @"Ciondolo del teschio", @"Schädelanhänger", @"Pendentif tête-de-mort", @"骷髏墜子", @"骷髅坠子", @"Rhinestones playfully fill the eyes on this quirky silver skull pendant. It's only as gothic as you want to make it.", @"シルバースカルのペンダント\nスカルの眼球部分にラインストーンが\nあしらわれた遊び心がうれしい", @"La pedrería hace resplandecer este colgante plateado poco convencional en forma de calavera. Es todo lo gótico que tú quieras verlo.", @"Due diamantini sintetici formano gli occhi di questo bizzarro ciondolo d'argento a forma di teschio. Gotico, proprio come piace a te.", @"Die Augen dieses ausgefallenen silbernen Schädelanhängers sind auf verspielte Weise mit Glitzersteinen besetzt. Er ist nur genau so düster, wie du ihn haben willst.", @"Un pendentif excentrique en argent en forme de tête de mort orné de strass scintillants.", @"銀色骷髏的墜子，\n骷髏的眼球部分鑲上水鑽，\n巧思令人驚奇。", @"银色骷髅的坠子 \n骷髅的眼球部分镶上水钻，\n巧思令人惊奇。") },
