            { 10180, new TwewyItem(10180, 180, @"tile696", @"Plumeria Studs", @"プルメリアピアス", @"Pendientes plumeria", @"Orecchini frangipani", @"Frangipani-Ohrringe", @"Clous plumeria", @"雞蛋花耳環", @"鸡蛋花耳环", @"Capturing the beauty of lush Hawaii, these gem-studded plumeria blossom earrings work beautifully with the matching ring.", @"ハワイアンジュエリーピアス\nプルメリアの花の中心には石があしらわれている\nリングとおそろいでつけるといっそうステキ", @"Estos pendientes de flores de plumeria con gemas incrustadas capturan la belleza de Hawái. Quedan estupendos con el anillo a juego.", @"Questi orecchini costellati di gemme a forma di frangipani che catturano la bellezza delle lussureggianti Hawaii stanno da favola con l'anello abbinato.", @"Diese edelsteinbesetzten Ohrringe mit Frangipani-Blüten fangen die Schönheit des fruchtbaren Hawaii ein und passen hervorragend zum entsprechenden Ring.", @"Capturant la beauté luxuriante d'Hawaï, ces boucles d'oreille en fleur de frangipanier incrustées de gemmes font un malheur avec la bague assortie.", @"夏威夷珠寶耳環，\n在雞蛋花的中心裝飾著寶石，\n和戒指湊成一套會更加美麗。", @"夏威夷珠宝耳环 \n在鸡蛋花的中心装饰着宝石，\n和戒指凑成一套会更加美丽。") },
            { 10181, new TwewyItem(10181, 181, @"tile697", @"Navel Piercing", @"ネーブルピアス", @"Piercing de ombligo", @"Piercing per ombelico", @"Bauchnabelpiercing", @"Piercing de nombril", @"橙色臍環", @"橙色脐环", @"The delicately cut stone dangling from this mature and sexy belly button piercing is sure to draw eyes and compliments.", @"ヘソピアス\nストーンのカットが繊細でキラキラ光る\nデザインが大人っぽくセクシーさを演出できる", @"La delicada joya de este sofisticado y sexi piercing de ombligo sin duda atraerá miradas y cumplidos por igual.", @"La pietra delicata che pende da questo piercing da ombelico così sexy attira sicuramente l'attenzione e anche tanti complimenti.", @"Der zart geschliffene Stein, der von diesem erwachsenen und aufregenden Bauchnabelpiercing hängt, erntet garantiert jede Menge Blicke und Komplimente.", @"La pierre délicatement taillée qui pendille de ce bijou de nombril mûr et sexy attirera aussi bien les regards que les compliments.", @"肚臍環，\n寶石的切工十分細緻，閃耀著光澤，\n擁有成熟性感魅力的設計。", @"肚脐环 \n宝石的切工十分细致，闪耀着光泽，\n拥有成熟性感魅力的设计。") },
            { 10182, new TwewyItem(10182, 182, @"tile698", @"Heart Nails", @"ハートネイル", @"Uñas corazón", @"Unghie con cuoricini", @"Herz-Fingernägel", @"Faux-ongles cœur", @"愛心美甲", @"爱心美甲", @"Whimsical hearts cover these staid pink acrylic nails. Just right for the woman looking to put romance at her fingertips.", @"落ち着きのあるピンクをベースにビビッドな\nピンクのハートでまとめたデザインネイル\nロマンティックな指先を演出できる", @"Unos caprichosos corazones cubren estas uñas rosas de acrílico. Perfectas para la mujer que quiere tocar el amor con la punta de los dedos.", @"Queste unghie acriliche dallo stile serioso sono ricoperte da tanti cuoricini divertenti. Perfette per la donna che vuole aggiungere un tocco di romanticismo sulla punta delle dita.", @"Diese Acrylnägel in schlichtem Pink sind mit possierlichen Herzen verziert. Genau richtig für die Frau, die sich Romantik bis in die Fingerspitzen wünscht.", @"Des cœurs fantaisistes recouvrent ces ongles roses en acrylique. Avec eux, la romance est à portée de doigt.", @"以沉穩的粉紅色為基底，\n加上亮眼粉紅色愛心的指甲彩繪，\n讓指尖充滿浪漫色彩。", @"以沉稳的粉红色为基底 \n加上亮眼粉红色爱心的指甲彩绘，\n让指尖充满浪漫色彩。") },
            { 10183, new TwewyItem(10183, 183, @"tile699", @"Blue Nails", @"ブルーネイル", @"Uñas azules", @"Unghie blu", @"Blaue Fingernägel", @"Faux-ongles bleus", @"藍色美甲", @"蓝色美甲", @"Dazzling rhinestones dot these blue acrylic nails. Just right for the mature woman looking for a touch of elegance.", @"シンプルストーンをあしらったブルーのネイル\nキラリと光るシンプルストーンがポイント\n大人っぽい指先を演出できる", @"Una deslumbrante pedrería cubre estas uñas azules de acrílico. Perfectas para la mujer madura que busca un toque de elegancia.", @"Luminosissimi diamanti finti costellano queste unghie acriliche di colore blu. Perfette per la donna matura che cerca un tocco di eleganza.", @"Diese blauen Acrylnägel sind mit betörenden Glitzersteinen verziert. Genau richtig für die reifere Frau, die einen Hauch Eleganz wünscht.", @"Des strass éblouissants recouvrent ces ongles bleus en acrylique. Parfaits pour une femme mûre recherchant une touche d'élégance.", @"用水鑽做的藍點綴色美甲，\n特徵是閃耀的水鑽，\n讓指尖更加優雅成熟。", @"用水钻做的蓝点缀色美甲 \n特征是闪耀的水钻，\n让指尖更加优雅成熟。") },
            { 10184, new TwewyItem(10184, 184, @"tile647", @"Silver Screen Sweetheart", @"愛され女優ハット", @"Pamela glamur", @"Stellina del cinema", @"Filmliebling", @"Joli cœur du grand écran", @"備受喜愛的女明星帽", @"备受喜爱的女明星帽", @"Become a leading lady in this hat. Its natural tones and mid-sized brim make it glamorous, but not over the top.", @"古きよき映画女優の気分になれるハット\nナチュラルな色づかいでつばも広すぎないから\nデイリー使いに大活躍", @"Con este sombrero serás toda una señora. Sus tonos naturales y el ala de tamaño medio dan una imagen glamurosa, pero sin excederse.", @"Diventa protagonista con questo cappello. Le sue tonalità naturali e la falda di dimensioni medie lo rendono ricco di stile, senza essere esagerato.", @"Mit diesem Hut wirst du zur Hauptdarstellerin. Die natürlichen Farbtöne und die mittelgroße Krempe sorgen für genau den richtigen Schuss Glamour.", @"Devenez une véritable star avec ce chapeau. Ses tons naturels et son bord de taille moyenne en font un accessoire glamour, sans tomber dans l'excès.", @"戴上帽子彷彿就成為過去那美好時代的電影女星，\n自然的配色和尺寸適當的帽簷，\n成為每天穿搭的大功臣。", @"仿佛能成为过去那美好时代的电影女星的帽子 \n自然的配色和尺寸适当的帽檐，\n成为每天穿搭的大功臣。") },
            { 10185, new TwewyItem(10185, 185, @"tile619", @"Silver Screen Starlet", @"ミステリアス女優ハット", @"Pamela de actriz", @"Diva del cinema", @"Filmsternchen", @"Starlette du grand écran", @"神秘氣息的女明星帽", @"神秘气息的女明星帽", @"Become a leading lady in this hat. The fashion press loves its sophisticated purple color and silk flower accent.", @"古きよき映画女優の気分になれるハット\n気品ただようパープルとコサージュがポイント\n雑誌に掲載されて大ブレイク", @"Con este sombrero serás toda una señora. A las revistas de moda les encanta su sofisticado tono morado y el detalle de la flor de seda.", @"Diventa protagonista con questo cappello. Le riviste di moda adorano il colore viola così sofisticato e il fiorellino di seta decorativo.", @"Mit diesem Hut wirst du zur Hauptdarstellerin. Die Modepresse liebt das anspruchsvolle Lila und die pfiffige Seidenblume.", @"Devenez une véritable star avec ce chapeau. Les magazines de mode adorent sa couleur violette sophistiquée et la fleur en soie qui orne son côté.", @"戴上帽子彷彿就成為過去那美好時代的電影女星，\n亮點在於氣質優雅的紫色與胸花，\n經雜誌介紹後大爆紅。", @"仿佛能成为过去那美好时代的电影女星的帽子 \n亮点在于气质优雅的紫色与胸花，\n经杂志介绍后大爆红。") },
            { 10186, new TwewyItem(10186, 186, @"tile591", @"Plain Shirt", @"プレーンシャツ", @"Camisa básica", @"Camicetta semplice", @"Einfache Bluse", @"Chemise unie", @"樸素襯衫", @"朴素衬衫", @"A plain short-sleeved button-down shirt. Its muted color and slim lines go great with anything. Every girl needs one!", @"プレーンな半そでシャツ\n何にでもあわせやすいシックな色味とシルエット\n必ず１枚は押さえておきたいアイテム", @"Camisa básica abotonada de manga corta. Con su color discreto y las líneas finas, va bien con cualquier cosa. ¡Todas las chicas deberían tener una!", @"Una camicia in tinta unita a mezze maniche. Il suo colore pacato e le sue linee sfiancate la rendono adatta a tutti gli outfit. Ad ogni ragazza ne serve una!", @"Eine einfache kurzärmlige Bluse. Die gedämpfte Farbe und die schlanke Linie passen zu allem. So etwas braucht jede Frau!", @"Une chemise à manches courtes simple. Sa couleur discrète et sa forme moulante s'accorderont facilement avec n'importe quoi. Toutes les filles doivent en avoir une dans leur garde-robe !", @"單色短袖襯衫，\n能夠搭配各種配件的優雅色調與版型，\n每個人都該有一件。", @"单色短袖衬衫 \n能够搭配各种配件的优雅色调与版型，\n每个人都该有一件。") },
            { 10187, new TwewyItem(10187, 187, @"tile563", @"Negative Polo", @"ネガポロシャツ", @"Polo negativo", @"Polo negativa", @"Negativ-Polohemd", @"Polo négatif", @"負色Polo衫", @"负色Polo衫", @"The white collar on this simple two-tone polo keeps the black from feeling oppressive. An easy match with pretty much anything.", @"ツートンカラーのシンプルなポロシャツ\nエリが白いので黒地でも重くなりすぎない\n何にでも合わせやすい便利なアイテム", @"El cuello blanco de este sencillo polo bicolor evita que el negro resulte abrumador. Combina fácilmente casi con cualquier prenda.", @"Il collo bianco di questa semplice polo bicolore fa in modo che il nero non risulti troppo oppressivo. Di facile abbinamento con praticamente tutto.", @"Der weiße Kragen dieses schlichten zweifarbigen Polohemds verhindert, dass das Schwarz zu dominant ist. Passt zu so gut wie allem.", @"Le col blanc de ce polo bicolore empêche le noir de devenir trop oppressant. Une pièce qui va avec tout !", @"樣式簡單的雙色調Polo衫，\n白色衣領讓黑色底不會太過沉重，\n百搭的方便單品。", @"样式简单的双色调Polo衫 \n白色衣领让黑色底不会太过沉重，\n百搭的方便单品。") },
            { 10188, new TwewyItem(10188, 188, @"tile535", @"Positive Polo", @"ポジポロシャツ", @"Polo positivo", @"Polo positiva", @"Positiv-Polohemd", @"Polo positif", @"正色Polo衫", @"正色Polo衫", @"Second in the two-tone polo series, this simple garment is extremely versatile. Put it to work for your wardrobe!", @"ツートンカラーのシンプルなポロシャツ\n何にでも合わせやすい便利なアイテム\nネガポロシャツの姉妹品", @"Esta sencilla prenda, segundo elemento de la colección de polos bicolores, es sumamente versátil. Sácale partido como fondo de armario.", @"La seconda della serie di polo bicolore, questo semplice capo d'abbigliamento è estremamente versatile. Mettilo subito nel tuo guardaroba!", @"Dieses zweite Teil der Kollektion zweifarbiger Polohemden ist einfach gehalten und dadurch extrem vielseitig einsetzbar. Passt auch zu deiner Garderobe!", @"Deuxième polo bicolore de la série, ce vêtement simple est extrêmement polyvalent. C'est pile ce qu'il manquait à votre garde-robe !", @"樣式簡單的雙色調Polo衫，\n百搭的方便單品，\n負色Polo衫的關聯商品。", @"样式简单的双色调Polo衫 \n百搭的方便单品，\n负色Polo衫的关联商品。") },
            { 10189, new TwewyItem(10189, 189, @"tile507", @"Pink Stripe", @"ピンクボーダー", @"Polo rayas rosas", @"Righe rosa", @"Pinke Streifen", @"Rayures roses", @"粉紅條紋上衣", @"粉红条纹上衣", @"Eye-popping pink stripes make this sporty polo extra cute. A classic color on a classic cut.", @"スポーティなボーダーのポロシャツ\nポップなピンクのボーダーがかわいさを演出\n正統派だからこそはまる色使い", @"Las destacadas rayas rosas le dan a este polo deportivo un toque superfino. Color clásico con un corte clásico.", @"Le righe rosa sgargianti rendono carinissima questa polo sportiva. Un colore classico su un taglio classico.", @"Die auffallenden pinkfarbenen Streifen machen dieses sportliche Polohemd besonders niedlich. Eine klassische Farbe auf einem klassischen Schnitt.", @"Des rayures rose vif rendent ce polo sportif encore plus adorable. Une couleur classique pour une coupe classique.", @"運動款式的橫條紋Polo衫，\n流行的粉紅色橫條紋散發可愛感，\n是正統派最難以抗拒的配色。", @"运动款式的横条纹Polo衫 \n流行的粉红色横条纹散发可爱感，\n是正统派最难以抗拒的配色。") },
            { 10190, new TwewyItem(10190, 190, @"tile479", @"Black Stripe", @"ブラックボーダー", @"Polo rayas negras", @"Righe nere", @"Schwarze Streifen", @"Rayures noires", @"黑色條紋上衣", @"黑色条纹上衣", @"Chic and simple black and white stripes keep this sporty polo shirt looking cool, even in the heat of midsummer.", @"スポーティなボーダーのポロシャツ\nシックでシンプルな黒×白のボーダー\n夏でもクールにキマる", @"Las sencillas rayas blancas y negras hacen de este polo deportivo una prenda chic y sofisticada, incluso durante el calor del verano.", @"Le righe bianche e nere, semplici ed eleganti, danno a questa polo sportiva un tocco fresco, anche nelle più calde giornate estive.", @"Schlichte Streifen in Schwarz und Weiß sorgen bei diesem sportlichen Polohemd auch in der größten Sommerhitze für einen coolen Look.", @"Avec ses rayures noires et blanches d'une simplicité très chic, ce polo sportif reste extrêmement cool, même en plein été.", @"運動款式的橫條紋Polo衫，\n優雅簡單的黑白橫條紋，\n夏天也能一樣酷炫。", @"运动款式的横条纹Polo衫 \n优雅简单的黑白横条纹，\n夏天也能一样酷炫。") },
            { 10191, new TwewyItem(10191, 191, @"tile451", @"Lovely Camisole", @"ラブリーキャミ", @"Camisola de ensueño", @"Canottiera adorabile", @"Reizendes Trägertop", @"Joli caraco", @"迷人吊帶背心", @"迷人吊带背心", @"Two-tiered frills and cute ribbons complete this breezy camisole, which girly girl model Kanié wore at her last big shoot.", @"ゆったりとしたキャミソール\n２段フリルとリボンがガーリー\nモデルのカニエちゃんが雑誌で着用して人気", @"Las dos capas de volantes y los lazos completan esta camisola ligera que llevó la femenina modelo Kanié en su última sesión de fotos.", @"Balze a due livelli e tanti fiocchetti carini completano questa canotta spigliata, che la femminilissima modella Kanié ha indossato durante il suo ultimo servizio fotografico.", @"Zweireihige Rüschen und süße Schleifchen runden dieses luftige Trägertop ab, das das Girlie-Model Kanié bei ihrem letzten großen Shooting trug.", @"Deux rangées de volants et d'adorables rubans complètent ce chemisier enjoué que la célèbre mannequin Kanié portait lors de son dernier gros shooting.", @"舒適的吊帶背心，\n２段式摺邊與緞帶相當有少女氣息，\n模特兒蟹江在雜誌上的穿搭照片引發熱潮。", @"舒适的吊带背心 \n2段式褶边与缎带相当有少女气息，\n模特儿蟹江在杂志上的穿搭照片引发热潮。") },
            { 10192, new TwewyItem(10192, 192, @"tile423", @"White Cache-coeur", @"ホワイトカシュクール", @"Cruzado blanco", @"Scaldacuore bianco", @"Weißes Wickeloberteil", @"Cache-cœur blanc", @"白色打底衫", @"白色打底衫", @"This simple and easy white cache-coeur hugs the body for a deliciously slim silhouette.", @"ホワイトのカシュクール\nボディラインを美しく見せるつくりになっている\nシンプルで使いやすい一品", @"Este sencillo suéter cruzado en blanco se ajusta al cuerpo para realzar la figura.", @"Questo semplice scaldacuore bianco abbraccia il corpo e dona una silhouette deliziosamente sfiancata.", @"Dieses einfache und bequeme Wickeloberteil liegt eng an und sorgt für eine traumhaft schlanke Silhouette.", @"Ce simple cache-cœur blanc épouse le corps pour une silhouette délicieusement fine.", @"白色的打底衫，\n能讓身體線條看起來更加美麗，\n簡單好穿搭的單品。", @"白色的打底衫 \n能让身体线条看起来更加美丽，\n简单好穿搭的单品。") },
            { 10193, new TwewyItem(10193, 193, @"tile395", @"Chic Black Turtleneck", @"モテタートル・ブラック", @"Suéter chic negro", @"Dolcevita elegante nero", @"Schicker Rollkragenpulli", @"Col roulé noir et chic", @"黑色萬人迷高領上衣", @"黑色万人迷高领上衣", @"Sexy and simple, this knit turtleneck is just heavy enough. Popular model Kanié bought three for herself.", @"モテ確実のシンプルなニット\nほどよいサイズ感で大活躍すること間違いなし\nモデルのカニエちゃんも３着買ったアイテム", @"Sencillo y atractivo, este suéter de punto de cuello alto tiene el peso justo. La popular modelo Kanié se compró tres.", @"Semplice e sexy, questo dolcevita di maglia è caldo e morbido. La famosa modella Kanié se ne è comprati tre!", @"Dieser aufregend schlicht gehaltene Strick-Rolli hat genau das richtige Gewicht. Das beliebte Model Kanié hat sich gleich drei Stück davon geholt.", @"Simple et sexy, ce col roulé en laine a l'épaisseur idéale. La célèbre mannequin Kanié s'en est acheté trois.", @"樣式簡單又有吸引力的針織衫，\n恰當的尺寸一定能大放異彩，\n模特兒蟹江也買了三件。", @"样式简单又有吸引力的针织衫 \n恰当的尺寸一定能大放异彩，\n模特儿蟹江也买了三件。") },
            { 10194, new TwewyItem(10194, 194, @"tile367", @"Midday Kitten Knit", @"まひるのこねこニット", @"Suéter felino", @"Maglione lungo con gatto", @"Kätzchen-Strickoberteil", @"Tricot chaton de midi", @"午間的小貓針織衫", @"午间的小猫针织衫", @"A huge, adorable kitten strides across this extra-long knit top. Guaranteed to make a lasting impression.", @"ロング丈のニット\nキュートな子ネコが大胆にあしらわれている\nこれを着ればインパクト大", @"Un gatito grande y adorable adorna este suéter de punto extralargo. Seguro que causa sensación.", @"Un gigantesco gattino attraversa questo maglione extra lungo e non si fa certo dimenticare.", @"Ein gewaltiges, zuckersüßes Kätzchen spaziert dieses extralange Strickoberteil entlang. Damit sorgst du garantiert für einen bleibenden Eindruck.", @"Un énorme et adorable chaton gambade sur ce tricot extra-long. Avec ça, on ne risque pas de vous oublier !", @"較長的針織衫，\n大膽地搭配了可愛小貓，\n穿上就能給人強烈印象。", @"较长的针织衫 \n大胆地搭配了可爱小猫，\n穿上就能给人强烈印象。") },
            { 10195, new TwewyItem(10195, 195, @"tile339", @"Black Jeans", @"ブラックデニム", @"Vaqueros negros", @"Jeans neri", @"Schwarze Jeans", @"Jean noir", @"黑色牛仔褲", @"黑色牛仔裤", @"Simple black jeans are proven to make your legs look longer and slimmer. Perfect daily wear that can also be a bit more formal.", @"ブラックのシンプルなジーンズ\nはくだけで足が長く見える美脚タイプ\nデイリーに使いまわせそう", @"Los vaqueros negros básicos hacen las piernas más largas y delgadas. Perfectos para el día a día y para ocasiones un poco más formales.", @"Questi jeans semplici e neri faranno apparire le tue gambe più lunghe e sottili. Un indumento da tutti i giorni, ma che può anche risultare più formale.", @"Einfache schwarze Jeans machen erwiesenermaßen schlankere und längere Beine. Perfekt für den Alltag, aber auch für etwas formellere Anlässe.", @"Il est prouvé que les jeans slims noirs rendent vos jambes plus longues et plus fines. Parfait tous les jours et également pour un look plus élégant.", @"樣式簡單的黑色牛仔褲，\n穿上就能讓腿看起來變長的美腿牛仔褲，\n用來日常穿搭吧。", @"样式简单的黑色牛仔裤 \n穿上就能让腿看起来变长的美腿牛仔裤，\n用来日常穿搭吧。") },
            { 10196, new TwewyItem(10196, 196, @"tile311", @"Brown Jeans", @"ブラウンデニム", @"Vaqueros marrones", @"Jeans marroni", @"Braune Jeans", @"Jean marron", @"褐色牛仔褲", @"褐色牛仔裤", @"These brown boot-cut jeans give your legs great shape, and make a great tag team with classic simple black jeans.", @"ブラウンのシンプルなジーンズ\nはくだけで足が長く見える美脚タイプ\nブラックデニムと合わせて持っておきたい一品", @"Estos vaqueros marrones de corte tipo bota favorecen la línea de las piernas. Primos hermanos del clásico vaquero negro.", @"Questi jeans marroni svasati donano una forma strepitosa alle tue gambe, e viaggiano in coppia con i jeans semplici neri.", @"Diese braune Bootcut-Jeans verleiht den Beinen eine tolle Form. Wenn du dann noch eine einfachen schwarze Jeans im Schrank hast, kann nichts mehr schiefgehen.", @"Ce jean marron légèrement évasé donnera une forme magnifique à vos jambes. Lui et le jean noir classique forment une équipe de choc !", @"樣式簡單的褐色牛仔褲，\n穿上就能讓腿看起來變長的美腿牛仔褲，\n和黑色牛仔褲都帶一件吧。", @"样式简单的褐色牛仔裤 \n穿上就能让腿看起来变长的美腿牛仔裤，\n和黑色牛仔裤都带一件吧。") },
            { 10197, new TwewyItem(10197, 197, @"tile283", @"Skinny Jeans (Blue)", @"ブルースキニー", @"Vaqueros ceñidos (azul)", @"Jeans skinny (blu)", @"Hautenge Jeans (blau)", @"Jean slim (bleu)", @"藍色緊身褲", @"蓝色紧身裤", @"A bit skinnier than usual, these playfully distressed jeans give the perception of a few inches' extra height.", @"細身のシンプルなスキニージーンズ\nはくだけで足が長く見える美脚タイプ\nダメージ加工がかわいい", @"Un poco más ajustados de lo habitual, estos vaqueros desgastados acentúan un poco tu altura.", @"Questi jeans consunti, un po' più skinny del solito, ti regalano qualche centimetro di altezza in più.", @"Diese verspielte Jeans im Used-Look liegt etwas enger an als üblich und sorgt dafür, dass du ein paar Zentimeter größer aussiehst.", @"Un peu plus moulant que d'habitude, ce jean vieilli donne l'impression que vous mesurez quelques centimètres de plus.", @"樣式簡單的細長窄管牛仔褲，\n穿上就能讓腿看起來變長的美腿牛仔褲，\n刷破加工很可愛。", @"样式简单的细长窄管牛仔裤 \n穿上就能让腿看起来变长的美腿牛仔裤， \n破洞很可爱。") },
            { 10198, new TwewyItem(10198, 198, @"tile255", @"My Favorite One-piece", @"愛されワンピ", @"Vestido favorito", @"Il mio vestitino preferito", @"Mein Lieblingskleid", @"Ma robes préférée", @"受寵連身裙", @"受宠连身裙", @"A bow at the chest completes this one-piece. Dyed a deep bordeaux that's not too cute--perfect for a woman in her 20s.", @"胸元のリボンがポイントのワンピース\n深みのあるワインレッドがかわいくなりすぎない\n２０代女性に人気のアイテム", @"El lazo del pecho es el toque final de este vestido. El color burdeos oscuro le resta un poco de inocencia: perfecto para las veinteañeras.", @"Un fiocco sul petto completa questo vestitino bordeaux, un colore che non lo rende troppo grazioso... ma perfetto per una ragazza sui vent'anni.", @"Dieses Kleid wird durch eine Schleife auf der Brust abgerundet. Durch das tiefe Bordeauxrot ist es nicht zu niedlich. Perfekt für eine Frau in den Zwanzigern.", @"Un nœud sur la poitrine complète cette robe fabuleuse. Son bordeaux profond casse son côté juvénile : l'idéal pour une femme dans la vingtaine.", @"特色是胸前緞帶的連身裙，\n具有層次的酒紅色不會顯得太過可愛，\n受到２０多歲女性歡迎的商品。", @"特色是胸前缎带的连衣裙 \n具有层次的酒红色不会显得太过可爱，\n受到20多岁女性欢迎的商品。") },
            { 10199, new TwewyItem(10199, 199, @"tile227", @"Angelic One-piece", @"天使ワンピ", @"Vestido angelical", @"Vestitino angelico", @"Himmlisches Kleid", @"Robe angélique", @"天使連身裙", @"天使连身裙", @"The ribbon tie at the waist adds a splash of romance to this cute pink one-piece. Magazine model Kanié recently posed in it.", @"胸元のリボンがポイントのピンクワンピース\nロマンティックなキュートさを演出してくれる\n雑誌でモデルのカニエちゃんも着用したアイテム", @"La cinta de la cintura confiere a este vestido un aire romántico. La modelo de revista Kanié lo llevó hace poco en una publicación.", @"Il fiocchetto in vita aggiunge una spruzzata di romanticismo a questo vestitino rosa. La fotomodella Kanié ha posato di recente con questo outfit.", @"Das Band um die Hüfte verleiht diesem zauberhaften rosa Kleid einen Hauch von Romantik. Das Model Kanié hat vor kurzem für eine Zeitschrift darin posiert.", @"Le ruban qui enserre sa taille rajoute une petite touche de romance à cette jolie robe rose. La mannequin Kanié a récemment posé avec.", @"特色是胸前緞帶的粉紅連身裙，\n營造浪漫可愛氛圍，\n模特兒的蟹江也在雜誌上穿過。", @"特色是胸前缎带的粉红连衣裙 \n营造浪漫可爱氛围，\n模特儿的蟹江也在杂志上穿过。") },
            { 10200, new TwewyItem(10200, 200, @"tile199", @"Lovely One-piece", @"ラブリーワンピ", @"Vestido de ensueño", @"Vestitino adorabile", @"Reizendes Kleidchen", @"Robe adorable", @"迷人連身裙", @"迷人连身裙", @"Cut in a flattering A-line, this bright white one-piece will make you look like an angel. A simple, flowing classic.", @"Ａラインワンピース\nモテ度アップまちがいなしの白がまぶしい\nふんわりとした正統派ワンピース", @"Parecerás un ángel con este alegre vestido blanco que tiene un favorecedor corte en A. Un clásico sencillo y vaporoso.", @"Questo vestitino bianco brillante, dal taglio a forma di A, ti farà sembrare un angelo. Un pezzo classico, semplice e morbido.", @"In diesem strahlend weißen Kleid mit schmeichelhafter A-Linie siehst du aus wie ein Engel. Ein einfacher, fließender Klassiker.", @"Avec sa coupe trapèze très flatteuse, cette robe d'un blanc éclatant vous donnera l'allure d'un ange. Un classique simple et fluide.", @"Ａ字連身裙，\n白色相當耀眼，一定能讓妳更受歡迎，\n輕飄飄的正統派連身裙。", @"A字连衣裙 \n白色相当耀眼，一定能让你更受欢迎，\n轻飘飘的正统派连衣裙。") },
            { 10201, new TwewyItem(10201, 201, @"tile171", @"Simple Mules", @"シンプルミュール", @"Sandalias básicas", @"Ciabatte semplici", @"Einfache Pantoletten", @"Mules simples", @"樸素穆勒鞋", @"朴素穆勒鞋", @"Chicly pared down to the bare essentials, these simple mules work equally well with a skirt or pants.", @"シンプルミュール\n飾り気のないシックなデザインが人気\nスカート、パンツスタイルを選ばず使える", @"El concepto chic en su noción más esencial. Estas sencillas zapatillas van igual de bien con falda o pantalón.", @"Ridotte elegantemente all'essenziale, queste semplici ciabatte stanno bene sia sotto una gonna, sia sotto un paio di pantaloni.", @"Diese einfachen Pantoletten sind auf das Nötigste beschränkt und passen perfekt zu einem Rock oder einer Hose.", @"Avec leur style chic et dépouillé, ces mules simples fonctionneront aussi bien avec une jupe qu'avec un pantalon.", @"樣式簡單的涼鞋，\n沒有匠氣的優雅設計很受歡迎，\n不論裙裝、褲裝都可搭配得宜。", @"样式简单的凉鞋 \n没有匠气的优雅设计很受欢迎，\n不论裙装、裤装都可搭配得宜。") },
            { 10202, new TwewyItem(10202, 202, @"tile143", @"Blossom Mules", @"ブルームミュール", @"Sandalias florales", @"Ciabatte fiorate", @"Blütensandalen", @"Mules fleuries", @"百花盛開穆勒鞋", @"百花盛开穆勒鞋", @"These sandals bear cute floral ornaments. Match these with a Natural Puppy one-piece and you'll feel like a princess.", @"花飾りつきのかわいいサンダル\nナチュラル・パピィのワンピースと合わせれば\nお嬢さまスタイル完成！", @"Estas sandalias llevan unos preciosos adornos florales. Combínalas con un vestido Natural Puppy y te sentirás como una princesa.", @"Queste ciabatte sono decorate da tanti fiorellini. Se le abbini a un vestito Natural Puppy ti sentirai una principessa.", @"Diese Sandalen sind mit hübschen Blümchen verziert. Zieh dazu ein Kleidchen von Natural Puppy an, und du fühlst dich wie eine Prinzessin.", @"Ces sandales arborent d'adorables ornements floraux. Assortissez-les avec une robe Natural Puppy pour vous transformer en une véritable princesse.", @"附有花朵裝飾的可愛涼鞋，\n搭配Natural Puppy的連身裙，\n打造千金小姐風格！", @"附有花朵装饰的可爱凉鞋 \n搭配Natural Puppy的连衣裙，\n打造千金小姐风格！") },
            { 10203, new TwewyItem(10203, 203, @"tile115", @"Enamel Pumps", @"エナメルパンプス", @"Zapatos esmaltados", @"Décolleté di vernice", @"Lackpumps", @"Escarpins émaillés", @"亮面高跟鞋", @"亮面高跟鞋", @"Nothing beats these bright red enamel pumps for sheer impact. The low heels make them a breeze to walk in.", @"エナメルパンプス\n光沢がある赤のエナメルはインパクト大\nヒールが低いので歩きやすさも◎", @"Nada impacta tanto como estos zapatos esmaltados en rojo. Como apenas tienen tacón, son comodísimos.", @"Niente batte queste décolleté di vernice rossa brillante, se vuoi lasciare il segno. Il tacco basso ti consente di camminarci in tutta comodità.", @"Wenn es um den großen Auftritt geht, ist nichts besser geeignet als diese knallroten Lackpumps. Die niedrigen Absätze sorgen für ein tolles Gehgefühl.", @"Rien n'a plus d'impact qu'une paire d'escarpins laqués rouge vif. Et grâce à leur talon bas, vous n'aurez aucun mal à marcher avec !", @"漆皮包鞋，\n散發光澤的紅色漆皮相當搶眼，\n低跟好走也是一大優點。", @"漆皮包鞋 \n散发光泽的红色漆皮相当抢眼，\n低跟好走也是一大优点。") },
