            { 10205, new TwewyItem(10205, 205, @"tile059", @"Waffle Necktie", @"ワッフルネクタイ", @"Corbata estampada azul", @"Cravatta a scacchi", @"Karo-Krawatte", @"Cravate gaufrée", @"格子領帶", @"格子领带", @"Add this checkered tie to the mix any day you feel your ensemble could use a little kick. One little twist, and you're stylin'.", @"格子柄のネクタイ\nちょっと物足りないなというときに\n巻きつけるだけでもオシャレ度がアップ", @"Complementa tu atuendo con esta corbata a cuadros cuando sientas que necesitas algo especial. Un pequeño toque que te llenará de estilo.", @"Indossa questa cravatta a scacchi ogni qualvolta che il tuo outfit richiede una marcia in più. Un po' di brio e lo stile è assicurato!", @"Du findest, dein Outfit könnte ein bissen Pfiff vertragen? Dann bist du bei dieser karierten Krawatte genau richtig. Perfekter Stil im Handumdrehen.", @"Ajoutez cette cravate à carreaux à n'importe quelle tenue pour lui donner un coup de fouet. Un look du tonnerre en un tour de main !", @"格紋領帶，\n搭配時覺得還差一點巧思的話，\n不妨就用這條來提升時尚度。", @"格纹领带 \n搭配时觉得还差一点巧思的话，\n不妨就用这条来提升时尚度。") },
            { 10206, new TwewyItem(10206, 206, @"tile031", @"Seattle", @"シアトル", @"Seattle", @"Seattle", @"Seattle", @"Seattle", @"西雅圖", @"西雅图", @"This black and white mesh cap boldly bears the brand logo's \x22W\x22 in a high-contrast red that's sure to catch eyes.", @"ブランドロゴのＷ柄メッシュキャップ\nブラックとホワイトのカラーリングに\nレッドのＷ柄がインパクト大", @"Esta gorra blanca y negra muestra sin complejos el logotipo de la marca «W», donde el rojo crea un contraste que será el centro de todas las miradas.", @"Questo cappellino bianco e nero mostra in bella vista il logo \x22W\x22 di colore rosso, che crea un forte contrasto e attira l'attenzione.", @"Diese schwarz-weiße Netzkappe trägt stolz das \x22W\x22 des Markenlogos in einem kontrastreichen Rot, das garantiert alle Blicke auf sich zieht.", @"Cette casquette en filet noire et blanche arbore le \x22W\x22 emblématique de la marque dans un rouge contrastant qui ne manquera pas d'attirer les regards.", @"品牌標誌的Ｗ花紋網帽，\n黑色與白色的配色\n搭配紅色Ｗ花紋相當搶眼。", @"品牌标志的W花纹网帽 \n黑色与白色的配色\n搭配红色W花纹相当抢眼。") },
            { 10207, new TwewyItem(10207, 207, @"tile003", @"San Francisco", @"サンフランシスコ", @"San Francisco", @"San Francisco", @"San Francisco", @"San Francisco", @"舊金山", @"旧金山", @"Red is the original and still top-selling color for this baseball cap series that's won the votes of MCs the city over.", @"ベースボールキャップシリーズ\nラッパー系には、もはや定番のアイテム\n基本カラーの赤は最初に手に入れたい一品", @"El rojo es el color original de esta gorra de béisbol, y sigue siendo el protagonista de la colección, que se ha llevado los votos de los maestros de ceremonias de toda la ciudad.", @"Il rosso è il colore originale e di punta di questa serie di cappellini da baseball amata dagli MC di tutta la città.", @"Rot ist die Originalfarbe dieser Baseballkappe, die in der MC-Szene der Stadt äußerst beliebt ist ... und nach wie vor die Farbe, die sich am besten verkauft.", @"Le rouge est la couleur la plus vendue pour cette série de casquettes qui a conquis les rappeurs de toute la ville.", @"棒球帽系列，\n可說是饒舌歌手的必備道具，\n一開始可先從基本的紅色買起。", @"棒球帽系列 \n可说是饶舌歌手的必备道具，\n一开始可先从基本的红色买起。") },
            { 10208, new TwewyItem(10208, 208, @"tile648", @"Las Vegas", @"ラスベガス", @"Las Vegas", @"Las Vegas", @"Las Vegas", @"Las Vegas", @"拉斯維加斯", @"拉斯维加斯", @"Blue is the color of choice for MCs looking to play it cool. This baseball cap is another Wild Boar staple.", @"ベースボールキャップシリーズ\nラッパー系にはもはや定番のアイテム\nブルーならさわやかにまとまる", @"El azul es el color preferido de los maestros de ceremonias que quieren dar una imagen desenfadada. Esta gorra de béisbol es otro clásico Wild Boar.", @"Il blu è il colore scelto dagli MC che vogliono risultare super fichi. Questo cappellino da baseball è un altro marchio distintivo di Wild Boar.", @"Blau ist die perfekte Farbe für MCs, die Wert auf Coolness legen. Diese Baseballkappe ist ein weiterer Klassiker von Wild Boar.", @"Le bleu est la couleur de prédilection des rappeurs qui veulent se la jouer cool. Cette casquette est une autre pièce emblématique de Wild Boar.", @"棒球帽系列，\n可說是饒舌歌手的必備道具，\n藍色相當拉風。", @"棒球帽系列 \n可说是饶舌歌手的必备道具，\n蓝色相当拉风。") },
            { 10209, new TwewyItem(10209, 209, @"tile649", @"Chicago", @"シカゴ", @"Chicago", @"Chicago", @"Chicago", @"Chicago", @"芝加哥", @"芝加哥", @"A casual knit beanie embroidered with the brand logo. The skater style works, whether you're hitting the board or the streets.", @"ロゴ入りニットキャップ\nかぶるだけでスケーター系スタイルになれる\nストリートファッションにオススメ", @"Gorro de punto informal con el logotipo de la marca. El estilo skater funciona, tanto si vas en monopatín como a pie.", @"Un berretto casual di maglia con ricamato il logo del brand. Lo stile da skater è perfetto sia che tu stia sfrecciando sullo skateboard, sia che tu stia facendo un giro per strada.", @"Eine legere Häkelmütze mit dem Markenlogo. Der Skater-Style funktioniert sowohl beim Sport als auch auf der Straße.", @"Un bonnet en tricot avec le logo de la marque brodé dessus. Le style skater est un succès assuré, aussi bien en ville que sur votre planche.", @"帶有標誌的針織帽，\n戴上就能變成滑雪者風格，\n適合街頭時尚造型。", @"带有标志的针织帽 \n戴上就能变成滑雪者风格，\n适合街头时尚造型。") },
            { 10210, new TwewyItem(10210, 210, @"tile650", @"New York", @"ニューヨーク", @"Nueva York", @"New York", @"New York", @"New York", @"紐約", @"纽约", @"Made of persimmon-dyed hemp that matures with loving use, this simple one-stripe hat fits well with any genre of clothes.", @"ライン入りのシンプルなハット\n使い込むほどに味が出る柿渋染めの麻を使用\nどのジャンルの服にも合わせられるアイテム", @"Este gorro de cáñamo de tonos caqui envejece estupendamente con el tiempo. Se complementa con cualquier estilo de ropa.", @"Fatto di un tessuto in canapa che migliora con un utilizzo amorevole, questo complice cappello con nastro sta bene con qualsiasi genere di vestiti.", @"Dieser einfache khakifarbene Hut mit Streifen besteht aus Hanf, dessen Look durch liebevolles Tragen an Klasse gewinnt. Passt zu Klamotten jeder Stilrichtung.", @"Fait de chanvre teinté au kaki qui mûrit au fil du temps, ce chapeau simple à une bande s'accordera avec tous les genres de vêtements.", @"帶有線條樣式簡單的帽子，\n使用澀柿染色麻布製成，\n用越久越有特色，能搭配任何種類服裝的單品。", @"带有线条样式简单的帽子 \n使用涩柿染色麻布制成，\n用越久越有特色，能搭配任何种类服装的单品。") },
