            { 10212, new TwewyItem(10212, 212, @"tile652", @"Hey Boy", @"ヘイボーイ", @"B-boy", @"Ehi, ragazzo", @"Hey, Junge!", @"Hey Boy", @"Hey Boy", @"嘿！男孩", @"Mean and green, this item kicks off the Wild Boar hoodie series. It's continued to sell big since being upped by a major mag.", @"緑のパーカートレーナー\nワイルド・ボア定番のパーカーシリーズ０１\n雑誌で紹介された人気のアイテム", @"Esta sudadera verde inaugura la colección de Wild Boar. Se vende como churros desde que apareció en una revista importante.", @"Verde e cattivo, questo capo dà il via alla serie di felpe con cappuccio di Wild Boar. Vende alla grande da quando è stato valutato positivamente da una rivista famosa.", @"Dieses fiese grüne Teil war der Startschuss der Kapuzenpulli-Serie von Wild Boar. Seit es von einem großen Magazin beworben wurde, gehen die Verkaufszahlen durch die Decke.", @"Vert et fier de l'être, ce modèle lance la collection de pulls à capuche de Wild Boar. Il part comme des petits pains depuis l'article d'un grand magazine.", @"綠色連帽運動衫，\nWild Boar的招牌連帽衫系列０１，\n雜誌介紹過的熱門商品。", @"绿色连帽运动衫 \nWild Boar的招牌连帽衫系列01，\n杂志介绍过的热门商品。") },
            { 10213, new TwewyItem(10213, 213, @"tile653", @"Hey Girl", @"ヘイガール", @"B-girl", @"Ehi, ragazza", @"Hey, Mädchen!", @"Hey Girl", @"Hey Girl", @"嘿！女孩", @"Drop-dead in red, round two of Wild Boar's hoodie series stays close to the brand's hip-hop roots.", @"赤いパーカートレーナー\nワイルド・ボア定番のパーカーシリーズ０２\nＨＩＰ-ＨＯＰテイスト", @"De rojo imponente, la segunda ronda de la colección de sudaderas de Wild Boar es fiel a las raíces hip-hop de la marca.", @"Di colore rosso mozzafiato, il secondo capo della serie di felpe con cappuccio di Wild Boar resta fedele alle origini hip-hop del brand.", @"Der zweite Teil der Kapuzenpulli-Serie von Wild Boar ist in prächtigem Rot gehalten und hält sich eng an die Hip-Hop-Wurzeln der Marke.", @"D'un rouge à tomber par terre, le deuxième modèle de la collection de pulls à capuche de Wild Boar reste fidèle aux racines hip-hop de la marque.", @"紅色連帽運動衫，\nWild Boar的招牌連帽衫系列０２，\n嘻哈風格。", @"红色连帽运动衫 \nWild Boar的招牌连帽衫系列02，\n嘻哈风格。") },
            { 10214, new TwewyItem(10214, 214, @"tile654", @"Hey Everybody", @"ヘイジェントルメン", @"B-everybody", @"Ehi, gente", @"Hey, Leute!", @"Hey tout le monde", @"Hey Gentleman", @"嘿！绅士", @"Get back in black with the final item in Wild Boar's hoodie series. Thanks to the color, it'll work with anything.", @"黒いパーカートレーナー\nワイルド・ボア定番のパーカーシリーズ０３\n黒地なので何にでも合わせやすい", @"Vuelve al negro con el último elemento de la colección de sudaderas de Wild Boar. Su color permite combinarla con cualquier cosa.", @"Ricopriti di nero con l'ultimo capo della serie di felpe con cappuccio di Wild Boar. Grazie a questo colore, si abbina facilmente a tutto.", @"Kehre mit dem letzten Teil der Kapuzenpulli-Serie von Wild Boar zurück zu Schwarz. Dank der Farbe passt der Pulli zu absolut allem.", @"Le noir est de retour avec le dernier modèle de la collection de pulls à capuche de Wild Boar. Grâce à sa couleur, il va avec absolument tout.", @"黑色連帽運動衫，\nWild Boar的招牌連帽衫系列０３，\n黑色底相當好搭。", @"黑色连帽运动衫 \nWild Boar的招牌连帽衫系列03，\n黑色底相当好搭。") },
            { 10215, new TwewyItem(10215, 215, @"tile655", @"Alive", @"アライヴ", @"Vida", @"Pieno di vita", @"Lebendig", @"En vie", @"Alive", @"活着", @"A bright gold logo adds a little street-style bling in perfect contrast to this simple black tee.", @"シンプルなＴシャツ\nシックなブラックにはえるゴールドの\nプリントがストリートテイスト", @"Un brillante logotipo dorado le da un toque callejero que contrasta a la perfección con esta sencilla camiseta negra.", @"Il logo di color oro brillante da un tocco di street-style in perfetto contrasto con questa semplice maglietta nera.", @"Das strahlend goldene Logo sorgt bei diesem einfachen schwarzen T-Shirt für ein wenig Streetstyle-Bling und den perfekten Kontrast.", @"Un logo doré brillant rajoute un petit côté bling-bling qui contraste merveilleusement avec la simplicité de ce T-shirt noir.", @"樣式簡單的Ｔ恤，\n時髦的黑色基底上配上金色印刷，\n呈現出街頭風格。", @"样式简单的T恤 \n时髦的黑色基底上配上金色印刷，\n呈现出街头风格。") },
