            { 10217, new TwewyItem(10217, 217, @"tile657", @"3 MC's 1 DJ", @"スリーＭＣ　ワンＤＪ", @"3 MC y 1 DJ", @"3 MC 1 DJ", @"3 MCs, 1 DJ", @"3 MC and 1 DJ", @"3 MC's 1 DJ", @"三个MC一个DJ", @"A classic white tee with a red graphic print. Buy it big, wear it loose, keep it real.", @"定番の白いＴシャツ\nさわやかな白にレッドのプリントが目立つ\nサイズが大きめでルーズなスタイルにまとまる", @"Clásica camiseta blanca con una impresión en rojo. Cómprala grande, llévala suelta y marca tendencia.", @"Una classica maglietta bianca con una stampa rossa al centro. Comprala di una taglia più grande e indossala ampia: farai un figurone.", @"Ein klassisch weißes T-Shirt mit rotem Druck. Kauf es groß, trag es locker, bleib authentisch.", @"Un T-shirt blanc classique avec un motif rouge. Achetez-le trop grand, portez-le large, et gardez la pêche !", @"經典的白色Ｔ恤，\n鮮明白色上的紅色印刷十分搶眼，\n尺寸較大，走的是寬鬆路線。", @"经典的白色T恤 \n鲜明白色上的红色印刷十分抢眼，\n尺寸较大，走的是宽松路线。") },
            { 10218, new TwewyItem(10218, 218, @"tile658", @"Pass the Mic", @"パス・ザ・マイク", @"Pasa el micro", @"Passa il microfono", @"Pass the Mic", @"Passe le mic", @"Pass the Mic", @"传递麦克", @"Red-on-white stripes line this oversized short-sleeve polo. It's all you need to complete your B-boy style.", @"ボーダー柄の半そでポロシャツ\nオーバーサイズなのでこれさえあれば\nＢ系スタイルはカンペキ", @"Las rayas rojas sobre el blanco de este polo holgado de manga corta son todo lo que necesitas para completar tu estilo «b-boy».", @"Voluminosa polo a maniche corte e a righe bianche e rosse. È tutto ciò che ti serve per completare il tuo stile da B-boy.", @"Rote Streifen auf Weiß zieren dieses extragroße kurzärmelige Polohemd. Mehr brauchst du nicht für deinen Breakdancer-Style.", @"Un polo à manches courtes à rayures rouges sur fond blanc. C'est pile ce qu'il vous faut pour compléter votre look hip-hop.", @"橫條紋的短袖Polo衫，\n穿上這件超大尺寸的衣服，\n立刻變身Ｂ系風格。", @"横条纹的短袖Polo衫 \n穿上这件超大尺寸的衣服，\n立刻变身B系风格。") },
            { 10219, new TwewyItem(10219, 219, @"tile659", @"Won't Stop", @"ＷＯＮ’Ｔ　ＳＴＯＰ ", @"Imparable", @"Infinito", @"Won't Stop", @"Ad libitum", @"WON'T STOP", @"不会停下", @"Tribal markings line the sides of these street-style half-length shorts. They're popular among the boarding crew.", @"ストリート系のハーフパンツ\nサイドにトライバルが入ったクールなテイスト\nボーダーに人気のアイテム", @"Estas bermudas van acentuadas por unas marcas tribales que recorren el lateral. Son muy populares entre los skaters.", @"I disegni tribali definiscono i lati di questi pinocchietti street-style. Sono popolarissimi tra le crew di skateboarder.", @"Tribalmuster zieren die Seiten dieser halblangen Hose im Streetstyle. Sehr beliebt bei Skatern.", @"Des motifs tribaux ornent les côtés de ce short mi-long au look super street. Extrêmement populaire chez les skaters.", @"街頭風格的五分褲，\n側邊有部落圖樣的帥氣設計，\n受到滑板玩家們歡迎的商品。", @"街头风格的五分裤 \n侧边有部落图样的帅气设计，\n受到滑板玩家们欢迎的商品。") },
            { 10220, new TwewyItem(10220, 220, @"tile660", @"Don't Stop", @"ＤＯＮ’Ｔ　ＳＴＯＰ", @"A tope", @"Mai fermarsi", @"Don't Stop", @"Non-stop", @"DON'T STOP", @"不要停下", @"Denim half-length shorts: a must-have item for anyone looking to stay cool out on the hot summer streets.", @"デニムのハーフパンツ\n定番の型なので飽きがこない\n１本は持っていたいアイテム", @"Bermudas vaqueras: una prenda esencial para quienes quieren ir fresquitos por la calle cuando más aprieta el calor.", @"Pinocchietti di jeans: un capo d'abbigliamento indispensabile per stare al fresco quando vai in giro per la città d'estate.", @"Eine halblange Jeans ist ein Muss für jeden, der auf den heißen Sommerstraßen cool bleiben will.", @"Un short mi-long en jean : une pièce incontournable pour tous ceux qui veulent rester au frais pendant les chaudes journées d'été en ville.", @"牛仔五分褲，\n經典款式百看不厭，\n每個人的必備單品。", @"牛仔五分裤 \n经典款式百看不厌，\n每个人的必备单品。") },
            { 10221, new TwewyItem(10221, 221, @"tile661", @"Camouflage", @"カモフラージュ", @"Camuflaje", @"Mimetici", @"Camouflage", @"Camouflage", @"偽裝", @"伪装", @"Camo print has long been king of the streets. These pants are a sweet centerpiece for any B-boy wardrobe.", @"迷彩柄のパンツ\n今やストリートでも定番の柄\n１本持っていると何かと役立つ", @"El estampado de camuflaje es, desde hace tiempo, el rey de las calles. Estos pantalones no pueden faltar en el armario de cualquier «b-boy».", @"La fantasia mimetica è da sempre la regina della strada. Questi pantaloni sono il pezzo forte del guardaroba di ogni B-boy.", @"Tarnmuster ist auf der Straße schon lange angesagt. Diese Hose ist ein hervorragendes Kernstück für jede Breakdancer-Garderobe.", @"L'imprimé camouflage est le roi de la rue depuis déjà un bon moment. Ce pantalon sera au centre de la garde-robe de tous les fans de hip-hop.", @"迷彩花紋的褲子，\n現在仍是街頭的經典花紋，\n有了這件就會好搭許多。", @"迷彩花纹的裤子 \n现在仍是街头的经典花纹，\n有了这件就会好搭许多。") },
            { 10222, new TwewyItem(10222, 222, @"tile662", @"Darkness", @"ダークネス", @"Tinieblas", @"Oscurità", @"Finsternis", @"Obscurité", @"黑暗", @"黑暗", @"These 3/4-length pants are a bit tough to work into an outfit, but those who manage are surefire sultans of the street.", @"七分丈の黒ショートパンツ　\n丈が短めなので若干コーディネイトに気を使うが\n着こなせば、ストリートで注目間違いなし！", @"Este pantalón pirata es complicado de combinar, pero quienes lo logren serán los amos de la calle.", @"Questi pantaloni a 3/4 non sono facilmente abbinabili, ma chi riesce a farlo diventa senza dubbio il sultano della strada.", @"Diese Dreiviertelhose ist zwar nicht sonderlich einfach in ein Outfit einzubauen, aber wer es schafft, ist sofort der Sultan der Straße.", @"Ce pantalon trois quarts n'est pas très facile à coordonner, mais ceux qui y parviennent sont immédiatement couronnés sultans de la rue.", @"黑色七分褲，長度略短，\n需要花點心思搭配，如果能穿得好看，\n一定能成為街頭的注目焦點！", @"黑色七分裤 \n长度略短，需要花点心思搭配，如果能穿得好看，\n一定能成为街头的注目焦点！") },
            { 10223, new TwewyItem(10223, 223, @"tile663", @"Denim Coveralls", @"デニムつなぎ", @"Mono vaquero", @"Tuta da lavoro di jeans", @"Jeansoverall", @"Salopette en denim", @"牛仔連身工作服", @"牛仔连身工作服", @"Blue denim worker's coveralls. Though a challenge to pull off, they're still popular with some Wild Boar fans.", @"デニムつなぎ\n着こなすのが難しいアイテム\n一部のワイルド・ボアファンに人気", @"Mono de trabajo vaquero azul. Aunque es todo un desafío en moda, sigue siendo popular entre algunos fans de Wild Boar.", @"Tuta da lavoro di jeans blu. Anche se sfoggiarla come si deve è una vera sfida, resta un capo molto in voga tra i fan di Wild Boar.", @"Ein blauer Arbeitsoverall aus Jeansstoff. Kann zwar nicht jeder tragen, ist aber dennoch beliebt bei einigen Fans von Wild Boar.", @"Une combinaison de travail en jean bleu. Assez difficile à porter, elle reste cependant très populaire auprès de certains fans de Wild Boar.", @"牛仔連身工作服，\n不容易穿得好看，\n在部分Wild Boar愛好者中相當熱門。", @"牛仔连身工作服 \n不容易穿得好看，\n在部分Wild Boar爱好者中相当热门。") },
            { 10224, new TwewyItem(10224, 224, @"tile664", @"Work Coveralls", @"ワークつなぎ", @"Mono de trabajo", @"Tuta da lavoro marrone", @"Arbeitsoverall", @"Salopette de chantier", @"作業連身工作服", @"作业连身工作服", @"Brown worker's coveralls. Though a huge challenge to pull off, they're still popular with some Wild Boar fans.", @"茶色いつなぎ　\n着こなすのがかなり難しいアイテム\n一部のワイルド・ボアファンに人気", @"Mono de trabajo vaquero marrón. Aunque es un auténtico desafío en moda, sigue siendo popular entre algunos fans de Wild Boar.", @"Tuta da lavoro di jeans marrone. Anche se sfoggiarla come si deve è una vera sfida, resta un capo molto in voga tra i fan di Wild Boar.", @"Ein brauner Arbeitsoverall. Können zwar nur die wenigsten tragen, ist aber dennoch beliebt bei einigen Fans von Wild Boar.", @"Une combinaison de travail en jean marron. Extrêmement difficile à porter, elle reste cependant très populaire auprès de certains fans de Wild Boar.", @"茶色連身工作服，\n不容易穿得好看，\n在部分Wild Boar愛好者中相當熱門。", @"茶色连身工作服 \n不容易穿得好看，\n在部分Wild Boar爱好者中相当热门。") },
            { 10225, new TwewyItem(10225, 225, @"tile665", @"Gold Die", @"ダイスネックレス", @"Dado dorado", @"Dado d'oro", @"Goldwürfel", @"Dé en or", @"骰子項鍊", @"骰子项链", @"This gold chain bears a single die--a symbol of good luck. This piece of bling just might make you an ace at the tables.", @"ヘッド部分がダイスのネックレス\n幸運のシンボルであるダイスを\nあしらっているからギャンブル運がよくなるかも", @"De esta cadena de oro cuelga un dado, símbolo de buena fortuna. Con esta joya ostentosa brillarás con luz propia.", @"Questa catena d'oro ha un ciondolo a forma di dado: un simbolo di fortuna. Questo elemento luccicante potrebbe farti diventare un asso al tavolo di gioco.", @"An dieser Goldkette ist als Glücksbringer ein einzelner Würfel befestigt. Mit diesem traumhaften Geschmeide räumst du an den Spieltischen möglicherweise groß ab.", @"Une chaîne en or avec un pendentif en forme de dé en guise de porte-bonheur. Ce bijou pourrait être votre meilleur allié à la table de jeux.", @"掛著骰子的項鍊，\n配戴象徵幸運的骰子，\n或許賭博運會變好。", @"挂着骰子的项链 \n配戴象征幸运的骰子，\n或许赌博运会变好。") },
            { 10226, new TwewyItem(10226, 226, @"tile666", @"Wild Boar Pendant", @"ワイルドボアペンダント", @"Colgante Wild Boar", @"Pendente Wild Boar", @"Wild Boar-Anhänger", @"Pendentif Wild Boar", @"Wild Boar墜子", @"Wild Boar坠子", @"The Wild Boar brand logo, in pendant form. Between the sharp design and bling factor, this is a must for any gangsta.", @"ブランドロゴをあしらったペンダント\nゴールドの輝きとロゴの存在感で確実に目立つ\nギャングスター風のスタイルに加えたい一品", @"Logotipo de la marca Wild Boar en forma de colgante. Entre el diseño definido y el factor ostentación, es imprescindible para todo «gangsta» que se precie.", @"Il logo di Wild Boar sotto forma di ciondolo. Tra il design deciso e il fattore luccicante, è un accessorio imperdibile per qualsiasi gangster che si rispetti.", @"Das Wild-Boar-Logo als Anhänger. Grandioses Design und enormer Bling-Faktor: ein Muss für jeden Gangsta.", @"Le logo de la marque Wild Boar sous la forme d'un pendentif. Avec son design bling-bling, ce bijou est un must pour tous les gangstas.", @"裝飾著品牌標誌的墜子，\n金色光輝與標誌非常搶眼，\n黑幫風格必備。", @"装饰着品牌标志的坠子 \n金色光辉与标志非常抢眼，\n黑帮风格必备。") },
            { 10227, new TwewyItem(10227, 227, @"tile667", @"King Pendant", @"キングペンダント", @"Colgante del rey", @"Pendente del re", @"Königs-Anhänger", @"Pendentif Roi", @"王者項鍊", @"王者坠子", @"Extra big in size and impact, this crown pendant will officially make you king of the street scene.", @"王冠をあしらったペンダント\n特大のペンダントへッドがインパクト大\nこれでストリートの王者に君臨しよう", @"Extragrande, tanto en tamaño como en impacto. Este colgante en forma de corona te convertirá, oficialmente, en el rey de las calles.", @"Di dimensioni e impatto enormi, questo ciondolo a forma di corona ti farà diventare ufficialmente il re della strada.", @"Fette Größe, fetter Auftritt: Mit diesem Kronenanhänger bist du ganz offiziell der König der Straße.", @"Avec sa taille phénoménale, ce pendentif en forme de couronne fera de vous le roi de la rue.", @"皇冠造型的墜子，\n特大尺寸令人印象深刻，\n就用這個穩坐街頭的王者寶座。", @"皇冠造型的坠子 \n特大尺寸令人印象深刻，\n就用这个稳坐街头的王者宝座。") },
            { 10228, new TwewyItem(10228, 228, @"tile668", @"Skull Deck", @"シャレコウベデッキ", @"Monopatín calavera", @"Tavola con teschio", @"Schädel-Board", @"Planche tête-de-mort", @"骷髏滑板", @"骷髅滑板", @"A Wild Boar original deck: the skull model. Balanced and steady, this board has a rep as a solid deck to start out on.", @"オリジナルスケボーデッキ　ドクロモデル\n安定感があり、乗りやすいと評判\n初心者なら迷わずコレを選ぼう", @"Monopatín Wild Boar original: modelo calavera. Equilibrado y estable, tiene fama de ser robusto, idóneo para principiantes.", @"Una tavola Wild Boar originale: il modello con il teschio. Equilibrata e robusta, è l'ideale per i principianti.", @"Ein Originalboard von Wild Boar: Modell Schädel. Dieses ausbalancierte und zuverlässige Board hat einen guten Ruf als Einsteigermodell.", @"Une planche originale de Wild Boar : le modèle tête de mort. Stable et équilibré, ce skate a la réputation d'être parfait pour les débutants.", @"原創滑板板身──骷髏造型，\n因為穩定、好滑而廣受好評，\n最適合初學者的選項。", @"原创滑板板身 \n骷髅造型，因为稳定、好滑而广受好评，\n最适合初学者的选项。") },
            { 10229, new TwewyItem(10229, 229, @"tile669", @"Camo Deck", @"メイサイデッキ", @"Monopatín camuflaje", @"Tavola mimetica", @"Tarnfarben-Board", @"Planche camouflage", @"迷彩滑板", @"迷彩滑板", @"A Wild Boar original deck: the camo model. Far from rock steady, this baby does rock in the speed department. Experts only, thanks.", @"オリジナルスケボーデッキ　カモフラモデル\n安定感に欠け、回転しやすいがスピードが出る\n上級者向けのデッキ", @"Monopatín Wild Boar original: modelo camuflaje. No es muy estable que digamos, pero corre que se las pela. Solo para expertos.", @"Una tavola Wild Boar originale: il modello mimetico. Lontana dall'essere robusta come una roccia, spacca però in velocità. Solo per veri esperti.", @"Ein Originalboard von Wild Boar: Modell Tarnfarbe. Dieses Schmuckstück ist alles andere als anfängerfreundlich, dafür aber brutal schnell. Nur für Experten.", @"Une planche originale de Wild Boar : le modèle camouflage. Tout sauf stable, ce bijou bat pourtant tous les records de vitesse. À réserver aux experts.", @"原創滑板板身──迷彩造型，\n不穩定、容易摔倒，\n但速度很快，適合老手的板身。", @"原创滑板板身 \n迷彩造型，稳定、容易摔倒，\n但速度很快，适合老手的板身。") },
            { 10230, new TwewyItem(10230, 230, @"tile670", @"CAT Deck", @"ＣＡＴデッキ", @"Monopatín CAT", @"Tavola CAT", @"CAT-Board", @"Planche CAT", @"CAT滑板", @"CAT滑板", @"A Wild Boar + CAT collaborative deck. The ride this board gives is as intense as its design. Think you can handle it?", @"ＣＡＴとのコラボデッキで幻の一品\n果たして君は乗りこなせるか？\n超上級者向けのクセありデッキ", @"Fruto de la colaboración Wild Boar + CAT. Este monopatín avanza con la misma intensidad que su diseño. ¿Serás capaz de dominarlo?", @"Una tavola nata dalla collaborazione tra Wild Boar e CAT. Padroneggiarla è un'esperienza mozzafiato, quasi quanto il suo design. Pensi di potercela fare?", @"Ein Board, das von Wild Boar und CAT gemeinsam entworfen wurde. Eine Fahrt aus diesem Board ist so intensiv wie sein Design. Hast du es drauf?", @"Une planche issue de la collaboration entre Wild Boar et CAT. Ce skate offre une expérience aussi mémorable que son design. Serez-vous à la hauteur ?", @"與ＣＡＴ聯名推出的夢幻板身，\n你能順利駕馭嗎？\n僅限專家，須以特殊方式駕馭的板身。", @"与CAT联名推出的梦幻板身 \n你能顺利驾驭吗？\n仅限专家，须以特殊方式驾驭的板身。") },
            { 10231, new TwewyItem(10231, 231, @"tile671", @"TWEWY Promo Coat", @"ＷＷコートジャケット", @"Chaquetón promo TWEWY", @"Cappotto promo TWEWY", @"TWEWY-Promo-Mantel", @"Manteau promo TWEWY", @"WW大衣", @"WW大衣", @"Our buyer doggedly hunted this coat down. Tetsuya Nomura designed it for the staff to wear at the Shibuya Game Show.", @"バイヤーが執念で入荷したコートジャケット\n渋谷ゲームショウでスタッフが着用して\n評判になった野村哲也デザインのユニフォーム", @"Nuestro comprador se empecinó en encontrar este abrigo. Tetsuya Nomura lo diseñó para el personal de la Shibuya Game Show.", @"Il nostro compratore ha testardamente scovato questo cappotto. Tetsuya Nomura l'ha disegnato per lo staff dello Shibuya Game Show.", @"Unser Einkäufer hat diesen Mantel hartnäckig aufgespürt. Tetsuya Nomura hat ihn für Mitarbeiter entworfen, um ihn bei der Shibuya Game Show zu tragen.", @"Notre acheteur a traqué ce manteau avec acharnement. Tetsuya Nomura l'a dessiné pour ses employés à l'occasion du Shibuya Game Show.", @"採購人員憑著自己的堅持所進貨的大衣，\n由野村哲也設計的制服\n在澀谷電玩展工作人員穿了之後引起轟動。", @"采购人员凭着自己的坚持所进货的大衣 \n由野村哲也设计的制服，\n在涩谷电玩展工作人员穿了之后引起轰动。") },
