            { 10233, new TwewyItem(10233, 233, @"tile592", @"TWEWY Promo Tote", @"ＷＷトートバッグ", @"Bolsa promo TWEWY", @"Borsa promo TWEWY", @"TWEWY-Promo-Tragetasche", @"Cabas promo TWEWY", @"WW托特包", @"WW托特包", @"Our buyer eagerly hunted this tote down: rare swag by Tetsuya Nomura that was handed out at the Shibuya Game Show.", @"バイヤーが熱意で入荷したトートバッグ\n渋谷ゲームショウで試遊された方へ配布された\n野村哲也デザインのレアノベルティグッズ", @"Nuestro comprador buscó con avidez esta bolsa: un complemento poco común de Tetsuya Nomura que se entregó en la Shibuya Game Show.", @"Il nostro compratore ha scovato con entusiasmo questa borsa: un accessorio raro di Tetsuya Nomura distribuito allo Shibuya Game Show.", @"Unser Einkäufer hat diese Tragetasche eifrig aufgespürt: seltenes Stück von Tetsuya Nomura, das es bei der Shibuya Game Show zu gewinnen gab.", @"Notre acheteur a avidement traqué ce cabas. Un accessoire rare conçu par Tetsuya Nomura distribué lors du Shibuya Game Show.", @"採購人員懷抱熱情進貨的托特包，\n由野村哲也設計的稀有宣傳周邊商品，\n會分送給在澀谷電玩展試玩的客人。", @"采购人员怀抱热情进货的托特包 \n由野村哲也设计的稀有宣传周边商品，\n会分送给在涩谷电玩展试玩的客人。") },
