            { 10244, new TwewyItem(10244, 244, @"tile284", @"Wizard's Glasses", @"名人のメガネ", @"Gafas del Mago", @"Occhiali del Mago", @"Zauberers Brille", @"Lunettes du sorcier", @"名人的眼鏡", @"名人的眼镜", @"Our buyer did all it took to hunt these down: elusive specs said to have once belonged to the famed inventor of Tin Pin Slammer.", @"バイヤーがあらゆる手段を駆使して入荷した眼鏡\nかつて、マブスラ開発者として人気を博した名人が\n愛用していたという幻のアイテム", @"Nuestro comprador hizo todo lo posible por encontrar estas escurridizas gafas. Según dicen, pertenecieron al afamado inventor del Tin Pin Slammer.", @"Il nostro compratore ha fatto tutto il necessario per trovarli: si dice che questi occhiali esclusivi siano un tempo appartenuti al celebre inventore di Tin Pin Slammer.", @"Unser Einkäufer hat alles gegeben, um diese begehrte Brille aufzuspüren, die angeblich einst dem berühmten Schöpfer von Tin Pin Slammer gehörte.", @"Notre acheteur a tout fait pour dénicher cet accessoire : une paire de lunettes insaisissable qui aurait appartenu au célèbre inventeur de Tin Pin Slammer.", @"採購人員用盡一切手段才成功進貨的眼鏡，\n據說知名的激鬥徽章開發者曾經相當愛用，\n可說是夢幻逸品。", @"采购人员用尽一切手段才成功进货的眼镜 \n据说知名的激撞徽章开发者曾经相当爱用，\n可说是梦幻逸品。") },
            { 10245, new TwewyItem(10245, 245, @"tile256", @"My Phones", @"おれのヘッドフォン", @"Mis cascos", @"Le mie cuffie", @"Meine Kopfhörer", @"Mon casque", @"我的耳機", @"我的耳机", @"CAT, our buyer, designed these uber-rare blue headphones: a marvel of performance and design. Only a few were ever made.", @"バイヤー・ＣＡＴがデザインした青いヘッドフォン\n機能性とデザイン性と話題性をかねそろえた一品\n数量限定で激レア", @"CAT, nuestro comprador, diseñó estos auriculares superraros, maravillosa fusión de rendimiento y diseño. Solo se fabricaron unos pocos.", @"CAT, Il nostro compratore, ha progettato queste cuffie blu ultra-rare: una meraviglia di prestazioni e design. Ne sono state realizzate pochissime.", @"CAT, unser Einkäufer, hat diese ultraseltenen blauen Kopfhörer entworfen, deren Performance und Design ein wahres Meisterwerk sind. Es wurden nur wenige Exemplare hergestellt.", @"CAT, notre acheteur, a conçu lui-même ce casque bleu über rare : un bijou de performance et de design. Seules quelques pièces ont été fabriquées.", @"採購人員‧ＣＡＴ設計的藍色耳機，\n兼具機能性、設計性與話題性的商品，\n限量所以超級稀有。", @"采购人员CAT设计的蓝色耳机 \n兼具机能性、设计性与话题性的商品，\n限量所以超级稀有。") },
            { 10246, new TwewyItem(10246, 246, @"tile228", @"Your Cap", @"おまえのキャップ", @"Tu gorra", @"Il tuo cappellino", @"Deine Kappe", @"Ta casquette", @"你的帽子", @"你的帽子", @"Our buyer designed and produced this uber-rare cap: a marvel of practicality and design. Only a few were ever made.", @"バイヤーがデザイン・制作したキャップ\n機能性とデザイン性と話題性をかねそろえた一品\n数量限定で激レア", @"Nuestro comprador diseñó y fabricó esta gorra superrara, maravillosa fusión de pragmatismo y diseño. Solo se fabricaron unas pocas.", @"Il nostro compratore ha disegnato e prodotto questo cappellino ultra raro: una meraviglia di praticità e design. Ne sono stati realizzati pochissimi.", @"Unser Einkäufer hat diese ultraseltene Kappe entworfen, deren Komfort und Design ein wahres Meisterwerk sind. Es wurden nur wenige Exemplare hergestellt.", @"CAT, notre acheteur, a conçu et produit lui-même cette casquette über rare : un bijou de praticité et de design. Seules quelques pièces ont été fabriquées.", @"採購人員所設計、製作的鴨舌帽，\n兼具機能性、設計性與話題性的商品，\n限量所以超級稀有。", @"采购人员所设计、制作的鸭舌帽 \n兼具机能性、设计性与话题性的商品，\n限量所以超级稀有。") },
            { 10247, new TwewyItem(10247, 247, @"tile200", @"Her Stuffed Animal", @"かのじょのぬいぐるみ", @"Su peluche", @"Il suo peluche", @"Ihr Stofftier", @"Sa peluche", @"她的布偶", @"她的布偶", @"Our buyer used every dirty trick to acquire this pig--uh, cat named [#FF0000]Mr. Mew[#000000] that Shiki brought to life via psychomancy.", @"バイヤーが反則技で入手したブタ…ではなく\n[#FF0000]にゃんタン[#000000]という名のネコ　シキの能力\nサイコマンスで自我を与えられたぬいぐるみ", @"Nuestro comprador utilizó todo tipo de triquiñuelas para conseguir este cerdo... digo, gato, llamado [#FF0000]Sr. Miau[#000000] al que Shiki dio vida a través de la psicomancia.", @"Il nostro compratore ha usato tutti i trucchetti che conosceva per impossessarsi di questo maial-- ehm, gatto, chiamato [#FF0000]Mr. Miao[#000000], a cui Shiki ha dato vita tramite la psicomanzia.", @"Unser Einkäufer hat jeden schmutzigen Trick eingesetzt, um dieses Schwein, äh, diese Katze namens [#000000]Mr. Miau[#000000] zu erwerben, die Shiki mittels Psychomantie zum Leben erweckt hat.", @"Notre acheteur a fait des pieds et des mains pour dénicher ce cochon... euh, chat, nommé [#FF0000]M. Miaou[#000000], amené à la vie par Shiki grâce à la psychomancie.", @"採購人員靠著作弊招式得到的豬……不對，\n應該是叫做[#FF0000]喵先生[#000000]的貓。\n以四季的能力……心靈魔術\n獲得自我意識的布偶。", @"采购人员靠着作弊招式得到的猪……不，\n是叫做[#FF0000]喵先生[#000000]的猫。以四季的能力，\n心灵魔术获得自我意识的布偶。") },
            { 10248, new TwewyItem(10248, 248, @"tile172", @"Angel Feather", @"天使のハネ", @"Pluma de ángel", @"Piuma d'angelo", @"Engelsfeder", @"Plume d'ange", @"天使羽毛", @"天使羽毛", @"Our buyer used divine means to acquire this mysterious feather that was once in the possession of Shibuya's Composer.", @"バイヤーが特別な力で入手した\n渋谷エリアのコンポーザーが\n持っていた謎の羽根", @"Nuestro comprador utilizó técnicas adivinatorias para adquirir esta misteriosa pluma que estuvo en manos del Compositor de Shibuya.", @"Il nostro compratore ha usato mezzi divini per impossessarsi di questa misteriosa piuma che un tempo apparteneva al Compositore di Shibuya.", @"Unser Einkäufer hat übernatürliche Kräfte eingesetzt, um diese geheimnisvolle Feder zu erwerben, die einst Shibuyas Komponisten gehörte.", @"Notre acheteur a utilisé des moyens divins pour obtenir cette plume mystérieuse qui appartenait jadis au Compositeur de Shibuya.", @"採購人員藉由特別的力量取得，\n澀谷區域的作曲家持有的神秘羽毛。", @"采购人员借由特别的力量取得，\n涩谷区域的\n作曲家持有的神秘羽毛。") },
            { 10249, new TwewyItem(10249, 249, @"tile144", @"Gakuran", @"学ラン", @"Gakuran", @"Gakuran", @"Gakuran", @"Gakuran", @"學生服", @"学生服", @"Ah, innocence! Remember the days of dress code? One look at this uniform sends you into fits of longing for your boyhood.", @"純情！　校則どおりの超標準学生服\n見ているだけで初々しい気持ちがよみがえる\nこれを着て海を走れば青春を満喫できる！", @"¡Bendita inocencia! ¿Recuerdas la época de los uniformes? Al ver este, rememorarás tu infancia con nostalgia.", @"Ah, innocenza! Ricordi i bei tempi del grembiule? Un solo sguardo a questa uniforme ti fa venire una voglia incredibile di tornare bambino.", @"Holde Unschuld! Erinnerst du dich noch, damals, als es Kleidervorschriften gab? Ein Blick auf diese Uniform, und du sehnst dich in deine Kindheit zurück.", @"Ah, l'innocence ! Un simple coup d'œil à cet uniforme d'écolier vous fera retomber en enfance.", @"純情！完全遵守校規規定的超標準學生制服，\n光是從旁看著就會湧現清純的心情，\n穿上這件在海邊奔跑就能享受青春！", @"纯情！完全遵守校规规定的超标准学生制服 \n光是从旁看着就会涌现清纯的心情，\n穿上这件在海边奔跑就能享受青春！") },
            { 10250, new TwewyItem(10250, 250, @"tile116", @"Sailor Suit", @"セーラー服", @"Traje de marinerito", @"Divisa da marinaretta", @"Matrosenanzug", @"Costume de marin", @"水手服", @"水手服", @"Oh, purity! Remember the days of dress code? One look at this uniform reminds you of that bittersweet day you stood in the rain.", @"清純！　校則どおりの超標準学生服\n見ているだけで甘酸っぱい気持ちがよみがえる\nこれを着て雨にうたれれば青春を満喫できる！", @"¡Bendita pureza! ¿Recuerdas la época de los uniformes? Al ver este, rememorarás el día agridulce en que estuviste de pie bajo la lluvia.", @"Oh, purezza! Ricordi i bei tempi del grembiule? Un solo sguardo a questa uniforme ti fa ricordare, con una punta di amarezza, i giorni in cui te ne stavi sotto la pioggia.", @"Holde Reinheit! Erinnerst du dich noch, damals, als es Kleidervorschriften gab? Ein Blick auf diese Uniform, und du erinnerst dich wieder an diesen bittersüßen Tag, als du im Regen standest.", @"Ah, la pureté ! Un simple coup d'œil à cet uniforme d'écolière vous rappellera l'époque où vous vous amusiez à sauter dans les flaques.", @"清純！完全遵守校規規定的超標準學生制服，\n光是從旁看著就會湧現酸酸甜甜的心情，\n穿上這件淋雨就能享受青春！", @"清纯！完全遵守校规规定的超标准学生制服 \n光是从旁看着就会涌现酸酸甜甜的心情，\n穿上这件淋雨就能享受青春！") },
            { 10251, new TwewyItem(10251, 251, @"tile088", @"Boys' Uniform with Blazer", @"ブレザーの男子制服", @"Uniforme escolar de niño", @"Uniforme da ragazzo giacca", @"Jungsuniform mit Blazer", @"Uniforme de mec avec blazer", @"男生制服（西裝外套）", @"男生制服（西装外套）", @"A replica of the uniforms from St. Michael's, the famous rich kid school for boy geniuses. Wearing this will get you mad dates.", @"お金持ちで優秀なおぼっちゃんが通う学校として\n有名な聖べシュテル学園のレプリカ\nこれを着て街を歩けば告られまくり", @"Réplica de los uniformes de San Miguel, la famosa escuela para niños prodigio con dinero. Si te lo pones, las citas te caerán del cielo.", @"Una riproduzione delle uniformi della St. Michael, la famosa scuola per genietti ricchi. Indossarla ti farà ottenere un sacco di appuntamenti.", @"Eine Replik der Uniformen von St. Michael's, der berühmten Schule für reiche und geniale Knaben. Wenn du das trägst, wirst du dich vor Dates kaum retten können.", @"Une réplique des uniformes de St. Michael, la célèbre école huppée pour garçons surdoués. Avec ça, toutes les filles tomberont à vos pieds.", @"因為有錢人的優秀少爺前往就讀而聞名的\n聖貝希特爾學園的制服複製品，\n穿上這件就會被瘋狂告白。", @"因为有钱人的优秀少爷前往就读而闻名的\n圣贝希特尔学园的制服复制品 \n穿上这件就会被疯狂告白。") },
            { 10252, new TwewyItem(10252, 252, @"tile060", @"Girls' Uniform with Blazer", @"ブレザーの女子制服", @"Uniforme escolar de niña", @"Uniforme da ragazza giacca", @"Mädchenuniform mit Blazer", @"Uniforme de fille avec blazer", @"女生制服（西裝外套）", @"女生制服（西装外套）", @"A replica of the uniforms from St. Ursula's, the famous rich kid school for proper girls. Wearing this will turn every head.", @"お金持ちが通うお嬢さま学校として有名な\n聖キプリス学園のレプリカ\nこれを着て街を歩けば誰もが振りかえる", @"Réplica de los uniformes de Santa Úrsula, la famosa escuela para niñas decentes. Si te lo pones, serás el centro de atención.", @"Una riproduzione delle uniformi della St. Ursula, la famosa scuola per ricche ragazze per bene. Se la indossi, tutti si volteranno a guardarti.", @"Eine Replik der Uniformen von St. Ursula's, der berühmten Schule für reiche und wohlerzogene Mädchen. Wenn du das trägst, drehen sich alle nach dir um.", @"Une réplique des uniformes de Ste. Ursula, la célèbre école huppée pour filles modèles. Avec ça, vous allez faire tourner les têtes.", @"以有錢人就讀的千金小姐學校而聞名的\n聖希普利斯學園的制服複製品，\n穿上這件走在街上，所有人都會為妳回頭。", @"以有钱人就读的千金小姐学校而闻名的\n圣希普利斯学园的制服复制品 \n穿上这件走在街上，所有人都会为你回头。") },
            { 10253, new TwewyItem(10253, 253, @"tile032", @"Girls' Uniform with Sweater", @"セーターつき女子制服", @"Uniforme de niña con suéter", @"Uniforme con maglione", @"Mädchenuniform mit Pulli", @"Uniforme de fille avec sweat", @"女生制服（附毛衣）", @"女生制服（附毛衣）", @"A replica of the summer uniforms from St. Ursula's, the famous rich kid school for proper girls. As white as your pure heart!", @"お金持ちが通うお嬢さま学校として有名な\n聖キプリス学園の夏服レプリカ\n白いセーターが純真さ倍増！", @"Réplica de los uniformes de verano de Santa Úrsula, la famosa escuela para niñas decentes. \nTan blanco como la pureza de tu corazón.", @"Una riproduzione delle uniformi estive della St. Ursula, la famosa scuola per ricche ragazze per bene. Bianca come il tuo cuore puro!", @"Eine Replik der Sommeruniformen von St. Ursula's, der berühmten Schule für reiche und wohlerzogene Mädchen. So weiß wie dein reines Herz!", @"Une réplique des uniformes d'été de Ste. Ursula, la célèbre école huppée pour filles modèles. D'un blanc aussi pur que votre cœur !", @"以有錢人就讀的千金小姐學校而聞名的\n聖希普利斯學園的夏季制服複製品，\n白色毛衣看起來更加清純！", @"以有钱人就读的千金小姐学校而闻名的\n圣希普利斯学园的夏季制服复制品 \n白色毛衣看起来更加清纯！") },
            { 10254, new TwewyItem(10254, 254, @"tile004", @"Head Honcho", @"番長セット", @"Uniforme forrado", @"Pezzo grosso", @"Oberkommandant", @"Grand chef", @"老大套組", @"老大套组", @"A uniform with red lining and a gold dragon. Chinese characters for \x22ai rabu yuu\x22 have been embroidered on the back. Ooh, tough!", @"番長のための長ラン\n裏地は赤に金色の竜、背中にはもちろん\n『愛羅武勇』がししゅうされ迫力のある仕上がり", @"Uniforme forrado de rojo y con un dragón dorado. Lleva grabados en la parte trasera los caracteres chinos de «ai rabu yuu». No se puede ser más duro.", @"Un'uniforme con una fascia rossa e un drago d'oro. Sulla schiena sono stati ricamati i caratteri cinesi che stanno per \x22ai rabu yuu\x22. Ooh, però!", @"Eine Uniform mit rotem Futter und einem goldenen Drachen. Die chinesischen Schriftzeichen für \x22ai rabu yuu\x22 (\x22Ich liebe dich\x22) sind auf dem Rücken eingestickt. Echt hart!", @"Un uniforme avec une doublure rouge et un dragon doré. Les caractères chinois pour \x22ai rabu yuu\x22 ont été brodés dans son dos. Un vrai look de dur à cuire !", @"為不良少年的老大所設計的長版學生服，\n紅色內裏搭配金色的龍，\n背上不可或缺地繡上『愛羅武勇』，充滿魄力。", @"为不良少年的老大所设计的长版学生服 \n红色内里搭配金色的龙，\n背上不可或缺地绣上『爱罗武勇』，充满魄力。") },
            { 10255, new TwewyItem(10255, 255, @"tile621", @"Yukata", @"ゆかた", @"Yukata", @"Yukata", @"Yukata", @"Yukata", @"浴衣", @"浴衣", @"Summer! Festivals! Fireworks! Wear this on that balmy summer eve you plan to steal your honey's heart for good!", @"夏だ！　祭りだ！　花火だ！！\n夏の夜はこれを着て、気になるあいつのハートを\nがっつりつかんじゃおう！", @"¡Verano! ¡Fiestas! ¡Fuegos artificiales! Póntelo esa noche de verano en la que pienses robarle el corazón a tu amor.", @"Estate! Festival! Fuochi d'artificio! Indossa questo capo in quella serata estiva in cui vorrai conquistare per sempre il cuore del tuo innamorato!", @"Sommer! Feste! Feuerwerk! Trage das hier an einem milden Sommerabend, um das Herz deines Schatzes endgültig zu stehlen!", @"L'été ! Les festivals ! Les feux d'artifice ! Portez cette tenue lors d'une douce soirée estivale pour faire fondre le cœur de votre bien-aimé !", @"夏天！慶典！煙火！！\n夏季夜晚就穿上這件衣服，\n牢牢抓住心上人的心！", @"夏天！庆典！烟火！！ \n夏季夜晚就穿上这件衣服，\n牢牢抓住心上人的心！") },
            { 10256, new TwewyItem(10256, 256, @"tile622", @"The Dead Slammurai", @"スラッシュマンデッド", @"El atizamurái Inerte", @"Lo Slammurai morto", @"Der tote Slammurai", @"Le slammouraï mort", @"激鬥人DEAD", @"激撞徽章选手DEAD", @"This cosplay is slammin'! Become the pure-hearted leader of the Slammurai. Mete out justice at the Tin Pin table. Slaaam...ON!", @"超人気！　マーブルスラッシュで戦う\nマーブル戦隊スラッシュマンのコスプレ衣装\n清くただしく美しい心を持つリーダーモデル", @"¡Este cosplay arrasa! Conviértete en el líder de corazón puro de los atizamuráis. Reparte justicia en la mesa del Tin Pin. ¡Listos para... ATIZAR!", @"Questo cosplay è super slam! Diventa il leader dal cuore puro di Slammurai. Fai giustizia al tavolo di Tin Pin. Vai di slam!", @"Dieses Cosplay ist der Hammer! Werde der gutherzige Anführer der Slammurai. Sorge für Gerechtigkeit am Tin-Pin-Tisch. Los geht's!", @"Cette tenue de cosplay est vraiment cool ! Devenez le leader au cœur pur des Slammouraïs. Rendez la justice sur la table de Tin Pin. Et que ça slaaam !", @"超人氣！在激鬥徽章中戰鬥的\n徽章戰隊激鬥人的角色扮演服，\n擁有純潔正派美麗內心的領導者造型。", @"超人气！在激撞徽章中战斗的\n徽章战队激撞徽章选手的角色扮演服 \n拥有纯洁正派美丽内心的领导者造型。") },
            { 10257, new TwewyItem(10257, 257, @"tile623", @"The Black Slammurai", @"スラッシュマンブラック", @"El atizamurái Negro", @"Lo Slammurai nero", @"Der schwarze Slammurai", @"Le slammouraï noir", @"激鬥人BLACK", @"激撞徽章选手BLACK", @"This cosplay is slammin'! Become the nihilistic rival member of the Slammurai. Way too cool for the Tin Pin table. Slaaam...ON!", @"超人気！　マーブルスラッシュで戦う\nマーブル戦隊スラッシュマンのコスプレ衣装\nニヒルでクールなライバルキャラモデル", @"¡Este cosplay arrasa! Conviértete en el rival nihilista de los atizamuráis. Demasiado chulo para la mesa del Tin Pin. ¡Listos para... ATIZAR!", @"Questo cosplay è super slam! Diventa il membro rivale nichilistico di Slammurai. Il tavolo di Tin Pin non è degno di te. Vai di slam!", @"Dieses Cosplay ist der Hammer! Werde der nihilistische Rivale der Slammurai. Viel zu cool für den Tin-Pin-Tisch. Los geht's!", @"Cette tenue de cosplay est vraiment cool ! Devenez le membre nihiliste des Slammouraïs. Trop cool pour la table de Tin Pin. Et que ça slaaam !", @"超人氣！在激鬥徽章中戰鬥的\n徽章戰隊激鬥人的角色扮演服，\n冷酷帥氣的敵方角色造型。", @"超人气！在激撞徽章中战斗的\n徽章战队激撞徽章选手的角色扮演服 \n冷酷帅气的敌方角色造型。") },
            { 10258, new TwewyItem(10258, 258, @"tile624", @"Nose Glasses", @"鼻メガネ", @"Gafas narizonas", @"Occhiali con naso", @"Nasenbrille", @"Lunettes de farce et attrape", @"大鼻子眼鏡", @"大鼻子眼镜", @"This novelty item is funny enough to reduce some folks to tears on sight. Try it as a pick-me-up when you're feeling down.", @"某イラストレーターの母親も愛用してたアイテム\nこれを見ただけで反射的に泣ける人がいるらしい\n落ち込んだときに使うと気分があがる", @"Este novedoso artículo es tan gracioso que llorarás de risa. Póntelo para animarte cuando estés de bajón.", @"Questo oggetto è talmente divertente da far piangere dalle risate la gente. Usalo per tirarti su quando sei di malumore.", @"Dieser Scherzartikel ist so lustig, dass manchen Leute vor Lachen die Tränen kommen. Sorgt für gute Laune, wenn du dich mies fühlst.", @"Cette babiole est si drôle que certains fondent carrément en larmes en la voyant. Servez-vous-en comme remontant quand vous avez le moral dans les chaussettes.", @"某插畫家的母親也相當愛用的單品，\n似乎有人光是看到這個就會反射性地想哭，\n沮喪時配戴就能讓心情變好。", @"某插画家的母亲也相当爱用的单品 \n似乎有人光是看到这个就会反射性地想哭，\n沮丧时配戴就能让心情变好。") },
            { 10259, new TwewyItem(10259, 259, @"tile625", @"Samurai Wig", @"サムライカツラ", @"Peluca de samurái", @"Parrucca da samurai", @"Samurai-Perücke", @"Perruque de samouraï", @"武士假髮", @"武士假发", @"This novelty item reminds us of the long-forgotten warriors of the past. It's especially popular among foreigners. Make new friends!", @"忘れ去られし武士の心を思い出させるアイテム\n外国人のお土産として大変人気らしい\nこれをかぶれば外国人の人気者になれる", @"Este novedoso artículo nos recuerda a los guerreros olvidados del pasado. Es popular entre los forasteros y te ayudará a hacer nuevos amigos.", @"Questo oggetto ci ricorda i guerrieri del passato ormai dimenticati. È particolarmente popolare soprattutto tra gli stranieri. Fatti nuovi amici!", @"Dieser Scherzartikel erinnert uns an die längst vergessenen Krieger der Vergangenheit. Besonders beliebt bei Leuten von auswärts. Schließe neue Freundschaften!", @"Cette babiole nous rappelle les héros oubliés du passé. Elle est particulièrement populaire auprès des étrangers. Faites-vous de nouveaux amis !", @"能讓人回想起已經遺忘的武士之心，\n似乎是超受外國人歡迎的伴手禮，\n戴上它就能在外國人之間大受歡迎。", @"能让人回想起已经遗忘的武士之心，\n似乎是超受外国人欢迎的伴手礼，\n戴上它就能在外国人之间大受欢迎。") },
            { 10260, new TwewyItem(10260, 260, @"tile626", @"Mr. Mew Suit", @"にゃんタンきぐるみ", @"Traje del Sr. Miau", @"Tuta da Mr. Miao", @"Mr. Miaus Anzug", @"Costume de M. Miaou", @"喵先生人偶裝", @"喵先生人偶装", @"Shiki buckled down to put this together for last year's school festival. Afterwards, it mysteriously disappeared from the grounds.", @"昨年の学園祭で使うためにシキが\n気合を入れて作り上げたにゃんタンきぐるみ\n学園祭終了後、学校から紛失してしまっていた", @"Shiki se puso manos a la obra para tenerlo listo para la fiesta escolar del año pasado. Después, despareció misteriosamente.", @"Shiki si è impegnata tanto per realizzarlo in occasione del festival scolastico dell'anno scorso. Dopo quell'evento, è misteriosamente sparito nel nulla.", @"Shiki hat alles gegeben, um das hier für das Schulfest letztes Jahr zusammenzustellen. Anschließend verschwand es auf mysteriöse Weise vom Gelände.", @"Shiki a travaillé dur pour fabriquer ce costume pour le festival de l'école de l'an dernier. Après ça, il a mystérieusement disparu.", @"四季為了在去年校慶使用\n而努力製作的喵先生布偶裝，\n在校慶結束後就從學校消失了。", @"四季为了在去年校庆使用\n而努力制作的喵先生布偶装 \n在校庆结束后就从学校消失了。") },
            { 10261, new TwewyItem(10261, 261, @"tile627", @"New Year's Gift", @"お歳暮", @"Regalo de Año Nuevo", @"Regalo per l'anno nuovo", @"Neujahrsgeschenk", @"Cadeau du Nouvel An", @"年節賀禮", @"年节贺礼", @"A year-end tradition. What could be inside? Do you open it and kill the suspense...or save it for a rainy day and pray it's not perishable?", @"年末の風物詩、もらうとうれしいお歳暮\n中身は開けてからのお楽しみ♪と放置しがち…\nでも、もし…生ものだったりしたら…", @"Tradición de fin de año. ¿Qué habrá dentro? ¿Lo abres para acabar con el suspense o prefieres guardarlo para cuando te haga falta? (Esperemos que no caduque).", @"Una tradizione dell'ultimo dell'anno. Cosa ci sarà all'interno? Lo aprirai per porre fine alla suspense... o lo conserverai per il futuro, sperando che non abbia una data di scadenza?", @"Eine Tradition zum Jahresende. Was da wohl drin ist? Öffnest du es und verdirbst dir die Überraschung, oder sparst du es für schlechte Zeiten auf und betest, dass es nichts Verderbliches ist?", @"Une tradition de fin d'année. Que peut-il bien renfermer ? Mieux vaut-il l'ouvrir et mettre fin au suspens... ou le conserver pour une journée pluvieuse et prier pour qu'il ne soit pas\npérissable ?", @"年末的特色，拿到會很開心的年終禮品，\n大家都很期待打開後的內容♪\n但是常常會放到忘記……\n而且……如果是會臭掉的東西就……", @"年末的特色，拿到会很开心的年终礼品 \n大家都很期待打开后的内容♪\n但是常常会放到忘记……\n而且……如果是会臭掉的东西就……") },
            { 10262, new TwewyItem(10262, 262, @"tile628", @"Pirate Hat", @"かいぞくハット", @"Sombrero pirata", @"Cappello da pirata", @"Piratenhut", @"Chapeau de pirate", @"海賊帽", @"海贼帽", @"Arrr, this be a seaworthy hat from distant shores. You might say we're all pirates, roughin' the seas called everyday society...", @"大海の荒波を乗り越えるかいぞくハット\n人はみな、社会という荒波に立ち向かう\nかいぞくなのかもしれない…", @"Grumetes, este sombrero es perfecto para surcar los siete mares. Podrías decir que todos somos piratas que navegamos por los océanos de la sociedad...", @"Arrr, questo cappello proviene dalle coste di mari lontani. In effetti, al giorno d'oggi, siamo tutti pirati che solcano i mari della società odierna...", @"Arrr, dies ist ein seetauglicher Hut von weit entfernten Ufern. Man könnte sagen, dass wir allesamt Piraten sind, die das Meer namens Alltag und Gesellschaft bezwingen ...", @"Arrr, un beau chapeau marin venu de mers lointaines. Après tout, nous sommes peut-être tous des pirates, navigant sur la mer agitée de la société actuelle...", @"能戰勝大海的驚濤駭浪的海盜帽，\n或許每個人都是海盜，\n對抗著名為社會的驚濤駭浪……", @"能战胜大海的惊涛骇浪的海盗帽 \n或许每个人都是海盗，\n对抗着名为社会的惊涛骇浪……") },
            { 10263, new TwewyItem(10263, 263, @"tile629", @"Potted Plant", @"はちうえ", @"Planta en maceta", @"Vaso di fiori", @"Topfpflanze", @"Plante en pot", @"盆栽", @"盆栽", @"This little guy will melt your stress away. Take heart from its tiny red flowers, said in feng shui to bring good luck!", @"ストレス社会で疲れた心をいやすはちうえ\n赤い花のパワーをもらって元気になろう\n赤い花は風水的には懸賞運に効くらしいぞ！", @"Este pequeñín te liberará del estrés. Anímate con sus diminutas flores rojas: según el feng shui, te traerán buena fortuna.", @"Questo vasetto è fatto apposta per eliminare lo stress. Trai conforto dai suoi fiorellini rossi: portano fortuna, secondo il feng shui!", @"Dieses kleine Ding lässt deinen Stress verschwinden. Erfreu dich an seinen winzigen roten Blüten, die laut Feng Shui Glück bringen!", @"Cette petite plante vous libèrera du stress et ses jolies fleurs rouges vous donneront du courage. En plus, ça porte bonheur, à en croire le feng shui !", @"在充滿壓力的社會中，能夠療癒心靈的盆栽，\n獲取紅色花朵的力量打起精神吧，\n紅花在風水上似乎能提升懸賞運喔！", @"在充满压力的社会中能够疗愈心灵的盆栽 \n获取红色花朵的力量打起精神吧，\n红花在风水上似乎能提升悬赏运哦！") },
            { 10264, new TwewyItem(10264, 264, @"tile630", @"Mr. Claus", @"メンズサンタセット", @"Papá Noel", @"Sig. Babbo Natale", @"Weihnachtsmann", @"M. Noël", @"男性聖誕老人裝", @"男性圣诞老人装", @"The gift that keeps on giving...to other people! Hanekoma had it ready for the holiday season, then decided it wasn't his bag...", @"すべての人に愛と夢を配るサンタセット\n羽狛がクリスマスのときに着るつもりで準備した\nしかし、動きづらいため着用を断念した代物", @"El regalo que no para de regalar... ¡a los demás! Hanekoma lo tenía preparado para las vacaciones y después decidió que no era de su gusto...", @"Il regalo che fa regali... agli altri! Hanekoma l'aveva finito per le vacanze natalizie, ma poi ha deciso che non era il suo genere.", @"Eine schöne Bescherung ... für andere Leute! Hanekoma hatte sich das schon für die Feiertage zurechtgelegt, aber dann entschieden, dass das nicht so sein Ding ist ...", @"Une source intarissable de bienfaits... pour les autres ! Hanekoma l'avait mis de côté pour les fêtes, puis il a décidé que c'était trop barbant...", @"將愛與夢想分送給所有人的聖誕組合，\n羽柏原本打算在聖誕節時穿上這套衣服，\n但是因為很難行動，所以最後還是放棄了。", @"将爱与梦想分送给所有人的圣诞组合 \n羽泊原本打算在圣诞节时穿上这套衣服，\n但是因为很难行动，所以最后还是放弃了。") },
            { 10265, new TwewyItem(10265, 265, @"tile631", @"Mrs. Claus", @"ウィメンズサンタセット", @"Mamá Noel", @"Sig.ra Mamma Natale", @"Weihnachtsfrau", @"Mme. Noël", @"女性聖誕老人裝", @"女性圣诞老人装", @"Bring sweet dreams to children everywhere! Eri designed this for a Christmas party, and Shiki spent all night sewing it.", @"お子様に愛と夢を配るサンタセット\nクリスマス会のためにエリがデザインして\nシキが一晩でぬいあげた友情のコラボレーション", @"Dulces sueños para los niños de todo el mundo. Eri diseñó esto para una fiesta navideña y Shiki se pasó la noche entera cosiendo.", @"Regala dolci sogni ai bambini di tutto il mondo! Eri l'ha disegnato per la festa di Natale, e Shiki ha passato tutta la notte a cucirlo.", @"Bringe Kindern allerorts süße Träume! Eri hat dieses Teil für eine Weihnachtsfeier entworfen, und Shiki hat die ganze Nacht damit verbracht, es zu nähen.", @"Faites faire de beaux rêves à tous les enfants ! Eri a dessiné ce costume pour une fête de Noël et Shiki a passé la nuit à le coudre.", @"將愛與夢想分送給孩子們的聖誕組合，\n是愛理為了聖誕派對所設計，\n再由四季花上一晚縫好的友情合作成果。", @"将爱与梦想分送给孩子们的圣诞组合 \n是绘理为了圣诞派对所设计，\n再由四季花上一晚缝好的友情合作成果。") },
            { 10266, new TwewyItem(10266, 266, @"tile632", @"Black Book Bag", @"黒ランドセル", @"Mochila escolar negra", @"Cartella nera", @"Schwarze Büchertasche", @"Cartable noir", @"黑色學生書包", @"黑色学生书包", @"Six years of Beat's elementary school memories are crammed into this thing. He treated it terribly, so it's on its last legs.", @"ビイトの６年間の思い出がつまったランドセル\n乱暴に扱ったのか、傷みが激しく崩壊寸前", @"Beat guarda aquí seis años de recuerdos en la escuela primaria. La trató fatal, así que está en las últimas.", @"In questo affare sono stipati sei anni di ricordi delle elementari di Beat. L'ha trattato terribilmente, perciò ormai non gli resta molto tempo.", @"Dieses Ding enthält vier Jahre von Beats Grundschulerinnerungen. Er hat es grauenhaft behandelt – viel macht es nicht mehr mit.", @"Les souvenirs des six années d'école élémentaire de Beat sont entassés dans ce sac. Il n'en a vraiment pas pris soin, alors il est en piteux état.", @"累積了拍子６年來回憶的書包，\n受到粗暴對待，傷痕累累都快壞了。", @"累积了比特6年来回忆的书包 \n受到粗暴对待，伤痕累累都快坏了。") },
            { 10267, new TwewyItem(10267, 267, @"tile633", @"Red Book Bag", @"赤ランドセル", @"Mochila escolar roja", @"Cartella rossa", @"Rote Büchertasche", @"Cartable rouge", @"紅色學生書包", @"红色学生书包", @"Six years of Rhyme's elementary school memories are crammed into this thing. She took good care of it, and it really shows.", @"ライムの６年間の思い出がつまったランドセル\n扱いが丁寧なため、ほぼ新品のようなキレイさ！", @"Rhyme guarda aquí seis años de recuerdos en la escuela primaria. La cuidó muy bien, como salta a la vista.", @"In questo affare sono stipati sei anni di ricordi delle elementari di Rhyme. Ne ha avuto gran cura, e si vede.", @"Dieses Ding enthält vier Jahre von Rhymes Grundschulerinnerungen. Sie hat es gut behandelt, und das sieht man auch.", @"Les souvenirs des six années d'école élémentaire de Rhyme sont entassés dans ce sac. Elle en a pris grand soin, et ça se voit.", @"累積了來夢６年來回憶的書包，\n因為細心呵護，所以幾乎像是新的一樣漂亮！", @"累积了莱姆6年来回忆的书包 \n因为细心呵护，所以几乎像是新的一样漂亮！") },
            { 10268, new TwewyItem(10268, 268, @"tile634", @"Biker Gloves", @"ライダーグローブ", @"Guantes de motero", @"Guanti da motociclista", @"Motorradhandschuhe", @"Gants de motard", @"騎士手套", @"骑士手套", @"These gloves were made to pro specifications, including a no-slip grip that keeps you glued to the handlebar.", @"トップライダーたちの意見をもとに作られた\nライダーグローブ\nすべりどめがついているので、強力グリップ！", @"Estos guantes fueron diseñados siguiendo las directrices de un profesional, incluyendo un agarre antideslizante que te deja pegado al manillar.", @"Questi guanti sono stati realizzati secondo le specifiche dei professionisti, inclusa un'impugnatura antiscivolo che terrà le tue mani incollate al manubrio.", @"Diese Handschuhe entsprechen höchsten Anforderungen und haben beispielsweise eine rutschfeste Handfläche, mit der du am Lenker klebst.", @"Ces gants ont été conçus pour répondre aux demandes des pros. Ils incluent notamment une doublure antidérapante qui ancrera votre main solidement au guidon.", @"根據頂尖騎士們的意見製作的騎士手套，\n附有止滑設計，讓人能牢牢握住油門！", @"根据顶尖骑士们的意见制作的骑士手套 \n附有止滑设计，\n让人能牢牢握住油门！") },
            { 10269, new TwewyItem(10269, 269, @"tile635", @"Maid Costume", @"メイドセット", @"Atuendo de criada", @"Costume da cameriera", @"Dienstmädchenkostüm", @"Costume de bonne", @"女僕裝", @"女仆装", @"Eri designed this maid outfit for last year's school festival, and Shiki sewed it. Their class ran a cafe!", @"昨年の学園祭で使うためにエリがデザインし\nシキが作り上げた、かわいいメイドセット\nクラスの出し物はカフェだったらしい", @"Eri diseñó este atuendo de doncella para la fiesta escolar del año pasado y Shiki lo cosió. ¡Su clase dirigía una cafetería!", @"Eri ha disegnato questo outfit da cameriera per il festival scolastico dello scorso anno, e Shiki l'ha cucito. La loro classe gestiva un bar!", @"Eri hat dieses Dienstmädchen-Outfit für das Schulfest letztes Jahr entworfen, und Shiki hat es genäht. Ihre Klasse hat ein Café geführt!", @"Eri a dessiné cette tenue de servante pour le festival de l'école de l'an dernier, et c'est Shiki qui l'a cousue. Leur classe avait mis en place un petit café !", @"愛理為了在去年校慶使用而設計，\n並由四季製作的可愛女僕服裝，\n當時班上似乎是開咖啡廳。", @"绘理为了在去年校庆使用而设计\n并由四季制作的可爱女仆服装 \n当时班上\n似乎是开咖啡厅。") },
            { 10270, new TwewyItem(10270, 270, @"tile636", @"Supermask's Mask", @"スーパーマスク", @"Máscara de Supermáscara", @"Super maschera", @"Maske von Supermaske", @"Masque de Supermasque", @"超級面具", @"超级面具", @"A replica of the wrestling mask worn by Supermask, king of aerial combat! Wear this and (it'll feel like) you can fly!", @"空中戦を得意とする覆面レスラー\nスーパーマスクのレプリカ\nこれをかぶれば空が飛べる！　…ような気がする", @"Réplica de la máscara de luchador de Supermáscara, el rey del combate aéreo. ¡Póntela y volarás! (Al menos te lo parecerá).", @"La replica della maschera da wrestling indossata da Supermaschera, re dei combattimenti aerei! Indossala e (praticamente) spiccherai il volo!", @"Eine Replik der Wrestling-Maske von Supermaske, dem König der Luftakrobatik! Wenn du das trägst, kannst du fliegen (na ja, zumindest fühlt es sich so an)!", @"Une réplique du masque de lutte porté par Supermask, le roi du combat aérien ! Avec lui, vous aurez l'impression de savoir voler !", @"擅長空中戰鬥的蒙面摔角手\n超級面具人的面具複製品，\n戴上這張面具之後（感覺好像）就能飛上天！", @"擅长空中战斗的蒙面摔角手\n超级面具人的面具复制品 \n戴上这张面具之后，\n感觉好像就能飞上天！") },
            { 10271, new TwewyItem(10271, 271, @"tile637", @"Ninja Garb", @"忍びの衣", @"Traje de ninja", @"Vestito da ninja", @"Ninja-Anzug", @"Costume de ninja", @"忍者服", @"忍者服", @"The favored fashion among ninja assassins, roomy enough to allow for a host of techniques. Most Japanese wear them every Tuesday.", @"ある忍者が愛用していた装束\n忍者とは闇に忍び、闇を斬る日本古来の暗殺者\nさまざまな術を使い敵を討ったといわれる", @"Prenda preferida por los asesinos ninja. Es tan holgada que permite la ejecución de una variedad de llaves. La mayoría de los japoneses lo llevan los martes.", @"La moda più in voga tra gli assassini ninja, abbastanza ampia da consentire di mettere in pratica numerose tecniche di combattimento. La maggior parte dei giapponesi la indossa di martedì.", @"Äußerst angesagt bei Ninja-Assassinen und geräumig genug für eine Vielzahl von Techniken. Die meisten Japaner tragen so etwas jeden Dienstag.", @"La tenue préférée des assassins ninjas, assez ample pour effectuer une tonne de mouvements techniques. La plupart des Japonais portent ça tous les mardis.", @"某忍者喜愛的裝扮，\n據傳忍者是日本自古以來的刺客，\n藏身於黑暗，討伐黑暗，\n使用各種忍術打倒敵人。", @"某忍者喜爱的装扮，\n据传忍者是日本自古以来的刺客，\n藏身于黑暗，讨伐黑暗，\n使用各种忍术打倒敌人。") },
            { 10272, new TwewyItem(10272, 272, @"tile638", @"Samurai Helm", @"侍のかぶと", @"Casco de samurái", @"Elmo da samurai", @"Samurai-Helm", @"Heaume de samouraï", @"武士頭盔", @"武士头盔", @"The lacquered helm of a legendary warrior, etched by a master armorer. Strong enough to withstand a thousand blows...if you can lift it.", @"ある武将が愛用していたとつたわる伝説のカブト\n美しい装飾から武具師の熱いたましいを感じる\nあらゆる攻撃に耐えられるが、意外と重い", @"Casco laqueado de un guerrero legendario, grabado por un experto armero. Es tan resistente que soporta un millar de golpes... si consigues levantarlo.", @"L'elmo laccato di un guerriero leggendario, intagliato da un mastro armaiolo. Abbastanza duro da poter resistere a migliaia di colpi... sempre se riesci a sollevarlo.", @"Dieser lackierte Helm eines legendären Kriegers wurde von einem Meister der Rüstungsschmiedekunst graviert. Er widersteht tausend Schlägen ... sofern du stark genug bist, ihn zu tragen.", @"Le heaume laqué d'un guerrier légendaire, gravé par un maître armurier. Assez robuste pour résister à un millier de coups... si vous arrivez à le soulever.", @"傳說中某位武將愛用的傳說頭盔，\n能從美麗的裝飾感受到製造者的熱誠，\n雖然能夠抵擋各種攻擊，卻意外地很重。", @"传说中某位武将爱用的传说头盔 \n能从美丽的装饰感受到制造者的热诚，\n虽然能够抵挡各种攻击，却意外地很重。") },
            { 10273, new TwewyItem(10273, 273, @"tile639", @"Samurai Armor", @"侍のよろい", @"Armadura de samurái", @"Armatura da samurai", @"Samurai-Rüstung", @"Armure de samouraï", @"武士盔甲", @"武士盔甲", @"The plated mail of a legendary warrior, crafted lovingly by a master armorer. Strong enough to withstand a thousand blows, and light as can be!", @"ある武将が愛用していたとつたわる伝説のヨロイ\n美しい装飾から武具師の熱いたましいを感じる\nあらゆる攻撃に耐えられるうえ、見た目より軽い", @"Malla chapada de un guerrero legendario, fabricada con el cariño de un experto armero. Es tan resistente que soporta un millar de golpes y tan ligera como la que más.", @"La maglia corazzata di un guerriero leggendario, amorevolmente creata da un mastro armaiolo. Abbastanza dura da poter resistere a migliaia di colpi, e leggera come l'aria!", @"Diese Plattenrüstung eines legendären Kriegers wurde liebevoll von einem Meister der Rüstungsschmiedekunst angefertigt. Sie widersteht tausend Schlägen und ist dabei unglaublich leicht!", @"La cotte de mailles d'un guerrier légendaire, fabriquée avec amour par un maître armurier. Assez robuste pour résister à un millier de coups et légère comme une plume !", @"傳說中某位武將愛用的傳說盔甲，\n能從美麗的裝飾感受到製造者的熱誠，\n不但能夠抵擋各種攻擊，還比外觀看起來更輕。", @"传说中某位武将爱用的传说盔甲 \n能从美丽的装饰感受到制造者的热诚，\n不但能够抵挡各种攻击，还比外观看起来更轻。") },
            { 10274, new TwewyItem(10274, 274, @"tile640", @"Fan of the Rising Sun", @"日の出の扇", @"Abanico del sol naciente", @"Ventaglio sole nascente", @"Fächer des Sonnenaufgangs", @"Éventail du soleil levant", @"日出圖樣的扇子", @"日出图样的扇子", @"The silken fan of a legendary warrior, painstakingly embroidered by a master artisan. Its kind sees use in Butoh dance and Noh theater.", @"ある武将が愛用していたとつたわる伝説の扇\n美しい装飾から職人の熱いたましいを感じる\n日本舞踊や能楽で使用されている由緒正しい一品", @"Abanico de seda de un guerrero legendario, bordado con gran esfuerzo por un maestro artesano. Se utiliza en la danza Butoh y el teatro Noh.", @"Il ventaglio di seta di un guerriero leggendario, scrupolosamente ricamato da un mastro artigiano. Questo tipo di ventagli si usa nella danza Butoh e nel teatro Noh.", @"Dieser seidene Fächer eines legendären Kriegers wurde in mühsamer Kleinarbeit von einem Meister bestickt. Wird verwendet im Butoh-Tanztheater und im Nō.", @"L'éventail en soie d'un guerrier légendaire, brodé minutieusement par un maître artisan. On utilise ce genre d'éventails dans la danse butō et le théâtre nô.", @"傳說中某位武將愛用的傳說之扇，\n能從美麗的裝飾感受到行家的熱誠，\n使用於日本舞蹈與能樂的正統道具。", @"传说中某位武将爱用的传说之扇 \n能从美丽的装饰感受到行家的热诚，\n使用于日本舞蹈与能乐的正统道具。") },
            { 10275, new TwewyItem(10275, 275, @"tile641", @"Samurai Sword", @"侍のかたな", @"Espada de samurái", @"Spada da samurai", @"Samurai-Schwert", @"Épée de samouraï", @"武士刀", @"武士刀", @"The keen katana of a legendary warrior, whet diligently by a master smith. It was the sharpest blade on the planet...until it got all dull.", @"ある武将が愛用していたとつたわる伝説の刀\n美しい装飾から武具師の熱いたましいを感じる\nしかし、今や切れ味はまったく期待できない", @"Ferviente katana de un guerrero legendario, afilada diligentemente por un maestro herrero. Era la espada más afilada del planeta, hasta que se desgastó.", @"La katana tagliente di un leggendario guerriero, affilata diligentemente da un mastro fabbro. Era la lama più affilata del pianeta... finché non si è smussata.", @"Dieses scharfe Katana eines legendären Kriegers wurde sorgfältig von einem Meisterschmied geschliffen. Es war die schärfste Klinge der\nWelt ... bis es stumpf wurde.", @"Le katana tranchant d'un guerrier légendaire, affûté par un maître forgeron. C'était la lame la plus aiguisée de la planète... jusqu'à ce qu'elle s'émousse.", @"傳說中某位武將愛用的傳說之刀，\n能從美麗的裝飾感受到製造者的熱誠，\n不過現在已經完鈍掉了。", @"传说中某位武将爱用的传说之刀 \n能从美丽的装饰感受到制造者的热诚，\n不过现在已经完钝掉了。") },
            { 10276, new TwewyItem(10276, 276, @"tile642", @"Solid Slammer", @"マーブルギア", @"Superatizador", @"Solid Slammer", @"Solider Slammer", @"Slammer solide", @"徽章發射器", @"徽章发射器", @"Before setting up shop at Ramen Don, Ken Doi developed toys. Just strap this on, and (it'll feel like) you're a Tin Pin titan!", @"らあめん　どん店主が脱サラ前に開発したおもちゃ\nこれを着けてマブスラをすれば強くなる！！\n…気がする", @"Antes de abrir el Ramen Don, Ken Doi fabricaba juguetes. ¡Ponte este y serás un titán del Tin Pin! (Al menos te lo parecerá).", @"Prima di aprire i battenti del Ramen Don, Ken Doi costruiva giocattoli. Allacciatelo e diventerai (quasi come) un titano del Tin Pin!", @"Bevor er das Ramen Don aufmachte, entwickelte Ken Doi Spielsachen. Schnall dir das hier um, und du wirst zum Tin-Pin-Titanen (na ja, zumindest fühlt es sich so an)!", @"Avant de créer son restaurant de Ramen Don, Ken Doi était fabriquant de jouets. Enfilez ça et vous aurez l'impression d'être un titan de\nTin Pin !", @"拉麵DON的店長在辭掉原本工作之前\n開發的玩具，戴上這個之後，\n（感覺）遊玩激鬥徽章時就會變強！！", @"拉面DON的店长在辞掉原本工作之前开发的玩具 \n戴上这个之后，\n（感觉）更擅长激撞徽章了！！") },
            { 10277, new TwewyItem(10277, 277, @"tile643", @"False Teeth", @"いれば", @"Dentadura postiza", @"Dentiera", @"Falsche Zähne", @"Fausses dents", @"假牙", @"假牙", @"Someone seems to have forgotten these. Surely the poor soul is wandering Shibuya at this very moment with a gnawing problem...", @"どなたかの忘れ物\n今頃この渋谷のどこかで困っている人が\nいるのかもしれない…", @"Parece que alguien se la dejó olvidada. El pobre diablo debe de estar recorriendo ahora Shibuya con serios problemas para masticar.", @"Mi sa che qualcuno se l'è dimenticata. Di certo quel poveretto starà andando in giro per Shibuya con un serio problema di masticazione...", @"Die hat wohl jemand vergessen. Wahrscheinlich wandert die arme Seele gerade mit einem nagenden Problem durch Shibuya ...", @"Quelqu'un semble les avoir oubliées là. Le malheureux doit être en train de traîner dans Shibuya en ce moment-même en se rongeant les sangs...", @"某個人的遺失物，\n現在澀谷的某處\n或許有人正因此頭痛不已……", @"某个人的遗失物 \n现在涩谷的某处，\n或许有人正因此头痛不已……") },
            { 10278, new TwewyItem(10278, 278, @"tile593", @"Lucky Mallet", @"うちでのこづち", @"Mazo de la fortuna", @"Mazza fortunata", @"Glückshammer", @"Maillet porte-bonheur", @"打出小槌", @"打出小槌", @"The miniature golden hammer of Muromachi-period legends that lets you change your height at will. Perfect for short folks!", @"室町時代から伝わる金のうちでのこづち\nこれを振れば身長が自在にのびちぢみ\n身長コンプレックスが解決！…できればいいのに", @"Cuenta la leyenda que el martillo dorado en miniatura del período Muromachi te permite cambiar de altura a voluntad. Es ideal para la gente de escasa estatura.", @"La miniatura del martello d'oro risalente alle leggende del periodo Muromachi, che ti fa cambiare statura a comando. Perfetto per la gente bassa!", @"Der goldene Miniaturhammer der Legenden aus der Muromachi-Zeit, mit dem man seine Größe nach Belieben verändern kann. Perfekt für kleine Leute!", @"Un marteau doré miniature issu des légendes de l'époque de Muromachi qui vous permettra de changer de taille à votre gré. Parfait pour les rase-mottes !", @"從室町時代流傳下來的金色萬寶槌，\n揮動這個槌子就能自由變高變矮，\n解決對身高的自卑情節！……真是這樣就好了。", @"从室町时代流传下来的金色万宝槌 \n挥动这个槌子就能自由变高变矮，\n解决对身高的自卑情节！……真是这样就好了。") },
            { 10279, new TwewyItem(10279, 279, @"tile565", @"Mr. Ducky", @"あひるちゃん", @"Sr. Patito", @"Sig. Papero", @"Quietscheente", @"M. Coin-coin", @"小鴨鴨", @"小鸭鸭", @"Set this herbal-scented ducky in the tub, and it starts singin' and swimmin' around. Bath time was never this much fun!", @"お風呂にうかべると歌いながら泳ぎだす\nハーブの香りつき、あひるちゃん\nこれさえあればバスタイムも楽しく過ごせる", @"Si metes este patito con aroma de hierbas en la bañera, se pondrá a cantar y a nadar. ¡La hora del baño nunca había sido tan divertida!", @"Metti questa paperella all'aroma di erbe nella vasca da bagno e comincerà a cantare e a sguazzarti attorno. L'ora nel bagno non è mai stata così divertente!", @"Setze dieses Entchen mit Kräuterduft in die Wanne, und schon fängt es an, zu singen und herumzuschwimmen. Baden hat noch nie so viel Spaß gemacht!", @"Mettez ce petit canard parfumé dans votre baignoire et il se mettra à chanter en pataugeant. L'heure du bain n'aura jamais été aussi amusante !", @"放進浴缸裡就會邊唱歌邊游泳，\n帶有香草香氣的小鴨鴨，\n有了它就能度過愉快的洗澡時光。", @"放进浴缸里就会边唱歌边游泳 \n带有香草香气的小鸭鸭，\n有了它就能度过愉快的洗澡时光。") },
            { 20000, new TwewyItem(20000, 0, @"tile537", @"Hamburger", @"ハンバーガー", @"Hamburguesa", @"Hamburger", @"Hamburger", @"Hamburger", @"漢堡", @"汉堡", @"A regular hamburger. Nothing special, but who can complain?", @"定番のハンバーガー\nリーズナブルでちょうどいいボリューム\nプレーンなおいしさ", @"Hamburguesa corriente y moliente, nada del otro mundo, pero no nos podemos quejar.", @"Un normale hamburger. Niente di speciale, ma chi può lamentarsi?", @"Ein ganz normaler Hamburger. Nichts Besonderes, aber was gibt es daran auszusetzen?", @"Un hamburger normal. Il n'a rien de spécial,\net alors ?", @"經典漢堡\n價格便宜份量又適中\n平凡的美味。", @"经典汉堡\n价格便宜，份量又适中，\n平凡的美味。") },
            { 20001, new TwewyItem(20001, 1, @"tile509", @"Double Burger", @"ダブルバーガー", @"Hamburguesa doble", @"Hamburger doppio", @"Doppelburger", @"Double burger", @"雙層漢堡", @"双层汉堡", @"Two mouthwateringly juicy patties on a sesame-seed bun. This delectable burger is enough to sate the hungriest of men.", @"ボリューム満点のダブルバーガー\nジューシーなハンバーグを２枚はさんだ\nおなかいっぱいになれる人気メニュー", @"Dos jugosas hamburguesas con pan de sésamo. Esta carne deliciosa basta para saciar a la persona más hambrienta.", @"Due hamburger succosi e invitanti racchiusi in un panino al sesamo. Questo piatto squisito riesce a saziare il più affamato degli uomini.", @"Zwei schmackhaft-saftige Fleischbratlinge in einem Sesambrötchen. Dieser leckere Burger macht selbst die hungrigsten Männer satt.", @"Deux steaks hachés délicieusement juteux sur un pain aux graines de sésame. Ce délicieux hamburger suffit à rassasier les plus affamés.", @"重量級的雙層漢堡\n夾了２片多汁的漢堡肉\n能吃得很飽的人氣餐點。", @"重量级的双层汉堡\n夹了2片多汁的汉堡肉，\n能吃得很饱的人气餐点。") },
            { 20002, new TwewyItem(20002, 2, @"tile481", @"French Fries", @"ポテトフライ", @"Patatas fritas", @"Patatine fritte", @"Pommes frites", @"Frites", @"薯條", @"薯条", @"Thin-cut potatoes, lightly salted and fried to a golden brown. Forget about calories--these are worth the weight.", @"揚げたてあつあつのポテトフライ\n塩をふった揚げたてはひとくち食べたら\n止まらないおいしさ", @"Patatas cortadas a tiras finas, ligeramente saladas y fritas a la perfección. Olvídate de las calorías, esto no hay que perdérselo.", @"Patate tagliate fini, leggermente salate e dorate nell'olio. Dimenticate le calorie, queste valgono tutti i chili che prenderete.", @"Dünn geschnittene Kartoffeln mit etwas Salz, goldbraun frittiert. Vergiss die Kalorien – diese Pommes sind die zusätzlichen Pfunde wert.", @"Des pommes de terre finement coupées, salées et parfaitement dorées. Oubliez les calories... ça vaut son pesant de gras.", @"剛炸好還熱呼呼的薯條\n一炸好就撒上鹽的薯條\n好吃到停不下來。", @"刚炸好还热呼呼的薯条\n一炸好就撒上盐的薯条，\n好吃到停不下来。") },
            { 20003, new TwewyItem(20003, 3, @"tile453", @"Hot Dog", @"ホットドッグ", @"Perrito caliente", @"Hot Dog", @"Hotdog", @"Hot-dog", @"熱狗堡", @"热狗堡", @"A juicy frankfurter jutting out of a freshly-baked bun. Sometimes the simplest foods can be the best.", @"シンプルでおいしいホットドッグ\nジューシーなソーセージがパンから\nとびでるほどのボリューム", @"Jugosa salchicha que sobresale en un panecillo recién horneado. A veces la comida más sencilla es la mejor.", @"Un succoso wurstel che sporge da un panino appena sfornato. A volte il cibo più semplice è anche il migliore.", @"Eine saftige Frankfurter in einem frisch gebackenen Brötchen. Manchmal ist das einfachste Essen das beste.", @"Une saucisse juteuse dépassant d'un pain à hot-dog fraîchement cuit. Parfois, les plats les plus simples sont les meilleurs.", @"樸實又好吃的熱狗堡\n多汁又飽滿的大熱狗\n連麵包都快夾不住了。", @"朴实又好吃的热狗堡\n多汁又饱满的大热狗，\n连面包都快夹不住了。") },
            { 20004, new TwewyItem(20004, 4, @"tile425", @"Special Dog", @"スペシャルドッグ", @"Perrito especial", @"Hot Dog speciale", @"Hotdog Spezial", @"Hot-dog spécial", @"特製熱狗堡", @"特制热狗堡", @"A hot dog loaded with melted cheddar, relish, and ketchup for a colorful meal that's a feast for the eyes.", @"チーズたっぷりのスペシャルドッグ\nソーセージの上に風味豊かなチーズを\nたっぷりのせて栄養もバツグン", @"Perrito caliente acompañado de queso cheddar fundido, salsa de pepinillos y kétchup: todo un abanico de colores para el deleite de tus sentidos.", @"Un hot dog ripieno di cheddar fuso, salsa ai sottaceti e ketchup per un pasto colorato che è una gioia per gli occhi.", @"Ein mit geschmolzenem Cheddar, Relish und Ketchup beladener Hotdog ergibt eine farbenfrohe Mahlzeit, die auch das Auge anspricht.", @"Un hot-dog blindé de cheddar fondu, de condiments et de ketchup pour un repas coloré qui régalera le ventre et les yeux.", @"放滿起司的特製熱狗堡\n熱狗上放滿滋味豐富的起司\n非常營養。", @"放满起司的特制热狗堡\n热狗上放满滋味丰富的起司，\n非常营养。") },
            { 20005, new TwewyItem(20005, 5, @"tile397", @"Donuts", @"ドーナツ", @"Dónuts", @"Ciambelle", @"Donuts", @"Donuts", @"甜甜圈", @"甜甜圈", @"Old-fashioned donuts. Crisp and not too sweet, these tasty morsels are perfect for a snack.", @"風味豊かな手作りドーナツ\n生地の自然な甘みとサクサクの食感がポイント\n小腹がすいたときにうれしいボリューム", @"Dónuts de toda la vida. En su justa medida de azúcar, estos sabrosos bocados son la merienda perfecta.", @"Ciambelle classiche. Croccanti e non troppo dolci: questi bocconi appetitosi sono perfetti per la merenda.", @"Gute alte Donuts, frisch und nicht zu süß. Damit sind diese Leckerbissen der perfekte Snack für zwischendurch!", @"Un bon vieux donut. Croustillante et pas trop sucrée, cette délicieuse pâtisserie est idéale pour un encas.", @"滋味豐富的手工甜甜圈\n麵團的自然甜味與酥脆口感是最大賣點\n在有點餓的時候吃分量剛剛好。", @"滋味丰富的手工甜甜圈\n面团的自然甜味与酥脆口感是最大卖点，\n在有点饿的时候吃分量刚刚好。") },
            { 20006, new TwewyItem(20006, 6, @"tile369", @"Muffin Set", @"マフィンセット", @"Magdalenas", @"Set di muffin", @"Muffin-Duo", @"Assortiment de muffins", @"馬芬組合", @"马芬组合", @"Plain and chocolate chip muffins, paired together for maximum variety. They're more filling than they look!", @"プレーンマフィンとチョコマフィンのセット\nふたつの味が飽きを感じさせない\n見た目よりも意外とボリュームがある", @"Magdalenas básicas y con pepitas de chocolate, pues en la variedad está el gusto. ¡Llenan más de lo que parece!", @"Muffin semplici e con pezzetti di cioccolato, per il massimo della varietà. E riempiono di più di quanto non sembri!", @"Zwei Muffins in verschiedenen Geschmacksrichtungen – einmal mit und einmal ohne Schokostückchen. Sättigender, als sie aussehen!", @"Des muffins simples et aux pépites de chocolat, réunis pour plus de variété. Ils rassasient plus qu'ils n'en ont l'air !", @"原味馬芬與巧克力馬芬的組合\n兩種滋味令人吃不膩\n看起來小但分量很足。", @"原味马芬与巧克力马芬的组合\n两种滋味令人吃不腻，\n看起来小但分量很足。") },
            { 20007, new TwewyItem(20007, 7, @"tile341", @"Nuggets", @"ナゲット", @"Nuggets", @"Crocchette", @"Nuggets", @"Nuggets", @"雞塊", @"鸡块", @"Five-piece chicken nuggets. Every succulent bite offers an explosion of chickeny goodness that'll make you wish you had six.", @"揚げたてのナゲット５個入り\nサクサクのナゲットからジュワっとあふれだす\nジューシーな肉汁がおいしい", @"Cinco piezas de pollo rebozado. Cada bocado suculento provoca una explosión de excelencia aviar que te hará desear haber pedido seis.", @"Cinque crocchette di pollo. Ogni morso succulento sprigiona un'esplosione di bontà che vi farà desiderare di averne una sesta.", @"Fünf Chicken-Nuggets. Jeder Biss in das saftige Hühnchen bietet eine Geschmacksexplosion, die dich wünschen lässt, du hättest sechs.", @"5 nuggets de poulet. Chaque bouchée succulente offre une explosion de saveurs de poulet qui vous fera regretter de ne pas en avoir six.", @"放了剛炸好的５塊雞塊\n從香脆雞塊中流瀉出的豐沛肉汁\n真是美味極了。", @"放了刚炸好的5块鸡块\n从香脆鸡块中流泻出的丰沛肉汁，\n真是美味极了。") },
            { 20008, new TwewyItem(20008, 8, @"tile313", @"Salad", @"サラダ", @"Ensalada", @"Insalata", @"Salat", @"Salade", @"沙拉", @"沙拉", @"Crisp lettuce combined with a variety of colorful garden vegetables for a healthy, yet tasty, alternative.", @"フレッシュサラダ\nシャキシャキのレタスをはじめ、色とりどりの\n野菜がたっぷりとれるヘルシーメニュー", @"Lechuga tersa combinada con otras verduras de colores para formar una alternativa saludable a la par que sabrosa.", @"Lattuga croccante combinata con tante verdure fresche e colorate, per un'alternativa gustosa e salutare.", @"Dieser knackige Kopfsalat mit einer Auswahl an farbenfrohem Gartengemüse ist eine gesunde und zugleich leckere Alternative.", @"Une laitue croustillante associée à divers légumes du jardin de toutes les couleurs pour une alternative plus saine, mais tout aussi délicieuse.", @"新鮮沙拉\n可以吃到清脆的萵苣等\n五彩繽紛蔬菜的健康菜色。", @"新鲜沙拉\n可以吃到清脆的莴苣等，\n五彩缤纷蔬菜的健康餐点。") },
            { 20009, new TwewyItem(20009, 9, @"tile285", @"\x22Tatsumi\x22 Burger", @"幻のバーガー【竜味】", @"Hamburguesa «Tatsumi»", @"Hamburger \x22Tatsumi\x22", @"\x22Tatsumi\x22-Burger", @"Burger \x22Tatsumi\x22", @"夢幻漢堡【龍風味】", @"梦幻汉堡【龙风味】", @"The ultimate burger, made with only the finest ingredients. Even the pickiest of foodies will shut up and chow down.", @"素材はすべて高級品をチョイスした\nこだわりの高級ハンバーガー\nあらゆる食通を満足させるおいしさ", @"La hamburguesa por excelencia, hecha solo con los mejores ingredientes. Hará comer y callar hasta a los más exigentes comidistas.", @"L'hamburger supremo, preparato solo con i migliori ingredienti. Anche i più esigenti in fatto di cibo terranno la bocca chiusa... e masticheranno.", @"Der ultimative Burger aus den feinsten Zutaten. Selbst die wählerischsten Feinschmecker werden ihn ohne zu Meckern verdrücken.", @"Le hamburger ultime, fait avec les meilleurs ingrédients. Même les plus difficiles mordront dedans sans faire de commentaires.", @"十分講究的高級漢堡\n所用的材料都是特選的高級品\n美味程度足以滿足任何饕客的味蕾。", @"十分讲究的高级汉堡\n所用的材料都是特选的高级品，\n美味程度足以满足任何饕客的味蕾。") },
            { 20010, new TwewyItem(20010, 10, @"tile257", @"Definitivo Chili Dog", @"プレミアムチリドッグ", @"Perrito picante «Órale»", @"Hot Dog piccante extralusso", @"Definitivo-Chilidog", @"Hot-dog épicé Definitivo", @"特級辣醬熱狗堡", @"特级辣酱热狗堡", @"An extra-select frank made with only top-quality ingredients. It all comes down to the chili.", @"素材はすべて高級品をチョイスした\nこだわりの高級ホットドッグ\nあらゆる食通を満足させるおいしさ", @"Selecta salchicha alemana hecha con ingredientes de primera calidad. El secreto está en el chili.", @"Un wurstel extra selezionato con soli ingredienti di ottima qualità. Il vero segreto è il peperoncino.", @"Eine speziell ausgewählte Frankfurter, die nur mit den besten Zutaten zubereitet wird. Den entscheidenden Unterschied macht die Chilisoße.", @"Une saucisse de Francfort supérieure, fabriquée avec des ingrédients de première qualité. C'est le piment qui fait tout.", @"十分講究的高級熱狗堡\n所有的材料都是特選的高級品\n美味程度足以滿足任何饕客的味蕾。", @"十分讲究的高级热狗堡\n所有的材料都是特选的高级品，\n美味程度足以满足任何饕客的味蕾。") },
            { 20011, new TwewyItem(20011, 11, @"tile229", @"Cola", @"コーラ", @"Cola", @"Bibita", @"Cola", @"Cola", @"可樂", @"可乐", @"Frosty, fizzy, and fun, this classic quencher packs the refreshing power of the kola nut!", @"独特の風味と、のどにはじける刺激がたまらない\n１杯で心も体もリフレッシュできる", @"Fría, espumosa y divertida, esta clásica bebida tiene el poder refrescante de la nuez de cola.", @"Gelida, frizzante e divertente... questa classica bibita dissetante detiene il potere rinfrescante della cola!", @"Eiskalt, sprudelnd und unterhaltsam – dieser klassische Durstlöscher erfrischt mit der geballten Kraft der Kolanuss!", @"Glacée, pétillante et amusante, cette boisson classique renferme toute la puissance rafraîchissante de la noix de kola !", @"無人可以抵擋這獨特風味\n與在喉嚨爆發的刺激感\n喝下１杯就能讓身心煥然一新。", @"无人可以抵挡这独特风味\n与在喉咙爆发的刺激感，\n喝下1杯就能让身心焕然一新。") },
            { 20012, new TwewyItem(20012, 12, @"tile201", @"OJ", @"オレンジジュース", @"Zumo", @"Succo d'arancia", @"O-Saft", @"Jus d'orange", @"柳橙汁", @"柳橙汁", @"All-natural 100% orange juice. Fresh, full, citrusy flavor granted by the twin blessings of the earth and sun.", @"果汁１００％のオレンジジュース\n大地と太陽の恵みをたっぷり受けたオレンジを使用\nナチュラルでさっぱりとした味わい", @"Zumo de naranja 100 % natural. Su sabor refrescante, intenso y cítrico es un don bendito de la tierra y el sol.", @"Puro succo d'arancia. Il suo sapore fresco, intenso e agrumato è dovuto alle due meraviglie della terra e del sole.", @"100 % Orangensaft. Sein frisches und vollmundiges Zitrusfruchtaroma ist eine Gabe von Erde und Sonne.", @"100 % jus d'orange. Un bon goût d'agrumes frais produit par l'action combinée de la terre et du soleil.", @"１００％果汁的柳橙汁\n使用的是充分獲得大地與太陽恩惠的柳橙\n風味自然又輕爽。", @"100%果汁的柳橙汁\n使用的是充分获得大地与太阳恩惠的柳橙，\n风味自然又轻爽。") },
            { 20013, new TwewyItem(20013, 13, @"tile173", @"Coffee", @"コーヒー", @"Café", @"Caffè", @"Kaffee", @"Café", @"咖啡", @"咖啡", @"A dark, smoky flavor punctuates this smooth black coffee.", @"口あたりまろやかな仕上がりで\n気軽に飲めるコーヒー", @"El prominente sabor tostado de este café acentúa su oscura suavidad.", @"Il sapore scuro e affumicato caratterizza questo caffè nero.", @"Diesen milden, schwarzen Kaffee akzentuiert ein dunkles, rauchiges Aroma.", @"Ce café noir délicieux est relevé par un arôme sombre et fumé.", @"呈現出圓潤口感的咖啡\n喝起來毫無負擔。", @"呈现出圆润口感的咖啡，\n喝起来毫无负担。") },
            { 20014, new TwewyItem(20014, 14, @"tile145", @"House Blend", @"ブレンドコーヒー", @"Mezcla de la casa", @"Mix della casa", @"Hausmischung", @"Café maison", @"綜合咖啡", @"综合咖啡", @"Only the finest beans were selected for this drip coffee; the aroma is almost as invigorating as the flavor.", @"厳選された香り高いドリップコーヒー\n１日中楽しめるバランスの良い味わい ", @"Este café de filtro está elaborado con los mejores granos; su aroma es casi tan estimulante como su sabor.", @"Per questo caffè americano sono stati scelti i chicchi migliori, e l'aroma è corroborante quasi quanto il sapore.", @"Für diesen Filterkaffee wurden nur die feinsten Bohnen ausgewählt. Sein Duft ist fast so anregend wie sein Geschmack.", @"Seuls les meilleurs grains ont été sélectionnés pour ce café filtre. L'arôme est presque aussi tonifiant que le goût.", @"香味迷人的嚴選濾泡式咖啡\n那均衡的風味足以享受一整天。", @"香味迷人的严选滤泡式咖啡\n那均衡的风味足以享受一整天。") },
            { 20015, new TwewyItem(20015, 15, @"tile117", @"Minestrone", @"ミネストローネ", @"Minestrone", @"Minestrone", @"Minestrone", @"Minestrone", @"義大利雜菜湯", @"意大利杂菜汤", @"Piping hot minestrone. Packed with fresh-cut vegetables, this soup is both healthy and filling.", @"あつあつのミネストローネ\nざっくりと切った野菜が歯ごたえバツグン\n栄養満点の具だくさんスープ", @"Esta sopa minestrone supercaliente con verduras frescas resulta saludable y sustanciosa.", @"Minestrone fumante. Questa zuppa, preparata con le verdure più fresche, è tanto salutare quanto saziante.", @"Eine dampfend heiße Minestrone, reich an erntefrischem Gemüse. Sie ist nicht nur gesund, sondern macht auch satt!", @"Un minestrone bien chaud. Fabriquée à partir de légumes fraîchement cueillis, cette soupe est aussi saine que délicieuse.", @"燙口的義大利雜菜湯\n大略切碎的蔬菜口感超群\n料多又營養滿點的一道湯品。", @"烫口的意大利杂菜汤\n粗略切碎的蔬菜口感超群，\n料多又营养满点的一道汤品。") },
            { 20016, new TwewyItem(20016, 16, @"tile089", @"Corn Chowder", @"コーンポタージュ", @"Sopa de maíz", @"Zuppa di mais", @"Dicke Maissuppe", @"Velouté de maïs", @"玉米濃湯", @"玉米浓汤", @"Piping hot corn chowder. A thick, rich blend of corn, cream, and butter.", @"あつあつのコーンポタージュスープ\nとうもろこしをたっぷり使ったまろやかで\nコクのあるスープ", @"Sopa de maíz supercaliente. Una espesa e intensa combinación de maíz, nata y mantequilla.", @"Zuppa al mais bollente. Una ricca e intensa fusione di mais, panna e burro.", @"Eine dampfend heiße, reichhaltige Suppe aus Mais, Sahne und Butter.", @"Un velouté de maïs bien chaud. Un mélange riche et épais de maïs, de crème et de beurre.", @"燙口的玉米濃湯\n使用了大量玉米\n口感圓潤滋味醇厚的一道湯品。", @"烫口的玉米浓汤\n使用了大量玉米，\n口感圆润滋味醇厚的一道汤品。") },
            { 20017, new TwewyItem(20017, 17, @"tile061", @"Bouillabaisse", @"ブイヤベース", @"Bullabesa", @"Bouillabaisse", @"Bouillabaisse", @"Bouillabaisse", @"馬賽魚湯", @"马赛鱼汤", @"A flavorful seafood stew. The delicious, rich broth is guaranteed to transport your palate to paradise.", @"新鮮な魚介がたっぷり入ったブイヤベース\nじっくり煮込んだまろやかな味は\n至福の境地にいたるおいしさ", @"Sabrosa sopa de pescados. Este intenso y delicioso guiso hará las delicias de tu paladar.", @"Uno stufato di pesce ricco di sapore. Questo brodo ricco e delizioso manderà in estasi il vostro palato.", @"Ein schmackhafter Meeresfrüchteeintopf. Diese köstliche, reichhaltige Brühe entführt deinen Gaumen garantiert ins Paradies.", @"Un ragoût de fruits de mer savoureux. Le bouillon riche et délicieux transportera votre palais vers le paradis.", @"加入了多種新鮮魚貝類的馬賽魚湯\n細火慢熬後的濃醇滋味\n美味到讓人進入至福的境界。", @"加入了多种新鲜鱼贝类的马赛鱼汤\n细火慢熬后的浓醇滋味，\n美味到让人进入至福的境界。") },
            { 20018, new TwewyItem(20018, 18, @"tile033", @"Pumpkin Soup", @"パンプキンスープ", @"Sopa de calabaza", @"Zuppa di zucca", @"Kürbissuppe", @"Soupe de potiron", @"南瓜湯", @"南瓜汤", @"A thick chowder kissed by the subtle sweetness of pumpkin. Nutritious and delicious.", @"かぼちゃの甘味を生かしたパンプキンスープ\n丁寧に裏ごしして仕上げているため\n味わい豊かで、栄養もたっぷり", @"Sopa espesa coronada con la dulce sutileza de la calabaza. Nutritiva y deliciosa.", @"Una zuppa cremosa, baciata dalla dolcezza sottile della zucca. Nutriente e squisita.", @"Eine dicke Suppe mit der zarten Süße von Kürbissen. Nahrhaft und köstlich.", @"Un velouté épais relevé par la douceur subtile de la citrouille. Nourrissant et délicieux.", @"充分發揮出南瓜甜味的南瓜湯\n製作時在過篩上有特別下過功夫\n因此滋味豐富也充滿營養。", @"充分发挥出南瓜甜味的南瓜汤\n制作时在过筛上有特别下过功夫，\n因此滋味丰富也充满营养。") },
            { 20019, new TwewyItem(20019, 19, @"tile005", @"Shoyu Ramen", @"しょうゆラーメン", @"Ramen shoyu", @"Ramen Shoyu", @"Shoyu-Ramen", @"Ramen sauce soja", @"醬油拉麵", @"酱油拉面", @"Noodles in a delicious soy sauce broth. An exercise in balance, the soup's flavor is deep yet not heavy, savory but not saline.", @"看板メニューのしょうゆラーメン\nコクがありながら、さっぱりとしたスープは\nこってり系とは別次元のおいしさ", @"Fideos con una deliciosa salsa de soja. En un auténtico ejercicio de equilibrio, el sabor de la sopa es intenso pero nada pesado, salado en su justa medida.", @"Noodle in un delizioso brodo di salsa di soia. Un virtuoso esempio di equilibrio, infatti questa zuppa non è troppo pesante; è saporita, ma non eccessivamente salata.", @"Nudeln in einer leckeren Sojasoßenbrühe. Diese Suppe zeichnet sich durch ihren ausgewogenen Geschmack aus: kräftig, aber nicht schwer, herzhaft, aber nicht salzig.", @"Des nouilles dans un bouillon à la sauce soja. Véritable exercice d'équilibre, l'arôme de cette soupe est profond sans être lourd, savoureux sans être trop salé.", @"本店招牌的醬油拉麵\n滋味醇厚喝起來卻很清爽\n在美味度上與濃厚系可說是各有千秋。", @"本店招牌餐点的酱油拉面\n滋味醇厚喝起来却很清爽的汤，\n在美味度上与浓厚系可说是各擅胜场。") },
            { 20020, new TwewyItem(20020, 20, @"tile594", @"Miso Ramen", @"みそラーメン", @"Ramen miso", @"Ramen Miso", @"Miso-Ramen", @"Ramen miso", @"味噌拉麵", @"味噌拉面", @"Noodles in miso broth, topped with veggies. Red and white miso were stewed for over thirty hours to create an unmistakably rich soup.", @"野菜がたっぷり入った味噌ラーメン\n赤味噌と白味噌をブレンドして３０時間かけた\nコクのあるスープがたまらない", @"Fideos con caldo de miso y aderezados con verduras. El miso rojo y blanco se ha guisado durante treinta horas para elaborar una sopa inconfundiblemente rica.", @"Noodle in brodo di miso ricoperti di verdure. Il miso rosso e verde sono stati stufati per oltre trenta ore per ottenere una zuppa inequivocabilmente corposa.", @"Nudeln in Miso-Brühe mit Gemüse. Rotes und weißes Miso wurde über 30 Stunden gedämpft, um eine unverwechselbare reichhaltige Suppe zu kreieren.", @"Des nouilles au bouillon miso et aux légumes. Le miso rouge et noir a mijoté pendant plus de trente heures pour créer une soupe d'une richesse indéniable.", @"加入大量蔬菜的味噌拉麵\n湯是混合紅味噌與白味噌並花費３０小時所製成\n醇厚風味令人難以抗拒。", @"加入大量蔬菜的味噌拉面\n汤是混合红味噌与白味噌并花费30小时所制成，\n醇厚风味令人难以抗拒。") },
            { 20021, new TwewyItem(20021, 21, @"tile595", @"Shio Ramen", @"しおラーメン", @"Ramen shio", @"Ramen Shio", @"Shio-Ramen", @"Ramen au bouillon", @"鹽味拉麵", @"盐味拉面", @"Noodles in a light, salty broth. The simple, unpretentious flavor will convince even the choosiest ramen nut.", @"さっぱりしたおいしさの塩ラーメン\nシンプルな味でごまかしがいっさいない\n通もナットクの味", @"Fideos con un suave caldo salado. Este sencillo sabor, sin pretensiones, convencerá hasta al más exigente fanático del ramen.", @"Noodle in un brodo leggero e salato. Il loro sapore semplice e poco pretenzioso convincerà anche il più esigente tra i fanatici di ramen.", @"Nudeln in einer leichten, salzigen Brühe. Der einfache und unkomplizierte Geschmack überzeugt selbst die wählerischsten Ramen-Fanatiker.", @"Des nouilles dans un bouillon léger et salé. Sa saveur simple et sans prétention va convaincre même les dingues de ramen les plus difficiles.", @"清爽又美味的鹽味拉麵\n不耍花招的樸素滋味\n是連專家都點頭的好味道。", @"清爽又美味的盐味拉面\n不耍花招的朴素滋味，\n是连专家都点头的好味道。") },
            { 20022, new TwewyItem(20022, 22, @"tile596", @"Tonkotsu Ramen", @"とんこつラーメン", @"Ramen tonkotsu", @"Ramen Tonkotsu", @"Tonkotsu-Ramen", @"Ramen Tonkotsu", @"豚骨拉麵", @"豚骨拉面", @"Noodles in a full-flavored pork bone broth. Hand-picked ham hocks and backfat provide an unexpectedly clean, crisp taste.", @"熟成スープが決め手の豚骨ラーメン\n厳選した豚骨と背脂を使用している\n意外なほどさっぱりした味わいに仕上げている", @"Fideos con una sopa de sabor intenso preparada con huesos de cerdo. El jamón de jarretes extraído a mano y la grasa del lomo le dan un sabor sorprendente y atrevido.", @"Noodle in un saporitissimo brodo di vertebre di maiale. I garretti e il grasso posteriore accuratamente scelti donano un sapore inaspettatamente intenso.", @"Nudeln in einer vollmundigen Schweinsknochenbrühe. Sorgfältig ausgewählte Schweinshaxen und erlesener Rückenspeck sorgen für einen unerwartet frischen und reinen Geschmack.", @"Des nouilles dans un bouillon parfumé aux os de porc. Des jarrets et de la couenne découpés à la main offrent une saveur étonnamment gouleyante et agréable.", @"豚骨拉麵就是以熟成高湯決勝負\n使用嚴選豚骨與背脂\n製作出的滋味意外地清爽。", @"豚骨拉面就是以熟成高汤决胜负\n使用严选豚骨与背脂，\n制作出的滋味意外地清爽。") },
            { 20023, new TwewyItem(20023, 23, @"tile597", @"Shadow Steak Ramen", @"暗黒ステーキラーメン", @"Ramen negro con carne", @"Shadow Ramen con Manzo", @"Shadow-Ramen mit Steak", @"Ramen au steak des ombres", @"暗黑牛排拉麵", @"暗黑牛排拉面", @"Shimmering black noodles topped with a decadent Yonezawa beef steak give this murky ramen a top-class flavor.", @"黒光りした麺　そしてスープ\n米沢牛を贅沢にトッピングした究極のラーメン\n極上の味わいをあなたに！", @"Fideos negros coronados con un suculento filete de ternera de Yonezawa; este ramen oscuro está para chuparse los dedos.", @"I noodle neri scintillanti guarniti con un'enorme bistecca di manzo di Yonezawa donano a questo ramen torbido un sapore di prima categoria.", @"Glänzende schwarze Nudeln mit dekadentem Yonezawa-Rindersteak geben dieser trüben Ramen-Suppe ein erstklassiges Aroma.", @"Des nouilles noires appétissantes recouvertes d'un bifteck Yonezawa gourmand qui donnent à ce ramen trouble un goût de première classe.", @"黑得發亮的麵與湯\n不計成本拿出米澤牛當配料的究極拉麵\n為您獻上至高的美味！", @"黑得发亮的面与汤\n不计成本拿出米泽牛当配料的究极拉面，\n为您献上至高的美味！") },
            { 20024, new TwewyItem(20024, 24, @"tile598", @"Mystic Ramen", @"秘伝のラーメン", @"Ramen místico", @"Ramen Mistico", @"Mystische Ramen", @"Ramen mystique", @"秘傳拉麵", @"秘传拉面", @"The result of countless hours of research, this is the ultimate ramen. One mouthful and no other noodles will ever compare.", @"らあめん　どん店主が研究に研究を重ね\nついに到達したラーメンの極致！\nその味わいはどんな食通をもうならせる！", @"El ramen definitivo, resultado de un sinfín de horas de investigación. En cuanto lo pruebes, no querrás ningún otro.", @"Questi sono i ramen supremi, risultato di innumerevoli ore di ricerca. Un solo boccone, e nessun altro ramen si rivelerà mai più all'altezza.", @"Diese ultimativen Ramen sind das Ergebnis unzähliger Stunden Forschungsarbeit. Schon nach einem Löffel können andere Nudeln einfach nicht mehr mithalten.", @"Le résultat d'un nombre incalculable d'heures de recherche a donné ce ramen ultime. Une bouchée, et vous ne voudrez plus manger d'autres nouilles que celles-ci.", @"拉麵DON的店長經過無數研究\n才終於達到了拉麵的頂點！\n這味道能讓任何饕客心服口服。", @"拉面DON的店长经过无数研究\n才终于达到了拉面的顶点！\n这味道能让任何饕客心服口服。") },
            { 20025, new TwewyItem(20025, 25, @"tile599", @"Absolute Shadow Ramen", @"真・暗黒ラーメン", @"Ramen cinco estrellas", @"Shadow Ramen Assoluto", @"Absolute Shadow-Ramen", @"Ramen des ombres absolu", @"真‧暗黑拉麵", @"真‧暗黑拉面", @"This treasure of the ramen world was born of a complete reimagining of the soup, its flavor both familiar and brand new.", @"ラーメンとはなんたるかを一から見直し\n店主がていねいに作り上げた逸品！\nどこかなつかしくも新しさを感じるラーメン", @"Este tesoro del universo ramen es el resultado de un completo replanteamiento de la sopa, con un sabor familiar y desconocido a la vez.", @"Questo fiore all'occhiello del mondo del ramen è nato per dare una concezione completamente nuova alla zuppa. Il suo sapore è tanto tradizionale quanto innovativo.", @"Diese kulinarische Kostbarkeit aus der Ramen-Küche ist das Ergebnis einer kompletten Neuerfindung der Suppe. Ihr Geschmack ist gleichzeitig vertraut und brandneu.", @"Ce trésor du monde des ramen est né d'une revisite complète de la soupe. Son arôme est à la fois familier et nouveau.", @"店長在從頭思索拉麵是什麼之後\n用心製作的極品！\n令人感到懷念卻又創新的拉麵。", @"店长在从头思索拉面是什么之后\n用心制作的极品！\n令人感到怀念却又创新的拉面。") },
            { 20026, new TwewyItem(20026, 26, @"tile600", @"Insta-noodles", @"カップめん", @"Fideos instantáneos", @"Noodle istantanei", @"Instant-Nudeln", @"Nouilles instantanées", @"泡麵", @"泡面", @"Enjoy the classic taste of Ramen Don anywhere. Just add water!", @"どん店主お気に入りのカップラーメン\n手軽に有名店の味わいが楽しめる\nラーメン通もナットクの味", @"Disfruta donde quieras del clásico sabor del Ramen Don. ¡Añade agua y listo!", @"Godetevi il gusto classico di Ramen Don ovunque andiate. Basta aggiungere un po' d'acqua!", @"Genieße überall den klassischen \x22Ramen Don\x22-Geschmack. Einfach Wasser dazugeben und fertig!", @"Régalez-vous avec le goût classique du Ramen Don, n'importe où. Il vous suffit d'y ajouter de l'eau !", @"DON店長愛吃的杯麵\n輕輕鬆鬆就能享用名店的口味\n是連拉麵專家都點頭的好味道。", @"DON店长爱吃的杯面\n轻轻松松就能享用名店的口味，\n是连拉面专家都点头的好味道。") },
            { 20027, new TwewyItem(20027, 27, @"tile601", @"HP Tablets", @"ＨＰ錠", @"Pastillas de PV", @"Pastiglie PF", @"LP-Tabletten", @"Comprimés de PV", @"ＨＰ錠", @"HP锭", @"A full day's worth of nutrients packed into one handy tablet. Perfect for folks looking for a healthy life in the fast lane.", @"１日の栄養素をバッチリ補給できるカプセル薬\nかたよりがちな現代人の栄養バランスを\nサポートしてくれる力強い味方！", @"Todos los nutrientes necesarios para un día concentrados en una práctica pastilla. Perfecto para la gente que quiere vivir a tope, pero de una manera sana.", @"Il fabbisogno di sostanze nutritive di un'intera giornata racchiuso in una comoda pastiglia. Perfetto per chi persegue una vita salutare e non ha un minuto da perdere.", @"Alle Nährstoffe für den Tag in einer praktischen Tablette. Perfekt für Leute auf der Überholspur, denen eine gesunde Lebensweise wichtig ist.", @"Un comprimé pratique qui renferme tous les nutriments recommandés d'une journée. Idéal pour ceux qui n'ont pas le temps mais veulent manger sainement.", @"能補充１天所需營養的膠囊\n對容易營養不均衡的現代人而言\n可說是最佳幫手！", @"能补充1天所需营养的胶囊\n对容易营养不均衡的现代人而言，\n可说是最佳帮手！") },
            { 20028, new TwewyItem(20028, 28, @"tile602", @"ATK Capsules", @"ＡＴＫカプセル", @"Cápsulas de ATQ", @"Pillole ATT", @"ANG-Kapseln", @"Capsules d'ATQ", @"ＡＴＫ膠囊", @"ATK胶囊", @"Rich in niacinamide, this unique blend encourages activity throughout the body's tissues, upping its natural supply of energy.", @"ニコチン酸アミドを豊富に含むカプセル薬\n身体機能の活性化を促進する効果があり\n平常時よりも身体能力があがる", @"Rica en niacinamida, esta combinación única fomenta la actividad por todos los tejidos del cuerpo, incrementando su aporte natural de energía.", @"Questa esclusiva miscela, ricca di niacinamide, favorisce l'attività di tutti i tessuti del corpo, aumentando il rifornimento naturale di energia.", @"Diese einzigartige, niacinamidreiche Mischung regt die Aktivität im ganzen Körpergewebe an und steigert so die natürliche Energieversorgung.", @"Riche en vitamine PP, ce mélange unique encourage l'activité de tous les tissus du corps en augmentant leur apport naturel en énergie.", @"富含菸鹼醯胺的膠囊\n有促進身體機能活化的效果\n讓運動能力變得比平常更好。", @"富含烟酰胺的胶囊\n有促进身体机能活化的效果，\n让运动能力变得比平常更好。") },
            { 20029, new TwewyItem(20029, 29, @"tile603", @"DEF Medicine", @"ＤＥＦメディシン", @"Medicina de DEF", @"Medicina DIF", @"VER-Medizin", @"Pilule de DÉF", @"ＤＥＦ藥", @"DEF药", @"This vitamin C supplement not only boosts the body's resistance to illness, but also wards off stress-induced fatigue.", @"豊富なビタミンＣを含んだカプセル薬\nこのカプセルを飲めば、抵抗力が強まり\nあらゆるストレスに負けない体になる", @"Este suplemento de vitamina C aumenta la resistencia del cuerpo frente a las enfermedades, además de proteger de la fatiga inducida por el estrés.", @"Questo supplemento di vitamina C non solo potenzia la resistenza del corpo contro le malattie, ma previene anche la fatica causata dallo stress.", @"Dieses Vitamin-C-Präparat verbessert nicht nur die Abwehrkräfte des Körpers, sondern hilft auch gegen stressbedingte Müdigkeit.", @"Ce complément de vitamine C, en plus d'augmenter la résistance du corps à la maladie, repousse la fatigue due au stress.", @"富含維他命Ｃ的膠囊\n吞下這膠囊抵抗力就會變強\n讓身體不會輸給任何壓力。", @"富含维他命C的胶囊\n吞下这胶囊抵抗力就会变强，\n让身体不会输给任何压力。") },
            { 20030, new TwewyItem(20030, 30, @"tile604", @"Sync Bar", @"ＳＹＮＣスティック", @"Sincrobarrita", @"Barretta sincronia", @"Synchro-Riegel", @"Barre de synchro", @"ＳＹＮＣ棒", @"SYNC棒", @"Every bar has been blessed by Japan's top spirit channeler. Eat one, and you'll be making friends without even trying.", @"日本でいちばん有名なチャネラー井原さんが\n１本１本に祈りをこめたサプリメント\nこれさえ飲めば誰とでも仲良くなれる", @"Todos los bares cuentan con el principal canalizador espiritual de Japón. Cómete uno y verás que harás amigos sin apenas esfuerzo.", @"Ogni barretta è stata benedetta dal più grande medium del Giappone. Mangiatene una, e stringerete amicizia senza neanche accorgervene.", @"Jeder Riegel wurde von Japans Top-Geistermedium gesegnet. Wenn du einen davon isst, wirst du Freundschaften schließen, ohne es auch nur zu versuchen.", @"Chaque barre a été bénie par un des meilleurs magnétiseurs du Japon. Mangez-en une et vous vous ferez des amis sans même le vouloir.", @"由日本最有名的靈媒井原大師\n１根１根地加持過的營養棒\n只要吃了這個就可以跟任何人當好朋友。", @"由日本最有名的灵媒井原大师\n1根1根地加持过的营养棒，\n只要吃了这个就可以跟任何人当好朋友。") },
            { 20031, new TwewyItem(20031, 31, @"tile605", @"Ginseng", @"コウライニンジン", @"Ginseng", @"Ginseng", @"Ginseng", @"Ginseng", @"高麗蔘", @"高丽参", @"A step above your average ginseng, this special strain has been cultivated to maximize its strength-giving properties.", @"秘伝の方法で栽培した高級食材\n通常のニンジンとは異なり\n体力があがるといわれている", @"Esta cepa especial de ginseng está un paso por encima de la variedad común y ha sido cultivada para incrementar sus propiedades fortalecedoras.", @"Questa specie particolare, un gradino sopra al normale ginseng, è stata coltivata per massimizzare le sue proprietà rinforzanti.", @"Diese spezielle Ginseng-Gattung wurde mit dem Ziel kultiviert, die stärkende Wirkung von herkömmlichem Ginseng zu maximieren.", @"Un cran au-dessus de votre ginseng habituel, cette souche spéciale a été cultivée pour maximiser ses propriétés stimulantes.", @"以祕傳的方式栽培出的高級食材\n與一般人蔘不同\n據說可以加強體力。", @"以秘传的方式栽培出的高级食材\n与一般萝卜不同，\n据说可以加强体力。") },
            { 20032, new TwewyItem(20032, 32, @"tile606", @"Curious Mushrooms", @"不思議なキノコ", @"Setas curiosas", @"Funghi bizzarri", @"Sonderbare Pilze", @"Champignons étranges", @"不可思議菇", @"不可思议菇", @"Incredibly scarce, this rarefied delicacy is said to bring instant fortune to any who eat it.", @"マボロシとまでいわれるほど入手が困難な\n高級食材、その分効果はテキメンで\n強運を呼びこむとされている", @"Este manjar es increíblemente escaso; dicen que la fortuna sonríe de inmediato a quienes lo prueban.", @"Si dice che questa raffinata prelibatezza, molto difficile da reperire, porti istantaneamente fortuna a chiunque la mangi.", @"Diese unglaublich seltene und exklusive Delikatesse soll jedem, der sie isst, sofortiges Glück bringen.", @"Incroyablement rare, ce mets délicat apporterait instantanément la fortune à celui qui en mange.", @"因難以取得而獲得夢幻稱號的高級食材\n但效果極佳\n據說可以喚來絕佳好運。", @"因难以取得而获得梦幻称号的高级食材\n但效果极佳，\n据说可以唤来绝佳好运。") },
            { 20033, new TwewyItem(20033, 33, @"tile607", @"Cordyceps", @"冬虫夏草", @"Cordyceps", @"Cordyceps", @"Cordyceps", @"Cordyceps", @"冬蟲夏草", @"冬虫夏草", @"A rare and costly Chinese remedy, this parasitic fungus grows on insect larvae. Use it to tap the wellspring of courage within you.", @"昆虫に寄生したキノコ\n漢方として有名で、数が少なく高価だが\n服用するとみるみる勇気がわいてくる！", @"Este hongo parásito es un remedio chino caro y poco común que se alimenta de larvas de insectos. Úsalo para despertar el pozo de coraje que hay en tu interior.", @"Questo fungo parassita, un raro e costoso rimedio cinese, cresce sulle larve degli insetti. Usatelo per attingere alla fonte di coraggio che si trova in voi.", @"Diese seltene und teure chinesische Medizin wird aus einer parasitären Pilzart hergestellt, die auf Insektenlarven wächst. Sie ermöglicht dir, die Quelle des Mutes in dir anzuzapfen.", @"Un remède chinois rare et cher préparé à base de champignons parasites poussant sur les larves d'insecte. Servez-vous-en pour faire déferler une vague de courage en vous.", @"寄生到昆蟲身上的菇類\n此為是知名的中藥材且量少價格高\n但服用之後勇氣就會迅速地湧出。", @"寄生到昆虫身上的菇类\n此为是知名的中药材且量少价格高，\n但服用之后勇气就会迅速地涌出。") },
            { 20034, new TwewyItem(20034, 34, @"tile608", @"Viper Drink", @"マムシドリンク", @"Tónico viperino", @"Viper Drink", @"Viperntrank", @"Boisson de vipère", @"蝮蛇口服液", @"蝮蛇口服液", @"The secret of this nutritious tonic is red viper soaked in a special mixture. One gulp and you'll be bursting with energy.", @"赤マムシをなぞの液体につけこんだ\n滋養強壮ドリンク\n一口飲めばたちまち元気があふれてくる！", @"El secreto de este nutritivo tónico es la víbora roja macerada en una mezcla especial. Un trago y tendrás energía por arrobas.", @"Il segreto di questo tonico nutriente è la vipera rossa immersa in una miscela speciale. Un sorso solo ed esploderete di energia.", @"Das Geheimnis dieses nahrhaften Elixiers liegt in einer roten Viper, die in einer speziellen Mixtur getränkt wurde. Nur ein Schluck davon, und du wirst vor Energie strotzen.", @"Le secret de ce fortifiant : une vipère rouge trempée dans une mixture spéciale. Une gorgée et vous déborderez d'énergie.", @"將紅蝮蛇塞進謎樣液體後製成的\n營養滋補口服液\n喝下一口馬上就精神百倍。", @"将红蝮蛇塞进谜样液体后制成的\n营养滋补口服液\n喝下一口马上就精神百倍。") },
            { 20035, new TwewyItem(20035, 35, @"tile609", @"Royal Jelly Q10", @"ローヤルゼリーＱ１０", @"Jalea real Q10", @"Pappa reale Q10", @"Gelée royale Q10", @"Gelée royale Q10", @"蜂王漿Ｑ１０", @"蜂王浆Q10", @"This supplement is made with royal jelly--special honey only given to the queen bee. Its nutritional properties are unmatched.", @"“女王蜂”だけに与えられる栄養豊富な\nローヤルゼリーを独自製法でサプリ化\nこれさえ飲めば健康まちがいなし", @"Este suplemento está hecho de jalea real, una miel especial que solo recibe la abeja reina. Sus propiedades nutricionales no tienen parangón.", @"Questo integratore contiene pappa reale, un miele speciale prodotto solo per l'ape regina. Le sue proprietà nutritive sono ineguagliabili.", @"Dieses Präparat wird aus Gelée royale\nhergestellt – einem speziellen Honig, den nur die Bienenkönigin bekommt. Seine Nährwerte sind unübertroffen.", @"Ce complément alimentaire est fait à partir de gelée royale, un miel spécial destiné à la reine des abeilles. Ses propriétés nutritionnelles sont sans équivalent.", @"將營養豐富只有「女王蜂」才吃得到的\n蜂王漿以獨家技術製成營養劑\n只要吃下這個必能獲得健康。", @"将营养丰富只有“女王蜂”才吃得到的\n蜂王浆以独家技术制成营养剂\n只要吃下这个必能获得健康。") },
            { 20036, new TwewyItem(20036, 36, @"tile610", @"Mako Sinnergy", @"ヤンケル魔皇液", @"Tónico Mako", @"Sinergia Mako", @"Mako-Synergie", @"Synergie de Mako", @"楊格爾魔皇液", @"杨格尔魔皇液", @"Packed with over fifty different herbal medicines, this tonic gives its drinker an almost magical toughness.", @"計５０種類もの生薬をたっぷり配合\nこれさえ飲めばまさに魔法のように\n力があふれでる！", @"Este tónico, preparado con más de cincuenta hierbas medicinales, aporta a quien lo bebe una resistencia casi mágica.", @"Questo tonico, creato con oltre cinquanta rimedi erboristici, dona a chi lo beve una resistenza quasi magica.", @"Dieses Elixier aus über fünfzig verschiedenen Kräuterheilmitteln verleiht nahezu magische Robustheit.", @"Composé de plus de cinquante différentes herbes médicinales, ce fortifiant offre à celui qui en consomme une résistance quasiment magique.", @"富含５０種藥材\n只要喝了這個就會像被施了魔法般\n充滿力量。", @"富含50种药材\n只要喝了这个，\n就会像被施了魔法般充满力量。") },
            { 20037, new TwewyItem(20037, 37, @"tile611", @"BRAVE+", @"ＢＲＡＶＥ＋", @"ARROJO+", @"CORAGGIO+", @"MUT+", @"BRAVE+", @"ＢＲＡＶＥ＋", @"BRAVE+", @"Curiosity is the primary ingredient in this energy drink. One sip gives you the courage to do anything you put your mind to.", @"主成分が好奇心でできている栄養ドリンク\nこれを飲めば、あらゆることに興味がわき\nなんでも実行する勇気がみなぎる", @"La curiosidad es el principal ingrediente de esta bebida energética. Un trago te dará el coraje necesario para hacer lo que te propongas.", @"La curiosità è l'ingrediente principale di questa bevanda energetica. Un sorsetto dona il coraggio di fare qualsiasi cosa vi salti in mente.", @"Neugier ist die wichtigste Zutat dieses Energietranks. Schon ein Schluck verleiht dir den Mut, alles zu tun, was dir in den Sinn kommt.", @"La curiosité est l'ingrédient principal de cette boisson énergétique. Une gorgée vous donnera le courage de faire tout ce que vous entreprendrez.", @"主要成分為好奇心的營養口服液\n只要喝下這個就會對一切事物產生興趣\n充滿實行任何事的勇氣。", @"主要成分为好奇心的营养口服液\n只要喝下这个，就会对一切事物产生兴趣，\n充满实行任何事的勇气。") },
            { 20038, new TwewyItem(20038, 38, @"tile612", @"Vanilla Soft Serve", @"バニラソフト", @"Cucurucho de vainilla", @"Cono gelato alla vaniglia", @"Vanille-Softeis", @"Glace italienne goût vanille", @"香草冰淇淋", @"香草冰淇淋", @"Everyone's favorite: sweet vanilla soft serve. Its rich, creamy flavor delights young and old alike.", @"定番のとっても甘いバニラソフトクリーム\n深みのあるまろやかな味わいは\n子供も大人も満足させるおいしさ", @"El favorito de todos: el cucurucho de vainilla. Su sabor intenso y cremoso hace las delicias de grandes y pequeños por igual.", @"Il preferito di tutti: un morbido gelato alla vaniglia. Il suo sapore intenso e cremoso farà impazzire sia i grandi sia i piccoli.", @"Stets bei allen beliebt: süßes Vanille-Softeis. Sein vollmundiger, cremiger Geschmack entzückt Jung und Alt gleichermaßen.", @"Tout le monde l'adore : la glace italienne goût vanille. Son arôme riche et crémeux régale aussi bien les petits que les grands.", @"經典的超甜香草冰淇淋\n有深度的圓潤滋味\n是可以同時滿足大人與小孩的美味。", @"经典的超甜香草冰淇淋\n有深度的圆润滋味，\n是可以同时满足大人与小孩的美味。") },
            { 20039, new TwewyItem(20039, 39, @"tile613", @"Soft Serve Swirl", @"ミックスソフト", @"Pecado de placer", @"Vortice di gelato", @"Schoko-Vanille-Softeis", @"Glace à l'italienne", @"綜合冰淇淋", @"综合冰淇淋", @"Vanilla, dark chocolate and milk chocolate harmonize in a perfectly sinful symphony of creamy goodness.", @"ミックスソフトクリーム\nバニラ、チョコ、クリーミーなミルクチョコと\n３つの味が楽しめる欲張りなソフト", @"La vainilla, el chocolate negro y el chocolate con leche se armonizan formando un pecado sinfónico de cremoso placer.", @"Vaniglia, cioccolato fondente e cioccolato al latte si armonizzano in una perfetta sinfonia peccaminosa di bontà alla crema.", @"Vanille, dunkle Schokolade und Milchschokolade harmonieren perfekt zu einer sündhaft guten Symphonie an cremigem Genuss.", @"Vanille, chocolat noir et chocolat au lait sont réunis pour créer une symphonie harmonieuse de gourmandise crémeuse.", @"綜合冰淇淋\n可以貪心地一次享受香草、巧克力\n及柔滑的牛奶巧克力３種滋味。", @"综合冰淇淋\n可以贪心地一次享受香草、巧克力\n及柔滑的牛奶巧克力3种滋味。") },
            { 20040, new TwewyItem(20040, 40, @"tile614", @"Pancakes", @"ホットケーキ", @"Tortitas", @"Pancake", @"Pfannkuchen", @"Pancakes", @"鬆餅", @"松饼", @"Pancakes fresh off the griddle. The subtle sweetness of butter and maple syrup makes these an instant hit.", @"焼きたてホットケーキ\n上にのせたバターとメープルシロップの\nハーモニーが絶妙！", @"Tortitas recién sacadas de la plancha. La dulzura sutil de la mantequilla y el sirope de arce hacen de esta combinación un éxito garantizado.", @"Pancake appena sfornati. La delicata dolcezza del burro e dello sciroppo d'acero lo rendono un dessert irresistibile.", @"Frisch gebackene Pfannkuchen. Die zarte Süße von Butter und Ahornsirup machen sie vom ersten Bissen an zum Erfolg.", @"Des pancakes fraîchement cuits. La douceur subtile du beurre et du sirop d'érable font de ce mets un régal immédiat.", @"剛烤好的鬆餅\n澆在上面的奶油與楓糖\n共同譜出絕妙滋味！", @"刚烤好的松饼\n浇在上面的奶油与枫糖，\n共同谱出绝妙滋味！") },
            { 20041, new TwewyItem(20041, 41, @"tile615", @"Crepe", @"クレープ", @"Crep", @"Crêpe", @"Crêpe", @"Crêpe", @"可麗餅", @"可丽饼", @"A crepe filled with strawberries and fresh whipped cream, each flavor beautifully complementing the other.", @"いちごと生クリームのクレープ\nさっぱりとしたフレッシュいちごが\n生クリームの魅力をさらにひきたてる", @"Crep relleno de fresas y nata montada: dos sabores que se complementan a la perfección.", @"Una crêpe ripiena di fragole e fresca panna montata. Ciascun sapore completa l'altro in maniera sublime.", @"Ein mit Erdbeeren und frischer Schlagsahne gefüllter Crêpe, dessen Aromen sich wunderbar gegenseitig ergänzen.", @"Une crêpe fourrée aux framboises et à la crème fouettée. Chacun de ces ingrédients complète merveilleusement l'autre.", @"放有草莓與鮮奶油的可麗餅\n清爽的新鮮草莓\n大大襯托出鮮奶油的魅力。", @"放有草莓与鲜奶油的可丽饼\n清爽的新鲜草莓，\n大大衬托出鲜奶油的魅力。") },
            { 20042, new TwewyItem(20042, 42, @"tile006", @"Gourmet Rice Ball", @"うにおにぎり", @"Bola de arroz gourmet", @"Polpetta di riso gourmet", @"Gourmet-Reisbällchen", @"Boule de riz de gourmet", @"海膽飯糰", @"海胆饭团", @"Fragrant, salted sea urchin on the inside and fresh, decadent sea urchin on the outside. This rice ball is perfect.", @"中には香り高い塩うにが\n上にはとろけるような生うにがのった\nまさにエクセレントないっぴん", @"Erizo de mar aromático y salado por dentro y pecaminosamente rico por fuera. Esta bola de arroz es perfecta.", @"Fragrante riccio di mare salato all'interno e riccio di mare fresco e saporito all'esterno. Questa polpetta di riso è perfetta.", @"Duftender, salziger Seeigel innen und frischer, dekadenter Seeigel außen. Dieses Reisbällchen ist einfach perfekt.", @"Un oursin salé et parfumé à l'intérieur et un oursin frais et gourmand à l'extérieur. Cette boule de riz est parfaite.", @"包入香噴噴的鹽漬海膽，\n又放上入口即化的生海膽，\n簡直就是一道極致美味。", @"包入香喷喷的盐渍海胆，\n又放上入口即化的生海胆，\n简直就是一道极致美味。") },
            { 30000, new TwewyItem(30000, 0, @"tile566", @"Colorful Thread", @"あざやかな糸", @"Hilo colorido", @"Filo colorato", @"Buntes Garn", @"Fil coloré", @"鮮豔絲線", @"鲜艳丝线", @"Awe-inspiring thread, hand-dyed in Nishijin, Kyoto, heart of the Japanese textile trade, by craftsmen some would call national treasures.", @"織物の中心地京都・西陣の最高級糸を\n人間国宝の染色職人が丹精こめて染め上げた\n糸を見るだけで感動で涙がこみあげると評判", @"Hilo maravilloso, teñido a mano por unos artesanos considerados héroes nacionales en Nishijin, Kioto, motor de la industria textil japonesa.", @"Stupendo filo tinto a mano a Nishijin, Kyoto, cuore del commercio di tessuti giapponese, da artigiani che alcuni chiamerebbero tesoro nazionale.", @"Ehrfurchtgebietendes Material, handgefärbt in Nishijin, Kyōto, dem Herzen des japanischen Textilhandwerks, von Künstlern, die man zu Recht als nationales Kulturgut bezeichnen kann.", @"Une fringue qui inspire le respect, teinte à la main chez Nishijin à Kyoto, le cœur du commerce du textile japonais, par des artisans qui sont de véritables trésors nationaux.", @"織品重鎮京都‧西陣的頂級絲線，\n經過國寶染色工匠使出渾身解數染製，\n光是看到這絲線，就禁不住感動落淚。", @"织品重镇京都——西阵的顶级丝线，\n经过国宝级染色工匠使出浑身解数染制，\n光是看到这丝线，就禁不住感动落泪。") },
            { 30001, new TwewyItem(30001, 1, @"tile538", @"Sleek Silk", @"しなやかな絹", @"Seda brillante", @"Seta lucente", @"Elegante Seide", @"Soie brillante", @"柔滑絲綢", @"柔滑丝绸", @"Craftsmen poured heart and soul into this lustrous silk, woven the traditional way: from thread lovingly collected from silkworms.", @"愛情いっぱいに育てられた蚕で作った糸を\n伝統を守り抜いた職人が命を削って編み上げた絹\nその輝きは神々しく触れるだけで癒されるという", @"Los artesanos pusieron cuerpo y alma en esta lustrosa seda, tejida con el método tradicional: utilizando hebras recogidas directamente de los gusanos de seda.", @"Gli artigiani hanno messo anima e corpo in questa seta lussuosa, tessuta nella maniera tradizionale: con fili prodotti dai bachi da seta.", @"Handwerksmeister haben Herz und Seele in diese prächtige Seide gesteckt, die auf traditionelle Weise aus Fäden gewoben wurde, die liebevoll von Seidenraupen geerntet wurden.", @"Les artisans mettent tout leur cœur à la confection de cette magnifique soie, tissée selon la méthode traditionnelle : à partir de fils de vers à soie soigneusement récoltés.", @"使用投入大量心血養育的蠶所生產的絲線，\n堅持守護傳統的工匠拚命編織而成的絹布，\n散發出高雅聖潔的光芒，光是觸摸就很療癒。", @"使用投入大量心血养育的蚕所生产的丝线，\n坚持守护传统的工匠拼命编织而成的绢布，\n散发出高雅圣洁的光芒，光是触摸就很治愈。") },
            { 30002, new TwewyItem(30002, 2, @"tile510", @"Cozy Down", @"やわらかな羽毛", @"Plumas suaves", @"Piume accoglienti", @"Kuschelige Daunen", @"Duvet douillet", @"柔軟羽毛", @"柔软羽毛", @"A collection of the softest, warmest, and most resilient of chest feathers, used by arctic geese to shield their young from the harsh bite of winter.", @"北極圏で生息するガチョウが極寒の環境から\nヒナを守るために、巣作りに使う胸の毛だけを\n集めたやわらかく、弾力性がある最高羽毛", @"Colección formada por las plumas más suaves, cálidas y resistentes, utilizadas por los gansos del Ártico para proteger a sus crías de las inclemencias del invierno.", @"Una collezione delle piume più morbide, calde e resistenti, usate dalle oche artiche per proteggere i propri cuccioli dal freddo pungente dell'inverno.", @"Eine Sammlung der weichsten, wärmsten und widerstandsfähigsten Brustfedern, mit denen die Eisgänse ihre Jungen vor den unerbittlichen Winterwinden schützen.", @"Un ensemble des plumes de bréchet d'oie arctique. Ces plumes incroyablement douces, chaudes et résistantes servent à protéger leurs petits de la morsure de l'hiver.", @"棲息於北極圈的鵝為了在極寒的環境中\n守護幼鳥，築巢時只會使用胸口羽毛，\n為柔軟，具有彈性的頂級羽毛。", @"栖息于北极圈的鹅为了在极寒的环境中\n守护幼鸟，筑巢时只会使用胸口羽毛，\n是集柔软与弹性于一身的顶级羽毛。") },
            { 30003, new TwewyItem(30003, 3, @"tile482", @"Sparkling Silver", @"きらきらシルバー", @"Plata centelleante", @"Argento scintillante", @"Schimmerndes Silber", @"Argent étincelant", @"閃亮銀塊", @"闪亮银块", @"Exquisite silver of a rare quality, refined from select ore using strictly monitored heat and a chemical finish that yields a radiant sparkle.", @"材料の違い、調合の仕方、表面処理の薬剤\n燃焼温度など、厳密に品質管理されたシルバー\n見たことのない輝きを実現している逸品", @"Exquisita plata de una calidad excepcional, refinada a partir de un filón selecto por medio de calor controlado. El acabado químico le confiere un destello radiante.", @"Squisito argento di rara qualità, rifinito da minerali selezionati tramite l'utilizzo monitorato del calore e una finitura chimica che produce una radiosa luminosità.", @"Herausragendes Silber bester Qualität, bei minutiös kontrollierter Temperatur aus ausgewähltem Erz gewonnen und mithilfe einer chemischen Veredelung mit einem prächtigen Schimmer versehen.", @"Du bel argent d'une qualité rare, issu d'un minerai raffiné par une chaleur parfaitement maîtrisée et une finition chimique lui donnant son brillant intense.", @"材料差異、調和方式，表面處理的藥劑\n以及燃燒溫度等都受到嚴格品質管理的銀塊，\n呈現出前所未見光芒的逸品。", @"材料差异、调和方式，表面处理的药剂\n以及燃烧温度等都受到严格品质管理的银块，\n呈现出前所未见光芒的逸品。") },
            { 30004, new TwewyItem(30004, 4, @"tile454", @"Fluffy Cotton", @"もこもこの綿", @"Algodón mullido", @"Morbido cotone", @"Flauschige Baumwolle", @"Coton moelleux", @"毛茸茸棉花", @"毛茸茸棉花", @"Though luxurious Egyptian cotton is usually reserved for top-grade fabric, this airy sample was decadently set aside as crafter's cotton.", @"高級綿糸として人気が高いエジプト綿を\nあえて手芸綿にした最高級品\n未体験のふんわり度を実現", @"Aunque este lujoso algodón egipcio suele reservarse para telas de primerísima calidad, esta liviana muestra se dejó a un lado para fines artesanos.", @"Anche se il lussuoso cotone egiziano viene di norma riservato ai tessuti di alta qualità, questo campione leggero è stato messo da parte come cotone per artigianato.", @"Obwohl luxuriöse ägyptische Baumwolle in der Regel nur für erstklassige Stoffe verwendet wird, wurde diese luftige Charge dekadenterweise für Handwerker beiseitegelegt.", @"Bien que le luxueux coton égyptien soit en général réservé aux tissus haut de gamme, cet échantillon léger a été négligemment mis de côté en tant que coton artisanal.", @"將被列為高級棉類廣受歡迎的埃及棉\n拿來做手工藝的頂級品，\n呈現出未曾體驗過的蓬鬆柔軟。", @"将被列为高级棉类广受欢迎的埃及棉\n拿来做手工艺的顶级品，\n呈现出未曾体验过的蓬松柔软。") },
            { 30005, new TwewyItem(30005, 5, @"tile426", @"Stunning Crystals", @"きれいな鉱石", @"Cristales imponentes", @"Cristalli stupendi", @"Bezaubernde Kristalle", @"Cristaux stupéfiants", @"美麗礦石", @"美丽矿石", @"These breathtaking geodes can only be mined from the heart of the Himalayas. Each contains a panoply of colors in a harmonious mosaic.", @"ヒマラヤ山脈でしか採掘されない貴重な鉱石\n１種類の石の中に数種類のカラーが\nモザイクのように調和する美しくパワフルな石", @"Estas impresionantes geodas solo pueden extraerse del corazón del Himalaya y desprenden una pléyade de colores en un armonioso mosaico.", @"Questi geodi mozzafiato si trovano solo nelle miniere nel cuore dell'Himalaya. Ciascuno contiene un assortimento completo di colori che formano un mosaico armonioso.", @"Diese atemberaubenden Geoden kommen nur im Herzen des Himalaya vor. Jede einzelne enthält eine schillernde Palette von Farben, die ein harmonisches Mosaik bilden.", @"Ces géodes à couper le souffle ne peuvent être extraites qu'au cœur de l'Himalaya. Chacune contient une palette de couleurs arrangées selon une mosaïque harmonieuse.", @"只有在喜馬拉雅山開採得到的貴重礦石，\n１種石頭當中有數種顏色，\n就像馬賽克般富有調和之美與能量的礦石。", @"只有在喜马拉雅山开采得到的贵重矿石，\n1种石头当中有数种颜色，\n就像马赛克般富有调和之美与能量的矿石。") },
            { 30006, new TwewyItem(30006, 6, @"tile398", @"Durable Leather", @"じょうぶな革", @"Cuero resistente", @"Pelle resistente", @"Robustes Leder", @"Cuir solide", @"耐用皮革", @"耐用皮革", @"Hand-crafted by peerless tanners and favored by top-brand clothiers. Lustrous, supple, and naturally resistant to scratches and wear.", @"世界最高峰のなめし業者の最高級の革\nキズがつきにくく 、しなやかで張りがある\n高級ブランド店が好んで使用する素材", @"Fabricado a mano por los más grandes curtidores, está muy buscado por las primeras marcas. Lustroso, flexible y resistente.", @"Creata a mano da conciatori senza eguali e prediletta dai commercianti di tessuti dei brand più famosi. Lucente, elastica, e naturalmente resistente ai graffi e agli strappi.", @"Handgefertigt von den besten Gerbern und sehr beliebt bei den Designern der Topmarken. Sanft glänzend, geschmeidig und von Natur aus widerstandsfähig gegen Kratzer und Abrieb.", @"Fabriqué à la main par des tanneurs hors pair et utilisé par les plus grandes marques de vêtements. Brillant, souple et naturellement résistant aux rayures et à l'usure.", @"世界頂尖鞣製業者製作的頂級皮革，\n不易損傷，柔軟且耐拉扯，\n是精品品牌店喜愛使用的素材。", @"世界顶尖鞣制业者制作的顶级皮革，\n不易损伤，柔软且耐拉扯，\n是精品品牌店喜爱使用的素材。") },
            { 30007, new TwewyItem(30007, 7, @"tile370", @"Pretty Ribbon", @"かわいいリボン", @"Cinta hermosa", @"Fiocchetto carino", @"Hübsches Band", @"Joli ruban", @"可愛緞帶", @"可爱蝴蝶结", @"Cute and elegant, a haute couture standby since the days of Marie Antoinette. Gold-dusted lamé lends the ribbon a regal brilliance.", @"マリーアントワネットが使用したと言い伝えられる\n上品なピンクのかわいいリボン\nラメが金粉でまばゆく輝いている", @"Elegante a la par que encantadora, la cinta ha sido un elemento de la alta costura desde los tiempos de María Antonieta. El lamé dorado le confiere un brillo regio.", @"Raffinato ed elegante, una colonna portante della haute couture dai tempi di Maria Antonietta. Il lamé spolverato in oro dona al fiocco una brillantezza regale.", @"Putzig und elegant, ein Element der Haute Couture seit den Tagen Marie Antoinettes. Goldbestäubter Lamé verleiht dem Band königlichen Glanz.", @"Joli et élégant, un classique de la haute couture depuis l'époque de Marie-Antoinette. Un lamé recouvert d'or donne à ce ruban un brillant royal.", @"傳說法國的瑪麗皇后曾使用過，\n優雅粉色的可愛緞帶，\n金蔥布料上的金粉閃耀炫目光芒。", @"传说法国的玛丽皇后曾使用过，\n优雅的粉色可爱缎带，\n金葱布料上的金粉闪耀炫目光芒。") },
            { 30008, new TwewyItem(30008, 8, @"tile342", @"Choice Meat", @"フレッシュミート", @"Carne selecta", @"Carne di prima scelta", @"Exquisites Fleisch", @"Viande de choix", @"新鮮的肉", @"新鲜的肉", @"The marriage of red meat and flavor-rich fat makes this cut a cut above. These piggies dine solely on acorns in a free-range oak forest.", @"上質の脂肪と赤身が特徴の最高級の豚肉\n樫の林に放牧し、ドングリのみで大切に飼育され\nおいしいと珍重されている", @"La fusión de carne roja y grasa suculenta hace que este corte sea una delicia. Estos marranos se crían a base de bellotas y corren libremente por el bosque.", @"Il matrimonio della carne rossa e del grasso saporito fanno di questo un taglio superiore. Questi maialini si cibano unicamente di ghiande in una grande foresta di querce.", @"Die Kombination aus rotem Fleisch und geschmacksintensivem Fett ist einfach himmlisch. Diese in einem Eichenwald freilaufenden Schweine ernähren sich ausschließlich von Eicheln.", @"Le mariage de la viande rouge et du gras savoureux fait tout le charme de ce morceau choisi. Ces cochons élevés en liberté dans une forêt de chênes se nourrissent exclusivement de glands.", @"以上好肥肉及瘦肉著稱的頂級豬肉，\n放牧於橡樹林中只餵食橡子，\n小心翼翼地飼育著，\n由於美妙滋味受到看重。", @"以上好肥肉及瘦肉着称的顶级猪肉，\n放牧于橡树林中只喂食橡子，精心饲育而成，\n由于美妙滋味受到看重。") },
            { 30009, new TwewyItem(30009, 9, @"tile314", @"Sweet, Sweet Onions", @"あま～いたまねぎ", @"Cebolla extradulce", @"Cipolle dolcissime", @"Wunderbar süße Zwiebeln", @"Oignons super doux", @"甜～甜的洋蔥", @"甜～甜的洋葱", @"Pristine produce grown in 100% organic soil with traditional techniques. Kissed by the golden sun, they're bursting with flavorful, oniony goodness.", @"有機肥料を使用し、伝統農法で丁寧に育てた\n最高級たまねぎ\n太陽の恵みをうけ、とびきりあまいと評判", @"Un producto puro de cultivo tradicional y 100 % orgánico. La suave caricia del sol le da a esta cebolla una dulzura excepcional.", @"Verdure sanissime, coltivate al 100% in un terreno biologico tramite tecnica tradizionale. Baciate dal sole dorato, esplodono di bontà cipollina.", @"Grandioses Gemüse, das mit traditionellen Techniken in 100 % Bioboden angebaut wurde. Von der Sonne geküsst, platzen diese Prachtdinger schier vor leckerem, zwiebeligem Geschmack.", @"Un produit vierge qui pousse dans une terre\n100 % bio selon des techniques traditionnelles. Arrosés de soleil, ils débordent de saveur et sont délicieusement sucrés.", @"使用有機肥料，以傳統農法慎重培育的\n頂級青蔥，\n受到太陽照耀，因極其甘美的滋味備受好評。", @"使用有机肥料，以传统农法慎重培育的\n顶级洋葱，\n受到太阳照耀，因极其甘美的滋味备受好评。") },
            { 30010, new TwewyItem(30010, 10, @"tile286", @"Mystery Liquid", @"なぞの液体", @"Líquido misterioso", @"Liquido misterioso", @"Geheimnisvolle Flüssigkeit", @"Liquide mystère", @"謎樣液體", @"谜样液体", @"Though striking in both color and odor, a drop of this makes any cuisine overflow with flavor. A treasured delicacy, as rare as it is potent.", @"強烈な色と刺激臭がある、なぞの液体\nしかし１滴いれるだけでなぜか、どんな料理も\n風味豊かになる　高級品として珍重される", @"Aunque el color y el aroma resulten impactantes, una gota hace que el guiso rebose sabor. Un manjar muy apreciado, tan potente como difícil de conseguir.", @"Basta una goccia di questo liquido dal colore e l'odore straordinari per far esplodere di sapore qualunque tipo di cucina. Una squisitezza cara, tanto rara quanto potente.", @"Ein einzelner Tropfen dieser farblich und geruchlich beeindruckenden Flüssigkeit verleiht jedem Gericht ein unvergleichliches Aroma. Diese hoch geschätzte Delikatesse ist so selten wie wirkungsvoll.", @"Bien que l'odeur et la couleur soient surprenantes, une seule goutte et vos plats débordent de saveurs. Un ingrédient précieux, aussi rare que puissant.", @"具有強烈色彩與刺激性氣味的神秘液體，\n但只要加１滴，無論任何料理的風味\n都會莫名豐富起來，被視做高級品備受看重。", @"具有强烈色彩与刺激性气味的神秘液体，\n但只要加1滴，无论任何料理的风味\n都会莫名丰富起来，被视做高级品备受看重。") },
            { 30011, new TwewyItem(30011, 11, @"tile258", @"Red Viper", @"赤マムシ", @"Víbora roja", @"Vipera rossa", @"Rote Viper", @"Vipère rouge", @"紅蝮蛇", @"红蝮蛇", @"Steamed alive and then stored unprocessed in alcohol, still brimming with calcium and protein. Its meat serves a broad spectrum of purposes.", @"生きたマムシを蒸し焼きにしアルコールにつけた\n高級食材　未加工のため、カルシウムと\nタンパク質が豊富でさまざまな用途に使用される", @"Se cocina viva al vapor y después se macera en alcohol, manteniendo el calcio y las proteínas. Su carne se usa para un sinfín de platos.", @"Stufata viva e conservata nell'alcol senza essere lavorata, ancora traboccante di calcio e proteine. La sua carne serve a un ampio spettro di scopi.", @"Wird lebendig gedünstet und dann sofort in Alkohol konserviert, wodurch die Fülle an Kalzium und Proteinen erhalten bleibt. Ihr Fleisch bietet mannigfaltige Verwendungszwecke.", @"Cuit vivant à la vapeur, puis conservé tel quel dans l'alcool, cette viande pleine de calcium et de protéines couvre un large éventail de besoins.", @"將活的蝮蛇燜熟後再加酒的\n高級食材，由於未經加工，富含鈣質與\n蛋白質，可使用於各式各樣的用途。", @"将活的蝮蛇焖熟后再加酒的\n高级食材，由于未经加工，富含钙质与\n蛋白质，可使用于各式各样的用途。") },
            { 30012, new TwewyItem(30012, 12, @"tile230", @"Swallow's Nest", @"ツバメの巣", @"Nido de gorrión", @"Nido di rondine", @"Schwalbennest", @"Nid d'hirondelle", @"燕窩", @"燕窝", @"An experienced buyer scoured the markets of Hong Kong to find these top-grade specimens. Rich in vitamins to promote robust health.", @"経験豊富なバイヤーが香港市場にて厳選し\n自信を持って最高ランクと太鼓判を押した一品\n美容と健康に絶大な効果を発揮", @"Un experto comprador rebuscó por los mercados de Hong Kong hasta encontrar estos ejemplares de primera. Muy ricos en vitaminas.", @"Un compratore esperto ha setacciato i mercati di Hong Kong per trovare questi esemplari di primissima qualità. Sono ricchi di vitamine per favorire una salute robusta.", @"Ein erfahrener Einkäufer hat die Märkte Hongkongs durchkämmt, um diese erstklassigen Exemplare zu finden. Reich an Vitaminen und unglaublich gesund.", @"Un acheteur expérimenté a ratissé tous les marchés de Hong Kong pour trouver des spécimens de première qualité. Riche en vitamines pour une santé de fer.", @"經驗豐富的採購人員在香港市場嚴選，\n深具自信掛保證為頂級水準的一品，\n在美容保健方面發揮莫大效果。", @"经验丰富的采购人员在香港市场严选，\n深具自信，保证为顶级水准的极品，\n在美容保健方面发挥莫大效果。") },
            { 30013, new TwewyItem(30013, 13, @"tile202", @"Crimson Chili", @"クリムゾンチリペッパー", @"Chili carmesí", @"Peperoncino rosso", @"Purpurrote Chilisoße", @"Piment rouge", @"腥紅辣椒", @"腥红辣椒", @"Harvested from a rare plant that grows only high in the mountains of India, this extreme spice packs a medicinal kick to match its flavor.", @"インドの山奥にしか自生していない\n大変珍しい植物からとれた最高級のスパイス\n薬用としての効果が極めて高い", @"Cosechado de una planta poco común que solo crece en la cima de las montañas de la India, esta especia superpicante tiene un efecto medicinal tan impactante como su sabor.", @"Colta da una rara pianta che cresce solo sulle alte montagne dell'India, questa spezia estrema contiene un effetto medicinale che ben si abbina al suo sapore.", @"Diese extreme Würze wird aus einer seltenen Pflanze gewonnen, die nur hoch oben in den Bergen Indiens wächst. Sie ist so schmackhaft wie medizinisch wirksam.", @"Cueillie sur une plante rare qui ne pousse que dans les hautes montagnes d'Inde, cette épice extrême renferme un pouvoir médicinal aussi puissant que son arôme.", @"從只生長在印度深山，\n極其珍貴的植物身上萃取的頂級香料，\n作為藥用的效果也極高。", @"从只生长在印度深山，\n极其珍贵的植物身上萃取的顶级香料，\n作为药用的效果也极高。") },
            { 30014, new TwewyItem(30014, 14, @"tile174", @"Jumbo Chicken", @"おおきなトリガラ", @"Pollo extragrande", @"Pollo gigante", @"Jumbo-Hähnchen", @"Poulet géant", @"大塊雞骨架", @"大块鸡骨架", @"A large Nagoya Cochin chicken, raised on organic feed at a free-range farm to produce the world's most exquisitely tender poultry.", @"名古屋コーチンのおおきなトリガラ\n広大な土地を走り回り、オーガニックの\nエサだけで飼育された最高級品", @"Pollo Nagoya Cochin grande, criado en corral con alimentos orgánicos. El resultado: la carne más tierna y exquisita del mundo.", @"Un grosso pollo Nagoya Cochin, nutrito di mangimi organici in una fattoria all'aperto per produrre il pollame più morbido e squisito del mondo.", @"Ein großes Nagoya-Cochin-Huhn, aufgewachsen auf einem Biohof, der das zarteste Geflügel der ganzen Welt produziert.", @"Un gros poulet Nagoya Cochin élevé en liberté au grain bio. Sa viande est la plus tendre et la plus exquise du monde.", @"名古屋肉雞的大雞胸肉，\n在寬敞的土地上來回奔跑，\n只餵食有機飼料的頂級品。", @"名古屋肉鸡的大鸡骨架，\n在宽敞的土地上来回奔跑，\n只喂食有机饲料的顶级品。") },
            { 30015, new TwewyItem(30015, 15, @"tile146", @"Extra Fine Noodles", @"しこしこ極細麺", @"Fideos extrafinos", @"Noodle raffinatissimi", @"Extradünne Nudeln", @"Nouilles extra-fines", @"彈牙極細麵", @"弹牙极细面", @"Made of 100% premium pure-grain flour and ultra-soft water, these extra-thin noodles still retain an ideal body and toothsome firmness.", @"小麦の中心部だけを使った高級小麦１００％を\n使用し、超軟水で熟練の職人が打ちあげた\nしこしことした中にもコシがある理想的な麺", @"Hechos con harina de primera 100% pura y agua ultrasuave, estos fideos extrafinos tienen un cuerpo ideal y una firmeza sabrosa.", @"Fatti di farina di grano puro al 100% e acqua dolcissima, questi noodle super sottili mantengono una corposità ideale e una gradevole compattezza.", @"Diese extrafeinen Nudeln, die ausschließlich aus erstklassigem Mehl und ultraweichem Wasser hergestellt werden, behalten dennoch eine ideale Form und den perfekten Biss.", @"Préparées à base de farine complète et d'eau ultra-douce, ces nouilles extra fines conservent une texture idéale et une fermeté savoureuse.", @"１００％使用只保留小麥中心部分的高級小麥，\n熟練工匠使用超軟水手工打製而成，\n除了富有嚼勁之外，還很彈牙，是理想中的麵條。", @"100％使用只保留小麦中心部分的高级小麦，\n熟练工匠使用超软水手工打制而成，\n除了富有嚼劲之外，还很弹牙，是理想中的面条。") },
            { 30016, new TwewyItem(30016, 16, @"tile118", @"My First Wallet", @"こどもの財布", @"Mi primer monedero", @"Il mio primo portafogli", @"Meine erste Geldbörse", @"Mon premier portefeuille", @"小朋友錢包", @"小朋友钱包", @"A wallet with room for up to 99,999 yen, and not one jot more. Hardy nylon construction means you can count on it to last.", @"最大で９万９９９９円まで所持できる財布\nナイロン製なので丈夫で長持ち", @"Monedero con capacidad para 99 999 yenes, ni uno más. La resistente tela de nailon te garantiza un producto duradero.", @"Un portafogli che può contenere fino a 99.999 yen, e non uno di più. La fabbricazione in nylon resistente garantisce un'ottima durevolezza nel tempo.", @"Eine Geldbörse für bis zu 99.999 Yen und keinen Yen mehr. Dank der robusten Nylonkonstruktion lässt sie dich nie im Stich.", @"Un portefeuille pouvant contenir jusqu'à\n99 999 yens et pas un centime de plus. Grâce à sa conception en nylon robuste, il est fait pour durer.", @"最多可以放入９萬９９９９圓的錢包\n由於是尼龍製，非常耐用。", @"最多可以放入9万9999元的钱包\n使用尼龙制成，非常耐用。") },
