            { 30088, new TwewyItem(30088, 88, @"tile567", @"(S) Main Menu", @"Ｓ：メインメニュー", @"(S) Menú Inicio", @"(S) Menu principale", @"(S) Startmenü", @"(S) Menu principal", @"Ｓ：主選單", @"Ｓ：主菜单", @"[#FF0000]Tap the phone icon[#000000] in the upper-right corner of the screen while in the field to [#FF0000]open the Main Menu[#000000] and access game sub-menus.", @"フィールドの画面右上の[#FF0000]ケータイアイコンを\nタップすることでメインメニューを開く[#000000]ことができる\nメインメニューからさまざまなメニューを開ける", @"[#FF0000]Toca el icono del teléfono[#000000] de la parte superior derecha de la pantalla cuando estés en el exterior para [#FF0000]abrir el menú Inicio[#000000] y acceder a los submenús.", @"[#FF0000]Tocca l'icona del telefono[#000000] nell'angolo in alto a destra dello schermo mentre sei in gioco per [#FF0000]aprire il Menu principale[#000000] e accedere ai menu secondari.", @"[#FF0000]Tippe[#000000] unterwegs [#FF0000]auf das Handy-Symbol[#000000] oben rechts im Bild, [#FF0000]um das Startmenü zu öffnen[#000000] und auf Untermenüs zuzugreifen.", @"[#FF0000]Touchez l'icône Téléphone[#000000] dans le coin supérieur droit de l'écran quand vous êtes sur le terrain pour [#FF0000]ouvrir le menu Accueil[#000000] et accéder aux menu secondaires.", @"點擊場景畫面右上方的[#FF0000]手機圖示\n就能開啟主選單[#000000]\n從主選單可開啟其他各種選單。", @"点击场景画面右上方的[#FF0000]手机图示\n就能开启主菜单[#000000]\n从主菜单可开启其他各种菜单。") },
            { 30089, new TwewyItem(30089, 89, @"tile568", @"(S) Extra Slot", @"Ｓ：スロットプラス", @"(S) Hueco extra", @"(S) Spazio extra", @"(S) Zusätzlicher Platz", @"(S) Emplacement supp.", @"Ｓ：新增欄位", @"S：新增栏位", @"[#FF0000]Adds an additional pin slot[#000000] to your decks. Open the Pins Menu (from the Main Menu) and pick out another pin to wear!", @"[#FF0000]バッジスロットの数がひとつ増える[#000000]\nメインメニューからバッジメニューをひらいて\nスロットに好きなバッジをそうびしてみよう", @"[#FF0000]Agrega un hueco de pin adicional[#000000] a tus tablas. Abre el menú Pines (desde el menú Inicio) y colócate otro pin.", @"[#FF0000]Aggiunge un'ulteriore spazio spilla[#000000] ai tuoi set. Apri il Menu Spille (dal Menu principale) e scegli un'altra spilla da indossare!", @"Erweitert deine Sets um einen [#FF0000]zusätzlichen Pin-Platz[#000000]. Öffne das Pin-Menü (über das Startmenü) und stecke dir einen zusätzlichen Pin an!", @"[#FF0000]Ajoute un emplacement de badge supplémentaire[#000000] à vos decks. Ouvrez le menu Badges (depuis le menu Accueil) et choisissez un autre badge à porter !", @"[#FF0000]增加了１個徽章欄位[#000000]，\n從主選單中打開徽章選單\n把喜愛的徽章裝備在欄位上吧。", @"[#FF0000]增加了１个徽章栏位[#000000]，\n从主菜单中打开徽章菜单\n把喜爱的徽章装备在栏位上吧。") },
            { 30090, new TwewyItem(30090, 90, @"tile569", @"(S) Safe Landing", @"Ｓ：ふっとび回避", @"(S) Aterrizaje seguro", @"(S) Atterraggio sicuro", @"(S) Sichere Landung", @"(S) Atterrissage réussi", @"Ｓ：擊飛閃避", @"S：击飞闪避", @"[#00CC00]Neku sticker.[#000000] If an enemy attack sends Neku flying, [#FF0000]tap the screen[#000000] to recover in midair and [#FF0000]avoid getting knocked down[#000000].", @"[#FF0000]ネク専用[#000000]　ネクが敵の攻撃で[#FF0000]ふっとんだときに\n画面をタップしなおす[#000000]ことで体勢を\nたてなおして[#FF0000]ダウン[#000000]するのをふせぐことができる", @"[#00CC00]Sello de Neku.[#000000] Si un ataque enemigo envía a Neku por los aires, [#FF0000]toca la pantalla[#000000] para rescatarlo en pleno vuelo y [#FF0000]evitar que se estrelle[#000000].", @"[#00CC00]Sticker di Neku.[#000000] Se un attacco nemico fa volare Neku, [#FF0000]tocca lo schermo[#000000] per farlo riprendere a mezz'aria ed [#FF0000]evitare che si schianti a terra[#000000].", @"[#00CC00]Neku-Sticker.[#000000] Wenn ein gegnerischer Angriff Neku in die Luft schleudert, kannst du [#FF0000]auf den Bildschirm tippen[#000000], damit er sich in der Luft erholt und [#FF0000]nicht zu Boden geworfen wird[#000000].", @"[#00CC00]Sticker de Neku.[#000000] Si une attaque ennemie envoie Neku en l'air, [#FF0000]touchez l'écran[#000000] pour récupérer en plein vol et [#FF0000]éviter de tomber[#000000].", @"[#FF0000]音操專用[#000000]　音操被敵人的攻擊[#FF0000]擊飛時[#000000]，\n[#FF0000]重新點擊螢幕[#000000]就能重整姿勢，\n可以防範[#FF0000]倒地[#000000]。", @"[#FF0000]音操专用[#000000] 音操被敌人的攻击[#FF0000]击飞时[#000000]，\n[#FF0000]重新点击屏幕[#000000]就能重整姿势，\n可以防范[#FF0000]倒地[#000000]。") },
            { 30091, new TwewyItem(30091, 91, @"tile570", @"(S) Technical EXP", @"Ｓ：テクニカルＥＸＰ", @"(S) EXP técnica", @"(S) ESP tecnica", @"(S) Technische EP", @"(S) XP technique", @"Ｓ：技術性ＥＸＰ", @"S：技术性EXP", @"Collect a [#FF0000]technical EXP bonus[#000000] for landing [#FF0000]10 or more hits in midair[#000000].", @"[#FF0000]空中で１０ＨＩＴ以上攻撃を当てる[#000000]ことで\n[#FF0000]テクニカルＥＸＰボーナス[#000000]をゲットできる\nようになる", @"Consigue una [#FF0000]bonificación de EXP técnica[#000000] al lograr [#FF0000]diez o más impactos aéreos[#000000].", @"Ottieni un [#FF0000]bonus ESP tecnica[#000000] se sferri [#FF0000]10 o più colpi a mezz'aria[#000000].", @"Du erhältst einen [#FF0000]technischen EP-Bonus[#000000], wenn du [#FF0000]10 oder mehr Treffer in der Luft[#000000] landest.", @"Récoltez un [#FF0000]bonus d'XP technique[#000000] quand vous infligez [#FF0000]10 coups en l'air ou plus[#000000].", @"[#FF0000]在空中攻擊命中１０ＨＩＴ以上[#000000]，\n就能獲得[#FF0000]技術性ＥＸＰ加成[#000000]。", @"[#FF0000]在空中攻击命中10HIT以上[#000000]，\n就能获得\n[#FF0000]技术性EXP加成[#000000]。") },
            { 30092, new TwewyItem(30092, 92, @"tile571", @"(S) Shutdown", @"Ｓ：シャットダウン", @"(S) Ausencia", @"(S) Spegnimento", @"(S) Abschalten", @"(S) Absence", @"Ｓ：關機", @"S：关机", @"Select [#FF0000]Continue from the Title Screen[#000000] after having [#FF0000]exited the game[#000000], and the pins Neku is wearing will [#FF0000]earn PP for the time you were away[#000000] (maxing out at 7 days' worth of bonus PP).", @"[#FF0000]ゲームを遊んでいない時間[#000000]に応じて、\n[#FF0000]バッジメニュー[#000000]を開いた時に[#FF0000]そうびしたバッジに\n最高７日分まで溜まったＢＰボーナスが入る[#000000]\nようになる", @"[#FF0000]Si continúas desde la pantalla del título[#000000] después de [#FF0000]salir del Juego[#000000], los [#FF0000]pines que lleve Neku ganarán PP[#000000] durante el tiempo que estés ausente, hasta un máximo de siete días.", @"[#FF0000]Continua dalla Schermata del titolo[#000000] dopo aver [#FF0000]abbandonato la partita[#000000], e [#FF0000]le spille che indossa Neku guadagneranno PS[#000000] in base al tempo in cui resterai inattivo, fino a un massimo di 7 giorni.", @"[#FF0000]Du kannst vom Titelbildschirm aus weiterspielen[#000000], wenn du [#FF0000]das Spiel beendet hast[#000000]. Während deiner Abwesenheit erhalten [#FF0000]Pins, die Neku trägt, weiter PP[#000000] (maximal 7 Tage).", @"[#FF0000]Continuez depuis l'écran titre[#000000] après avoir [#FF0000]quitté le jeu[#000000] et les [#FF0000]badges portés par Neku gagneront des PB[#000000] pendant votre absence, jusqu'à 7 jours.", @"[#FF0000]沒有遊玩遊戲的時間[#000000]將獲得累積，\n於打開[#FF0000]徽章選單[#000000]時，\n[#FF0000]裝備的徽章最多能獲得７天份的ＰＰ加成[#000000]。", @"[#FF0000]没有玩游戏的时间[#000000]将获得累积，\n于打开[#FF0000]徽章菜单[#000000]时，\n[#FF0000]装备的徽章最多能获得７天份的PP加成[#000000]。") },
            { 30093, new TwewyItem(30093, 93, @"tile572", @"(S) Brand Awareness", @"Ｓ：ブランドぞくせい", @"(S) Conciencia de marca", @"(S) Riconoscibilità brand", @"(S) Markenbewusstsein", @"(S) Reconnaissance marque", @"Ｓ：品牌屬性", @"S：品牌属性", @"[#00CC00]Neku sticker.[#000000] Pins get [#FF0000]stronger or weaker[#000000] based on [#FF0000]where their brands place[#000000] on the area's brand chart. The [#FF0000]last-place brand's Attack is halved[#000000].", @"[#FF0000]ネク専用[#000000]　[#FF0000]ブランドランキング[#000000]のブランドの順位[#000000]に\nよって、バッジの[#FF0000]攻撃力がアップしたりダウン[#000000]する\nまた[#FF0000]ランキング最下位のバッジは攻撃力が半減[#000000]する", @"[#00CC00]Sello de Neku.[#000000] Los pines se [#FF0000]fortalecen o debilitan[#000000] dependiendo del [#FF0000]puesto que ocupen sus marcas[#000000] en la lista de la zona. El [#FF0000]ataque de la marca que ocupa el último lugar se reduce a la mitad[#000000].", @"[#00CC00]Sticker di Neku.[#000000] Le spille diventano [#FF0000]più forti o più deboli[#000000] in base alla [#FF0000]posizione del loro brand[#000000] nella classifica dei brand di quell'area. L'[#FF0000]Attacco del brand all'ultimo posto è dimezzato[#000000].", @"[#00CC00]Neku-Sticker.[#000000] Pins werden [#FF0000]stärker oder schwächer[#000000], je nach [#FF0000]der Platzierung ihrer Marke[#000000] in den Markencharts der Gegend. Der [#FF0000]Angriff der letztplatzierten Marke wird halbiert[#000000].", @"[#00CC00]Sticker de Neku.[#000000] Les badges deviennent [#FF0000]plus puissants ou plus faibles[#000000] en fonction de [#FF0000]la place de leur marque[#000000] sur le podium des marques du quartier. L'attaque de la marque en dernière place est [#FF0000]divisée par deux[#000000].", @"[#FF0000]音操專用[#000000]　根據[#FF0000]品牌排名[#000000]的[#FF0000]品牌順序[#000000]，\n徽章的[#FF0000]攻擊力會有增有減[#000000]。\n此外，[#FF0000]排名最低的徽章攻擊力會減半[#000000]。", @"[#FF0000]音操专用[#000000] 根据[#FF0000]品牌排名[#000000]的[#FF0000]品牌顺序[#000000]，\n徽章的[#FF0000]攻击力会提升或减低[#000000]。\n此外，[#FF0000]倒数第一的徽章攻击力会减半[#000000]。") },
            { 30094, new TwewyItem(30094, 94, @"tile573", @"(S) Dash", @"Ｓ：ダッシュ", @"(S) Acelerón", @"(S) Scatto", @"(S) Sprinten", @"(S) Sprint", @"Ｓ：衝刺", @"S：冲刺", @"[#FF0000]Quickly drag[#000000] Neku to [#FF0000]dash[#000000]. At the very start of his dash, Neku is [#FF0000]untouchable[#000000], allowing him to slip past oncoming enemy attacks.", @"ネクを[#FF0000]すばやく動かす[#000000]ことで[#FF0000]ダッシュ[#000000]する\nダッシュの[#FF0000]ではじめは無敵[#000000]になるので\n敵の攻撃などをよけることができる", @"[#FF0000]Arrastra rápidamente[#000000] a Neku para que [#FF0000]acelere[#000000]. Al principio de este proceso, Neku será [#FF0000]intocable[#000000] y podrá pasar de largo frente a los ataques enemigos.", @"[#FF0000]Trascina rapidamente[#000000] Neku per [#FF0000]scattare[#000000]. All'inizio dello scatto Neku è [#FF0000]intoccabile[#000000], e ciò gli consente di sfuggire agli attacchi nemici.", @"[#FF0000]Ziehe Neku[#000000] schnell um zu [#FF0000]Sprinten[#000000]. Zu Beginn seines Sprints ist Neku [#FF0000]unantastbar[#000000], sodass er gegnerischen Angriffen ausweichen kann.", @"[#FF0000]Faites glisser rapidement[#000000] Neku pour [#FF0000]sprinter[#000000]. Au tout début de son sprint, Neku est [#FF0000]invincible[#000000], ce qui lui permet de passer au travers des attaques ennemies.", @"[#FF0000]快速移動[#000000]音操，可使他進行[#FF0000]衝刺[#000000]，\n衝刺[#FF0000]一開始為無敵狀態[#000000]，\n可藉此避開敵人攻擊。", @"[#FF0000]快速移动[#000000]音操，可使他进行[#FF0000]冲刺[#000000]，\n冲刺[#FF0000]一开始为无敌状态[#000000]，\n可藉此避开敌人攻击。") },
            { 30095, new TwewyItem(30095, 95, @"tile574", @"(S) Game Cleared", @"Ｓ：ゲームクリア", @"(S) Juego superado", @"(S) Partita completata", @"(S) Spiel gemeistert", @"(S) Jeu terminé", @"Ｓ：通關", @"S：通关", @"This proves that you've [#FF0000]beaten the game[#000000]. Nice work! You can now access the [#FF0000]Chapter Selection Menu[#000000] from the Main Menu.", @"この[#FF0000]ゲームをクリアした[#000000]あかし\nメインメニューから[#FF0000]チャプターセレクト[#000000]を\nえらべるようになる", @"Esto demuestra que has [#FF0000]superado el Juego[#000000]. ¡Buen trabajo! Ahora puedes acceder al [#FF0000]menú de selección de capítulos[#000000] desde el menú Inicio.", @"Questo dimostra che hai [#FF0000]vinto il gioco[#000000]. Ottimo lavoro! Ora puoi accedere al [#FF0000]menu di selezione capitoli[#000000] dal Menu principale.", @"Dein Beweis dafür, dass du [#FF0000]das Spiel gemeistert hast[#000000]. Gut gemacht! Du kannst jetzt über das Startmenü auf das [#FF0000]Kapitel-Auswahlmenü[#000000] zugreifen.", @"Voilà qui prouve que vous avez [#FF0000]terminé le jeu[#000000]. Bien joué ! Vous pouvez désormais accéder au [#FF0000]menu de sélection des chapitres[#000000] depuis le menu Accueil.", @"[#FF0000]本作通關[#000000]的證明，\n可讓主選單新增[#FF0000]章節選單[#000000]選項。", @"[#FF0000]本作通关[#000000]的证明，\n可让主菜单新增[#FF0000]章节菜单[#000000]选项。") },
