            { 30120, new TwewyItem(30120, 120, @"tile231", @"(S) Chain 4", @"Ｓ：エンカウント・４", @"(S) Cadena de 4", @"(S) Catena 4", @"(S) 4er-Kette", @"(S) 4 à la chaîne", @"Ｓ：４連戰", @"S：4连战", @"Lets you [#FF0000]chain up to 4 battles[#000000] at once. [#FF0000]Enemies grow stronger[#000000] with each \x22reduction\x22 (round), but also [#FF0000]drop pins more often[#000000].", @"エンカウント時[#FF0000]４チェイン[#000000]まで[#FF0000]連戦バトル[#000000]できる\n連戦ラウンド数に応じて[#FF0000]敵が強くなる[#000000]が\n敵を倒したときに[#FF0000]バッジを落とす確率がアップ[#000000]する", @"Te permite [#FF0000]encadenar hasta cuatro batallas[#000000] a la vez. [#FF0000]Los enemigos se fortalecen[#000000] con cada «reducción» (ronda), pero también [#FF0000]sueltan pines con mayor frecuencia[#000000].", @"Ti permette di [#FF0000]concatenare fino a 4 battaglie[#000000] alla volta. I [#FF0000]nemici diventano più forti[#000000] ad ogni \x22riduzione\x22 (round), ma [#FF0000]lasciano anche cadere spille più spesso[#000000].", @"Hiermit kannst du [#FF0000]bis zu 4 Kämpfe als Kette[#000000] spielen. [#FF0000]Gegner werden mit jeder \x22Reduzierung\x22 (Runde) stärker[#000000], aber du [#FF0000]findest auch häufiger Pins[#000000].", @"Vous permet [#FF0000]d'enchaîner jusqu'à 4 combats[#000000] d'un coup. Les [#FF0000]ennemis deviennent de plus en plus forts[#000000] à chaque \x22réduction\x22 (manche), et ils [#FF0000]lâchent aussi des badges plus souvent[#000000].", @"遇敵時的[#FF0000]連續戰鬥[#000000]最多可達到[#FF0000]４連鎖[#000000]，\n雖然隨著連續戰鬥回合數推進[#FF0000]敵人會越變越強[#000000]，\n但每次打倒敵人時[#FF0000]徽章掉落機率都會提升[#000000]。", @"遇敌时的[#FF0000]连续战斗[#000000]最多可达到[#FF0000]4连锁[#000000]，\n虽然随着连续战斗回合数推进[#FF0000]敌人会越变越强[#000000]，\n但每次打倒敌人时[#FF0000]徽章掉落机率都会提升[#000000]。") },
            { 30121, new TwewyItem(30121, 121, @"tile203", @"(S) Chain 16", @"Ｓ：エンカウント・１６", @"(S) Cadena de 16", @"(S) Catena 16", @"(S) 16er-Kette", @"(S) 16 à la chaîne", @"Ｓ：１６連戰", @"S：16连战", @"Lets you [#FF0000]chain up to 16 battles[#000000] at once. [#FF0000]Enemies grow stronger[#000000] with each \x22reduction\x22 (round), but also [#FF0000]drop pins more often[#000000].", @"エンカウント時[#FF0000]１６チェイン[#000000]まで[#FF0000]連戦バトル[#000000]できる\n連戦ラウンド数に応じて[#FF0000]敵が強くなる[#000000]が\n敵を倒したときに[#FF0000]バッジを落とす確率がアップ[#000000]する", @"Te permite [#FF0000]encadenar hasta 16 batallas[#000000] a la vez. [#FF0000]Los enemigos se fortalecen[#000000] con cada «reducción» (ronda), pero también [#FF0000]sueltan pines con mayor frecuencia[#000000].", @"Ti permette di [#FF0000]concatenare fino a 16 battaglie[#000000] alla volta. I [#FF0000]nemici diventano più forti[#000000] ad ogni \x22riduzione\x22 (round), ma [#FF0000]lasciano anche cadere spille più spesso[#000000].", @"Hiermit kannst du [#FF0000]bis zu 16 Kämpfe als Kette[#000000] spielen. [#FF0000]Gegner werden mit jeder \x22Reduzierung\x22 (Runde) stärker[#000000], aber du [#FF0000]findest auch häufiger Pins[#000000].", @"Vous permet [#FF0000]d'enchaîner jusqu'à 16 combats[#000000] d'un coup. Les [#FF0000]ennemis deviennent de plus en plus forts[#000000] à chaque \x22réduction\x22 (manche), et ils [#FF0000]lâchent aussi des badges plus souvent[#000000].", @"遇敵時的[#FF0000]連續戰鬥[#000000]最多可達到[#FF0000]１６連鎖[#000000]，\n雖然隨著連續戰鬥回合數推進[#FF0000]敵人會越變越強[#000000]，\n但每次打倒敵人時[#FF0000]徽章掉落機率都會提升[#000000]。", @"遇敌时的[#FF0000]连续战斗[#000000]最多可达到[#FF0000]16连锁[#000000]，\n虽然随着连续战斗回合数推进[#FF0000]敌人会越变越强[#000000]，\n但每次打倒敌人时[#FF0000]徽章掉落机率都会提升[#000000]。") },
            { 30122, new TwewyItem(30122, 122, @"tile175", @"(S) Retry Battles", @"Ｓ：バトルリトライ", @"(S) Repetición de la batalla", @"(S) Riprova le battaglie", @"(S) Kämpfe neu versuchen", @"(S) Recommencer les combats", @"Ｓ：重新挑戰", @"S：重新挑战", @"Lets you recover from a Game Over and [#FF0000]retry the battle you lost[#000000]. In the case of a chain battle, you will start from the first round.", @"ゲームオーバーになっても\n[#FF0000]そのバトルをリトライ[#000000]できる\n連戦の場合、はじめからリトライとなる", @"Te permite recuperarte tras un «fin del Juego» y [#FF0000]volver a librar la batalla perdida[#000000]. Si se trata de una batalla en cadena, empezarás desde la primera ronda.", @"Ti permette di recuperare da un Game over e [#FF0000]riprovare le battaglie che hai perso[#000000]. In caso di battaglia a catena, ricomincerai dal primo round.", @"Hiermit kannst du ein \x22Game Over\x22 überstehen und [#FF0000]den verlorenen Kampf erneut versuchen[#000000]. Bei einem Kettenkampf fängst du wieder in der ersten Runde an.", @"Vous permet de reprendre une partie terminée et de [#FF0000]réessayer le combat que vous avez perdu[#000000]. En cas de combat à la chaîne, vous recommencerez à partir de la première manche.", @"即使遊戲結束\n也能[#FF0000]重新挑戰該場戰鬥[#000000]，\n若是連續戰鬥，則會從第一場開始。", @"即使游戏结束\n也能[#FF0000]重新挑战该场战斗[#000000]，\n若是连续战斗，则会从第一场开始。") },
            { 30123, new TwewyItem(30123, 123, @"tile147", @"(S) Hard", @"Ｓ：ハード", @"(S) Difícil", @"(S) Difficile", @"(S) Schwierig", @"(S) Difficile", @"Ｓ：困難", @"S：困难", @"Lets you [#FF0000]set the difficulty to Hard[#000000] from the Main Menu. Makes battles tougher, but nets you more EXP and more variations of pins.", @"メインメニューから[#FF0000]バトル難易度：ハード[#000000]を\nえらべる　バトルはむずかしくなるが\n敵を倒したときの経験値やバッジの種類が増える", @"Puedes [#FF0000]ajustar la dificultad a modo Difícil[#000000] desde el menú Inicio. Endurece más las batallas, pero te da más EXP y pines mejores.", @"Ti permette di [#FF0000]impostare la difficoltà su Difficile[#000000] dal Menu principale. Le battaglie diventano più dure, ma ti fanno guadagnare più ESP e più varianti di spille.", @"Hiermit kannst du im Startmenü den [#FF0000]Schwierigkeitsgrad auf Schwierig[#000000] setzen. Dadurch werden die Kämpfe schwieriger, aber du erhältst mehr EP und mehr Arten von Pins.", @"Vous permet de [#FF0000]régler la difficulté sur Difficile[#000000] depuis le menu Accueil. Les combats seront plus durs, mais ils vous rapporteront plus de points d'XP et différents badges.", @"可從主選單選擇[#FF0000]戰鬥難度：困難[#000000]，\n雖然戰鬥會變困難，\n但打倒敵人時獲得的\n經驗值與徽章種類都會增加。", @"可从主菜单选择[#FF0000]战斗难度：困难[#000000]，\n虽然战斗会变困难，\n但打倒敌人时获得的\n经验值与徽章种类都会增加。") },
            { 30124, new TwewyItem(30124, 124, @"tile119", @"(S) Hollow Leg", @"Ｓ：フードリミッター解除", @"(S) Sin fondo", @"(S) Senza fondo", @"(S) Notvorrat", @"(S) Grosse bouffe", @"Ｓ：食物限制解除", @"S：食物限制解除", @"Locks the [#FF0000]number of bytes you can eat[#000000] at [#FF0000]24[#000000]. Eating food no longer causes this number to decrease.", @"フードメモリの最大値が２４のままになり\n食べ物を食べてもフードメモリの最大値が\n減らなくなる", @"El [#FF0000]número de bocados que puedes comer[#000000] se fija en [#FF0000]24[#000000] y esta cantidad ya no se reduce al alimentarte.", @"Blocca il [#FF0000]numero di byte che puoi consumare[#000000] a [#FF0000]24[#000000]. Consumare alimenti non fa più diminuire questo numero.", @"Setzt die [#FF0000]Anzahl der Bissen, die du essen kannst,[#000000] dauerhaft auf [#FF0000]24[#000000]. Diese Zahl sinkt nicht mehr, egal wie viel du isst.", @"Verrouille le [#FF0000]nombre de bouchées que vous pouvez manger[#000000] sur [#FF0000]24[#000000]. Ce nombre ne diminuera plus quand vous mangerez.", @"消化儲存量的最大值一直維持２４不變，\n即使吃下食物，消化儲存量也不會減少。", @"消化储存量的最大值一直维持24不变，\n即使吃下食物，\n消化储存量也不会减少。") },
            { 30125, new TwewyItem(30125, 125, @"tile091", @"(S) Ultimate", @"Ｓ：アルティメット", @"(S) Definitivo", @"(S) Massimo", @"(S) Ultimativ", @"(S) Ultime", @"Ｓ：極難", @"S：极难", @"Lets you [#FF0000]set the difficulty to Ultimate[#000000] from the Main Menu. Makes battles insanely tough, but nets you more EXP and more variations of pins.", @"メインメニューから[#FF0000]バトル難易度：アルティメット[#000000]\nをえらべる　バトルはすごくむずかしくなるが\n敵を倒したときの経験値やバッジの種類が増える", @"Puedes [#FF0000]ajustar la dificultad a modo Definitivo[#000000] desde el menú Inicio. La dureza de las batallas será brutal, pero conseguirás más EXP y pines mejores.", @"Ti permette di [#FF0000]impostare la difficoltà su Massima[#000000] dal Menu principale. Le battaglie diventano estremamente dure, ma ti fanno guadagnare più ESP e più varianti di spille.", @"Hiermit kannst du im Startmenü den [#FF0000]Schwierigkeitsgrad auf Ultimativ[#000000] setzen. Dadurch werden die Kämpfe unglaublich schwierig, aber du erhältst mehr EP und mehr Arten von Pins.", @"Vous permet de [#FF0000]régler la difficulté sur Ultime[#000000] depuis le menu Accueil. Les combats seront extrêmement durs, mais ils vous rapporteront plus de points d'XP et différents badges.", @"可從主選單選擇[#FF0000]戰鬥難度：極難[#000000]，\n雖然戰鬥會變得極為困難，\n但打倒敵人時獲得的經驗值與徽章種類\n都會增加。", @"可从主菜单选择[#FF0000]战斗难度：极难[#000000]，\n虽然战斗会变得极为困难，\n但打倒敌人时​​获得的经验值与徽章种类\n都会增加。") },
            { 30126, new TwewyItem(30126, 126, @"tile063", @"(S) Easy", @"Ｓ：イージー", @"(S) Fácil", @"(S) Facile", @"(S) Einfach", @"(S) Facile", @"Ｓ：簡單", @"S：简单", @"Lets you [#FF0000]set the difficulty to Easy[#000000] from the Main Menu. Makes battles more manageable, but nets you fewer EXP and fewer variations of pins.", @"メインメニューから[#FF0000]バトル難易度：イージー[#000000]を\nえらべる　バトルはかんたんになるが\n敵を倒したときの経験値やバッジの種類が減る", @"Puedes [#FF0000]ajustar la dificultad a modo Fácil[#000000] desde el menú Inicio. Las batallas serán más manejables, pero conseguirás menos EXP y pines más débiles.", @"Ti permette di [#FF0000]impostare la difficoltà su Facile[#000000] dal Menu principale. Le battaglie diventano più gestibili, ma ti fanno guadagnare meno ESP e meno varianti di spille.", @"Hiermit kannst du im Startmenü den [#FF0000]Schwierigkeitsgrad auf Einfach[#000000] setzen. Dadurch werden die Kämpfe einfacher, aber du erhältst weniger EP und weniger Arten von Pins.", @"Vous permet de [#FF0000]régler la difficulté sur Facile[#000000] depuis le menu Accueil. Les combats seront moins durs, mais ils vous rapporteront moins de points d'XP et moins de badges.", @"可從主選單選擇[#FF0000]戰鬥難度：簡單[#000000]，\n雖然戰鬥會變簡單，\n但打倒敵人時獲得的經驗值與徽章種類\n都會減少。", @"可从主菜单选择[#FF0000]战斗难度：简单[#000000]，\n虽然战斗会变简单，\n但打倒敌人时​​获得的经验值与徽章种类\n都会减少。") },
            { 30127, new TwewyItem(30127, 127, @"tile035", @"(S) Noise Report", @"Ｓ：ノイズレポート", @"(S) Informe de Ruido", @"(S) Report Rumori", @"(S) Noise-Bericht", @"(S) Rapport d'Écho", @"Ｓ：諾伊茲報告", @"S：噪音报告", @"Adds the [#FF0000]Noise Report[#000000] to the Main Menu. View info on enemies you've faced, such as [#FF0000]what pins they drop[#000000], or tips on erasing them.", @"メインメニューから[#FF0000]ノイズメニュー[#000000]を開ける\n[#FF0000]ノイズのドロップするアイテム[#000000]や[#FF0000]攻略法[#000000]など、\nいろいろなノイズの情報を知ることができる", @"Incorpora el [#FF0000]informe de Ruido[#000000] al menú Inicio, donde puedes consultar información sobre los enemigos a los que te has enfrentado: [#FF0000]qué pines sueltan[#000000] o consejos para acabar con ellos.", @"Aggiunge il [#FF0000]Report Rumori[#000000] al Menu principale. Visualizza le informazioni sui nemici che hai affrontato: [#FF0000]quali spille lasciano cadere[#000000], o i suggerimenti per cancellarli.", @"Erweitert das Startmenü um den [#FF0000]Noise-Bericht[#000000]. Hier erhältst du Infos über besiegte Gegner: [#FF0000]welche Pins du bei ihnen findest[#000000] oder wo ihre Schwächen liegen.", @"Ajoute le [#FF0000]rapport d'Écho[#000000] au menu Accueil. Il permet de consulter des informations sur les ennemis que vous avez affrontés : [#FF0000]quels badges ils ont lâchés[#000000] ou des astuces sur la façon de les battre.", @"在戰鬥時，\n靈活運用[#FF0000]搭檔徽章[#000000]能幫助主角進行攻擊，\n不過計量表用盡時會暫時無法使用，\n請多加留意。", @"从主菜单开启[#FF0000]噪音菜单[#000000]后，\n可得知[#FF0000]噪音的掉落道具[#000000]与[#FF0000]攻略法[#000000]等各种资讯。") },
            { 30128, new TwewyItem(30128, 128, @"tile007", @"(S) Tin Pin Menu", @"Ｓ：ミニゲーム対戦", @"(S) Tin Pin", @"(S) Tin Pin", @"(S) Tin-Pin", @"(S) Tin Pin", @"Ｓ：小遊戲對戰", @"S：小游戏对战", @"Adds [#FF0000]Tin Pin Slammer[#000000] to the Main Menu so you can select your favorite stage and slam to your heart's content!", @"メインメニューから[#FF0000]マーブルスラッシュ[#000000]の\n[#FF0000]専用モード[#000000]をあそべるようになる\nすきなステージを選んであそんでみよう", @"Incorpora el [#FF0000]Tin Pin Slammer[#000000] al menú Inicio para poder seleccionar y jugar tu escenario preferido.", @"Aggiunge [#FF0000]Tin Pin Slammer[#000000] al Menu principale per permetterti di selezionare il tuo livello preferito.", @"Erweitert das Startmenü um [#FF0000]Tin Pin Slammer[#000000] – nun kannst du dir deine Lieblingsarena aussuchen und spielen.", @"Ajoute [#FF0000]Tin Pin Slammer[#000000] au menu Accueil pour que vous puissiez choisir votre niveau préféré.", @"可從主選單選擇[#FF0000]激鬥徽章[#000000]\n[#FF0000]專用模式[#000000]進行遊玩，\n挑選喜歡的關卡玩玩看吧。", @"可从主菜单选择[#FF0000]激撞徽章[#000000]\n[#FF0000]专用模式[#000000]进行游玩，\n挑选喜欢的关卡玩玩看吧。") },
            { 30129, new TwewyItem(30129, 129, @"tile540", @"(S) Co-op", @"Ｓ：２人でプレイ", @"(S) Co-op", @"(S) Co-op", @"(S) Co-op", @"(S) Co-op", @"Ｓ：雙人遊玩", @"S：2人游戏", @"Adds the [#FF0000]Co-op Menu[#000000] to the Main Menu. Co-op lets you use the Joy-Con™ controllers to [#FF0000]bring a friend into the fray[#000000]!", @"メインメニューから[#FF0000]おすそわけメニュー[#000000]をえらべる\nようになる\nJoy-Conを「おすそわけ」して[#FF0000]バトルを2人で\n遊ぶ[#000000]ことができるぞ", @"Añade los [#FF0000]Co-op[#000000] al menú de Inicio. ¡Co-op te permite usar los mandos Joy-Con para [#FF0000] traer a un amigo al combate[#000000]!\n", @"Aggiunge il [#FF0000]Menu Co-op[#000000] al Menu principale. La modalità Co-op ti permette di usare i Joy-Con™ per [#FF0000]portare un amico nella mischia[#000000]!", @"Fügt das [#FF0000]Co-op-Menü[#000000] zum Startmenü hinzu. Im Co-op-Modus kannst du mithilfe der Joy-Con™ einen [#FF0000]Freund zur Hilfe rufen[#000000]!", @"Ajoute les menus [#FF0000]Co-op[#000000] au menu Accueil. Utilisez les Joy-Con™ pour [#FF0000]ramener vos amis dans la mélée[#FF0000].", @"可從主選單選擇[#FF0000]分享選單[#000000]，\n將Joy-Con「分享」給另一位玩家，\n[#FF0000]以雙人遊玩戰鬥[#000000]。", @"可从主菜单选择[#FF0000]分享菜单[#000000]，\n便可以将Joy-Con「分享」给另一位玩家，\n[#FF0000]以进行2人游戏战斗[#000000]。") },
            { 30130, new TwewyItem(30130, 130, @"tile541", @"(B) Partnered Combat", @"Ｂ：パートナーとバトル", @"(L) Combate en tándem", @"(L) Combattimento partner", @"(B) Gemeinsamer Kampf", @"(L) Combat avec un partenaire", @"Ｂ：與搭檔戰鬥", @"Ｂ：与搭档战斗", @"By [#FF0000]working together[#000000], Neku and his partner will have an easier time taking down foes.", @"ネクとパートナーで敵を同時に攻撃できる", @"Al [#FF0000]aunar esfuerzos[#000000], a Neku y su compañero les costará menos derrotar a los enemigos.", @"[#FF0000]Collaborando[#000000], Neku e il suo partner riusciranno a sconfiggere i nemici più facilmente.", @"Wenn sie [#FF0000]zusammenarbeiten[#000000], haben Neku und sein Partner eine bessere Chance, ihre Gegner zu besiegen.", @"En [#FF0000]s'associant[#000000], Neku et son partenaire auront moins de mal à éliminer leurs adversaires.", @"音操與搭檔可同時攻擊敵人。", @"音操与搭档可同时攻击敌人。") },
            { 30131, new TwewyItem(30131, 131, @"tile541", @"(B) Partner Pin", @"Ｂ：パートナーバッジ", @"(L) Pin compañero", @"(L) Spilla del partner", @"(B) Partner-Pin", @"(L) Badge partenaire", @"Ｂ：搭檔徽章", @"B：搭档徽章", @"Neku's partner can assist him in battle. But watch the [#FF0000]Partner Pin[#000000] gauge—once you use it up, you'll have to wait for a [#FF0000]reboot[#000000].", @"[#FF0000]パートナーバッジ[#000000]をうまく使って戦おう\n主人公が倒れていても攻撃できるぞ\nゲージがなくなるとしばらく使えないので\n注意しよう", @"Neku puede pedir ayuda a un compañero durante la batalla. Pero vigila la barra del [#FF0000]pin compañero[#000000]: cuando se agote, tendrás que esperar a que se [#FF0000]recargue[#000000].", @"Neku può chiedere aiuto al suo compagno durante il combattimento. Ma fai attenzione alla barra della [#FF0000]spilla del partner[#000000]: se si esaurisce, dovrai aspettare che si [#FF0000]riattivi[#000000].", @"Während Neku kämpft, kann sein Partner mit ins Gefecht springen. Achte jedoch auf die Anzeige des [#FF0000]Partner-Pins[#000000] – sobald diese leer ist, musst du warten, bis sie sich [#FF0000]wieder aufgeladen hat[#000000].", @"Pendant un combat, Neku peut être aidé par son partenaire. Mais attention à la jauge du [#FF0000]badge partenaire[#000000]. Une fois vide, vous devrez attendre sa [#FF0000]réactivation[#000000].", @"在戰鬥時，\n靈活運用[#FF0000]搭檔徽章[#000000]能幫助主角進行攻擊，\n不過計量表用盡時會暫時無法使用，\n請多加留意。", @"在战斗时，\n灵活运用[#FF0000]搭档徽章[#000000]能帮助主角进行攻击，\n不过计量表用尽时会暂时无法使用，\n请多加留意。") },
            { 30132, new TwewyItem(30132, 132, @"tile541", @"(B) Controlling Combat", @"Ｂ：バトルのそうさ", @"(L) Control del combate", @"(L) Controllo combattimento", @"(B) Kampfkontrolle", @"(L) Contrôler le combat", @"Ｂ：戰鬥操作", @"B：战斗操作", @"Use [#FF0000]touch commands[#000000] to fight. Input the [#FF0000]commands assigned to the pins[#000000] in your deck to [#FF0000]activate powerful psychs[#000000].", @"バトルでは[#FF0000]タッチコマンド[#000000]を使って戦おう\nそうびした[#FF0000]バッジ毎に決められた操作を入力[#000000]\nして色々なサイキックを発動することができるぞ", @"Usa los [#FF0000]comandos táctiles[#000000] para luchar. Usa los [#FF0000]comandos asignados a los pines[#000000] de tu tabla para [#FF0000]activar poderosos psicopoderes[#000000].", @"Usa i [#FF0000]comandi touch[#000000] per combattere. Inserisci i [#FF0000]comandi assegnati alle spille[#000000] nel tuo set per [#FF0000]attivare potenti psico[#000000].", @"Benutze im Kampf [#FF0000]Touch-Befehle[#000000]. Verwende die [#FF0000]Befehle der Pins[#000000] in deinem Set, um [#FF0000]mächtige Psychs zu aktivieren[#000000].", @"Utilisez les [#FF0000]commandes tactiles[#000000] pour vous battre. Effectuez les [#FF0000]commandes assignées aux badges[#000000] de votre deck pour [#FF0000]activer des psychs puissants[#000000].", @"在戰鬥中使用[#FF0000]觸控指令[#000000]進行戰鬥吧，\n配合裝備的[#FF0000]徽章輸入指定的操作[#000000]，\n就可以發動各種超能喔。", @"在战斗中使用[#FF0000]触控指令[#000000]进行战斗吧，\n配合装备的[#FF0000]徽章输入指定的操作[#000000]，\n就可以发动各种超能哦。") },
            { 30133, new TwewyItem(30133, 133, @"tile541", @"(B) Cross Combos", @"Ｂ：シンクロコンボ", @"(L) Combos cruzados", @"(L) Combo incrociate", @"(B) Koop-Kombos", @"(L) Combos croisés", @"Ｂ：同步連擊", @"B：同步连击", @"Try to [#FF0000]alternate attacks between Neku and his partner[#000000]. You'll receive visual feedback telling you your [#FF0000]sync rate has increased[#000000]!", @"[#FF0000]ネクとパートナーの攻撃が交互になる[#000000]ように\n操作してみよう　[#FF0000]特殊なエフェクトがでて\nシンクロ率がアップ[#000000]するぞ！", @"Prueba a [#FF0000]alternar ataques entre Neku y su compañero[#000000]. Una indicación visual te avisará de que vuestro [#FF0000]porcentaje de sincronización ha subido[#000000].", @"Cerca di [#FF0000]alternare gli attacchi tra Neku e il suo partner[#000000]. Riceverai un feedback visivo che ti dirà che il tuo [#FF0000]tasso di sincronizzazione è aumentato[#000000]!", @"Versuche, [#FF0000]die Angriffe von Neku und seinem Partner abzuwechseln[#000000]. Du bekommst optische Hinweise darauf, wenn deine [#FF0000]Synchro-Rate steigt[#000000]!", @"Essayez d'[#FF0000]alterner les attaques entre Neku et de son partenaire[#000000]. Une indication visuelle vous signalera que votre [#FF0000]taux de synchro a augmenté[#000000] !", @"試著使出[#FF0000]讓音操與搭檔進行交互攻擊[#000000]的\n操作吧，[#FF0000]會出現特殊效果[#000000]，\n[#FF0000]同步率也會上升[#000000]喔！", @"试着使出[#FF0000]让音操与搭档进行交替攻击[#000000]的\n操作吧，[#FF0000]会出现特殊效果[#000000]，\n[#FF0000]同步率也会上升[#000000]哦！") },
            { 30134, new TwewyItem(30134, 134, @"tile541", @"(B) So I Beat the Enemy...", @"Ｂ：敵を倒すと…？", @"(L) Derrota aplastante", @"(L) Sconfiggi il nemico", @"(B) Sieg über den Gegner ...", @"(L) J'ai battu l'ennemi...", @"Ｂ：打倒敵人後！", @"B：打倒敌人后!", @"Defeat foes to earn [#FF0000]EXP[#000000] and [#FF0000]PP[#000000]. EXP help [#FF0000]Neku gain levels[#000000]; PP awarded at the Results Screen [#FF0000]level up the pins he's wearing[#000000].", @"敵を倒すと[#FF0000]ＥＸＰ[#000000]と[#FF0000]ＢＰ[#000000]が手に入る　ＥＸＰは[#FF0000]ネク\nのレベルアップ[#000000]に使われ、ＢＰはリザルト画面で\n[#FF0000]そうびしたバッジのレベルアップ[#000000]に使われるぞ！", @"Derrota a los enemigos para adquirir [#FF0000]EXP[#000000] y [#FF0000]PP[#000000]. La EXP ayuda a [#FF0000]Neku a ganar niveles[#000000]; los PP otorgados en la pantalla Resultados [#FF0000]suben el nivel de los pines que lleva puestos[#000000].", @"Sconfiggi i nemici per guadagnare [#FF0000]ESP[#000000] e [#FF0000]PS[#000000]. L'ESP aiuta [#FF0000]Neku a ottenere livelli[#000000]; i PS conferiti nella Schermata dei risultati [#FF0000]fanno aumentare di livello la spilla che indossa[#000000].", @"Besiege Gegner, um [#FF0000]EP[#000000] und [#FF0000]PP[#000000] zu sammeln. Neku braucht [#FF0000]EP[#000000], um seine Stufe zu steigern, und die PP, die er im Ergebnisbildschirm erhält, erhöhen [#FF0000]die Stufe der Pins, die er trägt[#000000].", @"Battez des ennemis pour gagner des points d'[#FF0000]XP[#000000] et des [#FF0000]PB[#000000]. L'XP aide [#FF0000]Neku à passer au niveau supérieur[#000000]. Les PB reçus à l'écran des résultats [#FF0000]augmentent le niveau des badges qu'il porte[#000000].", @"打倒敵人後會獲得[#FF0000]ＥＸＰ[#000000]與[#FF0000]ＰＰ[#000000]，\nＥＸＰ可用於提升[#FF0000]音操的等級[#000000]，\nＰＰ則可在結算畫面[#FF0000]讓裝備的徽章升級[#000000]喔！", @"打倒敌人后会获得[#FF0000]EXP[#000000]与[#FF0000]PP[#000000]，\nEXP可用于提升[#FF0000]音操的等级[#000000]，\nPP则可在结算画面[#FF0000]让装备的徽章升级[#000000]哦！") },
            { 30135, new TwewyItem(30135, 135, @"tile541", @"(B) CONTROLS / Drag", @"Ｂ：そうさ／ドラッグ", @"(L) CONTROLES: Arrastrar", @"(L) COMANDI / Trascina", @"(B) BEFEHLE/Ziehen", @"(L) COMMANDES / Glisser", @"Ｂ：操作／拖曳", @"B：操作／拖拽", @"To [#00CC00]drag[#000000], [#FF0000]slide your finger/pointer while keeping it in contact with the screen[#000000]. Dragging is used to move Neku or activate certain psychs.", @"バトル中、画面を[#FF0000]タッチしたまま（サイキック\nボタンを押したまま）ひっぱるように\n移動させる[#000000]ことを[#FF0000]ドラッグ[#000000]という\nドラッグで発動するサイキックで使ったりする", @"Para [#00CC00]arrastrar[#000000], [#FF0000]desliza el dedo/puntero sin perder el contacto con la pantalla[#000000]. Sirve para mover a Neku o activar determinados psicopoderes.", @"Per [#00CC00]trascinare[#000000], [#FF0000]trascina il dito/puntatore sullo schermo[#000000]. Il trascinamento serve per muovere Neku o per attivare certi psico.", @"Um zu [#00CC00]ziehen[#000000], [#FF0000]bewegst den Finger/Pointer, über den Bildschirmt[#000000]. Durch Ziehen kannst du Neku bewegen oder bestimmte Psychs aktivieren.", @"Pour [#00CC00]glisser[#000000], [#FF0000]faites glisser en maintenant[#000000]. Ce mouvement sert à déplacer Neku ou à activer certains psychs.", @"戰鬥中，[#FF0000]觸碰著螢幕（按住超能按鈕）後\n以拖拉的方式移動角色[#000000]\n稱為[#FF0000]拖曳[#000000]，\n可用來移動音操或使出需靠拖曳發動的超能。", @"战斗中，[#FF0000]触碰着屏幕（按住超能键）后\n以拖拉的方式移动角色[#000000]\n称为[#FF0000]拖曳[#000000]，\n可用来移动音操或使出需靠拖曳发动的超能。") },
            { 30136, new TwewyItem(30136, 136, @"tile541", @"(B) CONTROLS / Tap", @"Ｂ：そうさ／タップ", @"(L) CONTROLES: Tocar", @"(L) COMANDI / Tocca", @"(B) BEFEHLE/Tippen", @"(L) COMMANDES / Toucher", @"Ｂ：操作／點擊", @"B：操作／点击", @"To [#00CC00]tap[#000000], [#FF0000]quickly touch the screen and release[#000000]. Tapping is used to activate certain psychs.", @"バトル中、画面を[#FF0000]一瞬だけつつく\n（サイキックボタンを一瞬だけ押す）[#000000]ことを\n[#FF0000]タップ[#000000]という\nタップで発動できるサイキックで使ったりする", @"Para [#00CC00]tocar[#000000], [#FF0000]da un toque rápido en la pantalla y quita el dedo/puntero[#000000]. El toque se utiliza para activar algunos psicopoderes.", @"Per [#00CC00]toccare[#000000], [#FF0000]tocca velocemente lo schermo e rilascia[#000000]. Toccare serve per attivare certi psico.", @"Um zu [#00CC00]tippen[#000000], [#FF0000]berührst du kurz den Bildschirm[#000000]. Durch Tippen aktivierst du bestimmte Psychs.", @"Pour [#00CC00]toucher[#000000], [#FF0000]touchez rapidement l'écran et retirez votre doigt[#000000]. Ce mouvement sert à activer certains psychs.", @"戰鬥中，[#FF0000]快速戳一下螢幕\n（快速按一下超能按鈕）[#000000]\n稱為[#FF0000]點擊[#000000]，\n可用來使出需靠點擊發動的超能。", @"战斗中，[#FF0000]快速触碰一下屏幕\n（快速按一下超能键）[#000000]\n称为[#FF0000]点击[#000000]，\n可用来使出需靠点击发动的超能。") },
            { 30137, new TwewyItem(30137, 137, @"tile541", @"(B) CONTROLS / Slash", @"Ｂ：そうさ／スラッシュ", @"(L) CONTROLES: Cortar", @"(L) COMANDI / Fendente", @"(B) BEFEHLE/Hieb", @"(L) COMMANDES / Balayer", @"Ｂ：操作／劃線", @"B：操作／划线", @"To [#00CC00]slash[#000000], [#FF0000]draw a short, quick line[#000000]. Having trouble? Be sure to [#FF0000]release right after slashing[#000000].", @"バトル中、画面に[#FF0000]指でサッと一瞬だけ\n線を引く[#000000]ことを[#FF0000]スラッシュ[#000000]という", @"Para [#00CC00]cortar[#000000], [#FF0000]traza una línea corta y rápida con el dedo/puntero[#000000]. ¿Problemas? [#FF0000]Levanta el dedo en cuanto acabes el corte[#000000].", @"Per [#00CC00]colpire con un fendente[#000000], [#FF0000]traccia una linea breve e rapida con il dito/puntatore[#000000]. Non ci riesci? Assicurati di [#FF0000]rilasciare immediatamente dopo aver lanciato il fendente[#000000].", @"Um einen [#00CC00]Hieb[#000000] auszuführen, [#FF0000]ziehst du eine kurze, schnelle Linie mit dem Finger/ Pointer[#000000]. Hast du dabei Probleme? [#FF0000]Lass nach dem Hieb direkt wieder los.[#000000]", @"Pour [#00CC00]balayer[#000000], [#FF0000]tracez une petite ligne rapide[#000000]. Vous n'y arrivez pas ? Pensez bien à [#FF0000]relacher après le balayage[#000000].", @"戰鬥中，於螢幕上[#FF0000]快速劃出線條[#000000]稱為\n[#FF0000]劃線[#000000]。", @"战斗中，于荧幕上[#FF0000]快速划出线条[#000000]称为\n[#FF0000]划线[#000000]。") },
            { 30138, new TwewyItem(30138, 138, @"tile541", @"(B) CONTROLS / Press", @"Ｂ：そうさ／ホールド", @"(L) CONTROLES: Pulsar", @"(L) COMANDI / Premi", @"(B) BEFEHLE/Drücken", @"(L) COMMANDES / Appuyer", @"Ｂ：操作／長按", @"B：操作／长按", @"To [#00CC00]press[#000000], [#FF0000]keep your finger/pointer in contact with a single point[#000000] on the screen. Pressing is used to activate certain psychs.", @"バトル中、[#FF0000]画面の一点をタッチしたまま動かさずに\nおさえつづける[#000000]ことを[#FF0000]ホールド[#000000]という\nホールドで発動できるサイキックで使ったりする", @"Para [#00CC00]pulsar[#000000], [#FF0000]mantén el dedo/puntero en contacto con un único punto[#000000] de la pantalla. Pulsa para activar determinados psicopoderes.", @"Per [#00CC00]premere[#000000], [#FF0000]tieni il dito/puntatore a contatto con un singolo punto[#000000] dello schermo. Premere serve per attivare certi psico.", @"Um zu [#00CC00]drücken[#000000], [#FF0000]berührst du längere Zeit einen bestimmten Punkt[#000000] auf dem Bildschirm. Durch Drücken aktivierst du bestimmte Psychs.", @"Pour [#00CC00]appuyer[#000000], [#FF0000]maintenez sur un point précis[#000000]. Ce mouvement sert à activer certains psychs.", @"戰鬥中，\n[#FF0000]持續按住螢幕上的一點不動[#000000][#FF0000]稱為長按[#000000]，\n可用來使出需靠長按發動的超能。", @"战斗中，\n[#FF0000]持续按住荧幕上的一点不动[#000000][#FF0000]称为长按[#000000]，\n可用来使出需靠长按发动的超能。") },
            { 30139, new TwewyItem(30139, 139, @"tile541", @"(B) Use Obstacles", @"Ｂ：障害物を使う", @"(L) Uso de obstáculos", @"(L) Usa ostacoli", @"(B) Hindernisse verwenden", @"(L) Utiliser les obstacles", @"Ｂ：利用障礙物", @"B：利用障碍物", @"[#FF0000]Obstacles[#000000] lying around the field can be used during combat to deal damage to your enemies. Some foes will [#FF0000]use obstacles against you[#000000], too!", @"バトル中、[#FF0000]障害物[#000000]を利用して敵にダメージを与える\nこともできる　また、逆に[#FF0000]敵が障害物を利用して\n攻撃してくることもある[#000000]ので気をつけよう！", @"Durante el combate, puedes usar los [#FF0000]obstáculos[#000000] que encuentres para herir a tus enemigos, aunque [#FF0000]ellos también pueden usar obstáculos contra ti[#000000].", @"Gli [#FF0000]ostacoli[#000000] che si trovano nel campo possono essere usati durante il combattimento per infliggere danno ai nemici. Anche alcuni nemici [#FF0000]utilizzeranno gli ostacoli contro di te[#000000]!", @"Herumliegende [#FF0000]Hindernisse[#000000] kannst du im Kampf benutzen, um deinen Gegnern Schaden zuzufügen. Bestimmte Gegner [#FF0000]verwenden Hindernisse gegen dich[#000000]!", @"Les [#FF0000]obstacles[#000000] disposés un peu partout sur le terrain peuvent être utilisés lors des combats pour infliger des dégâts à vos ennemis. Certains adversaires [#FF0000]utilisent aussi ces obstacles contre vous[#000000] !", @"戰鬥中，也可以利用[#FF0000]障礙物[#000000]給予敵人傷害。\n相對地，[#FF0000]敵人也可以利用障礙物\n發動攻擊[#000000]，請多加留意！", @"战斗中，也可以利用[#FF0000]障碍物[#000000]给予敌人伤害。\n相对地，[#FF0000]敌人也可以利用障碍物\n发动攻击[#000000]，请多加留意！") },
            { 30140, new TwewyItem(30140, 140, @"tile541", @"(B) Wearing Pins", @"Ｂ：バッジのそうび", @"(L) Pines puestos", @"(L) Spille indossate", @"(B) Pins tragen", @"(L) Porter des badges", @"Ｂ：裝備徽章", @"B：装备徽章", @"Neku relies on the [#FF0000]pins he's wearing[#000000] to fight! Enter a pin's [#FF0000]touch command[#000000] correctly and the [#FF0000]pin icon will flash[#000000].", @"バトル中は[#FF0000]そうびしたバッジ[#000000]で戦うぞ！\n[#FF0000]タッチコマンドの入力に成功[#000000]したときは\n[#FF0000]使われているバッジが光る[#000000]ので覚えておこう！", @"Neku depende de los [#FF0000]pines que lleva puestos[#000000] para combatir. Usa correctamente el [#FF0000]comando táctil[#000000] de un pin y [#FF0000]su icono parpadeará[#000000].", @"Neku dipende dalle [#FF0000]spille che indossa[#000000] per combattere! Inserisci un [#FF0000]comando touch[#000000] della spilla corretto e l'[#FF0000]icona della spilla lampeggerà[#000000].", @"Neku verwendet die [#FF0000]Pins, die er trägt[#000000], im Kampf! Wenn du den [#FF0000]Touch-Befehl[#000000] eines Pins korrekt eingibst, [#FF0000]blinkt das Pin-Symbol[#000000].", @"Neku s'appuie sur les [#FF0000]badges qu'il porte[#000000] pour se battre ! Effectuez correctement la [#FF0000]commande tactile[#000000] d'un badge et l'[#FF0000]icône du badge clignotera[#000000].", @"戰鬥中，使用[#FF0000]裝備的徽章[#000000]戰鬥吧！\n[#FF0000]成功輸入觸控指令[#000000]時，\n[#FF0000]使用的徽章會發光[#000000]，請記住這點！", @"战斗中，使用[#FF0000]装备的徽章[#000000]战斗吧！\n[#FF0000]成功输入触控指令[#000000]时，\n[#FF0000]使用的徽章会发光[#000000]，请记住这点！") },
            { 30141, new TwewyItem(30141, 141, @"tile541", @"(B) Sub-slots", @"Ｂ：サブスロット", @"(L) Subhuecos", @"(L) Spazi secondari", @"(B) Unterplätze", @"(L) Sous-emplacements", @"Ｂ：候補欄位", @"B：候补栏位", @"Use the Pins Menu to assign pins to [#FF0000]sub-slots[#000000]. Those pins will [#FF0000]only activate while you're holding a finger on the SUB button[#000000].", @"バッジメニューで[#FF0000]サブスロット[#000000]に指定された\nバッジは[#FF0000]サブボタンをタップしつづけると\n使えるようになる[#000000]ぞ！うまく切り替えて使おう！", @"En el menú Pines puedes asignar pines a [#FF0000]subhuecos[#000000]. Estos pines [#FF0000]solo se activan si mantienes el dedo sobre el botón SUB[#000000].", @"Usa il Menu Spille per assegnare spille a [#FF0000]spazi secondari[#000000]. Quelle spille [#FF0000]si attiveranno soltanto se terrai premuto il dito sul pulsante SEC[#000000].", @"Im Pin-Menü kannst du Pins [#FF0000]Unterplätzen[#000000] zuordnen. Diese Pins werden [#FF0000]nur aktiviert, wenn du die Schaltfläche \x22UNT\x22 gedrückt hältst[#000000].", @"Utilisez le menu Badges pour assigner des badges aux [#FF0000]sous-emplacements[#000000]. Ces badges [#FF0000]s'activeront uniquement lorsque vous maintiendrez votre doigt appuyé sur le bouton SOUS[#000000].", @"於徽章選單中，被指定放在[#FF0000]候補欄位[#000000]的徽章，\n[#FF0000]只要按著候補按鈕就可以使用[#000000]！\n善加利用這功能切換想要使用的徽章吧！", @"于徽章菜单中，被指定放在[#FF0000]候补栏位[#000000]的徽章，\n[#FF0000]只要点击候补按键就可以使用[#000000]！\n善加利用这功能切换想要使用的徽章吧！") },
            { 30142, new TwewyItem(30142, 142, @"tile541", @"(B) Boot/Reboot", @"Ｂ：ブートとリブート", @"(L) Carga y recarga", @"(L) Attiva/Riattiva", @"(B) (Wieder) aufladen", @"(L) Activation/Réactivation", @"Ｂ：啟動與重啟", @"B：启动与重启", @"Some pins need to [#FF0000]boot[#000000] at the start of battle before they can be used. [#FF0000]Once a pin's gauge runs out[#000000], you'll have to wait for it to [#FF0000]reboot[#000000].", @"バトルの[#FF0000]開始時にバッジが使用可能になる[#000000]ことを\n[#FF0000]ブート[#000000]といい、[#FF0000]バッジゲージを使いきったときなど\nに一定時間で使用可能になる[#000000]ことを[#FF0000]リブート[#000000]という", @"Algunos pines tienen que [#FF0000]cargarse[#000000] al comienzo de la batalla antes de usarlos. [#FF0000]Cuando se agote la barra de un pin[#000000], tendrás que esperar a que se [#FF0000]recargue[#000000].", @"Alcune spille devono [#FF0000]attivarsi[#000000] a inizio battaglia prima di poter essere usate. [#FF0000]Quando la barra di una spilla si esaurisce[#000000], dovrai aspettare che si [#FF0000]riattivi[#000000].", @"Manche Pins müssen zu Beginn eines Kampfs erst [#FF0000]aufgeladen[#000000] werden, bevor du sie verwenden kannst. [#FF0000]Wenn die Anzeige eines Pins leer ist[#000000], musst du warten, bis er [#FF0000]wieder aufgeladen[#000000] ist.", @"Certains badges ont besoin d'un temps d'[#FF0000]activation[#000000] au début du combat avant de pouvoir être utilisés. [#FF0000]Une fois la jauge d'un badge épuisée[#000000], vous devrez attendre qu'il se [#FF0000]réactive[#000000].", @"戰鬥[#FF0000]開始時能使用徽章[#000000]的狀態\n稱為[#FF0000]啟動[#000000]，[#FF0000]徽章計量表用盡後[#000000]，\n[#FF0000]經過一段時間又能使用[#000000]稱為[#FF0000]重啟[#000000]。", @"战斗[#FF0000]开始时能使用徽章[#000000]的状态\n称为[#FF0000]启动[#000000]，[#FF0000]徽章计量表用尽后[#000000]，\n[#FF0000]经过一段时间又能使用[#000000]称为[#FF0000]重启[#000000]。") },
            { 30143, new TwewyItem(30143, 143, @"tile541", @"(B) Negative Statuses", @"Ｂ：バトルでの状態異常", @"(L) Estados negativos", @"(L) Stati negativi", @"(B) Negative Statuszustände", @"(L) Statuts négatifs", @"Ｂ：戰鬥時的異常狀態", @"B：战斗时的状态异常", @"Neku, his partner, and their enemies are all susceptible to [#FF0000]negative statuses[#000000] in battle. The negative effects will [#FF0000]go away in time[#000000].", @"バトル中、ネク達や敵が[#FF0000]状態異常[#000000]になることがある\n状態異常になると[#FF0000]ＨＰ減少[#000000]や[#FF0000]行動不能[#000000]といった\nデメリットが発生するが、[#FF0000]一定時間経てば\n元にもどる[#000000]ぞ！", @"Neku, su compañero y sus enemigos pueden sufrir [#FF0000]estados negativos[#000000] en plena batalla, pero estos efectos negativos [#FF0000]desaparecen con el tiempo[#000000].", @"Neku, il suo partner e i loro nemici sono tutti suscettibili a [#FF0000]status negativi[#000000] in battaglia. Gli effetti negativi [#FF0000]se ne andranno col tempo[#000000].", @"Neku, sein Partner und ihre Gegner können im Kampf [#FF0000]negative Statuszustände[#000000] erleiden. Die negativen Effekte [#FF0000]verschwinden mit der Zeit wieder[#000000].", @"Neku, son partenaire et ses ennemis sont tous susceptibles de subir des [#FF0000]statuts négatifs[#000000] au combat. Les effets négatifs [#FF0000]disparaissent avec le temps[#000000].", @"戰鬥中，音操等人與敵人可能會陷入[#FF0000]異常狀態[#000000]，\n一旦陷入異常狀態，\n就會發生[#FF0000]ＨＰ減少[#000000]或[#FF0000]無法行動[#000000]等負面效果，\n但只要[#FF0000]經過一段時間就會恢復原狀[#000000]！", @"战斗中，音操等人与敌人可能会陷入[#FF0000]状态异常[#000000]，\n一旦陷入状态异常，\n就会发生[#FF0000]HP减少[#000000]或[#FF0000]无法行动[#000000]等负面效果，\n但只要[#FF0000]经过一段时间就会恢复原状[#000000]！") },
            { 30144, new TwewyItem(30144, 144, @"tile541", @"(B) Pin Growth/Evolution", @"Ｂ：バッジの成長／進化", @"(L) Desarrollo/evolución pin", @"(L) Crescita/Evoluzione spilla", @"(B) Pin-Wachsen/-Evolution", @"(L) Croissance/évolution", @"Ｂ：徽章成長／進化", @"B：徽章成长／进化", @"[#FF0000]Pins grow as you earn PP.[#000000] Level up pins to increase their Attack or other stats. Some pins will [#FF0000]evolve into entirely new pins[#000000]!", @"[#FF0000]バッジはＢＰを手に入れることで成長[#000000]する\nレベルアップすると攻撃力等がアップしたりする\nまた、[#FF0000]進化して全く別のバッジになることもある[#000000]", @"[#FF0000]Los pines se desarrollan conforme ganas PP.[#000000] Sube el nivel de tus pines para aumentar su ataque y otras estadísticas. Algunos pines [#FF0000]evolucionarán en otros completamente distintos[#000000].", @"Le [#FF0000]spille crescono man mano che si guadagnano PS.[#000000] Fai aumentare di livello le spille per aumentare il loro Attacco o le loro statistiche. Alcune spille si [#FF0000]evolveranno in spille totalmente nuove[#000000]!", @"[#FF0000]Pins wachsen, wenn du PP sammelst[#000000]. Steigere ihre Stufe, um ihren Angriff und andere Werte zu erhöhen. Bestimmte Pins [#FF0000]führen eine Evolution zu ganz neuen Pins durch[#000000]!", @"[#FF0000]Les badges croissent à mesure que vous gagnez des PB[#000000]. Augmentez le niveau des badges pour augmenter leur attaque ou d'autres stats. Certains badges [#FF0000]évolueront en devenant complètement différents[#000000] !", @"[#FF0000]獲得ＰＰ可使徽章成長[#000000]，\n一旦升級，就會獲得攻擊力提升等好處，\n此外還可能[#FF0000]發生進化[#000000]，[#FF0000]變成完全不同的徽章[#000000]。", @"[#FF0000]获得PP可使徽章成长[#000000]，\n一旦升级，就会获得攻击力提升等好处，\n此外还可能[#FF0000]发生进化[#000000]，[#FF0000]变成完全不同的徽章[#000000]。") },
            { 30145, new TwewyItem(30145, 145, @"tile541", @"(B) Psych Affinities", @"Ｂ：サイキックの属性", @"(L) Psicoafinidades", @"(L) Affinità psico", @"(B) Psych-Affinitäten", @"(L) Affinités de psychs", @"Ｂ：超能的屬性", @"B：超能的属性", @"[#FF0000]Psych affinities[#000000] include [#FF0000]Negativity[#000000] (long-range attacks), [#FF0000]Positivity[#000000] (short-range attacks), and [#FF0000]Neutrality[#000000]. [#FF0000]Some foes are immune[#000000] to certain affinities.", @"[#FF0000]サイキックの属性[#000000]には[#FF0000]遠距離[#000000]攻撃中心の[#FF0000]ネガ属性[#000000]と\n近距離[#000000]攻撃中心の[#FF0000]ポジ属性[#000000]と[#FF0000]無属性[#000000]があり[#FF0000]敵の種類\nによっては全く攻撃が効かない属性[#000000]のときもあるぞ", @"Las [#FF0000]afinidades de los psicopoderes[#000000] incluyen la [#FF0000]negatividad[#000000] (ataques a distancia), la [#FF0000]positividad[#000000] (ataques de cerca) y la [#FF0000]neutralidad[#000000]. [#FF0000]Algunos enemigos son inmunes[#000000] a una de las afinidades.", @"Le [#FF0000]Affinità degli psico[#000000] includono [#FF0000]Negatività[#000000] (attacchi a lungo raggio), [#FF0000]Positività[#000000] (attacchi a corto raggio), e [#FF0000]Neutralità[#000000]. [#FF0000]Alcuni nemici sono immuni[#000000] a un'affinità.", @"Es gibt folgende [#FF0000]Psych-Affinitäten[#000000]: [#FF0000]Negativität[#000000] (Fernkampf), [#FF0000]Positivität[#000000] (Nahkampf) und [#FF0000]Neutralität[#000000]. Manche Gegner sind gegen bestimmte Affinitäten [#FF0000]immun[#000000].", @"[#FF0000]Les affinités de psychs[#000000] incluent la [#FF0000]négativité[#000000] (attaque de longue portée), la [#FF0000]positivité[#000000] (attaque de courte portée) et la [#FF0000]neutralité[#000000]. [#FF0000]Certains adversaires sont immunisés[#000000] contre une affinité.", @"[#FF0000]超能屬性[#000000]中有以[#FF0000]遠距離[#000000]攻擊為中心的[#FF0000]遠距屬性[#000000]與\n以[#FF0000]近距離[#000000]攻擊為中心的[#FF0000]近距屬性[#000000]以及[#FF0000]無屬性[#000000]。\n[#FF0000]根據敵人種類[#000000]，[#FF0000]某些屬性的攻擊可能會無效[#000000]。", @"[#FF0000]超能属性[#000000]中有以[#FF0000]远距离[#000000]攻击为中心的[#FF0000]远距属性[#000000]与\n以[#FF0000]近距离[#000000]攻击为中心的[#FF0000]近距属性[#000000]以及[#FF0000]无属性[#000000]。\n[#FF0000]根据敌人种类[#000000]，[#FF0000]某些属性的攻击可能会无效[#000000]。") },
            { 30146, new TwewyItem(30146, 146, @"tile541", @"(B) Escaping from Battle", @"Ｂ：バトルから逃げる", @"(L) Huida de la batalla", @"(L) Fuga dal combattimento", @"(B) Flucht aus dem Kampf", @"(L) Évasion des combats", @"Ｂ：逃離戰鬥", @"B：逃离战斗", @"To [#FF0000]escape from battle[#000000], press the [#FF0000]PAUSE button[#000000] to pause combat, then select [#FF0000]\x22Gotta bounce!\x22[#000000] One caveat: escaping may [#FF0000]tick off your partner[#000000].", @"[#FF0000]バトルから逃げる[#000000]ときは[#FF0000]ポーズボタン[#000000]をタップして\nポーズメニューで[#FF0000]「バトルから逃げる」[#000000]をえらぼう\n[#FF0000]逃げると怒られる[#000000]ことも…？", @"Si quieres [#FF0000]escapar de la batalla[#000000], pulsa el [#FF0000]botón PAUSA[#000000] y el combate se interrumpirá. Después selecciona [#FF0000]«¡Hay que pirarse!»[#000000]. Recuerda: si escapas, [#FF0000]tu compañero se puede mosquear[#000000].", @"Per [#FF0000]scappare dalla battaglia[#000000], premi il [#FF0000]pulsante PAUSA[#000000] per mettere in pausa il combattimento, poi seleziona [#FF0000]\x22Devo schizzare via!\x22.[#000000]Un avvertimento: scappare può [#FF0000]mandare in bestia il tuo partner[#000000].", @"Um aus [#FF0000]einem Kampf zu fliehen[#000000], drücke die [#FF0000]PAUSE-Taste[#000000], um den Kampf zu pausieren, und wähle dann [#FF0000]Nichts wie weg![#000000] Aber Vorsicht: Eine Flucht kann [#FF0000]deinen Partner verärgern[#000000].", @"Pour [#FF0000]fuir un combat[#000000], appuyez sur le [#FF0000]bouton PAUSE[#000000] afin de mettre le combat en pause, puis sélectionnez [#FF0000]\x22Faut que je file !\x22[#000000]. Mais attention, la fuite a tendance à [#FF0000]énerver votre partenaire[#000000].", @"想[#FF0000]逃離戰鬥[#000000]時點擊[#FF0000]暫停鍵[#000000]，\n在暫停選單選擇[#FF0000]「逃離戰鬥」[#000000]吧。\n不過，[#FF0000]逃走可能會被罵[#000000]……？", @"想[#FF0000]逃离战斗[#000000]时点击[#FF0000]暂停键[#000000]，\n在暂停菜单选择[#FF0000]“逃离战斗”[#000000]吧。\n不过，[#FF0000]逃走可能会被骂[#000000]!") },
            { 30147, new TwewyItem(30147, 147, @"tile542", @"(B) Scanning", @"Ｂ：スキャンについて", @"(L) Escaneo", @"(L) Scansione", @"(B) Scannen", @"(L) Scan", @"Ｂ：關於掃描", @"B：关于扫描", @"While in the field, [#FF0000]tap the scan pin[#000000] at the lower right of the screen to [#FF0000]project a scanning field[#000000] and [#FF0000]read people's minds[#000000]!", @"フィールドの画面右下の[#FF0000]スキャンバッジをタップ[#000000]\nすると[#FF0000]スキャンフィールドが発生、テレパシー[#000000]を\n使って[#FF0000]周りにいる人の思考を読む[#000000]ことができるぞ", @"Cuando estés en la calle, [#FF0000]toca el pin de escaneo[#000000] de la parte inferior derecha de la pantalla para [#FF0000]proyectar un campo de escaneo[#000000] y [#FF0000]leerles el pensamiento a los demás[#000000].", @"Quando sei sul campo, [#FF0000]tocca la spilla scansione[#000000] nella parte in basso a destra dello schermo per [#FF0000]proiettare un campo di scansione[#000000] e [#FF0000]leggere la mente delle persone[#000000]!", @"Im Einsatz kannst du unten rechts im Bild auf [#FF0000]den Scan-Pin tippen[#000000], um [#FF0000]ein Scan-Feld zu projizieren[#000000] und [#FF0000]die Gedanken der Leute zu lesen[#000000]!", @"Quand vous êtes sur le terrain, [#FF0000]touchez le badge de scan[#000000] en bas à droite de l'écran pour [#FF0000]projeter un champ de scan[#000000] et [#FF0000]lire les pensées des gens[#000000] !", @"[#FF0000]點擊場景畫面右下方的掃描徽章[#000000]\n就會出現掃描場景，接著會[#FF0000]使用心電感應[#000000]\n[#FF0000]讀取周遭人們的想法[#000000]。", @"[#FF0000]点击场景画面右下方的扫描徽章[#000000]\n就会出现扫描场景，接着会[#FF0000]使用心电感应[#000000]\n[#FF0000]读取周遭人们的想法[#000000]。") },
            { 30148, new TwewyItem(30148, 148, @"tile542", @"(B) Enemy Encounters", @"Ｂ：敵とのエンカウント", @"(L) Enfrentamientos hostiles", @"(L) Incontri con i nemici", @"(B) Kampf mit dem Feind", @"(L) Rencontres d'ennemis", @"Ｂ：遇敵", @"B：遇敌", @"[#FF0000]Tap one of the Noise symbols[#000000] that float around the field during a scan and Neku and his partner will [#FF0000]warp to the combat zone[#000000].", @"スキャン中にスキャンフィールドに漂う[#FF0000]ノイズ\nシンボルをタップ[#000000]すると[#FF0000]エンカウントフィールドに\n引きずり込まれてバトルがはじまる[#000000]ぞ", @"[#FF0000]Toca uno de los símbolos de Ruido[#000000] que flotan durante un escaneo para que Neku y su compañero [#FF0000]se teletransporten a la zona de combate[#000000].", @"[#FF0000]Tocca uno dei simboli dei Rumori[#000000] che fluttuano attorno al campo durante una scansione, e Neku e il suo partner [#FF0000]compariranno sulla zona di combattimento[#000000].", @"[#FF0000]Tippe während eines Scans auf eines der Noise-Symbole[#000000] in der Umgebung, damit Neku und sein Partner sich [#FF0000]ins Kampfgebiet teleportieren[#000000].", @"[#FF0000]Touchez l'un des symboles d'Échos[#000000] qui flottent sur le terrain pendant un scan et Neku et son partenaire [#FF0000]apparaîtront sur la zone de combat[#000000].", @"掃描中[#FF0000]點擊漂浮在場景上的\n諾伊茲標誌[#000000]，就會[#FF0000]被拖入遇敵場景\n開始戰鬥[#000000]。", @"扫描中[#FF0000]点击漂浮在场景上的\n噪音标志[#000000]，就会[#FF0000]被拖入遇敌场景\n开始战斗[#000000]。") },
            { 30149, new TwewyItem(30149, 149, @"tile542", @"(B) Chained Battles", @"Ｂ：連戦バトル", @"(L) Batallas encadenadas", @"(L) Battaglie a catena", @"(B) Kettenkämpfe", @"(L) Combats enchaînés", @"Ｂ：連戰", @"B：连战", @"[#FF0000]Tap additional Noise symbols[#000000] after the first to enter into a [#FF0000]chain battle[#000000]. Each Noise symbol you tap adds a round of battle.", @"スキャン中にノイズをタップして[#FF0000]エンカウントフィ\nールド[#000000]に入ったとき、[#FF0000]さらに別のノイズシンボルを\nタップすると連戦でバトル[#000000]できるようになる", @"Tras el primero, [#FF0000]toca símbolos de Ruido adicionales[#000000] para iniciar una [#FF0000]batalla en cadena[#000000]. Cada símbolo de Ruido que toques suma una ronda de combate.", @"[#FF0000]Tocca altri simboli dei Rumori[#000000] oltre il primo per entrare in una [#FF0000]battaglia a catena[#000000]. Ciascun simbolo dei Rumori che tocchi aggiunge un round alla battaglia.", @"[#FF0000]Tippe nach dem ersten auf zusätzliche Noise-Symbole[#000000], um einen [#FF0000]Kettenkampf[#000000] zu starten. Jedes Noise-Symbol, auf das du tippst, bedeutet eine zusätzliche Kampfrunde.", @"[#FF0000]Touchez d'autres symboles d'Échos[#000000] après le premier pour lancer un [#FF0000]combat à la chaîne[#000000]. Chaque symbole d'Écho sur lequel vous appuyez ajoute une manche au combat.", @"掃描中點擊諾伊茲進入[#FF0000]遇敵場景[#000000]時，\n[#FF0000]再點擊其他諾伊茲標誌\n就可以展開連續戰鬥[#000000]。", @"扫描中点击噪音进入[#FF0000]遇敌场景[#000000]时，\n[#FF0000]再点击其他噪音标志\n就可以展开连续战斗[#000000]。") },
            { 30150, new TwewyItem(30150, 150, @"tile542", @"(B) Red Noise Symbols", @"Ｂ：赤のノイズシンボル", @"(L) Símbolos de Ruido rojo", @"(L) Simboli Rumori rossi", @"(B) Rote Noise-Symbole", @"(L) Symboles Écho rouges", @"Ｂ：紅色的諾伊茲標誌", @"B：红色的噪音标志", @"[#FF0000]Red Noise symbols[#000000] floating around the scanning field are also known as [#FF0000]chump Noise symbols[#000000]. Noise are only visible during a scan.", @"スキャンフィールドに漂う[#FF0000]赤色のノイズシンボル[#000000]は\n別名[#FF0000]「ザコノイズシンボル」[#000000]とよばれ、\nスキャン中にだけその思念体を見ることができる", @"[#FF0000]Los símbolos de Ruido rojo[#000000] que flotan por el campo de escaneo se conocen también como [#FF0000]símbolos de Ruido básico[#000000]. El Ruido solo es visible durante el escaneo.", @"I [#FF0000]simboli dei Rumori rossi[#000000] che fluttuano attorno al campo scansionato sono noti come [#FF0000]simboli dei Rumori Stolti[#000000]. I Rumori sono visibili solo durante una scansione.", @"[#FF0000]Rote Noise-Symbole[#000000] im Scanfeld nennt man auch [#FF0000]Kleinvieh-Noise-Symbole[#000000]. Noise sind nur während eines Scans sichtbar.", @"Les [#FF0000]symboles d'Échos rouges[#000000] qui flottent dans le champ de scan sont les [#FF0000]symboles d'Échos basiques[#000000]. Les Échos ne sont visibles que pendant un scan.", @"漂浮在掃描場景的[#FF0000]紅色諾伊茲[#000000]，\n綽號叫做[#FF0000]「嘍囉諾伊茲標誌」[#000000]，\n只有在掃描中才能看到這種思念體。", @"漂浮在扫描场景的[#FF0000]红色噪音[#000000]\n绰号叫做[#FF0000]“杂兵噪音标志”[#000000]，\n只有在扫描中才能看到这种思念体。") },
            { 30151, new TwewyItem(30151, 151, @"tile542", @"(B) Blue Noise Symbols", @"Ｂ：青のノイズシンボル", @"(L) Símbolos de Ruido azul", @"(L) Simboli Rumori blu", @"(B) Blaue Noise-Symbole", @"(L) Symboles Écho bleus", @"Ｂ：藍色的諾伊茲標誌", @"B：蓝色的噪音标志", @"[#FF0000]Blue Noise symbols[#000000] floating around the scanning field are also known as [#FF0000]boss Noise symbols[#000000], and usually contain formidable Noise.", @"スキャンフィールドに漂う[#FF0000]青色のノイズシンボル[#000000]は\n別名[#FF0000]「ボスノイズシンボル」[#000000]とよばれる　このシン\nボルには強力なノイズが入っていることが多い", @"[#FF0000]Los símbolos de Ruido azul[#000000] que flotan por el campo de escaneo se conocen también como [#FF0000]símbolos de Ruido jefe[#000000], que suele ser muy poderoso.", @"I [#FF0000]simboli dei Rumori blu[#000000] che fluttuano attorno al campo scansionato sono noti come [#FF0000]simboli dei Rumori Boss[#000000], e solitamente contengono Rumori formidabili.", @"[#FF0000]Blaue Noise-Symbole[#000000] im Scanfeld nennt man auch [#FF0000]Boss-Noise-Symbole[#000000]. Diese enthalten in der Regel höchst gefährliche Noise.", @"Les [#FF0000]symboles d'Échos bleus[#000000] qui flottent dans le champ de scan sont les [#FF0000]symboles d'Échos boss[#000000]. Ils indiquent généralement des Échos redoutables.", @"漂浮在掃描場景的[#FF0000]藍色諾伊茲[#000000]\n綽號叫做[#FF0000]「頭目諾伊茲標誌」[#000000]，\n這種標誌中較常出現強大的諾伊茲。", @"漂浮在扫描场景的[#FF0000]蓝色噪音[#000000]\n绰号叫做[#FF0000]“头目噪音标志”[#000000]，\n这种标志中较常出现强大的噪音。") },
            { 30152, new TwewyItem(30152, 152, @"tile542", @"(B) Green Noise Symbols", @"Ｂ：緑のノイズシンボル", @"(L) Símbolos de Ruido verde", @"(L) Simboli Rumori verdi", @"(B) Grüne Noise-Symbole", @"(L) Symboles Écho verts", @"Ｂ：綠色的諾伊茲標誌", @"B：绿色的噪音标志", @"[#FF0000]Green Noise symbols[#000000] floating around the scanning field are also known as [#FF0000]Pig Noise symbols[#000000]. Pick on Pig Noise to [#FF0000]pick up pins[#000000]!", @"スキャンフィールドに漂う[#FF0000]緑色のノイズシンボル[#000000]は\n別名[#FF0000]「ピグノイズシンボル」[#000000]とよばれ、必ずピグ系\nのノイズが出現する　[#FF0000]アイテムゲットのチャンス[#000000]だ", @"[#FF0000]Los símbolos de Ruido verde[#000000] que flotan por el campo de escaneo se conocen también como [#FF0000]símbolos de Ruido porcino[#000000]. ¡Pincha a los puercos para [#FF0000]pillar pines[#000000]!", @"I [#FF0000]simboli dei Rumori verdi[#000000] che fluttuano attorno al campo scansionato sono noti come [#FF0000]simboli del Rumori Maiale[#000000]. Prendi di mira i Rumori Maiale per [#FF0000]raccogliere spille[#000000]!", @"[#FF0000]Grüne Noise-Symbole[#000000] im Scanfeld nennt man auch [#FF0000]Schweine-Noise-Symbole[#000000]. Leg dich mit Schweine-Noise an, um [#FF0000]Pins zu erhalten[#000000]!", @"Les [#FF0000]symboles d'Échos verts[#000000] qui flottent dans le champ de scan sont les [#FF0000]symboles d'Échos porcins[#000000]. Traquez un Écho porcin pour [#FF0000]récupérer des badges[#000000] !", @"漂浮在掃描場景的[#FF0000]綠色諾伊茲[#000000]\n綽號叫做[#FF0000]「豬型諾伊茲標誌」[#000000]，\n一定會出現豬型諾伊茲，\n[#FF0000]是獲得道具的好機會[#000000]。", @"漂浮在扫描场景的[#FF0000]绿色噪音[#000000]\n绰号叫做[#FF0000]“小猪噪音标志”[#000000]，\n一定会出现猪型噪音，\n[#FF0000]是获得道具的好机会[#000000]。") },
            { 30153, new TwewyItem(30153, 153, @"tile542", @"(B) Yellow Noise Symbols", @"Ｂ：黄のノイズシンボル", @"(L) Símbolos de Ruido amarillo", @"(L) Simboli Rumori gialli", @"(B) Gelbe Noise-Symbole", @"(L) Symboles Écho jaunes", @"Ｂ：黃色的諾伊茲標誌", @"B：黄色的噪音标志", @"[#FF0000]Yellow Noise symbols[#000000] floating around the scanning field are also known as [#FF0000]negative Noise symbols[#000000], and [#FF0000]drag down[#000000] the hosts they inhabit.", @"スキャンフィールドに漂う[#FF0000]黄色のノイズシンボル[#000000]は\n別名[#FF0000]「ネガティブノイズシンボル」[#000000]とよばれ、\n街の人や物にとり憑き[#FF0000]ネガティブの状態[#000000]にさせる", @"[#FF0000]Los símbolos de Ruido amarillo[#000000] que flotan por el campo de escaneo se conocen también como [#FF0000]símbolos de Ruido negativo[#000000]. [#FF0000]Desmoralizan[#000000] al huésped en el que se alojan.", @"I [#FF0000]simboli dei Rumori gialli[#000000] che fluttuano attorno al campo scansionato sono noti come [#FF0000]simboli dei Rumori Negativi[#000000], e [#FF0000]buttano giù[#000000] la persona che stanno possedendo.", @"[#FF0000]Gelbe Noise-Symbole[#000000] im Scanfeld nennt man auch [#FF0000]negative Noise-Symbole[#000000]. Diese [#FF0000]ziehen ihre Wirte nach unten[#000000].", @"Les [#FF0000]symboles d'Échos noirs[#000000] qui flottent dans le champ de scan sont les [#FF0000]symboles d'Échos négatifs[#000000]. Ils [#FF0000]affaiblissent[#000000] les hôtes qu'ils habitent.", @"漂浮在掃描場景的[#FF0000]黃色諾伊茲[#000000]\n綽號叫做[#FF0000]「負面諾伊茲標誌」[#000000]，\n會讓被附身的人物陷入[#FF0000]負面狀態[#000000]。", @"漂浮在扫描场景的[#FF0000]黄色噪音[#000000]\n绰号叫做[#FF0000]“负面噪音标志”[#000000]，\n会让被附身的人物陷入[#FF0000]负面状态[#000000]。") },
            { 30154, new TwewyItem(30154, 154, @"tile542", @"(B) Black Noise Symbols", @"Ｂ：黒のノイズシンボル", @"(L) Símbolos de Ruido negro", @"(L) Simboli Rumori neri", @"(B)Schwarze Noise-Symbole", @"(L) Symboles Écho noirs", @"Ｂ：黑色的諾伊茲標誌", @"B：黑色的噪音标志", @"[#FF0000]Black Noise symbols[#000000] floating around the scanning field are also known as [#FF0000]Taboo Noise symbols[#000000]. They will [#FF0000]come after you[#000000] during a scan!", @"スキャンフィールドに漂う[#FF0000]黒色のノイズシンボル[#000000]は\n別名[#FF0000]「禁断ノイズシンボル」[#000000]とよばれ、[#FF0000]スキャン中\n強制的にエンカウントしようとしてくる[#000000]ぞ！", @"[#FF0000]Los símbolos de Ruido negro[#000000] que flotan por el campo de escaneo se conocen también como [#FF0000]símbolos de Ruido tabú[#000000]. [#FF0000]Irán a por ti[#000000] durante el escaneo.", @"I [#FF0000]simboli dei Rumori neri[#000000] che fluttuano attorno al campo scansionato sono noti come [#FF0000]simboli dei Rumori Tabù[#000000]. Durante una scansione [#FF0000]ti inseguiranno[#000000]!", @"[#FF0000]Schwarze Noise-Symbole[#000000] im Scanfeld nennt man auch [#FF0000]Tabu-Noise-Symbole[#000000]. Sie [#FF0000]verfolgen dich[#000000], solange der Scan läuft!", @"Les [#FF0000]symboles d'Échos noirs[#000000] qui flottent dans le champ de scan s'appellent aussi les [#FF0000]symboles d'Échos tabous[#000000]. Ils vous [#FF0000]pourchasseront[#000000] pendant le scan !", @"漂浮在掃描場景的[#FF0000]黑色諾伊茲[#000000]\n綽號叫做[#FF0000]「禁忌諾伊茲標誌」[#000000]，\n[#FF0000]掃描中會被牠強制拖入遇敵狀態[#000000]喔！", @"漂浮在扫描场景的[#FF0000]黑色噪音[#000000]\n绰号叫做[#FF0000]“禁忌噪音标志”[#000000]，\n[#FF0000]扫描中会被它强制拖入遇敌状态[#000000]哦！") },
            { 30155, new TwewyItem(30155, 155, @"tile542", @"(B) Memes", @"Ｂ：キーワード", @"(L) Ideas", @"(L) Meme", @"(B) Meme", @"(L) Mèmes", @"Ｂ：關鍵字", @"B：关键字", @"Use [#FF0000]imprinting[#000000] to slip [#FF0000]memes[#000000] you've collected directly into people's minds! Those memes will cause folks to take [#FF0000]a variety of actions[#000000].", @"[#FF0000]インプリンティングイベント[#000000]であつめた[#FF0000]キーワード[#000000]\nを人々にすりこもう！　[#FF0000]キーワードをすりこまれた\n人はその時々に応じた行動をとる[#000000]ようになるぞ！", @"Utiliza la [#FF0000]impronta[#000000] para grabar las [#FF0000]ideas[#000000] que has recogido directamente en la mente de otros. Según la idea, las personas [#FF0000]actuarán de una manera u otra[#000000].", @"Usa l'[#FF0000]imprinting[#000000] per inserire i [#FF0000]meme[#000000] che hai raccolto direttamente nella mente delle persone! Questi meme faranno effettuare alla gente [#FF0000]una varietà di azioni[#000000].", @"Mit [#FF0000]Prägen[#000000] kannst du gesammelte [#FF0000]Meme[#000000] direkt in die Gedanken der Leute einpflanzen! Diese Meme verleiten die Menschen dann zu [#FF0000]bestimmten Aktionen[#000000].", @"Utilisez la [#FF0000]gravure[#000000] pour glisser les [#FF0000]mèmes[#000000] que vous avez récupérés dans l'esprit des gens ! Ces mèmes pousseront les gens à faire [#FF0000]toutes sortes d'actions[#000000].", @"將透過[#FF0000]烙印事件[#000000]收集到的[#FF0000]關鍵字[#000000]\n灌輸到人們腦中吧！[#FF0000]被灌輸關鍵字的人\n會根據當下狀況採取行動[#000000]！", @"将通过[#FF0000]烙印事件[#000000]收集到的[#FF0000]关键字[#000000]\n灌输到人们脑中吧！[#FF0000]被灌输关键字的人\n会根据当下状况采取行动[#000000]！") },
            { 30156, new TwewyItem(30156, 156, @"tile542", @"(B) Talk to Your Partner", @"Ｂ：パートナーとの会話", @"(L) Charla con el compañero", @"(L) Parla con il tuo partner", @"(B) Partner-Besprechung", @"(L) Parler avec partenaire", @"Ｂ：與搭檔的對話", @"B：与搭档的对话", @"[#FF0000]Stand in one place[#000000] on the field screen for a moment, and you may be able to [#FF0000]speak with your partner[#000000] for advice on how to proceed.", @"フィールドで[#FF0000]一定時間じっとしていると\nパートナーと会話できるようになることがある[#000000]\nパートナーからヒントを聞いて次の行動に移ろう！", @"[#FF0000]Quédate quieto un momento[#000000] y podrás [#FF0000]hablar con tu compañero[#000000], que te aconsejará sobre qué pasos seguir.", @"[#FF0000]Resta in un punto[#000000] del campo per un momento, e forse sarai in grado di [#FF0000]parlare col tuo partner[#000000] per scambiarvi consigli su come procedere.", @"[#FF0000]Wenn du kurz an einem Fleck stehen bleibst[#000000], kannst du möglicherweise [#FF0000]mit deinem Partner[#000000] darüber reden, wie es am besten weitergeht.", @"Sur l'écran du terrain, [#FF0000]restez immobile[#000000] quelques instants et vous pourrez peut-être [#FF0000]parler avec votre partenaire[#000000]. Celui-ci vous donnera des indices pour avancer.", @"在場景中[#FF0000]一段時間靜止不動\n就有可能可以跟搭檔對話[#000000]，\n從搭檔那裡聽取提示，展開下個行動吧！", @"在场景中[#FF0000]一段时间静止不动\n就有可能可以跟搭档对话[#000000]，\n从搭档那里听取提示，展开下个行动吧！") },
            { 30157, new TwewyItem(30157, 157, @"tile542", @"(B) Mail Icon", @"Ｂ：メールアイコン", @"(L) Icono del correo", @"(L) Icona mail", @"(B) Mail-Symbol", @"(L) Icône e-mail", @"Ｂ：郵件圖示", @"B：邮件图示", @"While in the field, [#FF0000]tap the mail icon[#000000] in the upper-left corner of the screen to read over the day's mission (your objective).", @"フィールドの画面左上の[#FF0000]メールアイコンをタップ[#000000]\nするとその日のミッションを確認できたり物語の\n大きな目的を知ることができる", @"Mientras recorres Shibuya, [#FF0000]toca el icono del correo[#000000], situado en la esquina superior izquierda de la pantalla, para leer la misión del día (tu objetivo).", @"Mentre sei sul campo, [#FF0000]tocca l'icona mail[#000000] nell'angolo in alto a sinistra dello schermo per leggere la missione del giorno (il tuo obiettivo).", @"Wenn du unterwegs bist, kannst du [#FF0000]auf das Mail-Symbol[#000000] oben links im Bild tippen, um dir die tägliche Mission (also dein Ziel) anzusehen.", @"Sur le terrain, [#FF0000]touchez l'icône e-mail[#000000] dans le coin supérieur gauche de l'écran pour lire la mission du jour (votre objectif).", @"[#FF0000]點擊場景畫面左上方的郵件圖示[#000000]\n就能確認當天的任務，\n以及得知劇情的大方向。", @"[#FF0000]点击场景画面左上方的邮件图示[#000000]\n就能确认当天的任务，\n以及得知剧情的大方向。") },
            { 30158, new TwewyItem(30158, 158, @"tile542", @"(B) Be a Trendsetter", @"Ｂ：トレンドをかえよう", @"(L) Marcando tendencias", @"(L) Detta la moda", @"(B) Zum Trendsetter werden", @"(L) Lancer des tendances", @"Ｂ：改變潮流吧", @"B：改变潮流吧", @"You can [#FF0000]set fashion trends[#000000] and make your favorite brand [#FF0000]more popular[#000000] in a given area by [#FF0000]wearing pins and items of that brand into battle[#000000].", @"[#FF0000]各ブランドのバッジをそうびしてバトル[#000000]すれば\nするほど　そのブランドを[#FF0000]そのエリアで流行させ\nトレンドを変えることができる[#000000]ぞ！", @"Puedes [#FF0000]marcar tendencias de moda[#000000] y hacer que tu marca favorita sea [#FF0000]más popular[#000000] en una zona determinada. Para ello, [#FF0000]lucha con los pines y los objetos de esa marca[#000000].", @"Puoi [#FF0000]lanciare mode[#000000] e far diventare [#FF0000]più popolare[#000000] in una determinata area il tuo brand preferito [#FF0000]indossando spille e oggetti di quel brand in battaglia[#000000].", @"Du kannst [#FF0000]Modetrends setzen[#000000] und deine Lieblingsmarke in einer bestimmten Gegend [#FF0000]beliebter[#000000] machen, indem du [#FF0000]Pins und Objekte dieser Marke im Kampf trägst[#000000].", @"Vous pouvez [#FF0000]définir les tendances de la mode[#000000] et rendre votre marque préférée [#FF0000]plus populaire[#000000] dans un quartier donné en [#FF0000]portant des badges et des objets de cette marque au combat[#000000].", @"[#FF0000]裝備各品牌的徽章持續戰鬥[#000000]，\n就能讓品牌在[#FF0000]該區域流行起來[#000000]，\n[#FF0000]改變潮流[#000000]喔！", @"[#FF0000]装备各品牌的徽章持续战斗[#000000]，\n就能让品牌在[#FF0000]该区域流行起来[#000000]，\n[#FF0000]改变潮流[#000000]哦！") },
            { 30159, new TwewyItem(30159, 159, @"tile543", @"(B) Shutdown", @"Ｂ：シャットダウン", @"(L) Ausencia", @"(L) Spegnimento", @"(B) Abschalten", @"(L) Absence", @"Ｂ：關機", @"B：关机", @"When you [#FF0000]continue your game[#000000] after [#FF0000]taking a break[#000000], the pins Neku is wearing will [#FF0000]earn PP for the time you were away[#000000] (maxing out at 7 days' worth of bonus PP).", @"[#FF0000]ゲームを遊んでいない時間[#000000]に応じて、\n[#FF0000]バッジメニュー[#000000]を開いた時に[#FF0000]そうびしたバッジに\n最高７日分まで溜まったＢＰボーナスが入る[#000000]\nようになる", @"Cuando [#FF0000]reanudes la partida[#000000] después de [#FF0000]haber dejado de jugar[#000000], los pines que Neku lleve [#FF0000]ganarán PP por el tiempo que hayas estado ausente[#000000].", @"Quando [#FF0000]riprendi la partita[#000000] dopo aver [#FF0000]fatto una pausa[#000000], la spilla indossata da Neku [#FF0000]guadagnerà PS in base alla durata della tua assenza[#000000].", @"Wenn du dein [#FF0000]Spiel fortsetzt[#000000], nachdem du [#FF0000]eine Pause gemacht hast[#000000], erhalten die Pins, die Neku trägt, [#FF0000]PP für die Zeit, in der du nicht gespielt hast[#000000].", @"Quand vous [#FF0000]reprenez votre partie[#000000] après [#FF0000]avoir fait une pause[#000000], les badges portés par Neku [#FF0000]auront gagné des PB pendant votre absence[#000000].", @"[#FF0000]沒有遊玩遊戲的時間[#000000]將獲得累積，\n於打開[#FF0000]徽章選單[#000000]時，\n[#FF0000]裝備的徽章最多能獲得７天份的ＰＰ加成[#000000]。", @"[#FF0000]没有玩游戏的时间[#000000]将获得累积， \n于打开[#FF0000]徽章菜单[#000000]时，\n[#FF0000]装备的徽章最多能获得７天份的PP加成[#000000]。") },
            { 30160, new TwewyItem(30160, 160, @"tile543", @"(B) Shop Clerks", @"Ｂ：ショップ店員", @"(L) Dependientes", @"(L) Commessi dei negozi", @"(B) Ladenverkäufer", @"(L) Vendeurs", @"Ｂ：商店店員", @"B：商店店员", @"As you [#FF0000]buy items from a store[#000000], your [#FF0000]friendship gauge (FSG) with the clerk will rise[#000000], and they'll offer [#FF0000]new items[#000000] and unlock [#FF0000]hidden item abilities[#000000].", @"ショップには必ず[#FF0000]店員[#000000]がいて[#FF0000]アイテムを買うことで\nフレンドシップゲージ（Ｆ．Ｓ．Ｇ．）がアップ[#000000]し\n[#FF0000]アビリティや新商品をゲット[#000000]できるのだ！", @"Cuando [#FF0000]compres objetos en una tienda[#000000], [#FF0000]aumentará la barra de amistad (BAM) con el dependiente[#000000], que te ofrecerá [#FF0000]nuevos artículos[#000000] y desbloqueará [#FF0000]habilidades ocultas de los objetos[#000000].", @"Più [#FF0000]comprerai oggetti in un negozio[#000000], più [#FF0000]aumenterà la tua barra dell'amicizia (AMICIZIA) con il commesso[#000000], il quale ti offrirà [#FF0000]nuovi oggetti[#000000] e sbloccherà [#FF0000]abilità dell'oggetto nascoste[#000000].", @"Wenn du [#FF0000]in Läden Objekte kaufst[#000000], [#FF0000]füllt sich deine Freundschaftsanzeige (FAZ) für die jeweiligen Verkäufer[#000000], und sie bieten dir [#FF0000]neue Objekte[#000000] an. Außerdem schalten sie [#FF0000]versteckte Objektfähigkeiten[#000000] frei.", @"Plus vous [#FF0000]achetez d'objets dans une boutique[#000000], plus votre [#FF0000]jauge d'amitié (JDA) avec le vendeur ou la vendeuse augmente[#000000], et il ou elle peut vous offrir de [#FF0000]nouveaux objets[#000000] et déverrouiller des [#FF0000]capacités d'objet cachées[#000000].", @"商店中一定會有[#FF0000]店員[#000000]，[#FF0000]購買道具\n會提升友好度（Ｆ．Ｓ．Ｇ．）[#000000]，\n[#FF0000]還能獲得能力與新商品[#000000]！", @"商店中一定会有[#FF0000]店员[#000000]，[#FF0000]购买道具\n会提升友好度（F.S.G.）[#000000]，\n[#FF0000]还能获得能力与新商品[#000000]！") },
            { 30161, new TwewyItem(30161, 161, @"tile543", @"(B) Item Abilities", @"Ｂ：アイテムアビリティ", @"(L) Habilidad oculta", @"(L) Abilità oggetti", @"(B) Objektfähigkeiten", @"(L) Capacités d'objets", @"Ｂ：道具能力", @"B：道具能力", @"Each item possesses a hidden [#FF0000]ability[#000000] which only activates after a [#FF0000]store clerk tells you about it[#000000]. Unlocked items have an [#FF0000]A[#000000] in their icons.", @"アイテムには一個ずつ[#FF0000]アビリティ[#000000]が隠されている！\nアイテムのアビリティは[#FF0000]ショップ店員から聞きだし\nゲットする[#000000]のだ！　アイコンの左上に[#FF0000]Ａ[#000000]がつくぞ！", @"Cada objeto tiene una [#FF0000]habilidad[#000000] oculta que solo se activa cuando un [#FF0000]dependiente te habla de ella[#000000]. Los objetos desbloqueados tienen una [#FF0000]A[#000000] en su icono.", @"Ciascun oggetto possiede un'[#FF0000]abilità[#000000] segreta, che si attiva soltanto dopo che [#FF0000]il commesso del negozio te ne ha parlato[#000000]. Gli oggetti sbloccati hanno una [#FF0000]A[#000000] nella loro icona.", @"Jedes Objekt verfügt über eine versteckte [#FF0000]Fähigkeit[#000000], die erst aktiviert wird, wenn ein [#FF0000]Verkäufer dir davon erzählt[#000000]. Freigeschaltete Objekte sind mit einem [#FF0000]A[#000000] in ihrem Symbol gekennzeichnet.", @"Chaque objet possède une [#FF0000]capacité[#000000] cachée qui ne peut s'activer qu'une fois qu'[#FF0000]un vendeur ou une vendeuse vous en a parlé[#000000]. Les objets déverrouillés portent un [#FF0000]A[#000000] sur leur icône.", @"每項商品都隱藏著[#FF0000]能力[#000000]！\n[#FF0000]可從商店店員聽到獲知道具的能力[#000000]！\n獲得能力的道具圖示左上方會加註[#FF0000]Ａ[#000000]！", @"每项商品都隐藏着[#FF0000]能力[#000000]！\n[#FF0000]可向商店店员问出\n后获得道具的能力[#000000]！\n获得能力的道具图示左上方会加注[#FF0000]A[#000000]！") },
            { 30162, new TwewyItem(30162, 162, @"tile543", @"(B) Shop Quests", @"Ｂ：ショップクエスト", @"(L) Trueques", @"(L) Missioni dei negozi", @"(B) Ladenquests", @"(L) Quêtes de boutiques", @"Ｂ：商店委託", @"B：商店委托", @"Some shops stock items labeled [#FF0000]QUEST[#000000] which money can't buy. [#FF0000]Trade in the materials listed in the QUEST info tab[#000000] to make them!", @"ショップのアイテムで[#FF0000]ＱＵＥＳＴ[#000000]と書かれた商品は\nお金では買えない　アイテムヘルプ下方の[#FF0000]ＱＵＥＳ\nＴタブに書かれた条件を満たす必要がある[#000000]のだ！", @"En algunas tiendas hay objetos marcados como [#FF0000]TRUEQUE[#000000] y que no se pueden comprar con dinero. [#FF0000]Para conseguirlos, tienes que cambiarlos por los materiales que se enumeran en la pestaña TRUEQUE[#000000].", @"Alcuni negozi possiedono oggetti etichettati come [#FF0000]MISSIONE[#000000] che non potrai acquistare col denaro. [#FF0000]Scambiali con i materiali elencati nella scheda informativa della MISSIONE[#000000] per ottenerli!", @"Bestimmte Objekte im Laden sind mit [#FF0000]QUEST[#000000] gekennzeichnet, diese gibt es nicht für Geld zu kaufen. [#FF0000]Tausche das im Reiter \x22Info\x22 der Quest aufgeführte Material ein[#000000], um sie herzustellen!", @"Certaines boutiques vendent des objets portant l'inscription [#FF0000]QUÊTE[#000000] qui ne peuvent pas être achetés avec de l'argent. [#FF0000]Échangez les matériaux listés dans l'onglet infos de QUÊTE[#000000] pour les fabriquer !", @"商店道具中，\n標示[#FF0000]ＱＵＥＳＴ[#000000]的商品無法以金錢購買，\n必須滿足道具說明下方\n[#FF0000]ＱＵＥＳＴ頁籤所記載的條件[#000000]！", @"商店道具中，标示[#FF0000]QUEST[#000000]的商品\n无法以金钱购买，必须满足道具说明下方[#FF0000]QUEST\n标签所记载的条件[#000000]！") },
            { 30163, new TwewyItem(30163, 163, @"tile544", @"(B) Tin Pin Slammer", @"Ｂ：マーブルスラッシュ", @"(L) Tin Pin Slammer", @"(L) Tin Pin Slammer", @"(B) Tin Pin Slammer", @"(L) Tin Pin Slammer", @"Ｂ：激鬥徽章", @"B：激撞徽章", @"[#FF0000]Tin Pin Slammer[#000000] (Tin Pin for short) is a mini-game where you use the [#FF0000]pins you're wearing[#000000] to try to [#FF0000]knock opponents' pins off the table[#000000].", @"マーブルスラッシュとは[#FF0000]バッジを使ったミニゲーム\n[#000000]のことだ！[#FF0000]そうびしたバッジ[#000000]を使い相手のバッジを\nおはじきのようにゲーム台から落とす[#000000]と勝ち！", @"El [#FF0000]Tin Pin Slammer[#000000] es un minijuego en el que usas los [#FF0000]pines que llevas[#000000] para intentar [#FF0000]tirar de la mesa los pines de tus adversarios[#000000].", @"[#FF0000]Tin Pin Slammer[#000000] (Tin Pin, in breve) è un mini-gioco nel quale usi le [#FF0000]spille che indossi[#000000] per cercar di [#FF0000]far cadere le spille degli avversari dal tavolo[#000000].", @"[#FF0000]Tin Pin Slammer[#000000] (kurz \x22Tin Pin\x22) ist ein Minispiel, in dem du die [#FF0000]Pins, die du gerade trägst[#000000] einsetzt, um [#FF0000]die Pins der Gegner vom Tisch zu fegen[#000000].", @"[#FF0000]Tin Pin Slammer[#000000] (Tin Pin pour les intimes) est un mini-jeu dans lequel vous utilisez les [#FF0000]badges que vous portez[#000000] pour essayer d'[#FF0000]éjecter de la table les badges de vos adversaires[#000000].", @"激鬥徽章為[#FF0000]使用徽章的小遊戲[#000000]！\n使用[#FF0000]裝備的徽章[#000000]將對手的徽章[#000000]\n像彈珠一樣彈出遊戲台就算獲勝！", @"激撞徽章为[#FF0000]使用徽章的小游戏[#000000]！\n使用[#FF0000]装备的徽章[#000000]将对手的徽章[#000000]\n像弹珠一样弹出游戏台就算获胜！") },
            { 30164, new TwewyItem(30164, 164, @"tile544", @"(B) Tin Pin Lineup", @"Ｂ：マブスラのバッジ", @"(L) Alineación atizadora", @"(L) Ordine Tin Pin", @"(B) Tin-Pin-Reihenfolge", @"(L) Formation de Tin Pin", @"Ｂ：激鬥徽章用的徽章", @"B：激撞徽章用的徽章", @"Your pin order in Tin Pin Slammer is determined by the pins' [#FF0000]slot numbers[#000000]. You use the pin in slot 1 first, then the rest in ascending order.", @"マーブルスラッシュで使用するバッジは\nバッジメニューの[#FF0000]デッキにそうび[#000000]されている\n番号タグが小さいものから使用されるぞ！", @"El orden de los pines en el Tin Pin Slammer depende del [#FF0000]hueco que ocupen en la tabla[#000000]. Primero usarás el pin del hueco 1, seguido de los demás en orden ascendente.", @"L'ordine delle spille in Tin Pin Slammer è determinato dal [#FF0000]numero dello spazio[#000000] delle spille. Utilizzerai per prima la spilla che si trova nello spazio 1, e poi le altre in ordine ascendente.", @"Die Reihenfolge deiner Pins in Tin Pin Slammer wird durch die [#FF0000]Platznummern[#000000] der Pins bestimmt. Zuerst verwendest du den Pin auf Platz 1, anschließend den Rest in aufsteigender Reihenfolge.", @"L'ordre de vos badges dans Tin Pin Slammer est déterminé par le [#FF0000]numéro d'emplacement[#000000] des badges. Vous utilisez le badge de l'emplacement 1, puis les autres en ordre croissant.", @"在激鬥徽章中使用的徽章為\n[#FF0000]裝備在徽章選單的徽章組合[#000000]，\n會從號碼標籤較小的開始使用！", @"在激撞徽章中使用的徽章为\n[#FF0000]装备在徽章菜单的徽章组合[#000000]，\n会从号码标签较小的开始使用！") },
            { 30165, new TwewyItem(30165, 165, @"tile544", @"(B) Charge Slam", @"Ｂ：チャージスラッシュ", @"(L) Arremetida", @"(L) Slam caricato", @"(B) Akkuschlag", @"(L) Slam chargé", @"Ｂ：蓄力劃線", @"B：蓄力划线", @"[#FF0000]Draw a line and hold your finger to the screen[#000000] to charge. Aim carefully, then [#FF0000]lift your finger[#000000] to perform a powerful [#FF0000]Charge Slam[#000000].", @"指で[#FF0000]線を引いて溜める[#000000]とチャージできる\n狙いさだめて指を離すと[#FF0000]チャージスラッシュ[#000000]\nをだすことができるぞ！", @"[#FF0000]Traza una línea manteniendo el dedo en la pantalla[#000000] para cargar el ataque. Apunta con cuidado y después [#FF0000]levanta el dedo[#000000] para dirigir una potente [#FF0000]arremetida[#000000].", @"[#FF0000]Traccia una linea e tieni il dito a contatto con lo schermo[#000000] per caricare. Prendi la mira, poi [#FF0000]solleva il dito[#000000] per eseguire un potente [#FF0000]Slam Caricato[#000000].", @"[#FF0000]Ziehe eine Linie und halte dabei deinen Finger auf dem Bildschirm[#000000], um Kraft zu tanken. Ziele genau und [#FF0000]hebe den Finger[#000000], um einen mächtigen [#FF0000]Akkuschlag[#000000] zu entfesseln.", @"[#FF0000]Tracez une ligne et laissez votre doigt sur l'écran[#000000] pour charger. Visez, puis [#FF0000]levez votre doigt[#000000] pour effectuer un puissant [#FF0000]slam chargé[#000000].", @"用手指[#FF0000]拉線後停住[#000000]就能蓄力，\n決定目標後放開手指就能使出\n[#FF0000]蓄力劃線[#000000]！", @"用手指[#FF0000]拉线后停住[#000000]就能蓄力，\n决定目标后放开手指就能使出\n[#FF0000]蓄力划线[#000000]！") },
            { 30166, new TwewyItem(30166, 166, @"tile544", @"(B) Spin Slam", @"Ｂ：カーブスラッシュ", @"(L) Tiro con efecto", @"(L) Attacco rotante", @"(B) Spin-Slam", @"(L) Slam tournoyant", @"Ｂ：轉向劃線", @"B：转向划线", @"Slash your pin down the middle and it will travel in a straight line, but did you know you can [#FF0000]slash along its edge[#000000] to apply spin and [#FF0000]make it curve[#000000]?", @"バッジの真ん中をスラッシュするとまっすぐ移動\nするが、[#FF0000]バッジのはしをスラッシュするとカーブが\nかかる[#000000]ぞ！　上級者のスラッシュテクニックだ！", @"Al cortar el pin por el centro, avanzará en línea recta; pero ¿sabías que también puedes [#FF0000]cortar por el borde[#000000] para lanzarlo [#FF0000]con efecto[#000000]?", @"Se sferri un fendente nel centro della tua spilla la farai muovere lungo una linea retta, ma lo sapevi che puoi [#FF0000]sferrare un fendente lungo i suoi bordi[#000000] per farla ruotare e quindi [#FF0000]curvare[#000000]?", @"Führe einen Hieb über die Mitte deines Pins aus, damit er sich in einer geraden Linie bewegt. Du kannst jedoch auch [#FF0000]einen Hieb an seinem Rand[#000000] ausführen, damit er Effet bekommt und [#FF0000]einen Bogen beschreibt[#000000].", @"Balayez votre badge en son milieu et il se déplacera en ligne droite. Mais saviez-vous que vous pouvez aussi [#FF0000]balayer ses bords[#000000] pour lui appliquer une rotation et [#FF0000]lui donner une trajectoire en courbe[#000000] ?", @"在徽章的正中央劃線就會筆直移動，\n[#FF0000]在徽章的尖端劃線就會轉向[#000000]！\n這是高手的劃線技巧！", @"在徽章的正中央划线就会笔直移动，\n[#FF0000]在徽章的边缘划线就会转向[#000000]！\n这是高手的划线技巧！") },
            { 30167, new TwewyItem(30167, 167, @"tile544", @"(B) Tin Pin Whammy 1", @"Ｂ：マブスラ必殺技１", @"(L) Golpetazo del Tin Pin 1", @"(L) Martellata Tin Pin 1", @"(B) Tin-Pin-Whammy 1", @"(L) Coup de Tin Pin 1", @"Ｂ：激鬥徽章必殺技１", @"B：激撞徽章必杀技1", @"[#FF0000]Tap the bomb button[#000000] to use the [#FF0000]Dive Bomber[#000000]. Your pin will rocket into the air, then [#FF0000]come crashing down[#000000] onto the spot you target!", @"ボムボタンをタップすると[#FF0000]ダイブボム[#000000]だ！\nバッジが高く舞い上がってターゲットした場所\nめがけて[#FF0000]ダイブ攻撃[#000000]するぞ！", @"[#FF0000]Toca el botón de la bomba[#000000] para usar la [#FF0000]bomba en picado[#000000]. Tu pin saldrá volando y después [#FF0000]caerá a plomo[#000000] sobre el objetivo.", @"[#FF0000]Tocca il pulsante bomba[#000000] per usare la [#FF0000]Meteora[#000000]. La tua spilla schizzerà in aria, poi si [#FF0000]schianterà a terra[#000000] sul punto che hai scelto!", @"[#FF0000]Tippe auf die Schaltfläche \x22Bombe\x22[#000000], um den [#FF0000]Sturzflug[#000000] einzusetzen. Dein Pin schießt in die Luft und [#FF0000]knallt dann herunter[#000000] auf den anvisierten Punkt!", @"[#FF0000]Touchez le bouton bombe[#000000] pour utiliser le [#FF0000]Bombardier[#000000]. Votre pin décollera comme une fusée pour [#FF0000]venir s'écraser[#000000] sur la zone ciblée !", @"點擊炸彈按鈕就會發動[#FF0000]俯衝炸彈[#000000]！\n徽章高高升起後，會朝著目標地點\n進行[#FF0000]俯衝攻擊[#000000]！", @"点击炸弹按键就会发动[#FF0000]俯冲炸弹[#000000]！\n徽章高高升起后，会朝着目标地点\n进行[#FF0000]俯冲攻击[#000000]！") },
            { 30168, new TwewyItem(30168, 168, @"tile544", @"(B) Tin Pin Whammy 2", @"Ｂ：マブスラ必殺技２", @"(L) Golpetazo del Tin Pin 2", @"(L) Martellata Tin Pin 2", @"(B) Tin-Pin-Whammy 2", @"(L) Coup de Tin Pin 2", @"Ｂ：激鬥徽章必殺技２", @"B：激撞徽章必杀技2", @"[#FF0000]Tap the stinger button[#000000] to use the [#FF0000]Stinger[#000000]. Bust out this [#FF0000]defensive technique[#000000] to turn the table on foes flying at you!", @"スティンガーボタンをタップすると\n[#FF0000]スティンガーボディ[#000000]だ！\nせまってくる相手にカウンター攻撃をしかけるぞ！\n[#FF0000]ガードタイプ[#000000]の必殺技だ！", @"[#FF0000]Toca el botón del aguijón[#000000] para usar el [#FF0000]aguijón[#000000]. Con esta [#FF0000]técnica de defensa[#000000] podrás volver las tornas contra los enemigos que te ataquen desde el aire.", @"[#FF0000]Tocca il pulsante aculeo[#000000] per usare l'[#FF0000]Aculeo[#000000]. Sfoggia questa [#FF0000]tecnica difensiva[#000000] per guadagnare vantaggio sugli avversari volanti!", @"[#FF0000]Tippe auf die Schaltfläche \x22Stachel\x22[#000000], um den [#FF0000]Stachel[#000000] einzusetzen. Mit dieser [#FF0000]Verteidigungstechnik[#000000] konterst du Gegner aus, die auf dich zufliegen!", @"[#FF0000]Touchez le bouton pique[#000000] pour utiliser la [#FF0000]Pique[#000000]. Déclenchez cette [#FF0000]technique défensive[#000000] pour renverser la situation contre les adversaires qui volent vers vous !", @"點擊刺球按鈕就會發動[#FF0000]尖刺鐵球[#000000]！\n會對逼近的敵人發動反擊！\n是[#FF0000]防禦型[#000000]的必殺技！", @"点击刺球按键\n就会发动[#FF0000]尖刺铁球[#000000]！\n会对逼近的敌人发动反击！\n是[#FF0000]防御型[#000000]的必杀技！") },
            { 30169, new TwewyItem(30169, 169, @"tile544", @"(B) Tin Pin Whammy 3", @"Ｂ：マブスラ必殺技３", @"(L) Golpetazo del Tin Pin 3", @"(L) Martellata Tin Pin 3", @"(B) Tin-Pin-Whammy 3", @"(L) Coup de Tin Pin 3", @"Ｂ：激鬥徽章必殺技３", @"B：激撞徽章必杀技3", @"[#FF0000]Tap the hammer button[#000000] to use the [#FF0000]Sledgehammer[#000000]. Start that hammer swinging and make the most of its [#FF0000]long attack range[#000000]!", @"ハンマーボタンをタップすると\n[#FF0000]スレッジハンマー[#000000]だ！\nハンマーをふりまわして攻撃をしかけるぞ！\n[#FF0000]攻撃判定の広さ[#000000]をいかそう！", @"[#FF0000]Toca el botón del mazo[#000000] para usar el [#FF0000]mazo[#000000]. ¡Empieza a blandirlo y saca el máximo partido de tu [#FF0000]ataque a distancia[#000000]!", @"[#FF0000]Tocca il pulsante mazza[#000000] per usare la [#FF0000]Mazza[#000000]. Comincia a far oscillare la mazza e sfrutta il più possibile il suo [#FF0000]attacco a lungo raggio[#000000]!", @"[#FF0000]Tippe auf die Schaltfläche \x22Hammer\x22[#000000], um den [#FF0000]Vorschlaghammer[#000000] einzusetzen. Wirble den Hammer herum und nutze seine [#FF0000]hohe Angriffsreichweite[#000000]!", @"[#FF0000]Touchez le bouton marteau[#000000] pour utiliser la [#FF0000]Masse[#000000]. Brandissez ce marteau et profitez à fond de sa [#FF0000]longue portée[#000000] !", @"點擊巨槌按鈕就會發動[#FF0000]旋轉巨槌[#000000]！\n巨槌會旋轉進行攻擊！\n活用其[#FF0000]廣域攻擊[#000000]的效果吧！", @"点击巨槌按键\n就会发动[#FF0000]旋转巨槌[#000000]！\n巨槌会旋转进行攻击！\n活用[#FF0000]攻击判定较广[#000000]的效果吧！") },
            { 30170, new TwewyItem(30170, 170, @"tile544", @"(B) Tin Pin Whammy 4", @"Ｂ：マブスラ必殺技４", @"(L) Golpetazo del Tin Pin 4", @"(L) Martellata Tin Pin 4", @"(B) Tin-Pin-Whammy 4", @"(L) Coup de Tin Pin 4", @"Ｂ：激鬥徽章必殺技４", @"B：激撞徽章必杀技4", @"The [#FF0000]Helping Hand[#000000] will automatically save your pin when it falls off the table, letting you literally [#FF0000]jump back into the game[#000000]!", @"ゲーム台から落ちそうになると、自動的に\n[#FF0000]エマジェンシーハンド[#000000]が発動する\n[#FF0000]ゲーム台に復帰[#000000]することができるぞ！", @"La [#FF0000]mano amiga[#000000] salva automáticamente tu pin cuando se cae de la mesa y, literalmente, [#FF0000]lo coloca de nuevo encima[#000000].", @"Il [#FF0000]Supporto[#000000] salverà automaticamente la tua spilla quando cade dal tavolo, facendoti letteralmente [#FF0000]risaltare nel gioco[#000000]!", @"Die [#FF0000]Helfende Hand[#000000] rettet automatisch deinen Pin, wenn er vom Tisch fällt. So kannst du buchstäblich wieder [#FF0000]zurück ins Spiel springen[#000000]!", @"Le [#FF0000]Coup de main[#000000] sauvera automatiquement votre badge s'il tombe de la table, vous permettant ainsi de [#FF0000]revenir dans la partie[#000000] !", @"一旦有掉落遊戲台的危險，將自動\n發動[#FF0000]急救巨手[#000000]，\n藉此就可以[#FF0000]回到遊戲台上[#000000]！", @"一旦有掉落游戏台的危险，将自动\n发动[#FF0000]急救巨手[#000000]，\n藉此就可以[#FF0000]回到游戏台上[#000000]！") },
            { 30171, new TwewyItem(30171, 171, @"tile545", @"(B) Secrets of Evolution", @"Ｂ：バッジ進化のヒミツ", @"(L) Secretos de evolución", @"(L) I segreti dell'evoluzione", @"(B) Geheimnis der Evolution", @"(L) Secrets de l'évolution", @"Ｂ：徽章進化的祕密", @"B：徽章进化的秘密", @"Want to collect every pin out there? Then you'll need to be resourceful and uncover the [#FF0000]mysterious forces that drive pin evolution[#000000].", @"[#FF0000]バッジの進化はナゾ[#000000]につつまれている！\nすべてのバッジをあつめるには、色々な力を使って\n進化のナゾを解き明かす必要があるだろう…", @"¿Quieres conseguir todos los pines? Para ello, tendrás que aprovechar todos tus recursos y descubrir las [#FF0000]fuerzas misteriosas que desencadenan la evolución de los pines[#000000].", @"Vuoi raccogliere tutte le spille esistenti? Allora dovrai dimostrarti intraprendente e scoprire le [#FF0000]forze misteriose che portano all'evoluzione della spilla[#000000].", @"Du willst dir jeden Pin da draußen holen? Dann musst du einfallsreich sein und die [#FF0000]geheimnisvollen Kräfte aufdecken, die für die Evolution der Pins verantwortlich sind[#000000].", @"Vous voulez collectionner tous les badges du\njeu ? Alors, vous devrez vous montrer ingénieux pour découvrir les [#FF0000]forces mystérieuses qui guident l'évolution des badges[#000000].", @"[#FF0000]徽章的進化充滿謎團[#000000]！\n想收集到所有徽章，就得使用各種力量\n解開進化之謎……", @"[#FF0000]徽章的进化充满谜团[#000000]！\n想收集到所有徽章，就得使用各种力量\n解开进化之谜……") },
            { 30172, new TwewyItem(30172, 172, @"tile545", @"(B) Tin Pin PP", @"Ｂ：マブスラでのＢＰ", @"(L) PP Tin Pin", @"(L) PS Tin Pin", @"(B) Tin-Pin-PP", @"(L) PB de Tin Pin", @"Ｂ：激鬥徽章中的ＰＰ", @"Ｂ：激撞徽章中的PP", @"Collect [#FF0000]Battle PP[#000000] every time you play a game of Tin Pin Slammer. Practicing is a great way to hone your slammin' skills while also earning PP!", @"マブスラバトルの終了後にバッジに入るＢＰは\n[#FF0000]バトルＢＰ[#000000]とよばれる\nバトルＢＰはマブスラの練習でも手に入るぞ！", @"Recoge [#FF0000]PP de batalla[#000000] cada vez que juegas un juego de Tin Pin Slammer. ¡Practicar es una excelente manera de perfeccionar tus habilidades de slammin mientras también ganas PP!", @"I PS conferiti dopo aver giocato a Tin Pin Slammer si chiamano [#FF0000]PS Tin Pin[#000000]. Allenarsi è un ottimo modo per affinare le tue abilità da Slammer e ottenere PS!", @"Sammle [#FF0000]Kampf-PP[#000000] in dem du Tin Pin Slammer spielst. Übung ist eine super Methode dein Können zu verbessern und gleichzeitig PP zu verdienen!", @"Collectez [#FF0000]PB de combat[#000000] à chaque fois que vous jouez au jeu Tin Pin Slammer. La pratique est le meilleur moyeur d'augmenter vos compétences tout en gagnant des PB ! ", @"激鬥徽章戰鬥結束後徽章收到的ＰＰ\n稱為[#FF0000]戰鬥ＰＰ[#000000]。\n戰鬥ＰＰ在激鬥徽章的練習模式中也可獲得喔！", @"激撞徽章战斗结束后徽章收到的PP\n称为[#FF0000]战斗PP[#000000]。\n战斗PP在激撞徽章的练习模式中也可获得喔！") },
            { 30173, new TwewyItem(30173, 173, @"tile545", @"(B) Battle PP", @"Ｂ：バトルＢＰ", @"(L) PP de batalla", @"(L) PS Battaglia", @"(B) Kampf-PP", @"(L) PB de combat", @"Ｂ：戰鬥ＰＰ", @"B：战斗PP", @"Collect [#FF0000]Battle PP[#000000] at the Results screen after erasing Noise in combat. You have to [#FF0000]fight Noise[#000000] if you want this type of PP!", @"バトルしたあとのリザルト画面でバッジに入る\nＢＰは、[#FF0000]バトルＢＰ[#000000]とよばれる", @"Recoge [#FF0000]PP de batalla[#000000] en la pantalla Resultados tras eliminar al Ruido en combate. Si quieres este tipo de PP, tienes que [#FF0000]luchar contra el Ruido[#000000].", @"Ottieni [#FF0000]PS Battaglia[#000000] nella Schermata dei risultati dopo aver cancellato i Rumori in combattimento. Dovrai [#FF0000]combattere contro i Rumori[#000000] se vorrai ottenere questo tipo di PS!", @"Du erhältst [#FF0000]Kampf-PP[#000000] im Ergebnisbildschirm, nachdem du Noise ausgelöscht hast. Du musst [#FF0000]gegen Noise kämpfen[#000000], um solche PP zu erhalten!", @"Récoltez des [#FF0000]PB de combat[#000000] sur l'écran de Résultats après avoir vaincu des Échos. Vous devez [#FF0000]combattre les Échos[#000000] pour gagner ce type de PB !", @"於戰鬥結束後的結算畫面中，徽章收到的ＰＰ\n稱為[#FF0000]戰鬥ＰＰ[#000000]。", @"于战斗结束后的结算画面中，徽章收到的PP\n称为[#FF0000]战斗PP[#000000]。") },
            { 30174, new TwewyItem(30174, 174, @"tile545", @"(B) Shutdown PP", @"Ｂ：シャットダウンＢＰ", @"(L) PP de ausencia", @"(L) PS Spegnimento", @"(B) Abschalt-PP", @"(L) PB d'absence", @"Ｂ：關機ＰＰ", @"B：关机PP", @"Collect [#FF0000]Shutdown PP[#000000] while you're not playing and the power is off. This way, you can still earn PP even if you [#FF0000]take a break from the game[#000000]!", @"シャットダウンシステムでバッジに入るＢＰは\n[#FF0000]シャットダウンＢＰ[#000000]とよばれる　このシステムで\nしかこの種類のＢＰは手に入らないぞ！", @"Recoge [#FF0000]PP de ausencia[#000000] cuando no estés jugando y el dispositivo esté apagado. Si quieres este tipo de PP, tendrás que [#FF0000]descansar del juego[#000000].", @"Ottieni [#FF0000]PS Spegnimento[#000000] quando non stai giocando e il dispositivo è spento. Dovrai [#FF0000]fare una pausa dal gioco[#000000] se vorrai ottenere questo tipo di PS!", @"Du erhältst [#FF0000]Abschalt-PP[#000000], während du nicht spielst und das Gerät abgeschaltet ist. Du musst [#FF0000]eine Spielpause einlegen[#000000], um solche PP zu erhalten!", @"Récoltez des [#FF0000]PB d'absence[#000000] pendant que vous ne jouez pas et que la console est éteinte. Vous devez [#FF0000]ne pas jouer au jeu pendant quelque temps[#000000] pour obtenir ce type de PB !", @"徽章透過關機系統收到的ＰＰ\n稱為[#FF0000]關機ＰＰ[#000000]，只有透過此系統\n才能獲得這種ＰＰ！", @"徽章通过关机系统收到的PP\n称为[#FF0000]关机PP[#000000]，只有通过此系统\n才能获得这种PP！") },
            { 30175, new TwewyItem(30175, 175, @"tile545", @"(B) Black Cat Atlas, Vol. 1", @"Ｂ：黒ネコの本 １巻", @"(L) Atlas Gato Negro, Vol. 1", @"(L) Libro gatto nero, vol. 1", @"(B) Schwarze Katze-Atlas 1", @"(L) Atlas du Chat noir, Vol. 1", @"Ｂ：黑貓之書第１集", @"B：黑猫之书第1集", @"Did you know [#FF0000]some pins work better than others[#000000] for landing [#FF0000]cross combos[#000000] with a given partner? Build your deck wisely!", @"シンクロコンボを決めやすいバッジは\nパートナー毎に異なるぞ\n相性をよく考えて使うバッジをえらぼう", @"¿Sabías que unos [#FF0000]pines funcionan mejor que otros[#000000] para hacer [#FF0000]combos cruzados[#000000] con un compañero determinado? ¡Elige bien los pines que colocas en la tabla!", @"Sapevi che [#FF0000]alcune spille funzionano meglio di altre[#000000] quando si tratta di [#FF0000]effettuare combo incrociate[#000000] con un dato partner? Costruisci saggiamente il tuo set!", @"Wusstest du, dass [#FF0000]manche Pins besser als andere geeignet sind[#000000], um [#FF0000]Koop-Kombos[#000000] mit einem bestimmten Partner auszuführen? Stelle dein Set überlegt zusammen!", @"Saviez-vous que [#FF0000]certains badges fonctionnent mieux que d'autres[#000000] pour réussir des [#FF0000]combos croisés[#000000] avec un partenaire donné ? Montez votre deck intelligemment !", @"容易發動同步連擊的徽章\n會隨搭檔變更而有所不同，\n好好思考彼此的契合度來選擇徽章吧。", @"容易发动同步连击技能的徽章\n会随搭档变更而有所不同，\n好好思考彼此的契合度来选择徽章吧。") },
            { 30176, new TwewyItem(30176, 176, @"tile545", @"(B) Black Cat Atlas, Vol. 2", @"Ｂ：黒ネコの本 ２巻", @"(L) Atlas Gato Negro, Vol. 2", @"(L) Libro gatto nero, vol. 2", @"(B) Schwarze Katze-Atlas 2", @"(L) Atlas du Chat noir, Vol. 2", @"Ｂ：黑貓之書第２集", @"B：黑猫之书第2集", @"Did you know it's [#FF0000]easier to deal damage to Taboo Noise[#000000] when you attack [#FF0000]with your partner[#000000]? Better get those cross combos down!", @"禁断ノイズは[#FF0000]パートナーと一緒に攻撃すると\nダメージを与えやすい[#000000]ぞ！\nシンクロコンボをうまく使って\n禁断ノイズをたおそう！", @"¿Sabías que es [#FF0000]más fácil dañar al Ruido tabú[#000000] cuando atacas [#FF0000]con tu compañero[#000000]? Más te vale dominar esos combos cruzados.", @"Sapevi che è [#FF0000]più facile infliggere danno ai Rumori Tabù[#000000] quando li attacchi [#FF0000]assieme al tuo partner[#000000]? Sarà meglio imparare quelle combo incrociate!", @"Wusstest du, dass es [#FF0000]einfacher ist, Tabu-Noise Schaden zuzufügen[#000000], wenn du [#FF0000]gemeinsam mit deinem Partner angreifst[#000000]? Zeit für coole Koop-Kombos!", @"Saviez-vous qu'il est [#FF0000]plus facile de blesser les Échos tabous[#000000] si vous attaquez [#FF0000]avec votre partenaire[#000000] ? À vous de maîtriser les combos croisés !", @"[#FF0000]和搭檔一起攻擊禁忌諾伊茲\n將更容易給予其傷害[#000000]！\n善加運用同步連擊\n來打倒禁忌諾伊茲吧！", @"[#FF0000]和搭档一起攻击禁忌噪音\n将更容易给予其伤害[#000000]！\n善加运用同步连击技能\n来打倒禁忌噪音吧！") },
            { 30177, new TwewyItem(30177, 177, @"tile545", @"(B) Black Cat Atlas, Vol. 3", @"Ｂ：黒ネコの本 ３巻", @"(L) Atlas Gato Negro, Vol. 3", @"(L) Libro gatto nero, vol. 3", @"(B) Schwarze Katze-Atlas 3", @"(L) Atlas du Chat noir, Vol. 3", @"Ｂ：黑貓之書第３集", @"B：黑猫之书第3集", @"Did you know that landing [#FF0000]cross combos[#000000] gives your sync rate a [#FF0000]major boost[#000000]? Practice that timing!", @"シンクロコンボを決めるとシンクロ率が\n大きくアップするぞ！\n積極的にねらってシンクロ率を高めよう！", @"¿Sabías que los [#FF0000]combos cruzados[#000000] [#FF0000]aumentan considerablemente[#000000] vuestra sincronización? Busca el momento perfecto.", @"Sapevi che eseguire [#FF0000]combo incrociate[#000000] dà un [#FF0000]potenziamento maggiore[#000000] al tuo tasso di sincronizzazione? Comincia ad allenare il tuo tempismo!", @"Wusstest du, dass erfolgreiche [#FF0000]Koop-Kombos[#000000] deine Synchro-Rate [#FF0000]enorm verbessern[#000000]? Perfektioniere dein Timing!", @"Saviez-vous qu'en réussissant des [#FF0000]combos croisés[#000000], vous offrez un [#FF0000]bonus important[#000000] à votre taux de synchro ? Entraînez-vous à maîtriser ce timing !", @"一旦發動同步連擊，\n同步率就會大幅提升喔！\n以此為目標努力提高同步率吧！", @"一旦发动同步连击技能，\n同步率就会大幅提升哦！\n以此为目标努力提高同步率吧！") },
            { 30178, new TwewyItem(30178, 178, @"tile545", @"(B) Black Cat Atlas, Vol. 4", @"Ｂ：黒ネコの本 ４巻", @"(L) Atlas Gato Negro, Vol. 4", @"(L) Libro gatto nero, vol. 4", @"(B) Schwarze Katze-Atlas 4", @"(L) Atlas du Chat noir, Vol. 4", @"Ｂ：黑貓之書第４集", @"B：黑猫之书第4集", @"Did you know a higher sync rate makes it easier to attain Fusion? Be careful not to [#FF0000]run away[#000000] from multiple battles in a row, or you'll [#FF0000]de-sync[#000000].", @"パートナーとのシンクロ率を高めると\n必殺技のチャンス！　[#FF0000]バトルから連続で\n逃げるとシンクロ率は下がってしまう[#000000]ので\n注意しよう", @"¿Sabías que con más sincronización es más fácil lograr la fusión? Ten cuidado de no [#FF0000]huir[#000000] de varias batallas seguidas o [#FF0000]perderás sincronización[#000000].", @"Sapevi che un tasso di sincronizzazione più alto rende più semplice realizzare la Fusione? Fai attenzione a non [#FF0000]scappare[#000000] da più battaglie di fila, altrimenti ti [#FF0000]desincronizzerai[#000000].", @"Wusstest du, dass eine höhere Synchro-Rate das Erreichen einer Fusion vereinfacht? Achte darauf, nicht aus zu vielen Kämpfen in Folge zu [#FF0000]fliehen[#000000], sonst [#FF0000]desynchronisierst[#000000] du.", @"Saviez-vous qu'un taux de synchro plus élevé facilite la réussite de la Fusion ? Mais veillez à ne pas [#FF0000]fuir[#000000] plusieurs combats à la suite sous peine de vous [#FF0000]désynchroniser[#000000].", @"只要提高與搭檔的同步率，\n就是使出必殺技的好機會！[#FF0000]連續逃離戰鬥\n則會降低同步率[#000000]，\n務必多加留意。", @"只要提高与搭档的同步率，\n就是使出必杀技的好机会！\n[#FF0000]连续逃离战斗则会降低同步率[#000000]，\n务必多加留意。") },
            { 30179, new TwewyItem(30179, 179, @"tile545", @"(B) Black Cat Atlas, Vol. 5", @"Ｂ：黒ネコの本 ５巻", @"(L) Atlas Gato Negro, Vol. 5", @"(L) Libro gatto nero, vol. 5", @"(B) Schwarze Katze-Atlas 5", @"(L) Atlas du Chat noir, Vol. 5", @"Ｂ：黑貓之書第５集", @"B：黑猫之书第5集", @"Did you know Neku can pull off better [#FF0000]aerial combos[#000000] by [#FF0000]using sub-slots to quickly switch[#000000] between pin psychs whose [#FF0000]touch commands overlap[#000000]?", @"ネクは複数のサイキックと[#FF0000]サブスロット[#000000]を利用して\n[#FF0000]空中コンボをねらってみよう！　[#FF0000]同じタッチコマン\nドのサイキックでも発動しわける[#000000]ことができるぞ！", @"¿Sabías que Neku puede hacer [#FF0000]combos aéreos[#000000] mejores [#FF0000]usando los subhuecos para [#000000]cambiar rápidamente entre psicopoderes con el [#FF0000]mismo comando táctil[#000000]?", @"Sapevi che a Neku riescono meglio le [#FF0000]combo aeree[#000000] se [#FF0000]usa slot secondari per alternare velocemente[#000000] gli psico delle spille i cui [#FF0000]comandi touch si sovrappongono[#000000]?", @"Wusstest du, dass Neku bessere [#FF0000]Luft-Kombos[#000000] durchführen kann, wenn du mithilfe von [#FF0000]Unterplätzen schnell zwischen Pin-Psychs wechselst[#000000], deren [#FF0000]Touch-Befehle sich überschneiden[#000000]?", @"Saviez-vous que Neku peut réussir de meilleurs [#FF0000]combos aériens[#000000] en [#FF0000]utilisant des sous-emplacements pour changer rapidement[#000000] entre les psychs de badges dont les [#FF0000]commandes tactiles sont les mêmes[#000000] ?", @"讓音操善加利用多種超能與[#FF0000]候補欄位[#000000]\n[#FF0000]使出空中連擊[#000000]吧！\n只要使用候補欄位，即使是[#FF0000]使用同樣\n觸控指令的超能也能分別發動[#000000]！", @"让音操善加利用多种超能与\n[#FF0000]候补栏位[#FF0000]使出空中连击技能[#000000]吧！\n只要使用候补栏位，即使是[#FF0000]使用同样\n触控指令的超能也能分别发动[#000000]！") },
            { 30180, new TwewyItem(30180, 180, @"tile545", @"(B) Black Cat Atlas, Vol. 6", @"Ｂ：黒ネコの本 ６巻", @"(L) Atlas Gato Negro, Vol. 6", @"(L) Libro gatto nero, vol. 6", @"(B) Schwarze Katze-Atlas 6", @"(L) Atlas du Chat noir, Vol. 6", @"Ｂ：黑貓之書第６集", @"B：黑猫之书第6集", @"Did you know pins in [#FF0000]lower-numbered slots respond to touch commands first[#000000]? If you can't seem to use a psych, [#FF0000]reorder your deck[#000000].", @"バトルで[#FF0000]思ったようにサイキックがだせない\n[#000000]ときは、デッキの[#FF0000]番号タグ[#000000]の小さいほうに、[#FF0000]より\n使いたいバッジをそうび[#000000]すればだしやすいぞ！", @"¿Sabías que los pines de los [#FF0000]huecos con los números más bajos responden primero a los comandos táctiles[#000000]? Si parece que un psicopoder no funciona, [#FF0000]reorganiza la tabla[#000000].", @"Sapevi che le spille negli [#FF0000]spazi secondari con i numeri più bassi rispondo per prime ai comandi touch[#000000]? Se ti sembra di non riuscire a usare uno psico, [#FF0000]riordina il tuo set[#000000].", @"Wusstest du, dass Pins auf [#FF0000]Plätzen mit niedriger Nummer zuerst auf Touch-Befehle reagieren[#000000]? Wenn du bestimmte Psychs irgendwie nie einsetzen kannst, solltest du [#FF0000]dein Set neu anordnen[#000000].", @"Saviez-vous que les badges des [#FF0000]premiers emplacements répondent aux commandes tactiles les premiers[#000000] ? Si vous avez l'impression de ne pas pouvoir utiliser un psych, [#FF0000]réorganisez votre deck[#000000].", @"戰鬥中[#FF0000]無法隨心所欲發動超能[#000000]時，\n[#FF0000]只要在徽章組合中，於較小的[#FF0000]號碼標籤[#000000]上，\n[#FF0000]裝備欲使用的徽章[#000000]，就會比較容易發動！", @"战斗中[#FF0000]无法随心所欲发动超能[#000000]时，\n[#FF0000]只要在徽章组合中，较小的[#FF0000]号码标签[#000000]上，\n[#FF0000]装备欲使用的徽章[#000000]，就会比较容易发动！") },
            { 30181, new TwewyItem(30181, 181, @"tile545", @"(B) Black Cat Atlas, Vol. 7", @"Ｂ：黒ネコの本 ７巻", @"(L) Atlas Gato Negro, Vol. 7", @"(L) Libro gatto nero, vol. 7", @"(B) Schwarze Katze-Atlas 7", @"(L) Atlas du Chat noir, Vol. 7", @"Ｂ：黑貓之書第７集", @"B：黑猫之书第7集", @"Did you know eating is a science? If you have [#FF0000]a lot of time[#000000] on a given day, [#FF0000]start by eating food that boosts your Attack or Defense[#000000].", @"フードアイテムを効率よくたべているだろうか？\n[#FF0000]時間に余裕[#000000]があるときは[#FF0000]「攻撃力」か「防御力」\nの上がるものを先に[#000000]食べたほうが良いかもしれない", @"¿Sabías que comer es una ciencia? Si tienes [#FF0000]mucho tiempo[#000000] cada día, [#FF0000]empieza por comer cosas que aumenten tu ataque o defensa[#000000].", @"Sapevi che mangiare è una scienza? Se hai [#FF0000]molto tempo[#000000] in una giornata, [#FF0000]comincia consumando alimenti che potenziano il tuo Attacco o la tua Difesa[#000000].", @"Wusstest du, dass Essen eine Wissenschaft ist? Wenn du an einem Tag [#FF0000]viel Zeit[#000000] hast, solltest du [#FF0000]zuerst Essen zu dir nehmen, das Angriff oder Verteidigung erhöht[#000000].", @"Saviez-vous que manger est une science ? Si vous avez [#FF0000]beaucoup de temps[#000000] par jour, [#FF0000]commencez par manger une nourriture qui augmente votre attaque ou votre défense[#000000].", @"是否有效率地活用食物道具呢？\n[#FF0000]倘若時間充足[#000000]，\n建議從[#FF0000]提升「攻擊力」或「防禦力」\n的食物開始食用比較好[#000000]。", @"是否有效率地食用食物道具呢？\n[#FF0000]倘若时间充足[#000000]，\n或许从[#FF0000]提升“攻击力”或“防御力”\n的食物开始食用比较好[#000000]。") },
            { 30182, new TwewyItem(30182, 182, @"tile545", @"(B) Black Cat Atlas, Vol. 8", @"Ｂ：黒ネコの本 ８巻", @"(L) Atlas Gato Negro, Vol. 8", @"(L) Libro gatto nero, vol. 8", @"(B) Schwarze Katze-Atlas 8", @"(L) Atlas du Chat noir, Vol. 8", @"Ｂ：黑貓之書第８集", @"B：黑猫之书第8集", @"Did you know item abilities are less about power and more about [#FF0000]customization[#000000]? Pick an outfit \x22suitable\x22 for the situation at hand.", @"そうびアイテムのアビリティは有利になる能力\nというよりも[#FF0000]カスタマイズに秀でた能力[#000000]が多い\n状況にあわせて有利なコーディネイトしよう！", @"¿Sabías que las habilidades de los objetos tienen menos que ver con el poder y más con la [#FF0000]personalización[#000000]? Elige un atuendo «adecuado» a la situación en la que te encuentres.", @"Sapevi che le abilità degli oggetti hanno poco a che fare con la potenza e molto con la [#FF0000]personalizzazione[#000000]? Scegli un outfit adatto a ogni singola situazione.", @"Wusstest du, dass es bei Objektfähigkeiten weniger um schiere Kraft als vielmehr um [#FF0000]Individualisierung[#000000] geht? Stell dir ein Outfit zusammen, das zur jeweiligen Situation passt.", @"Saviez-vous que les capacités d'objet sont plus une question de [#FF0000]personnalisation[#000000] que de puissance ? Choisissez une tenue \x22appropriée\x22 à la situation qui se présente.", @"比起裝備單純數值優秀的道具，\n裝備[#FF0000]能特化角色能力[#000000]的道具要好很多，\n配合狀況作出有利的搭配吧！", @"装备道具的能力并非能逆转战况的能力，\n而是有较多[#FF0000]适合用来自订角色的能力[#000000]，\n配合状况作出有利的搭配吧！") },
            { 30183, new TwewyItem(30183, 183, @"tile545", @"(B) Black Cat Atlas, Vol. 9", @"Ｂ：黒ネコの本 ９巻", @"(L) Atlas Gato Negro, Vol. 9", @"(L) Libro gatto nero, vol. 9", @"(B) Schwarze Katze-Atlas 9", @"(L) Atlas du Chat noir, Vol. 9", @"Ｂ：黑貓之書第９集", @"B：黑猫之书第9集", @"Did you know some pins can only be acquired through evolution? If you're [#FF0000]gunning for 100%[#000000], don't just rely on shops and battles.", @"[#FF0000]バッジのコンプリート[#000000]をめざす者に教えよう！\nショップ、バトル、イベントでしかゲットできない\nバッジの他、進化でしかゲットできない物もあるぞ", @"¿Sabías que algunos pines solo se pueden conseguir a través de la evolución? Si tu [#FF0000]objetivo es el 100 %[#000000], no te limites únicamente a las tiendas y las batallas.", @"Sapevi che alcune spille si possono acquisire solo attraverso l'evoluzione? Se [#FF0000]punti al 100%[#000000], non fare affidamento solo sui negozi o sulle battaglie.", @"Wusstest du, dass du bestimmte Pins nur durch Evolution erhalten kannst? Wenn du [#FF0000]100 % erreichen willst[#000000], darfst du dich nicht nur auf Läden und Kämpfe verlassen.", @"Saviez-vous que certains badges ne peuvent être obtenus que par l'évolution ? Si vous voulez [#FF0000]tous les avoir[#000000], ne comptez pas uniquement sur les boutiques et les combats.", @"給目標是[#FF0000]收集所有徽章[#000000]的人一個提示！\n除了只能透過商店、戰鬥、事件獲得的徽章以外，\n還有只能靠進化獲得的徽章。", @"给以[#FF0000]完整收集所有徽章[#000000]为目标的人一个提示！\n除了只能通过商店、战斗、事件获得的徽章以外，\n还有只能靠进化获得的徽章。") },
            { 30184, new TwewyItem(30184, 184, @"tile545", @"(B) Black Cat Atlas, Vol. 10", @"Ｂ：黒ネコの本１０巻", @"(L) Atlas Gato Negro, Vol. 10", @"(L) Libro gatto nero, vol. 10", @"(B) Schwarze Katze-Atlas 10", @"(L) Atlas du Chat noir, Vol. 10", @"Ｂ：黑貓之書第１０集", @"B：黑猫之书第10集", @"Did you know [#FF0000]Reaper Creeper[#000000] can solve all your problems? All you need is a coin, a sheet of paper, and a few crayons. (Mileage may vary.)", @"[#FF0000]秘密のおまじない「死神さん」[#000000]について教えよう！\n赤い鳥居、黒、白が書かれた紙と十円玉があれば\n死神さんが色々教えてくれるのだ！　…たぶん", @"¿Sabías que el [#FF0000]Segador Delator[#000000] puede resolver todos tus problemas? Solo necesitas una moneda, papel y lápices de colores. (Sujeto a condiciones).", @"Sapevi che [#FF0000]Signor Demone[#000000] può risolvere tutti i tuoi problemi? Ti serve solo una moneta, un foglio di carta e qualche pastello. (L'effetto può variare.)", @"Wusstest du, dass [#FF0000]Reaper-Rapport[#000000] all deine Probleme lösen kann? Du brauchst nur eine Münze, ein Blatt Papier und ein paar Buntstifte. Keine Gewährleistung.", @"Saviez-vous que [#FF0000]Reaper Creeper[#000000] peut résoudre tous vos problèmes ? Tout ce qu'il vous faut, c'est une pièce, une feuille de papier et quelques crayons. (Résultats non garantis.)", @"告訴你有關[#FF0000]秘密咒文「死神大人」[#000000]的事吧！\n只要準備一張畫有紅色鳥居，\n並寫上黑、白兩字的紙，和一枚十圓硬幣，\n死神大人就會透露許多事情……應該吧！", @"告诉你有关[#FF0000]秘密咒文“死神大人”[#000000]的事吧！\n只要准备画上红色鸟居\n并写上黑、白的纸与十元硬币，\n死神大人就会透露许多事情！……应该吧。") },
