            { 30192, new TwewyItem(30192, 192, @"tile545", @"(B) Curse Mission", @"Ｂ：カース・ミッション", @"(L) Misión maldita", @"(L) Missione Maledizione", @"(B) Verfluchte Mission", @"(L) Maudire la mission", @"Ｂ：詛咒任務", @"Ｂ：诅咒任务", @"Combat challenge in which Neku's HP slowly depletes as the battle goes on. No time to waste!", @"バトル中にネクのHPがどんどん減少して\nしまうミッションだ！", @"Misión en la que el HP de Neku se agota lentamente a medida que avanza la batalla. ¡No hay tiempo que perder!", @"Missione in cui i PF di Neku si esauriscono man mano che la battaglia procede. Non c'è tempo da perdere!", @"Mission: Neku verliert während des Kampfes langsam LP. Beeile dich!", @"Mission dans laquelle Neku perd lentement des PV durant la bataille. Pas de temps à perdre !", @"在戰鬥中，音操的HP會\n逐漸減少的任務！", @"在战斗中，音操的HP会\n逐渐减少的任务！") },
            { 30193, new TwewyItem(30193, 193, @"tile545", @"(B) Restore Mission", @"Ｂ：レストア・ミッション", @"(L) Misión de recuperación", @"(L) Missione Ripristino", @"(B) Regenerations-Mission", @"(L) Restaurer la mission", @"Ｂ：回復任務", @"Ｂ：回复任务", @"Combat challenge in which Neku regains a little HP after erasing a Noise. Heal up as necessary! ", @"バトル中にノイズを倒すたびネクのHPが\nすこし回復するミッションだ！", @"Misión en la que Neku recupera un poco de HP después de borrar un ruido. ¡Cura según sea necesario!", @"Missione in cui i PF di Neku aumentano un poco dopo aver cancellato un Rumore. Ricaricati in caso di necessità!", @"Mission: Wenn ein Noise zerstört wird, heilt Neku sich ein wenig. Versuche das auszunutzen.", @"Mission dans laquelle Neku regargne un peu de PV apres avoir effacé un Écho. Se soigner si nécéssaire !", @"在戰鬥中每次打倒諾伊茲，\n音操都會恢復少許HP的任務！", @"在战斗中每次打倒噪音，\n音操都会恢复少许HP的任务！") },
            { 30194, new TwewyItem(30194, 194, @"tile545", @"(B) Split Mission", @"Ｂ：スプリット・ミッション", @"(L) Misión dividida", @"(L) Missione Multi", @"(B) Teilungs-Mission", @"(L) Mission de division", @"Ｂ：分裂任務", @"Ｂ：分裂任务", @"Combat challenge in which Noise continue to multiply as the battle goes on. Take them out quickly!", @"バトル中にノイズが分裂してどんどん\n増えていくミッションだ！", @"Misión en la que el Ruido continúa multiplicándose a medida que avanza la batalla. ¡Sácalos rápidamente!", @"Missione in cui i Rumori continuano a moltiplicarsi man mano che la battaglia procede. Annientali velocemente! ", @"Mission: Noise vervielfacht sich während du kämpfst. Zerstöre sie möglichst schnell!", @"Mission dans laquelle les Échos continuent de se multiplier durant le combat.\nBattez les rapidement !", @"在戰鬥中,諾伊茲會進行分裂，\n數量將不斷增加！非常有任務性！", @"在战斗中， 噪音会进行分裂，\n数量将不断增加！非常有任务性！") },
            { 30195, new TwewyItem(30195, 195, @"tile545", @"(B) Sync Rave Mission", @"Ｂ：シンクレイヴ・ミッション", @"(L) Misión de sincronización", @"(L) Missione SincroRave", @"(B) Synchro-Rave-Mission", @"(L) Mission taux de synchro", @"Ｂ：同銳任務", @"Ｂ：同锐任务", @"Combat challenge in which your sync rate gets a boost. Team up with your partner to take down your enemies!", @"バトル中にたまるシンクロゲージの量が\n倍増するミッションだ！", @"Misión en la que la velocidad de sincronización recibe un impulso. ¡Únete a tu compañero para derrotar a tus enemigos!", @"Missione in cui la percentuale di sincronizzazione ottiene un incremento. Unisciti al tuo partner per annientare i tuoi nemici!", @"Mission: Deine Synchro-Rate kriegt einen Boost. Verbünde dich mit deinem Partner und zerstöre deine Feinde.", @"Mission dans laquelle votre taux de synchro augmente. Faites équipe avec un partenaire pour éliminer vos ennemis !", @"在戰鬥中，同步計量表的\n累積量將會加倍的任務！", @"在战斗中，同步计量表的\n累积量将会加倍的任务！") },
