            { 64, new TwewyPin(64,  "badge_065", @"Aqua Monster", @"アクアモンスター", @"Monstruo Acuático", @"Mostro d'acqua", @"Wassermonster", @"Monstre aquatique", @"水中怪物", @"水怪", @"[#FF0000]Tap empty space[#000000] to create a stationary orb of water. Orbs inflict damage on contact and then [#FF0000]rebound[#000000].", @"[#FF0000]空間をタップ[#000000]することでその位置に動かない\n水球を出し、当たった敵にダメージを与える\n敵が当たると水球は[#FF0000]反動で移動[#000000]する", @"[#FF0000]Toca un espacio vacío[#000000] para formar una esfera estática de agua. Las esferas infligen daño al impactar y después [#FF0000]rebotan[#000000].", @"[#FF0000]Tocca uno spazio vuoto[#000000] per creare una sfera d'acqua immobile. Le sfere infliggono danno a contatto e [#FF0000]rimbalzano[#000000].", @"[#FF0000]Tippe im leeren Raum[#000000], um eine stationäre Wasserkugel zu erschaffen. Kugeln verursachen bei Berührung Schaden und [#FF0000]prallen dann ab[#000000].", @"[#FF0000]Touchez un espace vide[#000000] pour créer un orbe d'eau stationnaire. Les orbes infligent des dégâts au contact, puis [#FF0000]rebondissent[#000000].", @"[#FF0000]點擊空間[#000000]就會朝該位置射出\n不會動的水球，給予命中的敵人傷害。\n命中敵人後，水球會朝[#FF0000]反方向移動[#000000]。", @"[#FF0000]点击空间[#000000]就会朝该位置射出\n不会动的水球，给予命中的敌人伤害。\n命中敌人后，水球会朝[#FF0000]反方向移动[#000000]。") },
