            { 66, new TwewyPin(66,  "badge_067", @"Aqua Demon", @"アクアデーモン", @"Demonio Acuático", @"Diavolo d'acqua", @"Wasserdämon", @"Démon aquatique", @"水中惡魔", @"水魔", @"[#FF0000]Tap empty space[#000000] to create a small, stationary orb of water. Orbs inflict damage on contact and then [#FF0000]rebound a good distance[#000000].", @"[#FF0000]空間をタップ[#000000]することでその位置に動かない\n小水球を出し、当たった敵にダメージを与える\n敵が当たると水球は[#FF0000]反動で大きく移動[#000000]する", @"[#FF0000]Toca un espacio vacío[#000000] para formar una pequeña esfera estática de agua. Las esferas infligen daño al impactar y después [#FF0000]rebotan a una distancia considerable[#000000].", @"[#FF0000]Tocca uno spazio vuoto[#000000] per creare una piccola sfera d'acqua immobile. Le sfere infliggono danno a contatto e [#FF0000]rimbalzano a lunga distanza[#000000].", @"[#FF0000]Tippe im leeren Raum[#000000], um eine kleine, stationäre Wasserkugel zu erschaffen. Kugeln verursachen bei Berührung Schaden und [#FF0000]prallen dann ab[#000000].", @"[#FF0000]Touchez un espace vide[#000000] pour créer un petit orbe d'eau stationnaire. Les orbes infligent des dégâts au contact, puis [#FF0000]rebondissent sur une longue distance[#000000].", @"[#FF0000]點擊空間[#000000]就會朝那位置射出\n不會動的小水球，給予命中的敵人傷害。\n命中敵人後，水球會朝[#FF0000]反方向大幅移動[#000000]。", @"[#FF0000]点击空间[#000000]就会朝那位置射出\n不会动的小水球，给予命中的敌人伤害。\n命中敌人后，水球会朝[#FF0000]反方向大幅移动[#000000]。") },
            { 67, new TwewyPin(67,  "badge_068", @"Cornered Rat", @"袋のネズミ", @"Rata Acorralada", @"Ratto intrappolato", @"Panikratte", @"Rat acculé", @"袋中鼠", @"笼中鼠", @"[#FF0000]Keep your finger trained on an enemy[#000000] to focus light upon them. Inflicts continuous damage and sometimes [#FF0000]Attack Break[#000000].", @"[#FF0000]敵を押さえ続ける[#000000]ことで光を収束させ\n敵に連続でダメージを与えると同時に\n状態異常[#FF0000]攻撃力減少[#000000]にすることもある", @"[#FF0000]Mantén seleccionado un enemigo[#000000] para fijar la luz en él. Inflige daño continuo y a veces provoca la [#FF0000]anulación de ataque[#000000].", @"[#FF0000]Tieni premuto su un nemico[#000000] per concentrare la luce su di lui. Infligge danno continuo e a volte [#FF0000]Spezza attacco[#000000].", @"[#FF0000]Drücke auf einen Gegner[#000000], um Licht auf ihm zu bündeln. Verursacht kontinuierlich Schaden und manchmal [#FF0000]Angriffsbruch[#000000].", @"[#FF0000]Maintenez un ennemi[#000000] pour l'illuminer. Inflige des dégâts continus et parfois une [#FF0000]Rupture d'attaque[#000000].", @"[#FF0000]持續壓住敵人[#000000]可使光芒匯聚，\n持續給予敵人傷害，同時還可能使其陷入\n異常狀態[#FF0000]攻擊力減少[#000000]。", @"[#FF0000]持续压住敌人[#000000]可使光芒汇聚，\n持续给予敌人伤害，同时还可能使其陷入\n状态异常[#FF0000]攻击力减少[#000000]。") },
            { 68, new TwewyPin(68,  "badge_069", @"Blast Warning", @"噴火アラート", @"Aviso: Explosión", @"Avvertimento improvviso", @"Eruptionswarnung", @"Alerte explosion", @"噴火警報", @"喷火警报", @"[#FF0000]Drag empty space[#000000] to create a path of flame. Inflicts damage on contact.", @"[#FF0000]空間をドラッグ[#000000]することでドラッグした線上に\n炎を走らせ、当たった敵にダメージを与える", @"[#FF0000]Arrastra por un espacio vacío[#000000] para crear una senda de llamas. Inflige daño al impactar.", @"[#FF0000]Trascina su uno spazio vuoto[#000000] per creare un percorso di fiamme. Infligge danno a contatto.", @"[#FF0000]Ziehe im leeren Raum[#000000], damit Flammen aus dem Boden züngeln. Verursacht bei Berührung Schaden.", @"[#FF0000]Balayez un espace vide[#000000] pour créer un chemin de flammes. Inflige des dégâts au contact.", @"[#FF0000]拖曳空間[#000000]會使拖曳過的路線起火，\n給予命中敵人傷害。", @"[#FF0000]拖拽空间[#000000]会使拖曳过的路线\n起火，给予被击中的敌人伤害。") },
            { 69, new TwewyPin(69,  "badge_070", @"Candle Service", @"キャンドルサービス", @"Servicio de Velas", @"Lume di candela", @"Kerzenzauber", @"Service à bougies", @"蠟燭服務", @"蜡烛服务", @"[#FF0000]Press empty space[#000000] to [#FF0000]spray a wide radius with sparks[#000000]. Inflicts damage on contact.", @"[#FF0000]空間をホールド[#000000]することで\nその位置から[#FF0000]広い範囲に火花を飛ばし[#000000]\n当たった敵にダメージを与える", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para [#FF0000]rociar con centellas un radio extenso[#000000]. Inflige daño al impactar.", @"[#FF0000]Premi su uno spazio vuoto[#000000] per [#FF0000]spruzzare scintille ad ampio raggio[#000000]. Infligge danno a contatto.", @"[#FF0000]Drücke im leeren Raum[#000000], um [#FF0000]einen großen Radius mit Funken zu überziehen[#000000]. Verursacht bei Berührung Schaden.", @"[#FF0000]Appuyez sur un espace vide[#000000] pour [#FF0000]lancer des étincelles dans un grand rayon[#000000]. Inflige des dégâts au contact.", @"[#FF0000]長按空間[#000000]就會朝該位置\n[#FF0000]射出大範圍火花[#000000]，\n給予命中的敵人傷害。", @"[#FF0000]长按空间[#000000]就会朝\n该位置[#FF0000]射出大范围火花[#000000]，\n给予命中的敌人伤害。") },
            { 70, new TwewyPin(70,  "badge_071", @"Shock Warning", @"ショックアラート", @"Aviso: Choque", @"Avvertimento scioccante", @"Schockwarnung", @"Alerte électrocution", @"衝擊警報", @"突袭警报", @"[#FF0000]Slash an enemy[#000000] any distance away and Neku will move in for a horizontal swipe. [#FF0000]Keep slashing[#000000] for a finisher that [#FF0000]knocks the enemy back[#000000].", @"[#FF0000]敵をスラッシュ[#000000]することで移動して斬りつける\n敵がどこにいても攻撃可能で[#FF0000]連続スラッシュ[#000000]すると\n最後に敵を[#FF0000]吹き飛ばす[#000000]", @"[#FF0000]Corta a un enemigo[#000000] a cualquier distancia y Neku se abalanzará para asestarle un espadazo. [#FF0000]Sigue cortando[#000000] para ejecutar un remate que [#FF0000]haga retroceder al enemigo[#000000].", @"[#FF0000]Colpisci un nemico con un fendente[#000000] a qualunque distanza e Neku si avvicinerà per colpirlo orizzontalmente. [#FF0000]Continua a colpire[#000000] per una mossa finale che [#FF0000]respinge[#000000] il nemico.", @"Führe einen [#FF0000]Hieb auf einen Gegner in beliebiger Entfernung[#000000] aus, damit Neku ihn horizontal angreift. [#FF0000]Führe weiter Hiebe aus[#000000], um einen [#FF0000]Finisher[#000000] zu aktivieren, [#FF0000]der den Gegner zurückstößt[#000000].", @"[#FF0000]Balayez un ennemi[#000000] à n'importe quelle distance et Neku ira lui asséner une frappe horizontale. [#FF0000]Continuez à le balayer[#000000] pour infliger un coup final qui [#FF0000]repoussera l'ennemi[#000000].", @"[#FF0000]劃過敵人[#000000]便能移動並使出斬擊。\n無論敵人位於何處皆可攻擊，\n若是[#FF0000]連續劃過敵人[#000000]，\n最後便可將敵人[#FF0000]擊飛[#000000]。", @"[#FF0000]划过敌人[#000000]便能移动并使出斩击。\n无论敌人位于何处皆可攻击，\n若是[#FF0000]连续划过敌人[#000000]，\n最后便可将敌人[#FF0000]击飞[#000000]。") },
            { 71, new TwewyPin(71,  "badge_072", @"Kinetic Warning", @"キネシスアラート", @"Aviso: Cinética", @"Avvertimento cinetico", @"Kinetikwarnung", @"Alerte cinétique", @"活躍警報", @"交通警报", @"[#FF0000]Slash across obstacles[#000000] like cars and signs to fling them in that direction. Inflicts damage on contact.", @"車や看板等の[#FF0000]障害物をスラッシュ[#000000]することで\nその方向に吹き飛ばし、当たった敵に\nダメージを与える", @"[#FF0000]Corta sobre obstáculos[#000000], como coches y señales, para lanzarlos en esa dirección. Inflige daño al impactar.", @"[#FF0000]Colpisci con un fendente gli ostacoli[#000000] come auto e insegne per lanciarli in quella direzione. Infligge danno a contatto.", @"Führe einen [#FF0000]Hieb auf Hindernisse[#000000] wie Autos und Schilder aus, um sie in diese Richtung zu schleudern. Verursacht bei Berührung Schaden.", @"[#FF0000]Balayez des obstacles[#000000] comme des voitures et des panneaux pour les propulser dans cette direction. Inflige des dégâts au contact.", @"[#FF0000]劃過障礙物[#000000]如車子或招牌，\n就會朝該方向飛去，\n給予命中的敵人傷害。", @"[#FF0000]划过障碍物[#000000]如车子或招牌，就会朝\n该方向飞去，\n给予命中的敌人伤害。") },
            { 72, new TwewyPin(72,  "badge_073", @"Impact Warning", @"フォールアラート", @"Aviso: Impacto", @"Avvertimento d'impatto", @"Einschlagswarnung", @"Alerte impact", @"墜落警報", @"空袭警报", @"[#FF0000]Tap empty space[#000000] to drop a [#FF0000]boulder[#000000] on that position. Inflicts damage on contact. Rapidly tap to rain more stones down.", @"[#FF0000]空間をタップ[#000000]すると、その位置に[#FF0000]石が落下[#000000]し\n当たった敵にダメージを与える\n石はゲージの続く限り連続で落とすことができる", @"[#FF0000]Toca un espacio vacío[#000000] para que caiga una [#FF0000]roca[#000000] en esa posición. Inflige daño al impactar. Toca repetidamente para provocar un aluvión de rocas.", @"[#FF0000]Tocca uno spazio vuoto[#000000] per rilasciare un [#FF0000]macigno[#000000] in quella posizione. Infligge danno a contatto. Tocca rapidamente per far piovere più pietre.", @"[#FF0000]Tippe im leeren Raum[#000000], um einen [#FF0000]Felsbrocken[#000000] auf diese Position zu werfen. Verursacht bei Berührung Schaden. Tippe schnell, damit mehr Steine fallen.", @"[#FF0000]Touchez un espace vide[#000000] pour y abattre un [#FF0000]rocher[#000000]. Inflige des dégâts au contact. Touchez de manière répétitive pour faire pleuvoir plus de pierres.", @"[#FF0000]點擊空間[#000000]，該位置便會[#FF0000]掉落石塊[#000000]，\n給予命中敵人傷害。\n可使石塊連續落下直至量表耗盡。", @"[#FF0000]点击空间[#000000]，该位置便会[#FF0000]掉落石块[#000000]，\n给予被击中的敌人伤害。\n可使石块连续落下直至计量表耗尽。") },
            { 73, new TwewyPin(73,  "badge_074", @"Storm Warning", @"サンダーアラート", @"Aviso: Tormenta", @"Avvertimento tempestoso", @"Sturmwarnung", @"Alerte tempête", @"落雷警報", @"落雷警报", @"[#FF0000]Tap an enemy[#000000] to strike it with lightning. [#FF0000]Tap additional enemies[#000000] while the lightning flashes for a [#FF0000]combo[#000000].", @"[#FF0000]敵をタップ[#000000]することでその敵に雷を落とし攻撃する\n雷が出ている間に[#FF0000]さらに別の敵をタップ[#000000]することで\n複数の敵に[#FF0000]連続攻撃[#000000]が可能", @"[#FF0000]Toca a un enemigo[#000000] para que le parta un rayo. [#FF0000]Toca a más enemigos[#000000] mientras el rayo destella para hacer un [#FF0000]combo[#000000].", @"[#FF0000]Tocca un nemico[#000000] per colpirlo con una saetta. [#FF0000]Tocca altri nemici[#000000] mentre la saetta lampeggia per ottenere una [#FF0000]combo[#000000].", @"[#FF0000]Tippe auf einen Gegner[#000000], um ihn mit einem Blitz anzugreifen. [#FF0000]Tippe auf zusätzliche Gegner[#000000], während der Blitz aktiv ist, um eine [#FF0000]Kombo[#000000] durchzuführen.", @"[#FF0000]Touchez un ennemi[#000000] pour le foudroyer. [#FF0000]Touchez d'autres ennemis[#000000] pendant que l'éclair s'abat pour faire un [#FF0000]combo[#000000].", @"[#FF0000]點擊敵人[#000000]便會對其使出落雷攻擊。\n若在雷電降下的期間[#FF0000]點擊其他敵人[#000000]，\n便可[#FF0000]連續攻擊[#000000]複數敵人。", @"[#FF0000]点击敌人[#000000]便会对其使出落雷攻击。\n若在雷电降下的期间[#FF0000]点击其他敌人[#000000]，\n便可[#FF0000]连续攻击[#000000]多名敌人。") },
            { 74, new TwewyPin(74,  "badge_075", @"Electric Warning", @"エレクトリックアラート", @"Aviso: Electricidad", @"Avvertimento elettrico", @"Elektrowarnung", @"Alerte électrique", @"電力警報", @"电击警报", @"[#FF0000]Tap empty space[#000000] and Neku will launch [#FF0000]two bolts of lightning[#000000] in that direction. Inflicts damage on contact.", @"[#FF0000]空間をタップ[#000000]するとネクから\nその方向へ[#FF0000]２本の雷[#000000]が発射され\n当たった敵にダメージを与える", @"[#FF0000]Toca un espacio vacío[#000000] para que Neku lance [#FF0000]dos rayos[#000000] en esa dirección. Inflige daño al impactar.", @"[#FF0000]Tocca uno spazio vuoto[#000000] e Neku lancerà [#FF0000]due lampi[#000000] in quella direzione. Infligge danno a contatto.", @"[#FF0000]Tippe im leeren Raum[#000000], damit Neku [#FF0000]zwei Blitzschläge[#000000] in diese Richtung abfeuert. Verursacht bei Berührung Schaden.", @"[#FF0000]Touchez un espace vide[#000000] et Neku lancera [#FF0000]deux éclairs[#000000] dans cette direction. Inflige des dégâts au contact.", @"[#FF0000]點擊空間[#000000]，音操就會\n朝該方向發射[#FF0000]２道雷電[#000000]，\n給予命中的敵人傷害。", @"[#FF0000]点击空间[#000000]，音操就会\n朝该方向发射[#FF0000]2道雷电[#000000]，\n给予命中的敌人伤害。") },
            { 75, new TwewyPin(75,  "badge_076", @"Teleport Warning", @"テレポアラート", @"Aviso: Teletransporte", @"Avvertimento teletrasporto", @"Teleportwarnung", @"Alerte téléportation", @"瞬移警報", @"瞬移警报", @"[#FF0000]Drag Neku[#000000] into a dash and he will vanish, rendering himself [#FF0000]impervious[#000000] to enemy attack.", @"[#FF0000]ネクをドラッグ[#000000]してダッシュさせると\nその間ネクの姿が消え、敵の[#FF0000]攻撃を回避[#000000]できる", @"[#FF0000]Arrastra a Neku[#000000] hasta que acelere. Desaparecerá y se volverá [#FF0000]inmune[#000000] al ataque enemigo.", @"[#FF0000]Trascina Neku[#000000] in uno scatto e svanirà, rendendosi [#FF0000]insensibile[#000000] agli attacchi nemici.", @"[#FF0000]Ziehe Neku[#000000], damit er sprintet und verschwindet. Dadurch kann er gegnerischen Angriffen [#FF0000]ausweichen[#000000].", @"[#FF0000]Faites glisser Neku[#000000] pour le faire sprinter, puis disparaître, ce qui le rendra [#FF0000]invulnérable[#000000] aux attaques ennemies.", @"[#FF0000]拖曳音操[#000000]使其進行衝刺，\n該段期間音操會消失不見，可以[#FF0000]閃避敵人攻擊[#000000]。", @"[#FF0000]拖拽音操[#000000]使其进行冲刺，\n该段期间音操会消失不见，可以[#FF0000]闪避敌人攻击[#000000]。") },
            { 76, new TwewyPin(76,  "badge_077", @"Shout", @"シャウト", @"Grito", @"Urlo", @"Schrei", @"Cri", @"高聲歌唱", @"吼叫", @"[#FF0000]Scratch empty space[#000000] to create a shock wave. Inflicts continuous damage on all enemies as well as [#FF0000]Defense Break[#000000]. (Some enemies may be immune.)", @"[#FF0000]空間をこする[#000000]と衝撃波が発生し\nすべての敵に連続でダメージを与えると\n同時に確実に状態異常[#FF0000]防御力減少[#000000]にする\n(一部の敵のぞく)", @"[#FF0000]Rasca en un espacio vacío[#000000] para generar una onda de choque. Inflige daño continuo en todos los enemigos y provoca la [#FF0000]anulación de defensa[#000000] (algunos enemigos podrían ser inmunes).", @"[#FF0000]Gratta su uno spazio vuoto[#000000] per creare un'onda d'urto. Infligge danno continuo a tutti nemici, così come [#FF0000]Spezza difesa[#000000]. (Alcuni nemici potrebbero esserne immuni).", @"[#FF0000]Kratze im leeren Raum[#000000], um eine Schockwelle zu erzeugen. Verursacht kontinuierlich Schaden und [#FF0000]Verteidigungsbruch[#000000] bei allen Gegnern (Manche Gegner sind möglicherweise immun).", @"[#FF0000]Grattez un espace vide[#000000] pour créer une onde de choc. Inflige des dégâts continus à tous les ennemis, ainsi qu'une [#FF0000]Rupture de défense[#000000]. (Certains ennemis peuvent être immunisés).", @"[#FF0000]摩擦空間[#000000]就會發生衝擊波，\n給予所有敵人連續傷害，\n同時一定會使之陷入異常狀態[#FF0000]防禦力減少[#000000]\n（部分敵人除外）。", @"[#FF0000]摩擦空间[#000000]就会发生冲击波，\n给予所有敌人连续伤害，\n同时一定会使之陷入状态异常\n[#FF0000]防御力减少[#000000]（部分敌人除外）。") },
            { 77, new TwewyPin(77,  "badge_078", @"Psych Support", @"サイコサポート", @"Apoyo Psíquico", @"Supporto psico", @"Psych-Support", @"Assistant psych", @"心靈協助", @"超能助手", @"[#FF0000]Adds extra uses[#000000] to pins with a limited number of uses (those with numbers displayed next to them in battle).", @"そうびしているカウント制バッジ\n(バトル中、バッジの上に数字が表示される物)の\n[#FF0000]カウント数を増やす[#000000]", @"[#FF0000]Añade usos adicionales[#000000] a los pines con un límite máximo (aquellos con un número al lado durante la batalla).", @"[#FF0000]Aggiunge utilizzi extra[#000000] alle spille con un numero limitato di utilizzi (quelle con i numeri visualizzati accanto in battaglia).", @"[#FF0000]Fügt Pins mit begrenzten Anwendungen zusätzliche Anwendungen hinzu[#000000] (Du erkennst diese Pins an der Zahl, die im Kampf neben ihnen erscheint).", @"[#FF0000]Rajoute des utilisations[#000000] aux badges dont le nombre d'utilisations est limité (ceux avec un nombre à côté d'eux en combat).", @"裝備中的計數式徽章\n（戰鬥中會在徽章上方顯示數字）\n的[#FF0000]計數數字增加[#000000]。", @"装备中的计数式徽章\n（战斗中会在徽章上方显示数字）\n的[#FF0000]计数数字增加[#000000]。") },
