            { 112, new TwewyPin(112,  "badge_113", @"Wassup Thunder!", @"カミナリわっしょい", @"¡Qué Pasa, Trueno!", @"Come butta, tuono!", @"Wasgeht-Donner!", @"Tonnerre quoi de 9 !", @"打雷哇咻", @"嘿！落雷", @"Start on empty space and [#FF0000]drag across one or more enemies[#000000] to lock on, then [#FF0000]lift your finger[#000000] to strike targets with lightning bolts. Inflicts damage.", @"[#FF0000]空間をドラッグ[#000000]すると、ドラッグした線上にいた\n敵を[#FF0000]ロックオン[#000000]し落雷でダメージを与えられる\n[#FF0000]複数の敵を同時にロックオン[#000000]することも可能", @"Comenzando por un espacio vacío, [#FF0000]arrastra sobre uno o más enemigos[#000000] para centrarte en ellos. Después [#FF0000]suelta[#000000] para lanzarles rayos. Inflige daño.", @"Parti da uno spazio vuoto e [#FF0000]trascina su uno o più nemici[#000000] per agganciarli, poi [#FF0000]rilascia[#000000] per colpire i nemici con saette. Infligge danno.", @"Beginne auf leerem Raum und [#FF0000]ziehe über einen oder mehrere Gegner[#000000], um sie als Ziel zu erfassen. [#FF0000]Lass dann los[#000000], um die Ziele mit Blitzen anzugreifen. Verursacht Schaden.", @"Partez d'un espace vide et [#FF0000]faites glisser sur un ou plusieurs ennemis[#000000] pour les cibler, puis [#FF0000]relâchez[#000000] pour frapper les cibles avec des éclairs. Inflige des dégâts.", @"[#FF0000]拖曳空間[#000000]會[#FF0000]鎖定[#000000]拖曳路線上的敵人降下落雷，\n使其受到傷害。\n可以[#FF0000]同時鎖定複數敵人[#000000]。", @"[#FF0000]拖拽空间[#000000]会[#FF0000]锁定[#000000]拖拽路线上的敌人降下落雷，\n使其受到伤害。\n可以[#FF0000]同时锁定多名敌人[#000000]。") },
