            { 114, new TwewyPin(114,  "badge_115", @"Wassup Voltage!", @"デンゲキわっしょい！！", @"¡Qué Pasa, Electricidad!", @"Come butta, tensione!", @"Wasgeht-Strom!", @"Décharge quoi de 9 !", @"電擊哇咻！", @"嘿！雷电！！", @"Start on empty space and [#FF0000]drag across one or more enemies[#000000] to lock on, then [#FF0000]lift your finger[#000000] to strike targets with lightning bolts. Inflicts damage.", @"[#FF0000]空間をドラッグ[#000000]すると、ドラッグした線上にいた\n敵を[#FF0000]ロックオン[#000000]し落雷でダメージを与えられる\n[#FF0000]複数の敵を同時にロックオン[#000000]することも可能", @"Comenzando por un espacio vacío, [#FF0000]arrastra sobre uno o más enemigos[#000000] para centrarte en ellos. Después [#FF0000]suelta[#000000] para lanzarles rayos. Inflige daño.", @"Parti da uno spazio vuoto e [#FF0000]trascina su uno o più nemici[#000000] per agganciarli, poi [#FF0000]rilascia[#000000] per colpire i nemici con saette. Infligge danno.", @"Beginne auf leerem Raum und [#FF0000]ziehe über einen oder mehrere Gegner[#000000], um sie als Ziel zu erfassen. [#FF0000]Lass dann los[#000000], um die Ziele mit Blitzen anzugreifen. Verursacht Schaden.", @"Partez d'un espace vite et [#FF0000]faites glisser sur un ou plusieurs ennemis[#000000] pour les cibler, puis [#FF0000]relâchez[#000000] pour frapper les cibles avec des éclairs. Inflige des dégâts.", @"[#FF0000]拖曳空間[#000000]會[#FF0000]鎖定[#000000]拖曳路線上的敵人降下落雷，\n使其受到傷害。\n可以[#FF0000]同時鎖定複數敵人[#000000]。", @"[#FF0000]拖拽空间[#000000]会[#FF0000]锁定[#000000]拖拽路线上的敌人降下落雷，\n使其受到伤害。\n可以[#FF0000]同时锁定多名敌人[#000000]。") },
            { 115, new TwewyPin(115,  "badge_116", @"Indestructo Man", @"不滅の男", @"Indestructible", @"Indistructo", @"Indestructo Man", @"Indestructo Man", @"不滅之男", @"不灭之男", @"Greatly extends the duration of [#FF0000]HP Drain's[#000000] negative effects on enemies.", @"状態異常[#FF0000]ＨＰ減少[#000000]の効果時間を大幅に延長する", @"Amplía considerablemente la duración de los efectos negativos de la [#FF0000]reducción de PV[#000000] en los enemigos.", @"Allunga notevolmente la durata degli effetti negativi di [#FF0000]Risucchio di PF[#000000] sui nemici.", @"Verlängert deutlich die Dauer der negativen Effekte von [#FF0000]LP-Entzug[#000000] auf Gegner.", @"Augmente considérablement la durée des effets négatifs du [#FF0000]Drain de PV[#000000] sur vos ennemis.", @"大幅延長異常狀態[#FF0000]ＨＰ減少[#000000]的效果時間。", @"大幅延长状态异常[#FF0000]HP减少[#000000]的效果时间。") },
            { 116, new TwewyPin(116,  "badge_117", @"Hip Snake", @"ヒップ・スネイク", @"Hip Snake", @"Hip Snake", @"Hip Snake", @"Hip Snake", @"Hip Snake", @"Hip Snake", @"Increases the [#FF0000]Attack[#000000] of any [#00CC00]Hip Snake[#000000] pins Neku is wearing.", @"そうびしている[#00CC00]ヒップ・スネイク[#000000]バッジの\n[#FF0000]攻撃力をアップ[#000000]する", @"Aumenta el [#FF0000]ataque[#000000] de los pines [#00CC00]Hip Snake[#000000] que lleva Neku.", @"Aumenta l'[#FF0000]Attacco[#000000] di qualunque spilla [#00CC00]Hip Snake[#000000] indossata da Neku.", @"Erhöht den [#FF0000]Angriff[#000000] jedes Pins von [#00CC00]Hip Snake[#000000], den Neku trägt.", @"Augmente l'[#FF0000]Attaque[#000000] de tous les badges [#00CC00]Hip Snake[#000000] que porte Neku.", @"裝備中[#00CC00]Hip Snake[#000000]徽章的\n[#FF0000]攻擊力提升[#000000]。", @"装备时，所有[#00CC00]Hip Snake[#000000]徽章的[#FF0000]攻击力提升[#000000]。") },
            { 117, new TwewyPin(117,  "badge_118", @"Octo Squeeze", @"ぎゅんぎゅんオクトパス", @"Tentáculos Atrayentes", @"Stretta del polipo", @"Okto-Zugkraft", @"Vortex poulpe", @"擠壓章魚", @"挤压章鱼", @"[#FF0000]Press empty space[#000000] to form a black hole that [#FF0000]draws enemies toward it[#000000]. (Some enemies may not be affected.)", @"[#FF0000]空間をホールド[#000000]することで、その位置に\n[#FF0000]敵を引き寄せる[#000000]ブラックホールを作り出す\n(一部の敵は引き寄せられない)", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para formar un agujero negro que [#FF0000]arrastrará a los enemigos hacia él[#000000] (algunos podrían no verse afectados).", @"[#FF0000]Premi su uno spazio vuoto[#000000] per formare un buco nero che [#FF0000]attira i nemici verso di sé[#000000]. (Potrebbe non avere effetto su alcuni nemici).", @"[#FF0000]Drücke im leeren Raum[#000000], um ein schwarzes Loch zu erschaffen, das [#FF0000]Gegner in seine Richtung zieht[#000000] (Manche Gegner sind möglicherweise immun).", @"[#FF0000]Appuyez sur un espace vide[#000000] pour créer un trou noir qui [#FF0000]attirera les ennemis vers lui[#000000]. (Certains ennemis ne seront peut-être pas affectés).", @"[#FF0000]長按空間[#000000]就會在該位置製造出\n[#FF0000]吸引敵人[#000000]的黑洞\n（無法吸引部分敵人）。", @"[#FF0000]长按空间[#000000]就会在该位置制造出\n[#FF0000]吸引敌人[#000000]的黑洞\n（部分敌人无法吸引）。") },
