            { 120, new TwewyPin(120,  "badge_121", @"Gimme Dat Sheep", @"いただきシープ", @"Esa Oveja Pa Mí", @"Dammi quella pecora", @"Her mit dem Schaf!", @"Passe le mouton", @"開動綿羊", @"我要绵羊", @"[#FF0000]Draw a circle in empty space[#000000] to form a black hole that [#FF0000]sucks enemies in[#000000]. No EXP received. (Some enemies may not be affected.)", @"[#FF0000]空間に円を描く[#000000]ことで、その位置に\n[#FF0000]敵を吸い込む[#000000]ブラックホールを作り出す\nただしＥＸＰはゲットできない(一部の敵には無効)", @"[#FF0000]Traza un círculo en un espacio vacío[#000000] para formar un agujero negro que [#FF0000]succionará a los enemigos[#000000] (algunos podrían no verse afectados). No recibes EXP.", @"[#FF0000]Traccia un cerchio in uno spazio vuoto[#000000] per formare un buco nero che [#FF0000]risucchia i nemici al proprio interno[#000000]. Non si riceve ESP. (Potrebbe non avere effetto su alcuni nemici).", @"[#FF0000]Ziehe einen Kreis im leeren Raum[#000000], um ein schwarzes Loch zu erschaffen, das [#FF0000]Gegner einsaugt[#000000]. Für diese Gegner erhältst du keine EP (Manche Gegner sind möglicherweise immun).", @"[#FF0000]Tracez un cercle dans un espace vide[#000000] pour créer un trou noir qui [#FF0000]aspirera les ennemis[#000000]. Ne génère aucun point d'XP. (Certains ennemis ne seront peut-être pas affectés).", @"[#FF0000]在空間畫圓[#000000]就會在該位置製造出\n[#FF0000]吸進敵人[#000000]的黑洞。\n但無法獲得ＥＸＰ（對部分敵人無效）。", @"[#FF0000]在空间画圆[#000000]就会在该位置制造出\n[#FF0000]吸进敌人[#000000]的黑洞。\n但无法获得EXP（对部分敌人无效）。") },
