            { 145, new TwewyPin(145,  "badge_146", @"LIVE!", @"Ｌ・Ｉ・Ｖ・Ｅ", @"¡VIVE!", @"LIVE!", @"LIVE!", @"EN DIRECT !", @"L.I.V.E", @"L.I.V.E", @"[#FF0000]Scratch empty space[#000000] to create a shock wave. Inflicts continuous damage on all enemies and always [#FF0000]Immobilizes[#000000] them. (Some enemies may be immune.)", @"[#FF0000]空間をこする[#000000]と衝撃波が発生し\nすべての敵に連続でダメージを与えると\n同時に確実に状態異常[#FF0000]行動不能[#000000]にする\n(一部の敵をのぞく)", @"[#FF0000]Rasca en un espacio vacío[#000000] para generar una onda de choque. Inflige daño continuo en todos los enemigos y siempre los [#FF0000]inmoviliza[#000000] (algunos podrían ser inmunes).", @"[#FF0000]Gratta su uno spazio vuoto[#000000] per creare un'onda d'urto. Infligge danno continuo a tutti nemici, e li [#FF0000]immobilizza[#000000] sempre. (Alcuni nemici potrebbero esserne immuni).", @"[#FF0000]Kratze im leeren Raum[#000000], um eine Schockwelle zu erzeugen. Verursacht kontinuierlich Schaden und [#FF0000]Unbeweglichkeit[#000000] bei allen Gegnern (Manche Gegner sind möglicherweise immun).", @"[#FF0000]Grattez un espace vide[#000000] pour créer une onde de choc. Inflige des dégâts continus à tous les ennemis et les [#FF0000]immobilise[#000000] systématiquement. (Certains ennemis peuvent être immunisés).", @"[#FF0000]摩擦空間[#000000]就會發生衝擊波，\n給予所有敵人連續傷害，\n同時一定會使之陷入異常狀態[#FF0000]無法行動[#000000]\n（部分敵人除外）。", @"[#FF0000]摩擦空间[#000000]就会发生冲击波，\n给予所有敌人连续伤害，\n同时一定会使之陷入状态异常\n[#FF0000]无法行动[#000000]（部分敌人除外）。") },
            { 146, new TwewyPin(146,  "badge_147", @"Peace Full", @"ピースフル", @"Paz Interior", @"Pacifico", @"Fried-voll", @"OKLM", @"和平滿滿", @"天下太平", @"[#FF0000]Tap the pin[#000000] to [#FF0000]restore HP[#000000].", @"[#FF0000]バッジをタップ[#000000]すると[#FF0000]ＨＰが回復[#000000]する", @"[#FF0000]Toca el pin[#000000] para [#FF0000]restablecer PV[#000000].", @"[#FF0000]Tocca la spilla[#000000] per [#FF0000]ripristinare i PF[#000000].", @"[#FF0000]Tippe auf den Pin[#000000], um [#FF0000]LP wiederherzustellen[#000000].", @"[#FF0000]Touchez le badge[#000000] pour [#FF0000]restaurer des PV[#000000].", @"[#FF0000]點擊徽章[#000000]便會[#FF0000]恢復ＨＰ[#000000]。", @"[#FF0000]点击徽章[#000000]便会[#FF0000]恢复HP[#000000]。") },
            { 147, new TwewyPin(147,  "badge_148", @"Thanx", @"サンクス", @"Gracias", @"Grazie", @"Danke", @"Cimer", @"謝謝", @"无限感激", @"[#FF0000]Tap the pin[#000000] to [#FF0000]restore a small amount of HP[#000000] and cure [#FF0000]HP Drain[#000000].", @"[#FF0000]バッジをタップ[#000000]すると\n[#FF0000]ＨＰが少し回復[#000000]すると同時に\n状態異常[#FF0000]ＨＰ減少[#000000]が解除される", @"[#FF0000]Toca el pin[#000000] para [#FF0000]restablecer una pequeña cantidad de PV[#000000] y curar la [#FF0000]reducción de PV[#000000].", @"[#FF0000]Tocca la spilla[#000000] per [#FF0000]ripristinare una piccola quantità di PF[#000000] e guarire dal [#FF0000]Risucchio di PF[#000000].", @"[#FF0000]Tippe auf den Pin[#000000], um [#FF0000]eine kleine Menge LP wiederherzustellen[#000000] und [#FF0000]LP-Entzug[#000000] zu heilen.", @"[#FF0000]Touchez le badge[#000000] pour [#FF0000]restaurer une petite quantité de PV[#000000] et interrompre le [#FF0000]Drain de PV[#000000].", @"[#FF0000]點擊徽章[#000000]便會\n[#FF0000]恢復少量ＨＰ[#000000]，同時解除\n異常狀態[#FF0000]ＨＰ減少[#000000]。", @"[#FF0000]点击徽章[#000000]便会\n[#FF0000]恢复少量HP[#000000]，同时解除\n状态异常[#FF0000]HP减少[#000000]。") },
            { 148, new TwewyPin(148,  "badge_149", @"D.I.Y.", @"Ｄ．Ｉ．Ｙ", @"Bricolaje", @"Fatto a mano", @"Heimwerker", @"D.I.Y.", @"D.I.Y", @"D.I.Y", @"Greatly extends the duration of [#FF0000]Attack Break's[#000000] negative effects on enemies.", @"状態異常[#FF0000]攻撃力減少[#000000]の効果時間を大幅に延長する", @"Amplía considerablemente la duración de los efectos negativos de la [#FF0000]anulación de ataque[#000000] en los enemigos.", @"Allunga notevolmente la durata degli effetti negativi di [#FF0000]Spezza attacco[#000000] sui nemici.", @"Verlängert deutlich die Dauer der negativen Effekte von [#FF0000]Angriffsbruch[#000000] auf Gegner.", @"Augmente considérablement la durée des effets négatifs de la [#FF0000]Rupture d'attaque[#000000] sur vos ennemis.", @"大幅延長異常狀態[#FF0000]攻擊力減少[#000000]的效果時間。", @"大幅延长状态异常[#FF0000]攻击力减少[#000000]的效果时间。") },
            { 149, new TwewyPin(149,  "badge_150", @"Tigre Punks", @"ティガー・パンクス", @"Tigre Punks", @"Tigre Punks", @"Tigre Punks", @"Tigre Punks", @"Tigre Punks", @"Tigre Punks", @"Increases the [#FF0000]Attack[#000000] of any [#00CC00]Tigre Punks[#000000] pins Neku is wearing.", @"そうびしている[#00CC00]ティガー・パンクス[#000000]バッジの\n[#FF0000]攻撃力をアップ[#000000]する", @"Aumenta el [#FF0000]ataque[#000000] de los pines [#00CC00]Tigre Punks[#000000] que lleva Neku.", @"Aumenta l'[#FF0000]Attacco[#000000] di qualunque spilla [#00CC00]Tigre Punks[#000000] indossata da Neku.", @"Erhöht den [#FF0000]Angriff[#000000] jedes Pins von [#00CC00]Tigre Punks[#000000], den Neku trägt.", @"Augmente l'[#FF0000]Attaque[#000000] de tous les badges [#00CC00]Tigre Punks[#000000] que porte Neku.", @"裝備中[#00CC00]Tigre Punks[#000000]徽章的\n[#FF0000]攻擊力提升[#000000]。", @"装备时，所有[#00CC00]Tigre Punks[#000000]徽章的[#FF0000]攻击力提升[#000000]。") },
            { 150, new TwewyPin(150,  "badge_151", @"One Stone, Many Birds", @"一網打尽", @"Un Tiro, Muchos Pájaros", @"Una fava, tanti uccelli", @"Ein Streich, viele Fliegen", @"Une pierre, plein de coups", @"一網打盡", @"一网打尽", @"[#FF0000]Press empty space[#000000] to launch a bullet in that direction which [#FF0000]fragments on enemy collision[#000000]. The fragments also inflict damage on contact.", @"[#FF0000]空間をホールド[#000000]することで\nその方向に[#FF0000]敵に当たると分裂する弾[#000000]を発射する\n分裂した弾も当たった敵にダメージを与える", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para disparar una bala en esa dirección que se [#FF0000]fragmenta al alcanzar al enemigo[#000000]. Los fragmentos también infligen daño al impactar.", @"[#FF0000]Premi su uno spazio vuoto[#000000] per lanciare un proiettile in quella direzione che [#FF0000]si frammenterà alla collisione col nemico[#000000]. I frammenti infliggono anche danno a contatto.", @"[#FF0000]Drücke im leeren Raum[#000000], um ein Geschoss in diese Richtung abzufeuern, [#FF0000]das bei Berührung mit einem Gegner zersplittert[#000000]. Die Splitter verursachen bei Berührung ebenfalls Schaden.", @"[#FF0000]Appuyez sur un espace vide[#000000] pour tirer une balle dans cette direction qui [#FF0000]explosera au moment de la collision avec l'ennemi[#000000]. Les éclats infligent également des dégâts au contact.", @"[#FF0000]長按空間[#000000]就會朝該方向\n發射[#FF0000]命中敵人後分裂的子彈[#000000]，\n分裂後的子彈也會給予命中的敵人傷害。", @"[#FF0000]长按空间[#000000]就会朝该方向\n发射[#FF0000]命中敌人后分裂的子弹[#000000]，\n分裂后的子弹也会给予命中的敌人伤害。") },
            { 151, new TwewyPin(151,  "badge_152", @"One Stroke, Vast Wealth", @"一獲千金", @"Un Golpe, Mucha Riqueza", @"Un colpo, ampio benessere", @"Ein Schlag, große Beute", @"Un coup, grande richesse", @"一舉致富", @"一获千金", @"[#FF0000]Press empty space[#000000] to launch a bullet in that direction which [#FF0000]fragments on enemy collision[#000000]. The fragments also inflict damage on contact.", @"[#FF0000]空間をホールド[#000000]することで\nその方向に[#FF0000]敵に当たると分裂する弾[#000000]を発射する\n分裂した弾も当たった敵にダメージを与える", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para disparar una bala en esa dirección que se [#FF0000]fragmenta al alcanzar al enemigo[#000000]. Los fragmentos también infligen daño al impactar.", @"[#FF0000]Premi su uno spazio vuoto[#000000] per lanciare un proiettile in quella direzione che [#FF0000]si frammenterà alla collisione col nemico[#000000]. I frammenti infliggono anche danno a contatto.", @"[#FF0000]Drücke im leeren Raum[#000000], um ein Geschoss in diese Richtung abzufeuern, [#FF0000]das bei Berührung mit einem Gegner zersplittert[#000000]. Die Splitter verursachen bei Berührung ebenfalls Schaden.", @"[#FF0000]Appuyez sur un espace vide[#000000] pour tirer une balle dans cette direction qui [#FF0000]explosera au moment de la collision avec l'ennemi[#000000]. Les éclats infligent également des dégâts au contact.", @"[#FF0000]按住空間[#000000]就會朝該方向\n發射[#FF0000]遇敵分裂的砲彈[#000000]，\n分裂後砲彈給予命中的敵人傷害。", @"[#FF0000]长按空间[#000000]就会朝该方向\n发射[#FF0000]命中敌人后分裂的子弹[#000000]，\n分裂后的子弹也会给予命中的敌人伤害。") },
            { 152, new TwewyPin(152,  "badge_153", @"One Grain, Infinite Promise", @"一粒万倍", @"Un Grano, Promesa Infinita", @"Un granello, promessa infinita", @"Ein Korn, viele Versprechen", @"Un grain, promesse infinie", @"一粒萬倍", @"一粒万倍", @"[#FF0000]Press empty space[#000000] to launch a bullet in that direction which [#FF0000]fragments on enemy collision[#000000]. The fragments also inflict damage on contact.", @"[#FF0000]空間をホールド[#000000]することで\nその方向に[#FF0000]敵に当たると分裂する弾[#000000]を発射する\n分裂した弾も当たった敵にダメージを与える", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para disparar una bala en esa dirección que se [#FF0000]fragmenta al alcanzar al enemigo[#000000]. Los fragmentos también infligen daño al impactar.", @"[#FF0000]Premi su uno spazio vuoto[#000000] per lanciare un proiettile in quella direzione che [#FF0000]si frammenterà alla collisione col nemico[#000000]. I frammenti infliggono anche danno a contatto.", @"[#FF0000]Drücke im leeren Raum[#000000], um ein Geschoss in diese Richtung abzufeuern, [#FF0000]das bei Berührung mit einem Gegner zersplittert[#000000]. Die Splitter verursachen bei Berührung ebenfalls Schaden.", @"[#FF0000]Appuyez sur un espace vide[#000000] pour tirer une balle dans cette direction qui [#FF0000]explosera au moment de la collision avec l'ennemi[#000000]. Les éclats infligent également des dégâts au contact.", @"[#FF0000]長按空間[#000000]就會朝該方向\n發射[#FF0000]命中敵人後分裂的子彈[#000000]，\n分裂後的子彈也會給予命中的敵人傷害。", @"[#FF0000]长按空间[#000000]就会朝该方向\n发射[#FF0000]命中敌人后分裂的子弹[#000000]，\n分裂后的子弹也会给予命中的敌人伤害。") },
            { 153, new TwewyPin(153,  "badge_154", @"Self Found, Others Lost", @"無我夢中", @"Encuentro Pers., Otros Perd.", @"Trovarsi, perdere gli altri", @"Ich finden, andere verlieren", @"Soi retrouvé, autres perdus", @"心無旁鶩", @"无我梦中", @"[#FF0000]Rapidly tap empty space[#000000] to spray a wide radius with electric charges. Inflicts damage on contact. Keep tapping for [#FF0000]more charges[#000000].", @"[#FF0000]空間をタップで連打[#000000]することで広い範囲に\n雷球を飛ばし、当たった敵にダメージを与える\n連打すればするほど[#FF0000]雷球の量は多くなる[#000000]", @"[#FF0000]Toca repetidamente un espacio vacío[#000000] para rociar con cargas eléctricas un radio extenso. Inflige daño al impactar. Sigue tocando para provocar [#FF0000]más cargas[#000000].", @"[#FF0000]Tocca rapidamente uno spazio vuoto[#000000] per spruzzare cariche elettriche ad ampio raggio. Infligge danno a contatto. Continua a toccare per spruzzare [#FF0000]più cariche[#000000].", @"[#FF0000]Tippe schnell im leeren Raum[#000000], um einen großen Radius mit elektrischen Ladungen zu überziehen. Verursacht bei Berührung Schaden. Tippe weiter, um [#FF0000]zusätzliche Ladungen zu erzeugen[#000000].", @"[#FF0000]Touchez de manière répétitive un espace vide[#000000] pour lancer des charges électriques dans un grand rayon. Inflige des dégâts au contact. Continuez pour lancer [#FF0000]plus de charges[#000000].", @"[#FF0000]連點空間[#000000]就會朝廣範圍\n射出雷球，給予命中敵人傷害。\n連點次數越多，[#FF0000]雷球量也會越多[#000000]。", @"[#FF0000]连点空间[#000000]就会朝广范围\n射出雷球，给予被击中的敌人伤害。\n连点次数越多，[#FF0000]雷球量也会越多[#000000]。") },
            { 154, new TwewyPin(154,  "badge_155", @"Fiery Spirit, Spirited Fire", @"気炎万丈", @"Espíritu Fogoso, Fuego Alma", @"Spirito fiero, fuoco spiritato", @"Feuriger Geist, Geistfeuer", @"Esprit fougueux, feu spirituel", @"燎原之勢", @"气炎万里", @"[#FF0000]Drag across empty space[#000000] to create a path of flame. Inflicts damage on contact.", @"[#FF0000]空間をドラッグ[#000000]することでドラッグした線上に\n炎を走らせ、当たった敵にダメージを与える", @"[#FF0000]Arrastra por un espacio vacío[#000000] para crear una senda de llamas. Inflige daño al impactar.", @"[#FF0000]Trascina su uno spazio vuoto[#000000] per creare un percorso di fiamme. Infligge danno a contatto.", @"[#FF0000]Ziehe im leeren Raum[#000000], damit Flammen aus dem Boden züngeln. Verursacht bei Berührung Schaden.", @"[#FF0000]Balayez un espace vide[#000000] pour créer un chemin de flammes. Inflige des dégâts au contact.", @"[#FF0000]拖曳空間[#000000]會使拖曳過的路線起火，\n給予命中敵人傷害。", @"[#FF0000]拖拽空间[#000000]会使拖曳过的路线\n起火，给予被击中的敌人伤害。") },
            { 155, new TwewyPin(155,  "badge_156", @"Flames Afar, Foes Aflame", @"隔岸観火", @"Enemigo lejano en llamas", @"Fiamme, nemici in cenere", @"Fernes Feuer, Feind in brand", @"Feu lointain, ennemis en feu", @"隔岸觀火", @"隔岸观火", @"[#FF0000]Drag across empty space[#000000] to create a path of tall flames. Inflicts damage on contact.", @"[#FF0000]空間をドラッグ[#000000]することでドラッグした線上に\n大きな炎を走らせ、当たった敵にダメージを与える", @"[#FF0000]Arrastra por un espacio vacío[#000000] para crear una senda de llamas altas. Inflige daño al impactar.", @"[#FF0000]Trascina su uno spazio vuoto[#000000] per creare un percorso di fiamme alte. Infligge danno a contatto.", @"[#FF0000]Ziehe im leeren Raum[#000000], damit hohe Flammen aus dem Boden züngeln. Verursacht bei Berührung Schaden.", @"[#FF0000]Balayez un espace vide[#000000] pour créer un chemin de hautes flammes. Inflige des dégâts au contact.", @"[#FF0000]拖曳空間[#000000]會使拖曳過的路線猛烈起火，\n給予命中敵人傷害。", @"[#FF0000]拖拽空间[#000000]会使拖曳过的路线\n猛烈起火，给予被击中的敌人伤害。") },
            { 156, new TwewyPin(156,  "badge_157", @"Final Pyre, All Expired", @"完全燃焼", @"Pira Final, Consumo Total", @"Pira finale, il fuoco fa male", @"Scheiterhaufen, Feuertod", @"Bûcher final, derniers soupirs", @"完全燃燒", @"完全燃烧", @"[#FF0000]Drag across empty space[#000000] to create a path of tall flames that [#FF0000]scatter[#000000] from their course. Inflicts damage on contact.", @"[#FF0000]空間をドラッグ[#000000]することで\nドラッグした線上に大きな炎を走らせる\n出現後、炎は[#FF0000]バラバラの方向に移動[#000000]する", @"[#FF0000]Arrastra por un espacio vacío[#000000] para crear una senda de llamas altas que se [#FF0000]propagan[#000000] más allá de su trayectoria. Inflige daño al impactar.", @"[#FF0000]Trascina su uno spazio vuoto[#000000] per creare un percorso di fiamme che [#FF0000]si diramano[#000000] dalla propria traiettoria. Infligge danno a contatto.", @"[#FF0000]Ziehe im leeren Raum[#000000], damit hohe Flammen aus dem Boden züngeln, die sich [#FF0000]verteilen[#000000]. Verursacht bei Berührung Schaden.", @"[#FF0000]Balayez un espace vide[#000000] pour créer un chemin de hautes flammes qui [#FF0000]se disperseront[#000000]. Inflige des dégâts au contact.", @"[#FF0000]拖曳空間[#000000]會使拖曳過的路線猛烈起火。\n起火後，火焰會往[#FF0000]不同方向移動[#000000]。", @"[#FF0000]拖拽空间[#000000]会使拖拽过的路线猛烈起火。\n起火后，火焰会往\n[#FF0000]不同方向移动[#000000]。") },
            { 157, new TwewyPin(157,  "badge_158", @"Blue Blood Burns Blue", @"炉火純青", @"Sangre Azul, Fuego Azul", @"Sangue blu, fuoco blu", @"Blaues Blut, blaues Brennen", @"Sang bleu, fumée bleue", @"爐火純青", @"炉火纯青", @"[#FF0000]Press empty space[#000000] to create a pillar of fire. Inflicts damage and sometimes [#FF0000]HP Drain[#000000] on contact.", @"[#FF0000]空間をホールド[#000000]することで、その位置に炎の柱を\n発生させ、当たった敵にダメージを与えると\n同時に一定の確率で状態異常[#FF0000]ＨＰ減少[#000000]にする", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para crear una columna de fuego. Inflige daño y a veces provoca la [#FF0000]reducción de PV[#000000] al impactar.", @"[#FF0000]Premi su uno spazio vuoto[#000000] per creare una colonna di fuoco. Infligge danno e a volte [#FF0000]Risucchio di PF[#000000] a contatto.", @"[#FF0000]Drücke im leeren Raum[#000000], um eine Flammensäule zu erschaffen. Verursacht bei Berührung Schaden und manchmal [#FF0000]LP-Entzug[#000000].", @"[#FF0000]Appuyez sur un espace vide[#000000] pour créer une colonne de feu. Inflige des dégâts et parfois un [#FF0000]Drain de PV[#000000] au contact.", @"[#FF0000]長按空間[#000000]該位置就會出現火柱，\n給予命中的敵人傷害，\n並以一定機率施加異常狀態[#FF0000]ＨＰ減少[#000000]。", @"[#FF0000]长按空间[#000000]该位置就会出现火柱，\n给予命中的敌人伤害，\n并以一定几率使其陷入状态异常[#FF0000]HP减少[#000000]。") },
            { 158, new TwewyPin(158,  "badge_159", @"Live Slow, Die Fast", @"油断大敵", @"Vive Lento, Muere Rápido", @"Nemico irrispettoso", @"Lebe langsam, stirb schnell", @"Vis lentement, meurs vite", @"戒慎恐懼", @"疏忽大意", @"[#FF0000]Tap one or more obstacles[#000000] like cars and signs, then [#FF0000]tap empty space[#000000] to hurl them. Inflicts damage on contact.", @"車や看板等の[#FF0000]障害物をタップ(複数可)[#000000]した後\n[#FF0000]空間をタップ[#000000]することでその障害物を飛ばし\n当たった敵にダメージを与える", @"[#FF0000]Toca uno o más obstáculos[#000000], como coches y señales, y después [#FF0000]toca un espacio vacío[#000000] para lanzarlos. Inflige daño al impactar.", @"[#FF0000]Tocca uno o più ostacoli[#000000] come auto e insegne, poi [#FF0000]tocca uno spazio vuoto[#000000] per scagliarle. Infligge danno a contatto.", @"[#FF0000]Tippe auf ein oder mehr Hindernisse[#000000] wie Autos und Schilder und [#FF0000]tippe dann auf leeren Raum[#000000], um sie zu schleudern. Verursacht bei Berührung Schaden.", @"[#FF0000]Touchez un ou plusieurs obstacles[#000000] comme des voitures et des panneaux, puis [#FF0000]touchez un espace vide[#000000] pour les y lancer. Inflige des dégâts au contact.", @"[#FF0000]點擊障礙物（可複數）[#000000]如車子或招牌之後，\n再次[#FF0000]點擊空間[#000000]就會將障礙物射出，\n給予命中的敵人傷害。", @"[#FF0000]点击障碍物（可多个）[#000000]如车子或招牌之后，\n再次[#FF0000]点击空间[#000000]就会将障碍物射出，\n给予命中的敌人伤害。") },
