            { 166, new TwewyPin(166,  "badge_167", @"Skull Rabbit", @"スカルラビット", @"Conejo Calavérico", @"Coniglio teschio", @"Totenkopfhase", @"Lapin tête-de-mort", @"骷髏兔兔", @"骷髅兔", @"[#FF0000]Tap empty space[#000000] to fire a [#FF0000]bullet[#000000] in that direction. Inflicts damage and sometimes [#FF0000]Defense Break[#000000] on contact.", @"[#FF0000]空間をタップ[#000000]することでその方向に[#FF0000]弾[#000000]を発射し\n当たった敵にダメージを与えると同時に\n一定確率で状態異常[#FF0000]防御力減少[#000000]にする", @"[#FF0000]Toca un espacio vacío[#000000] para disparar una [#FF0000]bala[#000000] en esa dirección. Inflige daño y a veces provoca la [#FF0000]anulación de defensa[#000000] al impactar.", @"[#FF0000]Tocca uno spazio vuoto[#000000] per sparare un [#FF0000]proiettile[#000000] in quella direzione. Infligge danno e a volte [#FF0000]Spezza difesa[#000000] a contatto.", @"[#FF0000]Tippe im leeren Raum[#000000], um ein [#FF0000]Geschoss[#000000] in diese Richtung abzufeuern. Verursacht bei Berührung Schaden und manchmal [#FF0000]Verteidigungsbruch[#000000].", @"[#FF0000]Touchez un espace vide[#000000] pour tirer une [#FF0000]balle[#000000] dans cette direction. Inflige des dégâts et parfois une [#FF0000]Rupture de défense[#000000] au contact.", @"[#FF0000]點擊空間[#000000]就會朝該方向發射[#FF0000]子彈[#000000]，\n給予命中的敵人傷害，\n並以一定機率施加異常狀態[#FF0000]防禦力減少[#000000]。", @"[#FF0000]点击空间[#000000]就会朝该方向发射[#FF0000]子弹[#000000]，\n给予命中的敌人伤害，\n并以一定几率使其陷入状态异常[#FF0000]防御力减少[#000000]。") },
            { 167, new TwewyPin(167,  "badge_168", @"Kaleidoscope", @"カレイドスコープ", @"Caleidoscopio", @"Caleidoscopio", @"Kaleidoskop", @"Kaléidoscope", @"萬花筒", @"万花筒", @"[#FF0000]Press empty space[#000000] to launch a bullet in that direction which [#FF0000]fragments on enemy collision[#000000]. The fragments also inflict damage on contact.", @"[#FF0000]空間をホールド[#000000]することで\nその方向に[#FF0000]敵に当たると分裂する弾[#000000]を発射する\n分裂した弾も当たった敵にダメージを与える", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para disparar una bala en esa dirección que se [#FF0000]fragmenta al alcanzar al enemigo[#000000]. Los fragmentos también infligen daño al impactar.", @"[#FF0000]Premi su uno spazio vuoto[#000000] per lanciare un proiettile in quella direzione che [#FF0000]si frammenterà alla collisione col nemico[#000000]. I frammenti infliggono anche danno a contatto.", @"[#FF0000]Drücke im leeren Raum[#000000], um ein Geschoss in diese Richtung abzufeuern, [#FF0000]das bei Berührung mit einem Gegner zersplittert[#000000]. Die Splitter verursachen bei Berührung ebenfalls Schaden.", @"[#FF0000]Appuyez sur un espace vide[#000000] pour tirer une balle dans cette direction qui [#FF0000]explosera au moment de la collision avec l'ennemi[#000000]. Les éclats infligent également des dégâts au contact.", @"[#FF0000]長按空間[#000000]就會朝該方向\n發射[#FF0000]命中敵人後分裂的子彈[#000000]，\n分裂後的子彈也會給予命中的敵人傷害。", @"[#FF0000]长按空间[#000000]就会朝该方向\n发射[#FF0000]命中敌人后分裂的子弹[#000000]，\n分裂后的子弹也会给予命中的敌人伤害。") },
