            { 186, new TwewyPin(186,  "badge_187", @"Thunder Rook", @"サンダー・ルーク", @"Torre Tormentosa", @"Torre del tuono", @"Donnerturm", @"Tour du tonnerre", @"雷霆城堡", @"雷霆之车", @"[#FF0000]Tap empty space[#000000] and Neku will fire lightning in that direction. Inflicts damage on contact.", @"[#FF0000]空間をタップ[#000000]するとネクからその方向へ\n雷が発射され、当たった敵にダメージを与える", @"[#FF0000]Toca un espacio vacío[#000000] para que Neku lance rayos en esa dirección. Inflige daño al impactar.", @"[#FF0000]Tocca uno spazio vuoto[#000000] e Neku sparerà delle saette in quella direzione. Infligge danno a contatto.", @"[#FF0000]Tippe im leeren Raum[#000000], damit Neku einen Blitz in diese Richtung abfeuert. Verursacht bei Berührung Schaden.", @"[#FF0000]Touchez un espace vide[#000000] et Neku lancera de la foudre dans cette direction. Inflige des dégâts au contact.", @"[#FF0000]點擊空間[#000000]，音操就會朝該方向發射雷電，\n給予命中的敵人傷害。", @"[#FF0000]点击空间[#000000]，音操就会朝该方向发射雷电，\n给予命中的敌人伤害。") },
