            { 204, new TwewyPin(204,  "badge_205", @"Diss", @"ディス", @"Humillación", @"Insulto", @"Disser", @"Clash", @"羞辱", @"破甲", @"Greatly extends the duration of [#FF0000]Defense Break's[#000000] negative effects on enemies.", @"状態異常[#FF0000]防御力減少[#000000]の効果時間を大幅に延長する", @"Amplía considerablemente la duración de los efectos negativos de la [#FF0000]anulación de defensa[#000000] en los enemigos.", @"Allunga notevolmente la durata degli effetti negativi di [#FF0000]Spezza difesa[#000000] sui nemici.", @"Verlängert deutlich die Dauer der negativen Effekte von [#FF0000]Verteidigungsbruch[#000000] auf Gegner.", @"Augmente considérablement la durée des effets négatifs de la [#FF0000]Rupture de défense[#000000] sur vos ennemis.", @"大幅延長異常狀態[#FF0000]防禦力減少[#000000]的效果時間。", @"大幅延长状态异常[#FF0000]防御力减少[#000000]的效果时间。") },
