            { 206, new TwewyPin(206,  "badge_207", @"Big Bang", @"ビッグバン", @"Big Bang", @"Big Bang", @"Urknall", @"Big Bang", @"大霹靂", @"合璧大爆炸", @"By itself, this pin exhibits no power. It reads: \x22The joys of a [#FF0000]universe made and unmade[#000000], friends across time, shall be your ray of light.\x22", @"このバッジだけをそうびしても発動できない\n「宇宙の誕生と終焉、[#FF0000]無二の親友とその喜びを分か\nち合う[#000000]とき、波動の光が生まれる」と刻まれている", @"Por sí solo, este pin no tiene poder. Dice: «Las albricias de un [#FF0000]universo hecho y deshecho[#000000], los amigos a través del tiempo, serán tu rayo de luz».", @"Da sola, questa spilla non mostra alcun potere. Recita: \x22Le gioie di un [#FF0000]universo fatto e disfatto[#000000] e gli amici nel tempo, saranno il tuo raggio di luce.\x22", @"Von diesem Pin allein geht keine Macht aus. Auf ihm steht: \x22Die Freuden eines [#FF0000]Universums, das entsteht und vergeht[#000000], Freunde über die Zeit hinweg, sollen dein Lichtstrahl sein.\x22", @"Seul, ce badge n'a aucun pouvoir. On peut y lire la phrase : \x22Les joies d'un [#FF0000]univers créé et détruit[#000000], amis à travers le temps, seront votre rayon de lumière\x22.", @"光是裝備這個徽章無法發動。\n上面刻著「宇宙的誕生與結束，\n[#FF0000]與無可取代的摯友分享這份喜悅[#000000]之時，\n波動光芒於焉創生」。", @"光是装备这个徽章无法发动。\n上面刻着“宇宙的诞生与结束，[#FF0000]与无可取代的挚友\n分享这份喜悦[#000000]之时，波动光芒于焉创生”。") },
