            { 212, new TwewyPin(212,  "badge_213", @"Black Mars", @"ブラックマーズ", @"Marte Negro", @"Marte nero", @"Schwarzer Mars", @"Mars noir", @"黑色火星", @"深黯火星", @"[#FF0000]Drag across empty space[#000000] to create a path of tall flames. Inflicts damage on contact. The pin says: \x22When [#FF0000]six darklit planets[#000000] align...\x22", @"[#FF0000]空間をドラッグ[#000000]することでドラッグした線上に\n大きな炎を走らせ、当たった敵にダメージを与える\n「[#FF0000]漆黒に輝く六星[#000000]の集いし刻…」と刻まれている", @"[#FF0000]Arrastra por un espacio vacío[#000000] para crear una senda de llamas altas. Inflige daño al impactar. El pin dice: «Cuando se alinean [#FF0000]seis planetas oscuros[#000000]...»", @"[#FF0000]Trascina su uno spazio vuoto[#000000] per creare un percorso di fiamme. Infligge danno a contatto. La spilla dice: \x22Quando [#FF0000]sei pianeti oscuri[#000000] si allineano...\x22", @"[#FF0000]Ziehe im leeren Raum[#000000], damit hohe Flammen aus dem Boden züngeln. Verursacht bei Berührung Schaden. Auf dem Pin steht: \x22Wenn sich die Bahnen [#FF0000]sechs dunkel erleuchteter Planeten[#000000] kreuzen ...\x22", @"[#FF0000]Balayez un espace vide[#000000] pour créer un chemin de hautes flammes. Inflige des dégâts au contact. On peut lire sur le badge : \x22Lorsque [#FF0000]six planètes claires-obscures[#000000] s'alignent...\x22.", @"[#FF0000]拖曳空間[#000000]會使拖曳過的路線猛烈起火，\n給予命中敵人傷害。\n刻著「[#FF0000]閃耀於漆黑之六星[#000000]的匯聚時刻……」。", @"[#FF0000]拖拽空间[#000000]会使拖曳过的路线\n猛烈起火，给予被击中的敌人伤害。\n刻着“[#FF0000]闪耀于漆黑之六星[#000000]的汇聚时刻……”。") },
            { 213, new TwewyPin(213,  "badge_214", @"Black Jupiter", @"ブラックジュピター", @"Júpiter Negro", @"Giove nero", @"Schwarzer Jupiter", @"Jupiter noir", @"黑色木星", @"深黯木星", @"[#FF0000]Slash empty space[#000000] to send a bolt of lightning along that line. Inflicts damage on contact. The pin says: \x22When [#FF0000]six darklit planets[#000000] align...\x22", @"[#FF0000]空間をスラッシュ[#000000]すると、その線上を雷が走り\n当たった敵にダメージを与える\n「[#FF0000]漆黒に輝く六星[#000000]の集いし刻…」と刻まれている", @"[#FF0000]Corta sobre un espacio vacío[#000000] para lanzar un rayo a lo largo de esa línea. Inflige daño al impactar. El pin dice: «Cuando se alinean [#FF0000]seis planetas oscuros[#000000]...»", @"[#FF0000]Colpisci uno spazio vuoto con un fendente[#000000] per mandare un lampo lungo quella linea. Infligge danno a contatto. La spilla dice: \x22Quando [#FF0000]sei pianeti oscuri[#000000] si allineano...\x22", @"Führe einen [#FF0000]Hieb im leeren Raum[#000000] aus, um einen Blitzschlag entlang dieser Linie abzufeuern. Verursacht bei Berührung Schaden. Auf dem Pin steht: \x22Wenn sich die Bahnen [#FF0000]sechs dunkel erleuchteter Planeten[#000000] kreuzen ...\x22", @"[#FF0000]Balayez un espace vide[#000000] pour lancer un éclair sur cette ligne. Inflige des dégâts au contact. On peut lire sur le badge : \x22Lorsque [#FF0000]six planètes claires-obscures[#000000] s'alignent...\x22.", @"[#FF0000]於空間中劃線[#000000]，雷電就會出現在劃過的路線上，\n給予命中敵人傷害。\n刻著「[#FF0000]閃耀於漆黑之六星[#000000]的匯聚時刻……」。", @"[#FF0000]在空间中划线[#000000]，雷电就会出现在划过的路线上，\n给予被击中的敌人伤害。\n刻着“[#FF0000]闪耀于漆黑之六星[#000000]的汇聚时刻……”。") },
            { 214, new TwewyPin(214,  "badge_215", @"Black Uranus", @"ブラックウラヌス", @"Urano Negro", @"Urano nero", @"Schwarzer Uranus", @"Uranus noir", @"黑色天王星", @"深黯天王星", @"[#FF0000]Slash vertically up on empty space[#000000] to form an icicle. Inflicts damage on contact. The pin says: \x22When [#FF0000]six darklit planets[#000000] align...\x22", @"[#FF0000]空間を下から上にスラッシュ[#000000]すると\nツララが出現し、当たった敵にダメージを与える\n「[#FF0000]漆黒に輝く六星[#000000]の集いし刻…」と刻まれている", @"[#FF0000]Corta verticalmente hacia arriba sobre un espacio vacío[#000000] para formar un carámbano. Inflige daño al impactar. El pin dice: «Cuando se alinean [#FF0000]seis planetas oscuros[#000000]...»", @"[#FF0000]Sferra un fendente verticale verso l'alto su uno spazio vuoto[#000000] per formare una stalattite. Infligge danno a contatto. La spilla dice: \x22Quando [#FF0000]sei pianeti oscuri[#000000] si allineano...\x22", @"Führe einen [#FF0000]Hieb im leeren Raum[#000000] aus, um einen Eiszapfen zu erschaffen. Verursacht bei Berührung Schaden. Auf dem Pin steht: \x22Wenn sich die Bahnen [#FF0000]sechs dunkel erleuchteter Planeten[#000000] kreuzen ...\x22", @"[#FF0000]Balayez vers le haut sur un espace vide[#000000] pour créer un stalactite. Inflige des dégâts au contact. On peut lire sur le badge : \x22Lorsque [#FF0000]six planètes claires-obscures[#000000] s'alignent...\x22.", @"[#FF0000]由下往上劃過空間[#000000]，\n就會出現冰柱，給予命中的敵人傷害。\n刻著「[#FF0000]閃耀於漆黑之六星[#000000]的匯聚時刻……」。", @"[#FF0000]由下往上划过空间[#000000]，\n就会出现冰柱，给予命中的敌人伤害。\n刻着“[#FF0000]闪耀于漆黑之六星[#000000]的汇聚时刻……”。") },
            { 215, new TwewyPin(215,  "badge_216", @"Black Venus", @"ブラックビーナス", @"Venus Negro", @"Venere nera", @"Schwarze Venus", @"Vénus noir", @"黑色金星", @"深黯金星", @"[#FF0000]Tap empty space[#000000] to fire a [#FF0000]bullet[#000000] in that direction. Inflicts damage on contact. The pin says: \x22When [#FF0000]six darklit planets[#000000] align...\x22", @"[#FF0000]空間をタップ[#000000]することでその方向に\n[#FF0000]弾[#000000]を飛ばし、当たった敵にダメージを与える\n「[#FF0000]漆黒に輝く六星[#000000]の集いし刻…」と刻まれている", @"[#FF0000]Toca un espacio vacío[#000000] para disparar una [#FF0000]bala[#000000] en esa dirección. Inflige daño al impactar. El pin dice: «Cuando se alinean [#FF0000]seis planetas oscuros[#000000]...»", @"[#FF0000]Tocca uno spazio vuoto[#000000] per sparare un [#FF0000]proiettile[#000000] in quella direzione. Infligge danno a contatto. La spilla dice: \x22Quando [#FF0000]sei pianeti oscuri[#000000] si allineano...\x22", @"[#FF0000]Tippe im leeren Raum[#000000], um ein [#FF0000]Geschoss[#000000] in diese Richtung abzufeuern. Verursacht bei Berührung Schaden. Auf dem Pin steht: \x22Wenn sich die Bahnen [#FF0000]sechs dunkel erleuchteter Planeten[#000000] kreuzen ...\x22", @"[#FF0000]Touchez un espace vide[#000000] pour tirer une [#FF0000]balle[#000000] dans cette direction. Inflige des dégâts au contact. On peut lire sur le badge : \x22Lorsque [#FF0000]six planètes claires-obscures[#000000] s'alignent...\x22.", @"[#FF0000]點擊空間[#000000]就會朝該方向射出\n[#FF0000]子彈[#000000]，給予命中的敵人傷害。\n刻著「[#FF0000]閃耀於漆黑之六星[#000000]的匯聚時刻……」。", @"[#FF0000]点击空间[#000000]就会朝该方向射出[#FF0000]子弹[#000000]，\n给予命中的敌人伤害。\n刻着“[#FF0000]闪耀于漆黑之六星[#000000]的汇聚时刻……”。") },
            { 216, new TwewyPin(216,  "badge_217", @"Black Saturn", @"ブラックサターン", @"Saturno Negro", @"Saturno nero", @"Schwarzer Saturn", @"Saturne noir", @"黑色土星", @"深黯土星", @"[#FF0000]Press Neku[#000000] to create a dark barrier that [#FF0000]restores HP and harms enemies[#000000]. Movement OK. The pin says: \x22When [#FF0000]six darklit planets[#000000] align...\x22", @"[#FF0000]ネクをホールド[#000000]すると闇バリアが発生し[#FF0000]接触した\n敵にダメージを与えた上ＨＰが回復　ドラッグ[#000000]で\n移動も可　「[#FF0000]漆黒に輝く六星[#000000]の集いし刻…」と刻\nまれている", @"[#FF0000]Pulsa sobre Neku[#000000] para formar una barrera oscura que [#FF0000]restablece PV y daña a los enemigos[#000000]. El movimiento no se ve afectado. El pin dice: «Cuando se alinean [#FF0000]seis planetas oscuros[#000000]...»", @"[#FF0000]Premi Neku[#000000]per creare una barriera oscura che [#FF0000]ripristina i PF e danneggia i nemici[#000000]. Movimento OK. La spilla dice: \x22Quando [#FF0000]sei pianeti oscuri[#000000] si allineano...\x22", @"[#FF0000]Drücke auf Neku[#000000], um eine Finsterbarriere zu erschaffen, die [#FF0000]LP wiederherstellt und Gegnern Schaden zufügt[#000000]. Bewegung ist möglich. Auf dem Pin steht: \x22Wenn sich die Bahnen [#FF0000]sechs dunkel erleuchteter Planeten[#000000] kreuzen ...\x22", @"[#FF0000]Appuyez sur Neku[#000000] pour créer une barrière sombre qui [#FF0000]restaurera des PV et blessera vos ennemis[#000000]. Déplacement possible. On peut lire sur le badge : \x22Lorsque [#FF0000]six planètes claires-obscures[#000000] s'alignent...\x22.", @"[#FF0000]長按音操[#000000]便會出現暗護盾，\n[#FF0000]給予接觸敵人傷害的同時還會逐漸恢復ＨＰ，\n護盾出現後，拖曳音操[#000000]便可以移動。\n刻著「[#FF0000]閃耀於漆黑之六星[#000000]的匯聚時刻……」。", @"[#FF0000]长按音操[#000000]便会出现黑暗护盾，\n[#FF0000]给予接触敌人伤害的同时还会逐渐恢复HP，\n护盾出现后，拖拽音操[#000000]便可以移动。\n刻着“[#FF0000]闪耀于漆黑之六星[#000000]的汇聚时刻……”。") },
            { 217, new TwewyPin(217,  "badge_218", @"Black Mercury", @"ブラックマーキュリー", @"Mercurio Negro", @"Mercurio nero", @"Schwarzer Merkur", @"Mercure noir", @"黑色水星", @"深黯水星", @"[#FF0000]Tap empty space[#000000] to create a stationary orb of water. Orbs rebound on contact. The pin says: \x22When [#FF0000]six darklit planets[#000000] align...\x22", @"[#FF0000]空間をタップ[#000000]することでその位置に動かない\n水球を出し、当たった敵にダメージを与える\n「[#FF0000]漆黒に輝く六星[#000000]の集いし刻…」と刻まれている", @"[#FF0000]Toca un espacio vacío[#000000] para formar una esfera estática de agua. Las esferas rebotan al impactar. El pin dice: «Cuando se alinean [#FF0000]seis planetas oscuros[#000000]...»", @"[#FF0000]Tocca uno spazio vuoto[#000000] per creare una sfera d'acqua immobile. Le sfere rimbalzano al contatto. La spilla dice: \x22Quando [#FF0000]sei pianeti oscuri[#000000] si allineano...\x22", @"[#FF0000]Tippe im leeren Raum[#000000], um eine stationäre Wasserkugel zu erschaffen. Kugeln prallen bei Kontakt ab. Auf dem Pin steht: \x22Wenn sich die Bahnen [#FF0000]sechs dunkel erleuchteter Planeten[#000000] kreuzen ...\x22", @"[#FF0000]Touchez un espace vide[#000000] pour créer un orbe d'eau stationnaire. Les orbes rebondissent au contact. On peut lire sur le badge : \x22Lorsque [#FF0000]six planètes claires-obscures[#000000] s'alignent...\x22.", @"[#FF0000]點擊空間[#000000]該位置就會出現不動水球，\n給予命中的敵人傷害。\n刻著「[#FF0000]閃耀於漆黑之六星[#000000]的匯聚時刻……」。", @"[#FF0000]点击空间[#000000]该位置就会出现不动水球，\n给予命中的敌人伤害。\n刻着“[#FF0000]闪耀于漆黑之六星[#000000]的汇聚时刻……”。") },
            { 218, new TwewyPin(218,  "badge_219", @"Righty Cat", @"キャット・ライト", @"Gato Diestro", @"Gatto destro", @"Rechtes Pfötchen", @"Chat droit", @"貓的右手", @"酷猫·右手", @"By itself, this pin exhibits no power. It reads: \x22Merciless power, when wielded with wisdom and courage, shall surely break the [#FF0000]gods' spell over all[#000000].\x22", @"このバッジだけをそうびしても発動できない\n「慈悲無き力、知恵と勇気と共に[#FF0000]神々から\n与えられし呪縛の全て[#000000]を解放するだろう」と\n刻まれている", @"Por sí solo, este pin no tiene poder. Dice: «Poder inclemente; cuando se ostenta con sabiduría y coraje, sin duda romperá [#FF0000]el hechizo de los dioses sobre todas las cosas[#000000]».", @"Da sola, questa spilla non mostra alcun potere. Recita: \x22La potenza spietata, se brandita con saggezza e coraggio, spezza senza dubbio alcuno l'[#FF0000]incantesimo degli dei su tutto[#000000].\x22", @"Von diesem Pin allein geht keine Macht aus. Auf ihm steht: \x22Gnadenlose Macht, mit Weisheit und Mut eingesetzt, wird garantiert die [#FF0000]Herrschaft der Götter über alles[#000000] brechen.\x22", @"Seul, ce badge n'a aucun pouvoir. On peut y lire la phrase : \x22Une puissance implacable, utilisée avec sagesse et courage, devrait briser le [#FF0000]sort omniprésent des dieux[#000000]\x22.", @"光是裝備這個徽章無法發動。\n上面刻著「[#FF0000]眾神所給予之所有咒縛[#000000]\n會隨不留情之力、智慧與勇氣\n一同解放」。", @"光是装备这个徽章无法发动。\n上面刻着“[#FF0000]众神所给予之所有咒缚[#000000]\n会随不留情之力、智慧与勇气\n一同解放”。") },
            { 219, new TwewyPin(219,  "badge_220", @"Brainy Cat", @"キャット・ブレイン", @"Gato Avispado", @"Gatto furbo", @"Cleveres Kätzchen", @"Chat tête", @"貓的智慧", @"酷猫·大脑", @"By itself, this pin exhibits no power. It reads: \x22Fierce courage, when joined by wisdom and power, shall surely break the [#FF0000]gods' spell over all[#000000].\x22", @"このバッジだけをそうびしても発動できない\n「猛る勇気、知恵そして力と共に[#FF0000]神々から\n与えられし呪縛の全て[#000000]を解放するだろう」と\n刻まれている", @"Por sí solo, este pin no tiene poder. Dice: «Coraje feroz; cuando se suman la sabiduría y el poder, sin duda romperá [#FF0000]el hechizo de los dioses sobre todas las cosas[#000000]».", @"Da sola, questa spilla non mostra alcun potere. Recita: \x22Il coraggio violento, se unito alla saggezza e alla potenza, spezza senza dubbio alcuno l'[#FF0000]incantesimo degli dei su tutto[#000000].\x22", @"Von diesem Pin allein geht keine Macht aus. Auf ihm steht: \x22Ungezügelter Mut, in Kombination mit Weisheit und Macht, wird garantiert die [#FF0000]Herrschaft der Götter über alles[#000000] brechen.\x22", @"Seul, ce badge n'a aucun pouvoir. On peut y lire la phrase : \x22Un courage farouche, accompagné de sagesse et de puissance, devrait briser le [#FF0000]sort omniprésent des dieux[#000000]\x22.", @"光是裝備這個徽章無法發動。\n上面刻著「[#FF0000]眾神所給予之所有咒縛[#000000]\n會隨剛猛勇氣、智慧與力量\n一同解放」。", @"光是装备这个徽章无法发动。\n上面刻着“[#FF0000]众神所给予之所有咒缚[#000000]\n会随刚猛勇气、智慧与力量\n一同解放”。") },
            { 220, new TwewyPin(220,  "badge_221", @"Lefty Cat", @"キャット・レフト", @"Gato Zurdo", @"Gatto mancino", @"Linkes Pfötchen", @"Chat gauche", @"貓的左手", @"酷猫·左手", @"By itself, this pin exhibits no power. It reads: \x22Sinister wisdom, with power and courage in hand, shall surely break the [#FF0000]gods' spell over all[#000000].\x22", @"このバッジだけをそうびしても発動できない\n「魔性の知恵、勇気と力を両手に[#FF0000]神々から\n与えられし呪縛の全て[#000000]を解放するだろう」と\n刻まれている", @"Por sí solo, este pin no tiene poder. Dice: «Sabiduría siniestra; cuando el poder y el coraje van unidos, sin duda romperá [#FF0000]el hechizo de los dioses sobre todas las cosas[#000000]».", @"Da sola, questa spilla non mostra alcun potere. Recita: \x22La saggezza sinistra, dotata di potenza e coraggio, spezza senza dubbio alcuno l'[#FF0000]incantesimo degli dei su tutto[#000000].\x22", @"Von diesem Pin allein geht keine Macht aus. Auf ihm steht: \x22Unheimliche Weisheit, Hand in Hand mit Macht und Mut, wird garantiert die [#FF0000]Herrschaft der Götter über alles[#000000] brechen.\x22", @"Seul, ce badge n'a aucun pouvoir. On peut y lire la phrase : \x22Une sagesse sinistre, doublée de puissance et de courage, devrait briser le [#FF0000]sort omniprésent des dieux[#000000]\x22.", @"光是裝備這個徽章無法發動。\n上面刻著「[#FF0000]眾神所給予之所有咒縛[#000000]\n會隨雙手握有的魔性智慧、勇氣與力量\n一同解放」。", @"光是装备这个徽章无法发动。\n上面刻着“[#FF0000]众神所给予之所有咒缚[#000000]\n会随双手握有的魔性智慧、勇气与力量\n一同解放”。") },
            { 221, new TwewyPin(221,  "badge_222", @"One Jump from Eden", @"究極まであと４歩", @"Edén a un Salto", @"Un balzo dall'Eden", @"Ein Sprung von Eden", @"À un saut d'Eden", @"距離究極只剩４步", @"4步之遥的究极", @"The pin reads: \x22A lamenting goddess left this prophecy for the five warring kingdoms below: that their world would end in blackest sun-fire.\x22", @"「戦争絶えぬ五国を悲しむ女神は人間達に予言を\n与えた、やがて世界は漆黒の太陽に焼き払われる\n運命なのだと…」と刻まれている", @"El pin dice: «Una diosa dejó, lamentándose, esta profecía para los cinco reinos en guerra de abajo: su mundo acabaría sumido en el más oscuro fuego solar».", @"La spilla recita: \x22Una dea lamentevole lasciò questa profezia ai cinque regni in guerra: il loro mondo finirà nel sole ardente più nero.\x22", @"Auf dem Pin steht: \x22Eine trauernde Göttin hinterließ diese Prophezeiung für die fünf verfeindeten Königreiche unter ihr: dass ihre Welt im schwärzesten Sonnenfeuer vergehen werde.\x22", @"On peut lire sur le badge : \x22Une déesse éplorée avait laissé une prophétie aux cinq royaumes en guerre ici-bas : que leur monde s'achève dans le plus noir des feux solaires\x22.", @"上面刻著「女神為烽火連天的五國而傷懷，\n對人類做出預言，世界最後將面對\n遭漆黑太陽燃燒殆盡之命運……」。", @"上面刻着“女神为烽火连天的五国而伤怀，\n对人类做出预言，世界最后将面对\n遭漆黑太阳燃烧殆尽之命运……”。") },
            { 222, new TwewyPin(222,  "badge_223", @"One Skip from Eden", @"究極まであと３歩", @"Edén a una Zancada", @"Un salto dall'Eden", @"Ein Hüpfer von Eden", @"À un bond d'Eden", @"距離究極只剩３步", @"3步之遥的究极", @"The pin reads: \x22Yet her prophecy held hope. The goddess promised to all living things, great and small, a [#FF0000]saving Light to ward off their doom[#000000].\x22", @"「女神の予言は続く　七日の後、等しく命を紡ぐ\n者に、[#FF0000]全ての災厄から逃れる光の加護[#000000]を\n与えると…」と刻まれている", @"El pin dice: «Pero la profecía albergaba esperanza. La diosa prometió a todos los seres vivos, grandes y pequeños, una [#FF0000]luz salvadora que los protegería de la destrucción»[#000000].", @"La spilla recita: \x22Ma la sua profezia lasciava trapelare una speranza. La dea aveva promesso a tutti gli esseri viventi, grandi e piccoli, che una [#FF0000]Luce di salvezza avrebbe respinto la loro maledizione[#000000].\x22", @"Auf dem Pin steht: \x22Und doch enthielt ihre Prophezeiung Hoffnung. Die Göttin versprach allen Lebewesen, ob groß oder klein, ein [#FF0000]rettendes Licht[#000000], [#FF0000]das ihren Untergang verhindern werde[#000000].\x22", @"On peut lire sur le badge : \x22Mais sa prophétie était teintée d'espoir. La déesse avait promis à tous les êtres vivants, petits et grands, une [#FF0000]Lumière salvatrice pour faire obstacle à leur destin tragique[#000000]\x22.", @"上面刻著「女神的預言還提到，\n七日後將給予平等延續生命者\n[#FF0000]逃離一切災厄的光之庇護[#000000]……」。", @"上面刻着“女神的预言还提到，\n七日后将给予平等延续生命者\n[#FF0000]逃离一切灾厄的光之庇护[#000000]……”。") },
            { 223, new TwewyPin(223,  "badge_224", @"One Hop from Eden", @"究極まであと２歩", @"Edén a un Brinco", @"Un saltello dall'Eden", @"Ein Hopser von Eden", @"À une ruade d'Eden", @"距離究極只剩２步", @"2步之遥的究极", @"The pin reads: \x22But the five kings would not believe her. So one sought strength and found futility; so another sank in mindless wisdom.\x22", @"「五国の王達は女神を信じない　予言にある災厄を\n払う究極の力を求め、一国はその無益な力に滅び\n一国は思想なき知恵に溺れた」と刻まれている", @"El pin dice: «Pero los cinco reyes no le creyeron. Así, uno buscó fuerza y encontró futilidad; otro se perdió en una sabiduría absurda».", @"La spilla recita: \x22Ma i cinque re non le credettero. Quindi uno cercò la forza e trovò la futilità; un altro sprofondò in una saggezza irrazionale.\x22", @"Auf dem Pin steht: \x22Aber die fünf Könige glaubten ihr nicht. Also suchte der eine Stärke, doch vergebens, und ein weiterer versank in gedankenloser Weisheit.\x22", @"On peut lire sur le badge : \x22Toutefois, les cinq rois refusèrent de la croire. L'un chercha la force mais trouva la futilité, et un autre sombra dans une sagesse inconsciente\x22.", @"上面刻著\n「五國的國王不相信女神，\n只顧尋求可驅除神諭所言災厄的終極力量，\n其中一國被無益之力毀滅，\n一國則沉溺於毫無主見的智慧」。", @"上面刻着\n“五国的国王不相信女神，只顾寻求可驱除\n神谕所言灾厄的终极力量，\n其中一国被无益之力毁灭，\n一国则沉溺于毫无主见的智慧”。") },
            { 224, new TwewyPin(224,  "badge_225", @"One Step from Eden", @"究極まであと１歩", @"Edén a un Paso", @"Un passo dall'Eden", @"Ein Schritt von Eden", @"À un pas d'Eden", @"距離究極只剩１步", @"1步之遥的究极", @"The pin reads: \x22In the end, the kings' delusions led them to a chamber of reckoning, where their unspent chaos brought fear and woe to all.\x22", @"「結果、王達の迷いは自らを審判の間へと導くに\n至った、その行き場の無い混沌はいたずらに恐怖と\n悲しみを世界にもたらした」と刻まれている", @"El pin dice: «Al final, los delirios de los reyes los llevaron a una sala del juicio final, donde el caos que tenían guardado causó miedo y dolor a todos».", @"La spilla recita: \x22Alla fine, l'illusione dei re li condusse alla stanza del giudizio, dove il loro caos non consumato portò paura e dolore a tutti.\x22", @"Auf dem Pin steht: \x22Am Ende führte ihre Verblendung die Könige in eine Kammer der Abrechnung, wo ihr aufgestautes Chaos allen Angst und Schrecken brachte.\x22", @"On peut lire sur le badge : \x22Pour finir, les illusions des rois les menèrent vers la salle du jugement dernier, où leur chaos inutilisé apporta peur et malheur à l'humanité\x22.", @"上面刻著\n「結果，國王們的迷惘將自身導向審判之室，\n那些無處可去的混沌，\n徒然將恐怖與悲傷帶到世上」。", @"上面刻着\n“结果，国王们的迷惘将自身导向审判之室，\n那些无处可去的混沌，\n徒然将恐怖与悲伤带到世上”。") },
            { 225, new TwewyPin(225,  "badge_226", @"Eden's Door", @"究極への扉", @"Puerta del Edén", @"Porta dell'Eden", @"Tor nach Eden", @"Porte d'Eden", @"通往究極之門", @"究极之门", @"The pin reads: \x22Now, as the boy stands before Eden, the [#FF0000]five kings in his wake[#000000], the goddess rewards his balanced judgment with her Light.\x22", @"「究極を手にした者、そして糧となった者…女神は\n五国の王に[#FF0000]公平且つ厳粛な審判[#000000]を下したその少年に\n光の加護を与えた」と刻まれている", @"El pin dice: «Ahora, mientras el muchacho se encuentra ante el Edén, con los [#FF0000]cinco reyes a su estela[#000000], la diosa premia con su luz su juicio equilibrado».", @"La spilla recita: \x22Ora, mentre il ragazzo è di fronte all'Eden, [#FF0000]i cinque re dietro di sé[#000000], la dea ricompensa il suo giudizio equilibrato con la sua Luce.\x22", @"Auf dem Pin steht: \x22Jetzt, da der Junge vor Eden steht, mit den [#FF0000]fünf Königen im Gefolge[#000000], belohnt die Göttin sein ausgewogenes Urteil mit ihrem Licht.\x22", @"On peut lire sur le badge : \x22À présent, alors que le garçon se tient devant l'Eden, les [#FF0000]cinq rois dans son sillage[#000000], la déesse récompense son jugement objectif en lui donnant sa Lumière\x22.", @"上面刻著「獲得終極力量，並賴以維生者……\n女神給予對五國國王執行[#FF0000]公平嚴肅審判的[#000000]少年\n光之庇護」。", @"上面刻着“获得终极力量，并赖以维生者……女神\n给予对五国国王执行[#FF0000]公平严肃审判的[#000000]少年\n光之庇护”。") },
            { 226, new TwewyPin(226,  "badge_227", @"Visionary Blend", @"まぼろしブレンド", @"Combinación Visionaria", @"Miscela visionaria", @"Visionäre Mischung", @"Mélange visionnaire", @"空想混合", @"梦幻之饮", @"[#FF0000]Automatically restores all HP[#000000] when they are low, and [#FF0000]cures negative statuses[#000000] when necessary.", @"ＨＰが少なくなったり、何らかの状態異常になると\n[#FF0000]自動的に完全回復[#000000]する", @"[#FF0000]Restablece automáticamente todos los PV[#000000] cuando su nivel está bajo y [#FF0000]cura los estados negativos[#000000] en caso necesario.", @"[#FF0000]Ripristina automaticamente i PF[#000000] quando sono bassi e [#FF0000]guarisce dagli stati negativi[#000000] quando necessario.", @"[#FF0000]Stellt automatisch alle LP wieder her[#000000], wenn diese niedrig sind, und [#FF0000]heilt negative Statuszustände[#000000], falls erforderlich.", @"[#FF0000]Restaure automatiquement tous les PV[#000000] lorsque la jauge est basse et [#FF0000]annule les états négatifs[#000000] si nécessaire.", @"若ＨＰ所剩不多，或陷入任何異常狀態\n[#FF0000]便會自動完全恢復[#000000]。", @"若HP所剩不多，或陷入任何状态异常\n[#FF0000]便会自动完全恢复[#000000]。") },
            { 227, new TwewyPin(227,  "badge_228", @"Red Skull", @"レッドスカル", @"Calavera Roja", @"Teschio rosso", @"Roter Schädel", @"Red Skull", @"紅骷髏", @"红骷髅", @"[#FF0000]Slows down[#000000] Neku's movement.", @"ネクの[#FF0000]移動速度が低下[#000000]する", @"[#FF0000]Ralentiza[#000000] el movimiento de Neku.", @"[#FF0000]Rallenta[#000000] i movimenti di Neku.", @"[#FF0000]Verlangsamt[#000000] Nekus Bewegung.", @"[#FF0000]Ralentit[#000000] les mouvements de Neku.", @"音操的[#FF0000]移動速度減慢[#000000]。", @"音操的[#FF0000]移动速度减慢[#000000]。") },
            { 228, new TwewyPin(228,  "badge_229", @"Gatito", @"ガティート", @"Gatito", @"Gatito", @"Gatito", @"Gatito", @"Gatito", @"Gatito", @"Increases the [#FF0000]Attack[#000000] of any [#00CC00]Gatito[#000000] pins Neku is wearing.", @"そうびしている[#00CC00]ガティート[#000000]バッジの\n[#FF0000]攻撃力をアップ[#000000]する", @"Aumenta el [#FF0000]ataque[#000000] de los pines [#00CC00]Gatito[#000000] que lleva Neku.", @"Aumenta l'[#FF0000]Attacco[#000000] di qualunque spilla [#00CC00]Gatito[#000000] indossata da Neku.", @"Erhöht den [#FF0000]Angriff[#000000] jedes Pins von [#00CC00]Gatito[#000000], den Neku trägt.", @"Augmente l'[#FF0000]Attaque[#000000] de tous les badges [#00CC00]Gatito[#000000] que porte Neku.", @"裝備中[#00CC00]Gatito[#000000]徽章的\n[#FF0000]攻擊力提升[#000000]。", @"装备时，所有[#00CC00]Gatito[#000000]徽章的[#FF0000]攻击力提升[#000000]。") },
            { 229, new TwewyPin(229,  "badge_230", @"Tin Pin Fire", @"マーブル・ファイア", @"Atizapín del Fuego", @"Fuoco di Tin Pin", @"Tin Pin Feuer", @"Feu Tin Pin", @"爆炎徽章", @"激撞徽章·火焰", @"A special Tin Pin used in slam-offs. This one was designed for Tin Pin Slammer beginners. [#FF0000]Keep scratching an enemy[#000000] to activate its psych.", @"マーブルバッジとよばれる種類のバッジのひとつ\nマーブルスラッシュの初心者用のバッジだ\n[#FF0000]敵をこすり続ける[#000000]とサイキックが発動", @"Pin especial que se usa en las justas. Idóneo para principiantes del Tin Pin Slammer. [#FF0000]Rasca sin parar a un enemigo[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. Questa era stata progettata per i principianti di Tin Pin Slammer. [#FF0000]Continua a grattare un nemico[#000000] per attivare il suo psico.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Dieser wurde für Anfänger entwickelt. [#FF0000]Kratze kontinuierlich auf einem Gegner[#000000], um sein Psych zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Celui-ci est destiné aux débutants dans Tin Pin Slammer. [#FF0000]Grattez longuement un ennemi[#000000] pour activer son psych.", @"被分類為戰鬥徽章的徽章之一，\n是激鬥徽章的新手專用徽章。\n[#FF0000]持續摩擦敵人[#000000]就會發動超能。", @"被分类为战斗徽章的徽章之一，\n是激撞徽章的新手专用徽章。\n[#FF0000]持续摩擦敌人[#000000]就会发动超能。") },
            { 230, new TwewyPin(230,  "badge_231", @"Tin Pin Custom", @"マーブル・カスタム", @"Atizapín Personalizado", @"Usanza di Tin Pin", @"Tin Pin Spezial", @"Coutume Tin Pin", @"改造徽章", @"激撞徽章·改", @"A special Tin Pin used in slam-offs. Modded pins like this one are banned from official play. [#FF0000]Press empty space[#000000] to activate the pin's psych.", @"マーブルバッジとよばれる種類のバッジのひとつ\n…を改造しているので公式大会では使えないらしい\n[#FF0000]空間をホールド[#000000]するとサイキックが発動", @"Pin especial utilizado en las justas. Estos pines trucados están prohibidos en el juego oficial. [#FF0000]Pulsa sobre un espacio vacío[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. Le spille modificate come questa sono vietate nelle partite ufficiali. [#FF0000]Premi su uno spazio vuoto[#000000] per attivare lo psico della spilla.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Modifizierte Pins wie dieser sind im offiziellen Spiel nicht zugelassen. [#FF0000]Drücke im leeren Raum[#000000], um das Psych des Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Les badges modifiés comme celui-ci sont interdits dans le jeu officiel. [#FF0000]Appuyez sur un espace vide[#000000] pour activer son psych.", @"被分類為戰鬥徽章的徽章之一，\n由於被……改造過，因此無法在正式大賽使用。\n[#FF0000]長按空間[#000000]就會發動超能。", @"被分类为战斗徽章的徽章之一，\n……由于改造过，因此无法在正式大赛使用。\n[#FF0000]长按空间[#000000]就会发动超能。") },
            { 231, new TwewyPin(231,  "badge_232", @"Tin Pin Wind", @"マーブル・ウインド", @"Atizapín del Viento", @"Vento di Tin Pin", @"Tin Pin Wind", @"Vent Tin Pin", @"疾風徽章", @"激撞徽章·风华", @"A special Tin Pin used in slam-offs. Yammer made this by further modding the TP Custom. [#FF0000]Slash across Neku[#000000] to activate the pin's psych.", @"マーブルバッジとよばれる種類のバッジのひとつ\nマーブル・カスタムを横山田がさらに改造した代物\n[#FF0000]ネクをスラッシュ[#000000]するとサイキックが発動", @"Pin especial utilizado en las justas. Charleta lo creó trucando aún más el Atizapín Personalizado. [#FF0000]Corta sobre Neku[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. L'ha creata Yammer modificando ulteriormente la TP personalizzata. [#FF0000]Colpisci Neku con un fendente[#000000] per attivare lo psico della spilla.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Yammer hat hierfür den TP Spezial noch weiter modifiziert. Führe einen [#FF0000]Hieb auf Neku[#000000] aus, um das Psych des Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois Yammer fait pour TP personnalisé. [#FF0000]Balayer autour de Neku[#000000]  pour activer son psych.", @"被分類為戰鬥徽章的徽章之一，\n此改造徽章是由橫山田進一步改造的成品。\n[#FF0000]劃過音操[#000000]就會發動超能。", @"被分类为战斗徽章的徽章之一，\n此激撞徽章·改是由横山田进一步改造的成品。\n[#FF0000]划过音操[#000000]就会发动超能。") },
            { 232, new TwewyPin(232,  "badge_233", @"Tin Pin Blade", @"マーブル・ブレード", @"Atizapín del Acero", @"Lama di Tin Pin", @"Tin Pin Klinge", @"Lame Tin Pin", @"刀鋒徽章", @"激撞徽章·音刃", @"A special Tin Pin used in slam-offs. Yammer considers this TP Wind mod his magnum opus. [#FF0000]Scratch empty space[#000000] to activate the pin's psych.", @"マーブル・ウインドを改造した\n横山田の最高傑作であるマーブルバッジ\n[#FF0000]空間をこする[#000000]とサイキックが発動", @"Pin especial utilizado en las justas. Para Charleta, esta modificación del Atizapín del Viento es su obra maestra. [#FF0000]Rasca en un espacio vacío[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. Yammer considera la modifica della TP vento la sua opera massima. [#FF0000]Gratta su uno spazio vuoto[#000000] per attivare lo psico della spilla.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Yammer betrachtet diese Modifizierung des TP Wind als sein Meisterwerk. [#FF0000]Kratze im leeren Raum[#000000], um das Psych des Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Yammer considère cette modification TP vent comme son chef d'œuvre. [#FF0000]Grattez un espace vide[#000000] pour activer son psych.", @"疾風彈珠的改造成品，\n橫山田的戰鬥徽章最高傑作。\n[#FF0000]摩擦空間[#000000]就會發動超能。", @"激撞徽章·风华的改造成品，\n横山田的战斗徽章最高杰作。\n[#FF0000]摩擦空间[#000000]就会发动超能。") },
            { 233, new TwewyPin(233,  "badge_234", @"Tin Pin Wheel", @"マーブル・ホイール", @"Atizapín de la Rueda", @"Ruota di Tin Pin", @"Tin Pin Rad", @"Roue Tin Pin", @"車輪徽章", @"激撞徽章·巨轮", @"A special Tin Pin used in slam-offs. It takes its motif from wheeled warriors and slammin' rides. [#FF0000]Drag Neku[#000000] to activate the pin's psych.", @"マーブルバッジとよばれる種類のバッジのひとつ\nバイクや車などのホイールを思わせるデザイン\n[#FF0000]ネクをドラッグ[#000000]するとサイキックが発動", @"Pin especial utilizado en las justas. Su motivo deriva de los guerreros sobre ruedas y los arietes. [#FF0000]Arrastra a Neku[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. Il suo motivo deriva dai guerrieri su ruote e dai re della strada. [#FF0000]Trascina Neku[#000000] per attivare lo psico della spilla.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Er trägt Motive von Kriegern der Landstraße und krassen Schlitten. [#FF0000]Ziehe Neku[#000000], um das Psych des Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Sa modification est inspirée de guerriers sur roues et de bolides vrombissant. [#FF0000]Faites glisser Neku[#000000] pour activer son psych.", @"被分類為戰鬥徽章的徽章之一，\n設計成類似摩托車與汽車車輪的樣式。\n[#FF0000]拖曳音操[#000000]就會發動超能。", @"被分类为战斗徽章的徽章之一，\n设计成类似摩托车与汽车车轮的样式。\n[#FF0000]拖拽音操[#000000]就会发动超能。") },
            { 234, new TwewyPin(234,  "badge_235", @"Tin Pin Dash", @"マーブル・ダッシュ", @"Atizapín Acelerado", @"Scatto di Tin Pin", @"Tin Pin Sprinter", @"Sprint Tin Pin", @"衝刺徽章", @"激撞徽章·冲刺", @"A special Tin Pin used in slam-offs. The American champ uses the same kind of pin. [#FF0000]Drag Neku[#000000] to activate the pin's psych.", @"マーブルバッジとよばれる種類のバッジのひとつ\nアメリカのチャンピオンが使っているらしい\n[#FF0000]ネクをドラッグ[#000000]するとサイキックが発動", @"Pin especial utilizado en las justas. El campeón estadounidense emplea el mismo tipo de pin. [#FF0000]Arrastra a Neku[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. I campioni americani usano lo stesso tipo di spilla. [#FF0000]Trascina Neku[#000000] per attivare lo psico della spilla.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Der amerikanische Meister verwendet diesen Pin. [#FF0000]Ziehe Neku[#000000], um das Psych des Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Le champion américain utilise le même genre de badge. [#FF0000]Faites glisser Neku[#000000] pour activer son psych.", @"被分類為戰鬥徽章的徽章之一，\n似乎是美國冠軍目前使用之物。\n[#FF0000]拖曳音操[#000000]就會發動超能。", @"被分类为战斗徽章的徽章之一，\n似乎是美国冠军目前使用之物。\n[#FF0000]拖拽音操[#000000]就会发动超能。") },
            { 235, new TwewyPin(235,  "badge_236", @"Tin Pin Thrift", @"マーブル・エコロジー", @"Atizapín Ahorrativo", @"Parsimonia di Tin Pin", @"Tin Pin Grasnelke", @"Économie Tin Pin", @"生態徽章", @"激撞徽章·生态", @"A Tin Pin with a nature motif. Places the wearer in [#FF0000]mortal peril[#000000] at the start of battle, but boosts [#FF0000]Attack[#000000] and [#FF0000]EXP earned[#000000] while in that state.", @"自然がテーマのマーブルバッジ　[#FF0000]そうび[#000000]するとバト\nル開始時点で[#FF0000]瀕死状態[#000000]になるが、[#FF0000]瀕死状態[#000000]の時\n[#FF0000]攻撃力がアップ[#000000]してゲットできる[#FF0000]ＥＸＰもアップ[#000000]", @"Atizapín con motivos naturales. Pone a su portador en [#FF0000]peligro mortal[#000000] al comienzo de la batalla, pero potencia el [#FF0000]ataque[#000000] y la [#FF0000]EXP ganada[#000000] en ese estado.", @"Una Tin Pin con un motivo naturalistico. Pone chi la indossa in un [#FF0000]pericolo mortale[#000000] all'inizio della battaglia, ma potenzia l'[#FF0000]Attacco[#000000] e l'[#FF0000]ESP ottenuta[#000000] in quello stato.", @"Dieser Tin Pin trägt ein Naturmotiv. Versetzt den Träger zu Beginn des Kampfes in [#FF0000]Lebensgefahr[#000000], erhöht dafür aber in diesem Zustand den [#FF0000]Angriff[#000000] und [#FF0000]die erhaltene Menge an EP[#000000].", @"Un badge présentant un motif naturel. Met son porteur en [#FF0000]danger de mort[#000000] au début du combat, mais cet état augmente l'[#FF0000]Attaque[#000000] et l'[#FF0000]XP gagnée[#000000].", @"以自然為主題的戰鬥徽章，\n[#FF0000]裝備[#000000]之後在戰鬥開始時\n就會陷入[#FF0000]瀕死狀態[#000000]，但[#FF0000]瀕死狀態[#000000]時\n[#FF0000]攻擊力提升[#000000]，能獲得的[#FF0000]ＥＸＰ也會增加[#000000]。", @"以自然为主题的战斗徽章，\n[#FF0000]装备[#000000]之后在战斗开始时就会陷入[#FF0000]濒死状态[#000000]，\n但[#FF0000]濒死状态[#000000]时[#FF0000]攻击力提升[#000000]，\n能获得的[#FF0000]EXP也会增加[#000000]。") },
            { 236, new TwewyPin(236,  "badge_237", @"Tin Pin Hellfire", @"マーブル・業火", @"Atizapín del Fuego Infernal", @"Fuoco infernale di Tin Pin", @"Tin Pin Höllenfeuer", @"Feu de l'enfer Tin Pin", @"業火徽章", @"激撞徽章·业火", @"A special Tin Pin used in slam-offs. This one was designed by the inventor of the Solid Slammer. [#FF0000]Slash across Neku[#000000] to activate the pin's psych.", @"マーブルバッジとよばれる種類のバッジのひとつ\nマーブルギア開発者によって作られたバッジ\n[#FF0000]ネクをスラッシュ[#000000]するとサイキックが発動", @"Pin especial utilizado en las justas. Lo diseñó el inventor del superatizador. [#FF0000]Corta sobre Neku[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. Questa è stata creata dall'inventore del Solid Slammer. [#FF0000]Colpisci Neku con un fendente[#000000] per attivare lo psico della spilla.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Dieser Pin wurde vom Erfinder des Soliden Slammers entwickelt. Führe einen [#FF0000]Hieb auf Neku[#000000] aus, um das Psych des Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Il a été conçu par l'inventeur du Slammer solide. [#FF0000]Balayez Neku[#000000] pour activer son psych.", @"被分類為戰鬥徽章的徽章之一，\n徽章發射器開發者所製造的徽章。\n[#FF0000]劃過音操[#000000]就會發動超能。", @"被分类为战斗徽章的徽章之一，\n徽章发射器开发者所制造的徽章。\n[#FF0000]划过音操[#000000]就会发动超能。") },
            { 237, new TwewyPin(237,  "badge_238", @"Tin Pin Sunscorch", @"マーブル・炎天", @"Atizapín del Sol Ardiente", @"Ustione di Tin Pin", @"Tin Pin Sonnenglut", @"Coup de soleil Tin Pin", @"炎天徽章", @"激撞徽章·炎天", @"A special Tin Pin used in slam-offs. This one was designed by the inventor of the Solid Slammer. [#FF0000]Press empty space[#000000] to activate the pin's psych.", @"マーブルバッジとよばれる種類のバッジのひとつ\nマーブルギア開発者によって作られたバッジ\n[#FF0000]空間をホールド[#000000]するとサイキックが発動", @"Pin especial utilizado en las justas. Lo diseñó el inventor del superatizador. [#FF0000]Pulsa sobre un espacio vacío[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. Questa è stata creata dall'inventore del Solid Slammer. [#FF0000]Premi su uno spazio vuoto[#000000] per attivare lo psico della spilla.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Dieser Pin wurde vom Erfinder des Soliden Slammers entwickelt. [#FF0000]Drücke im leeren Raum[#000000], um das Psych des Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Il a été conçu par l'inventeur du Slammer solide. [#FF0000]Appuyez sur un espace vide[#000000] pour activer son psych.", @"被分類為戰鬥徽章的徽章之一，\n徽章發射器開發者所製造的徽章。\n[#FF0000]長按空間[#000000]就會發動超能。", @"被分类为战斗徽章的徽章之一，\n徽章发射器开发者所制造的徽章。\n[#FF0000]长按空间[#000000]就会发动超能。") },
            { 238, new TwewyPin(238,  "badge_239", @"Tin Pin Rocker", @"マーブル・ロック", @"Atizapín Roquero", @"Rocker di Tin Pin", @"Tin Pin Rocker", @"Rockeur Tin Pin", @"搖滾徽章", @"激撞徽章·摇滚", @"A special Tin Pin used in slam-offs. Def Märch devotees were the first to own this tie-in swag. [#FF0000]Scratch empty space[#000000] to activate the pin's psych.", @"人気バンド「デスマーチ」との\nタイアップ商品であるマーブルバッジ\n[#FF0000]空間をこする[#000000]とサイキックが発動", @"Pin especial utilizado en las justas. Los seguidores de Def Märch fueron los primeros en tener este popular tesoro. [#FF0000]Rasca en un espacio vacío[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. I devoti dei Def Märch sono stati i primi a possedere questo oggetto a tema. [#FF0000]Gratta su uno spazio vuoto[#000000] per attivare lo psico della spilla.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Dieses Merchandising-Modell wurde erstmals von Anhängern von Def Märch eingesetzt. [#FF0000]Kratze im leeren Raum[#000000], um das Psych des Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Les fans de Def Märch ont été les premiers à posséder cet ornement officiel. [#FF0000]Grattez un espace vide[#000000] pour activer son psych.", @"與人氣樂團「Def Märch」\n合作推出的戰鬥徽章。\n[#FF0000]摩擦空間[#000000]就會發動超能。", @"与人气乐团「Def Märch」\n合作推出的战斗徽章。\n[#FF0000]摩擦空间[#000000]就会发动超能。") },
            { 239, new TwewyPin(239,  "badge_240", @"Tin Pin Artist", @"マーブル・アート", @"Atizapín Artista", @"Artista di Tin Pin", @"Tin Pin Künstler", @"Artiste Tin Pin", @"藝術徽章", @"激撞徽章·艺术", @"A special Tin Pin used in slam-offs. This rare design was [#FF0000]never meant to hit store shelves[#000000]. [#FF0000]Slash empty space[#000000] to activate the pin's psych.", @"マーブルバッジとよばれる種類のバッジのひとつ\n[#FF0000]発売中止のハズだった[#000000]超レアなマーブルバッジ\n[#FF0000]空間をスラッシュ[#000000]するとサイキックが発動", @"Pin especial utilizado en las justas. Este excepcional diseño [#FF0000]no iba a comercializarse[#000000]. [#FF0000]Corta sobre un espacio vacío[#000000] para activar su psicopoder.", @"Una speciale Tin Pin usata nei tornei. Questo design raro [#FF0000]non era destinato a finire sugli scaffali dei negozi[#000000]. [#FF0000]Sferra un fendente su uno spazio vuoto[#000000] per attivare lo psico della spilla.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Dieses seltene Exemplar [#FF0000]war nie für den gewerblichen Verkauf gedacht[#000000]. Führe einen [#FF0000]Hieb im leeren Raum[#000000] aus, um das Psych des Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Ce design rare n'était [#FF0000]pas censé être commercialisé[#000000]. [#FF0000]Balayez un espace vide[#000000] pour activer son psych.", @"被分類為戰鬥徽章的徽章之一，\n[#FF0000]應該已停止發售的[#000000]超稀有戰鬥徽章。\n[#FF0000]於空間中劃線[#000000]就會發動超能。", @"被分类为战斗徽章的徽章之一，\n[#FF0000]应该已停止发售的[#000000]超稀有战斗徽章。\n[#FF0000]在空间中划线[#000000]就会发动超能。") },
            { 240, new TwewyPin(240,  "badge_241", @"Tin Pin Devil", @"マーブル・デビル", @"Atizapín del Diablo", @"Diavolo di Tin Pin", @"Tin Pin Teufel", @"Démon Tin Pin", @"惡魔徽章", @"激撞徽章·恶魔", @"A special Tin Pin used in slam-offs. The original store packaging read: [#FF0000]\x22Manufactured by Evil.\x22[#000000] [#FF0000]Drag across empty space[#000000] to activate its psych.", @"マーブルバッジとよばれる種類のバッジのひとつ\n[#FF0000]「悪の秘密結社が作ったという設定」[#000000]のデザイン\n[#FF0000]空間をドラッグ[#000000]するとサイキックが発動", @"Pin especial utilizado en las justas. En el embalaje original ponía: [#FF0000]«Fabricado por el mal».[#000000] [#FF0000]Arrastra sobre un espacio vacío[#000000] para activar su psicopoder.", @"Una Tin Pin speciale usata nei tornei. La confezione originale dei negozi recitava: [#FF0000]\x22Creata dal diavolo.\x22[#000000] [#FF0000]Trascina su uno spazio vuoto in orizzontale[#000000] per attivare il suo psico.", @"Ein besonderer Tin Pin, der bei Tin Pin Slammer verwendet wird. Auf der Originalverpackung steht: [#FF0000]\x22Hergestellt vom Bösen\x22[#000000]. [#FF0000]Ziehe im leeren Raum[#000000], um das Psych dieses Pins zu aktivieren.", @"Un badge spécial utilisé dans les tournois. Sur la boîte originale, on pouvait lire : [#FF0000]\x22Fabriqué par le mal\x22[#000000]. [#FF0000]Balayez un espace vide[#000000] pour activer son psych.", @"被分類為戰鬥徽章的徽章之一，\n[#FF0000]設計概念為「組成了邪惡秘密社團的設定」[#000000]。\n[#FF0000]拖曳空間[#000000]就會發動超能。", @"被分类为战斗徽章的徽章之一，\n[#FF0000]设计概念为“组成了邪恶秘密社团的设定”[#000000]。\n[#FF0000]拖拽空间[#000000]就会发动超能。") },
            { 241, new TwewyPin(241,  "badge_242", @"Tin Pin Ifrit", @"マーブル・イフリート", @"Atizapín de Ifrit", @"Ifrit di Tin Pin", @"Tin Pin Ifrit", @"Ifrit Tin Pin", @"伊弗利特徽章", @"激撞徽章·伊夫利特", @"A powerful, top-class Tin Pin bearing the image of a divine beast with dominion over flame. [#FF0000]Tap empty space[#000000] to activate his psych.", @"炎を自在に操るといわれている神獣をデザインした\n最強クラスのマーブルバッジのひとつ\n[#FF0000]空間をタップ[#000000]するとサイキックが発動", @"Poderoso atizapín de primera con la imagen de una bestia divina que domina el fuego. [#FF0000]Toca un espacio vacío[#000000] para activar su psicopoder.", @"Una Tin Pin potente e di prima categoria con l'immagine di una bestia divina che domina le fiamme. [#FF0000]Tocca uno spazio vuoto[#000000] per attivare il suo psico.", @"Ein mächtiger, erstklassiger Tin Pin mit dem Bild eines göttlichen Tiers, das über die Flammen herrscht. [#FF0000]Tippe im leeren Raum[#000000], um sein Psych zu aktivieren.", @"Un badge puissant et de première classe qui représente une bête divine dominant des flammes. [#FF0000]Touchez un espace vide[#000000] pour activer son psych.", @"以能夠自由操控火焰的神獸為主題所設計，\n最強級別的戰鬥徽章之一。\n[#FF0000]點擊空間[#000000]就會發動超能。", @"以能够自由操控火焰的神兽为主题所设计，\n最强级别的战斗徽章之一。\n[#FF0000]点击空间[#000000]就会发动超能。") },
            { 242, new TwewyPin(242,  "badge_243", @"Tin Pin Shiva", @"マーブル・シヴァ", @"Atizapín de Shiva", @"Shiva di Tin Pin", @"Tin Pin Shiva", @"Shiva Tin Pin", @"濕婆徽章", @"激撞徽章·希瓦", @"A powerful, top-class Tin Pin with a cool design worthy of its namesake, the Ice Queen. [#FF0000]Rapidly tap empty space[#000000] to activate her psych.", @"冷ややかなデザインで[#FF0000]「氷の女王」[#000000]と呼ばれる\n最強クラスのマーブルバッジのひとつ\n[#FF0000]空間をタップで連打[#000000]するとサイキックが発動", @"Poderoso atizapín de primera con un impresionante diseño que hace honor a su nombre: Reina Gélida. [#FF0000]Toca repetidamente un espacio vacío[#000000] para activar su psicopoder.", @"Una Tin Pin potente e di prima categoria con un design da brivido degno della sua omonima, la Regina di ghiaccio. [#FF0000]Tocca rapidamente uno spazio vuoto[#000000] per attivare il suo psico.", @"Ein mächtiger, erstklassiger Tin Pin mit einem coolen Design, das der namensgebenden Eiskönigin würdig ist. [#FF0000]Tippe schnell im leeren Raum[#000000], um sein Psych zu aktivieren.", @"Un badge puissant et de première classe avec un design digne de son homonyme, la Reine de glace. [#FF0000]Touchez de manière répétitive un espace vide[#000000] pour activer son psych.", @"因冷冰冰的設計被封為[#FF0000]「冰之女王」[#000000]，\n最強級別的戰鬥徽章之一。\n[#FF0000]連點空間[#000000]就會發動超能。", @"因冷冰冰的设计被封为[#FF0000]“冰之女王”[#000000]，\n最强级别的战斗徽章之一。\n[#FF0000]连点空间[#000000]就会发动超能。") },
            { 243, new TwewyPin(243,  "badge_244", @"Tin Pin Golem", @"マーブル・ゴーレム", @"Atizapín del Gólem", @"Golem di Tin Pin", @"Tin Pin Golem", @"Golem Tin Pin", @"魔像徽章", @"激撞徽章·黄金巨像", @"[#FF0000]Also known as the \x22Hero Pin.\x22[#000000] Too bad people can't see past the toy; this baby is made of real gold. [#FF0000]Scratch empty space[#000000] to activate the pin's psych.", @"[#FF0000]別名「英雄バッジ」[#000000]本当に金で作られているが\nオモチャという認識が強く誰も気がつかないらしい\n[#FF0000]空間をこする[#000000]とサイキックが発動する", @"[#FF0000]Conocido también como el «pin de héroe».[#000000] Lástima que la gente no vea más allá del juguete, pues esta pieza está hecha de oro macizo. [#FF0000]Rasca en un espacio vacío[#000000] para activar su psicopoder.", @"[#FF0000]Alias la \x22Spilla Eroe\x22[#000000] Peccato che le persone non riescano a vedere oltre il giocattolo; questa bellezza è fatta d'oro vero. [#FF0000]Gratta su uno spazio vuoto[#000000] per attivare lo psico della spilla.", @"[#FF0000]Bekannt als der \x22Helden-Pin\x22[#000000]. Leider sehen die Leute nur das Spielzeug, und niemand erkennt, dass der Pin aus echtem Gold besteht. [#FF0000]Kratze im leeren Raum[#000000], um das Psych des Pins zu aktivieren.", @"[#FF0000]Alias le \x22badge du héros\x22.[#000000] Les gens n'y voient qu'un jouet, mais il est en or véritable. [#FF0000]Grattez un espace vide[#000000] pour activer son psych.", @"[#FF0000]別號「英雄徽章」[#000000]，雖然是用真的黃金打造，\n但因為給人類似玩具的印象太過強烈，\n似乎完全沒人發現。\n[#FF0000]摩擦空間[#000000]就會發動超能。", @"[#FF0000]别号“英雄徽章”[#000000]，虽然是用真的黄金打造，\n但因为给人玩具的印象太过强烈，似乎完全没人发现。\n[#FF0000]摩擦空间[#000000]就会发动超能。") },
            { 244, new TwewyPin(244,  "badge_245", @"Tin Pin Bahamut", @"マーブル・バハムート", @"Atizapín de Bahamut", @"Bahamut di Tin Pin", @"Tin Pin Bahamut", @"Bahamut Tin Pin", @"巴哈姆特徽章", @"激撞徽章·巴哈姆特", @"The ultimate Tin Pin, that of the [#FF0000]Wyrmking[#000000]. [#FF0000]Press empty space[#000000] to activate his psych, which Reapers fearfully call [#FF0000]\x22Mega Flare.\x22[#000000]", @"[#FF0000]「竜王」[#000000]とよばれる最強のマーブルバッジ\n[#FF0000]空間をホールド[#000000]するとサイキックが発動\n死神の間では通称[#FF0000]メガフレア[#000000]として恐れられている", @"El atizapín del [#FF0000]Rey Dragón[#000000]. [#FF0000]Pulsa sobre un espacio vacío[#000000] para activar su psicopoder, al que los segadores se refieren temerosos usando el término [#FF0000]«megafulgor»[#000000].", @"La Tin Pin massima, quella del[#FF0000]Re dei serpenti marini[#000000]. [#FF0000]Premi su uno spazio vuoto[#000000] per attivare il suo psico, che i Demoni chiamano timorosamente il[#FF0000]\x22Bagliore estremo\x22[#000000].", @"Dieser ultimative Tin Pin gehört zum [#FF0000]Lindwurmkönig[#000000]. [#FF0000]Drücke im leeren Raum[#000000], um sein Psych zu aktivieren, das die Reaper angsterfüllt [#FF0000]\x22Megafackel\x22[#000000] nennen.", @"Le badge ultime : celui du [#FF0000]Roi dragon[#000000]. [#FF0000]Appuyez sur un espace vide[#000000] pour activer son psych, que les Reapers appellent craintivement la [#FF0000]\x22Super Nova\x22[#000000].", @"稱為[#FF0000]「龍王」[#000000]的最強戰鬥徽章，\n[#FF0000]長按空間[#000000]就會發動超能。\n深受死神敬畏，通稱為[#FF0000]終極烈焰[#000000]。", @"称为[#FF0000]“龙王”[#000000]的最强战斗徽章，\n[#FF0000]长按空间[#000000]就会发动超能。\n深受死神敬畏，通称为[#FF0000]终极烈焰[#000000]。") },
