            { 266, new TwewyPin(266,  "badge_267", @"Pyrokinesis", @"パイロキネシス", @"Piroquinesia", @"Pirocinesi", @"Pyrokinese", @"Pyrokinésie", @"燃炎", @"心灵火", @"[#FF0000]Drag empty space[#000000] to create a path of flame. Inflicts damage on contact.", @"[#FF0000]空間をドラッグ[#000000]することでドラッグした線上に\n炎を走らせ、当たった敵にダメージを与える", @"[#FF0000]Arrastra por un espacio vacío[#000000] para crear una senda de llamas. Inflige daño al impactar.", @"[#FF0000]Trascina su uno spazio vuoto[#000000] per creare un percorso di fiamme. Infligge danno a contatto.", @"[#FF0000]Ziehe im leeren Raum[#000000], damit Flammen aus dem Boden züngeln. Verursacht bei Berührung Schaden.", @"[#FF0000]Balayez un espace vide[#000000] pour créer un chemin de flammes. Inflige des dégâts au contact.", @"[#FF0000]拖曳空間[#000000]會使拖曳過的路線起火，\n給予命中敵人傷害。", @"[#FF0000]拖拽空间[#000000]会使拖曳过的路线\n起火，给予被击中的敌人伤害。") },
            { 267, new TwewyPin(267,  "badge_268", @"Shockwave", @"ショックウェイヴ", @"Onda de Choque", @"Onda d'urto", @"Schockwelle", @"Onde de choc", @"衝擊波", @"冲击波", @"[#FF0000]Slash an enemy[#000000] any distance away and Neku will move in for a horizontal swipe. [#FF0000]Keep slashing[#000000] for a finisher that [#FF0000]knocks the enemy back[#000000].", @"[#FF0000]敵をスラッシュ[#000000]することで移動して斬りつける\n敵がどこにいても攻撃可能で[#FF0000]連続スラッシュ[#000000]すると\n最後に敵を[#FF0000]吹き飛ばす[#000000]", @"[#FF0000]Corta a un enemigo[#000000] a cualquier distancia y Neku se abalanzará para asestarle un espadazo. [#FF0000]Sigue cortando[#000000] para ejecutar un remate que [#FF0000]haga retroceder al enemigo[#000000].", @"[#FF0000]Colpisci un nemico con un fendente[#000000] a qualunque distanza e Neku si avvicinerà per colpirlo orizzontalmente. [#FF0000]Continua a colpire[#000000] per una mossa finale che [#FF0000]respinge[#000000] il nemico.", @"Führe einen [#FF0000]Hieb auf einen Gegner in beliebiger Entfernung[#000000] aus, damit Neku ihn horizontal angreift. [#FF0000]Führe weiter Hiebe aus[#000000], um einen [#FF0000]Finisher[#000000] zu aktivieren, [#FF0000]der den Gegner zurückstößt[#000000].", @"[#FF0000]Balayez un ennemi[#000000] à n'importe quelle distance et Neku ira lui asséner une frappe horizontale. [#FF0000]Continuez à le balayer[#000000] pour infliger un coup final qui [#FF0000]repoussera l'ennemi[#000000].", @"[#FF0000]劃過敵人[#000000]便能移動並使出斬擊。\n無論敵人位於何處皆可攻擊，\n若是[#FF0000]連續劃過敵人[#000000]，\n最後便可將敵人[#FF0000]擊飛[#000000]。", @"[#FF0000]划过敌人[#000000]便能移动并使出斩击。\n无论敌人位于何处皆可攻击，\n若是[#FF0000]连续划过敌人[#000000]，\n最后便可将敌人[#FF0000]击飞[#000000]。") },
            { 268, new TwewyPin(268,  "badge_269", @"Cure Drink", @"キュアドリンク", @"Bebida Curativa", @"Bevanda curativa", @"Heiltrank", @"Boisson de guérison", @"治療藥水", @"治愈之饮", @"[#FF0000]Tap the pin[#000000] to [#FF0000]restore HP[#000000].", @"[#FF0000]バッジをタップ[#000000]すると[#FF0000]ＨＰが回復[#000000]する", @"[#FF0000]Toca el pin[#000000] para [#FF0000]restablecer PV[#000000].", @"[#FF0000]Tocca la spilla[#000000] per [#FF0000]ripristinare i PF[#000000].", @"[#FF0000]Tippe auf den Pin[#000000], um [#FF0000]LP wiederherzustellen[#000000].", @"[#FF0000]Touchez le badge[#000000] pour [#FF0000]restaurer des PV[#000000].", @"[#FF0000]點擊徽章[#000000]便會[#FF0000]恢復ＨＰ[#000000]。", @"[#FF0000]点击徽章[#000000]便会[#FF0000]恢复HP[#000000]。") },
            { 269, new TwewyPin(269,  "badge_270", @"Force Rounds", @"バレットショット", @"Proyectiles de Fuerza", @"Proiettili di forza", @"Machtmunition", @"Cartouches de force", @"子彈射擊", @"气功弹", @"[#FF0000]Tap empty space[#000000] to fire a [#FF0000]bullet[#000000] in that direction. Inflicts damage on contact. Limited range.", @"[#FF0000]空間をタップ[#000000]することでその方向に[#FF0000]弾[#000000]を飛ばし\n当たった敵にダメージを与える\n弾はある程度進むと消える", @"[#FF0000]Toca un espacio vacío[#000000] para disparar una [#FF0000]bala[#000000] en esa dirección. Inflige daño al impactar. Alcance limitado.", @"[#FF0000]Tocca uno spazio vuoto[#000000] per sparare un [#FF0000]proiettile[#000000] in quella direzione. Infligge danno a contatto. Raggio limitato.", @"[#FF0000]Tippe im leeren Raum[#000000], um ein [#FF0000]Geschoss[#000000] in diese Richtung abzufeuern. Verursacht bei Berührung Schaden. Begrenzte Reichweite.", @"[#FF0000]Touchez un espace vide[#000000] pour tirer une [#FF0000]balle[#000000] dans cette direction. Inflige des dégâts au contact. Portée limitée.", @"[#FF0000]點擊空間[#000000]就會朝該方向射出[#FF0000]子彈[#000000]，\n給予命中的敵人傷害。\n子彈前進一定程度就會消失。", @"[#FF0000]点击空间[#000000]就会朝该方向射出[#FF0000]子弹[#000000]，\n给予命中的敌人伤害。\n子弹前进一定程度就会消失。") },
            { 270, new TwewyPin(270,  "badge_271", @"Psychokinesis", @"サイコキネシス", @"Psicoquinesia", @"Psicocinesi", @"Psychokinese", @"Psychokinésie", @"念力", @"意念移物", @"[#FF0000]Slash across obstacles[#000000] like cars and signs to fling them in that direction. Inflicts damage on contact.", @"車や看板等の[#FF0000]障害物をスラッシュ[#000000]することで\nその方向に吹き飛ばし\n当たった敵にダメージを与える", @"[#FF0000]Corta sobre obstáculos[#000000], como coches y señales, para lanzarlos en esa dirección. Inflige daño al impactar.", @"[#FF0000]Colpisci con un fendente gli ostacoli[#000000] come auto e insegne per lanciarli in quella direzione. Infligge danno a contatto.", @"Führe einen [#FF0000]Hieb auf Hindernisse[#000000] wie Autos und Schilder aus, um sie in diese Richtung zu schleudern. Verursacht bei Berührung Schaden.", @"[#FF0000]Balayez des obstacles[#000000] comme des voitures et des panneaux pour les propulser dans cette direction. Inflige des dégâts au contact.", @"[#FF0000]劃過障礙物[#000000]如車子或招牌，\n就會朝該方向飛去，給予命中的敵人傷害。", @"[#FF0000]划过障碍物[#000000]如车子或招牌，就会朝\n该方向飞去，\n给予命中的敌人伤害。") },
            { 271, new TwewyPin(271,  "badge_272", @"Thunderbolt", @"サンダーボルト", @"Rayo", @"Fulmine", @"Donnerkeil", @"Tonnerre", @"雷擊", @"电光一闪", @"[#FF0000]Tap an enemy[#000000] to strike it with lightning. [#FF0000]Tap additional enemies[#000000] while the lightning flashes for a [#FF0000]combo[#000000].", @"[#FF0000]敵をタップ[#000000]することでその敵に雷を落とし攻撃する\n雷が出ている間に[#FF0000]さらに別の敵をタップ[#000000]することで\n複数の敵に[#FF0000]連続攻撃[#000000]が可能", @"[#FF0000]Toca a un enemigo[#000000] para que le parta un rayo. [#FF0000]Toca a más enemigos[#000000] mientras el rayo destella para hacer un [#FF0000]combo[#000000].", @"[#FF0000]Tocca un nemico[#000000] per colpirlo con una saetta. [#FF0000]Tocca altri nemici[#000000] mentre la saetta lampeggia per ottenere una [#FF0000]combo[#000000].", @"[#FF0000]Tippe auf einen Gegner[#000000], um ihn mit einem Blitz anzugreifen. [#FF0000]Tippe auf zusätzliche Gegner[#000000], während der Blitz aktiv ist, um eine [#FF0000]Kombo[#000000] durchzuführen.", @"[#FF0000]Touchez un ennemi[#000000] pour le foudroyer. [#FF0000]Touchez d'autres ennemis[#000000] pendant que l'éclair s'abat pour faire un [#FF0000]combo[#000000].", @"[#FF0000]點擊敵人[#000000]便會對其使出落雷攻擊。\n若在雷電降下的期間[#FF0000]點擊其他敵人[#000000]，\n便可[#FF0000]連續攻擊[#000000]複數敵人。", @"[#FF0000]点击敌人[#000000]便会对其使出落雷攻击。\n若在雷电降下的期间[#FF0000]点击其他敌人[#000000]，\n便可[#FF0000]连续攻击[#000000]多名敌人。") },
            { 272, new TwewyPin(272,  "badge_273", @"The Eyes Have It", @"女だったら目で勝負", @"En la Mirada", @"La ragione agli occhi", @"Die Augen machen's", @"Philtre d'amour", @"女孩就是要靠眼神", @"迷人眼神", @"A rare pin often seen changing hands among lady Reapers. Wear it to win another's heart. [#FF0000]Rapidly tap an enemy[#000000] to activate the pin's psych.", @"女性の死神たちの間で取引されているレアなバッジ\n身に着けていると「恋が叶う」と言われている\n[#FF0000]敵をタップで連打し続ける[#000000]とサイキックが発動", @"Pin raro que suele cambiar de mano entre las segadoras. Póntelo para ganarte el corazón de otra persona. [#FF0000]Toca repetidamente a un enemigo[#000000] para activar su psicopoder.", @"Una spilla rara vista spesso passare di mano in mano tra le Demoni donna. Indossala per vincere il cuore di un altro. [#FF0000]Tocca rapidamente un nemico[#000000] per attivare lo psico della spilla.", @"Ein seltener Pin, den häufig weibliche Reaper untereinander tauschen. Trage ihn, um das Herz deines Gegenübers zu gewinnen. [#FF0000]Tippe schnell auf einen Gegner[#000000], um das Psych des Pins zu aktivieren.", @"Un badge rare que s'échangent souvent les membres féminines des Reapers. Portez-le pour gagner le cœur de l'être aimé. [#FF0000]Touchez de manière répétitive un ennemi[#000000] pour activer son psych.", @"在女性死神之間進行交易的稀有徽章，\n據說只要戴在身上就能「戀情順遂」。\n[#FF0000]持續連點敵人[#000000]就會發動超能。", @"在女性死神之间进行交易的稀有徽章，\n据说只要戴在身上就能“恋情顺遂”。\n[#FF0000]持续连点敌人[#000000]就会发动超能。") },
            { 273, new TwewyPin(273,  "badge_274", @"I Live for Food", @"食べることが大好き", @"Vivir para Comer", @"Vivo per il cibo", @"Ich lebe fürs Essen", @"Je vis pour la bouffe", @"就愛吃美食", @"我为食狂", @"A pin designed by a Reaper with a constant craving for curry 'n' rice. Wear it and you'll always have room for more. [#FF0000]Tap the pin[#000000] to restore HP.", @"カレー好きの死神によってデザインされたバッジ\n着けていると本当におなかが空くような気がする\n[#FF0000]バッジをタップ[#000000]すると[#FF0000]ＨＰが回復[#000000]する", @"Pin diseñado por un segador al que le chifla el arroz al curri. Si te lo pones, siempre tendrás hueco para más. [#FF0000]Toca el pin[#000000] para restablecer PV.", @"Una spilla progettata da un Demone con un desiderio costante di riso e curry. Indossala e avrai sempre spazio per altro. [#FF0000]Tocca la spilla[#000000] per ripristinare PF.", @"Ein Pin, der von einem Reaper mit Heißhunger auf Curry mit Reis entwickelt wurde. Trage ihn, damit immer Platz für einen Happen mehr ist. [#FF0000]Tippe auf den Pin[#000000], um LP wiederherzustellen.", @"Un badge conçu par un Reaper obsédé par le curry. Portez-le et vous aurez toujours de la place dans l'estomac. [#FF0000]Touchez le badge[#000000] pour restaurer des PV.", @"喜愛咖哩的死神設計出來的徽章，\n戴上之後會感受到真正的飢餓。\n[#FF0000]點擊徽章[#000000]就會[#FF0000]恢復ＨＰ[#000000]。", @"喜爱咖哩的死神设计出来的徽章，\n戴上之后会感受到真正的饥饿。\n[#FF0000]点击徽章[#000000]就会[#FF0000]恢复HP[#000000]。") },
            { 274, new TwewyPin(274,  "badge_275", @"Walk On, Walk Off", @"健康を考えておでかけ", @"Ida y Venida", @"Andare e venire", @"Auf und davon", @"Promenade de santé", @"為了健康出門走走", @"全民健身", @"A pin crafted by a Reaper who loves a good stroll. Wear this and life becomes a walk in the park. [#FF0000]Drag Neku[#000000] into a dash and he will vanish, rendering himself [#FF0000]impervious[#000000] to enemy attack.", @"おさんぽすることが大好きな死神がデザインした\nバッジ　着けていると元気いっぱいになる気がする\n[#FF0000]ネクをドラッグ[#000000]してダッシュさせると\nその間ネクの姿が消え、敵の攻撃を回避できる", @"Pin creado por un segador al que le encanta pasear. Si te lo pones, la vida te resultará un auténtico paseo. [#FF0000]Arrastra a Neku[#000000] para que acelere y desparecerá, volviéndose [#FF0000]inmune[#000000] al ataque enemigo.", @"Una spilla creata da un Demone a cui piace andare a passeggio. Indossala e la vita diventerà... una passeggiata. [#FF0000]Trascina Neku[#000000] in uno scatto e svanirà, rendendosi insensibile agli attacchi nemici.", @"Ein Pin, der von einem Reaper entwickelt wurde, der gerne wandert. Trage ihn, damit dein Leben ein Spaziergang wird. [#FF0000]Ziehe Neku[#000000], damit er sprintet und verschwindet, dadurch kann er gegnerischen Angriffen [#FF0000]ausweichen[#000000].", @"Un badge conçu par un Reaper amateur de balades. Portez-le et votre vie deviendra une promenade de santé. [#FF0000]Faites glisser Neku[#000000] pour qu'il sprinte : il disparaîtra en devenant alors [#FF0000]insensible[#000000] aux attaques ennemies.", @"最愛散步的死神所設計的徽章，\n戴上之後會產生充滿精力的感覺。\n[#FF0000]拖曳音操[#000000]使其進行衝刺時，\n衝刺期間內音操會消失不見，藉此閃避敵人攻擊。", @"最爱散步的死神所设计的徽章，\n戴上之后会产生充满精力的感觉。\n[#FF0000]拖曳音操[#000000]使其进行冲刺时，\n冲刺期间内音操会消失不见，藉此闪避敌人攻击。") },
            { 275, new TwewyPin(275,  "badge_276", @"Me Time is Free Time", @"ひとりでいると落ち着く", @"Tiempo Personal", @"Il mio tempo è libero", @"Zeit für mich selbst", @"Mon temps est libre", @"獨處時感到平靜", @"自得清净", @"\x22I'm not antisocial. I'm introspective,\x22 muses this pin's Reaper designer. [#FF0000]Press empty space[#000000] to activate the pin's psych.", @"みんなのことは嫌いじゃないけど、たまには一人も\n悪くないよね？と、思っている死神がデザインした\nバッジ　[#FF0000]空間をホールド[#000000]するとサイキックが発動", @"«No soy insociable, soy introspectivo», reflexiona el segador que diseñó este pin. [#FF0000]Pulsa sobre un espacio vacío[#000000] para activar su psicopoder.", @"\x22Non sono asociale. Sono introspettivo\x22, sostiene il disegnatore di questa spilla. [#FF0000]Premi su uno spazio vuoto[#000000] per attivare lo psico della spilla.", @"\x22Ich bin nicht unsozial. Ich gehe nur gern in mich\x22, philosophiert der Reaper, der diesen Pin entwickelt hat. [#FF0000]Drücke im leeren Raum[#000000], um das Psych des Pins zu aktivieren.", @"\x22Je ne suis pas antisocial, je suis introspectif\x22 pourrait être la devise du Reaper qui a conçu ce badge. [#FF0000]Appuyez sur un espace vide[#000000] pour activer son psych.", @"「雖然不討厭大家，但偶爾一個人也不錯」\n有這種想法的死神所設計的徽章。\n[#FF0000]長按空間[#000000]就會發動超能。", @"“虽然不讨厌大家，但偶尔一个人也不错”\n有这种想法的死神所设计的徽章。\n[#FF0000]长按空间[#000000]就会发动超能。") },
            { 276, new TwewyPin(276,  "badge_277", @"Fuji Yama", @"フジヤマ", @"Fujisan", @"Fuji Yama", @"Fuji", @"Fuji Yama", @"富士山", @"富士山", @"A pin themed after majestic \x22Fuji Yama,\x22 Japan's tallest and oft-misnomered mountain. [#FF0000]Rapidly tap empty space[#000000] to activate its psych.", @"日本で一番高い山、「フジヤマ」をモチーフに\nデザインされたバッジ\n[#FF0000]空間をタップで連打[#000000]するとサイキックが発動する", @"Pin dedicado al majestuoso Fujisan, el pico más alto de Japón cuyo nombre se confunde con frecuencia. [#FF0000]Toca repetidamente un espacio vacío[#000000] para activar su psicopoder.", @"Una spilla ispirata al maestoso \x22Fuji Yama\x22, la più alta montagna giapponese spesso chiamata impropriamente. [#FF0000]Tocca rapidamente uno spazio vuoto[#000000] per attivare il suo psico.", @"Ein Pin, dessen Motiv der majestätische Fuji ist, Japans höchster und oft falsch benannter Berg. [#FF0000]Tippe schnell im leeren Raum[#000000], um sein Psych zu aktivieren.", @"Un badge inspiré du majestueux mont Fuji, la plus haute montagne du Japon. [#FF0000]Touchez de manière répétitive un espace vide[#000000] pour activer son psych.", @"以日本最高山「富士山」為設計概念的徽章。\n[#FF0000]連點空間[#000000]就會發動超能。", @"以日本最高山“富士山”\n为设计概念的徽章。\n[#FF0000]连点空间[#000000]就会发动超能。") },
            { 277, new TwewyPin(277,  "badge_278", @"Daruma", @"ダルマ", @"Daruma", @"Daruma", @"Daruma", @"Daruma", @"不倒翁", @"不倒翁", @"A pin themed after the roly-poly Daruma, a traditional Japanese wish doll. [#FF0000]Draw a circle in empty space[#000000] to activate its psych.", @"日本古来より伝わる祈願成就の人形「ダルマ」を\nモチーフにデザインされたバッジ\n[#FF0000]空間に円を描く[#000000]とサイキックが発動する", @"Pin dedicado a la regordeta Daruma, tradicional muñeca japonesa. [#FF0000]Traza un círculo en un espacio vacío[#000000] para activar su psicopoder.", @"Una spilla ispirata alla rotonda Daruma, la tradizionale bambola giapponese dei desideri. [#FF0000]Traccia un cerchio in uno spazio vuoto[#000000] per attivare il suo psico.", @"Ein Pin, dessen Motiv der kugelrunde Daruma ist, eine traditionelle japanische Wunschpuppe. [#FF0000]Ziehe einen Kreis im leeren Raum[#000000], um sein Psych zu aktivieren.", @"Un badge inspiré d'un daruma rondouillard, un porte-bonheur traditionnel japonais. [#FF0000]Tracez un cercle dans un espace vide[#000000] pour activer son psych.", @"以日本自古相傳，能讓人實現願望的人偶\n「不倒翁」為設計概念的徽章。\n[#FF0000]在空間畫圓[#000000]>就會發動超能。", @"以日本自古相传，能让人实现愿望的人偶\n“不倒翁”为设计概念的徽章。\n[#FF0000]在空间画圆[#000000]就会发动超能。") },
            { 278, new TwewyPin(278,  "badge_279", @"Sushi", @"スシ", @"Sushi", @"Sushi", @"Sushi", @"Sushi", @"壽司", @"寿司", @"A pin themed after sushi, that traditional Japanese marriage of raw fish 'n' rice. Mmm! [#FF0000]Rapidly tap an enemy[#000000] to activate its psych.", @"日本古来より伝わる魚介と米を組みあわせた食べ物\n「スシ」をモチーフにデザインされたバッジ\n[#FF0000]敵をタップで連打[#000000]するとサイキックが発動する", @"Pin de temática sushi, la tradicional combinación japonesa de pescado y arroz. ¡Ñam! [#FF0000]Toca repetidamente a un enemigo[#000000] para activar su psicopoder.", @"Una spilla ispirata al sushi, il tradizionale matrimonio giapponese tra il pesce crudo e il riso. Mmm! [#FF0000]Tocca rapidamente un nemico[#000000] per attivare il suo psico.", @"Ein Pin, dessen Motiv Sushi ist, die japanische Kombination aus rohem Fisch und Reis. Lecker! [#FF0000]Tippe schnell auf einen Gegner[#000000], um sein Psych zu aktivieren.", @"Un badge sur le thème du sushi, ce plat traditionnel japonais mariant le poisson cru et le riz. [#FF0000]Touchez de manière répétitive un ennemi[#000000] pour activer son psych.", @"以日本自古相傳，由海鮮和米飯組成的食物\n「壽司」為設計概念的徽章。\n[#FF0000]連點敵人[#000000]就會發動超能。", @"以日本自古相传，由海鲜和米饭组成的食物\n“寿司”为设计概念的徽章。\n[#FF0000]连点敌人[#000000]就会发动超能。") },
            { 279, new TwewyPin(279,  "badge_280", @"Shinobi", @"シノビ", @"Shinobi", @"Shinobi", @"Shinobi", @"Shinobi", @"忍", @"忍", @"A pin themed around the traditional Japanese character meaning \x22deadly ninja awesomeness.\x22 [#FF0000]Slash across Neku[#000000] to activate its psych.", @"日本の文字「忍」をモチーフにしたバッジ\nそのデザインは古来の暗殺者「忍者」を思わせる\n[#FF0000]ネクをスラッシュ[#000000]するとサイキックが発動する", @"Pin diseñado en torno al personaje tradicional chino cuyo nombre significa «genialidad del letal ninja». [#FF0000]Corta sobre Neku[#000000] para activar su psicopoder.", @"Una spilla ispirata alla tradizionale filosofia giapponese del SUPERNINJA! [#FF0000]Colpisci Neku con un fendente[#000000] per attivare il suo psico.", @"Ein Pin, dessen Motiv das traditionelle japanische Zeichen für \x22tödlich starke Ninja-Krassheit\x22 ist. Führe einen [#FF0000]Hieb auf Neku[#000000] aus, um sein Psych zu aktivieren.", @"Un badge inspiré de la tradition japonaise super cool du ninja. [#FF0000]Balayez Neku[#000000] pour activer son psych.", @"以日本文字「忍」為設計概念的徽章，\n此徽章令人聯想到自古以來的暗殺者「忍者」。\n[#FF0000]劃過音操[#000000]就會發動超能。", @"以日本文字“忍”为设计概念的徽章，\n此徽章令人联想到自古以来的暗杀者“忍者”。\n[#FF0000]划过音操[#000000]就会发动超能。") },
            { 280, new TwewyPin(280,  "badge_281", @"Tigris", @"ティグリス", @"Tigris", @"Tigre", @"Tigris", @"Tigris", @"老虎", @"老虎", @"[#FF0000]Rapidly tap empty space[#000000] to form three icicles. Inflicts damage on contact.", @"[#FF0000]空間をタップで連打[#000000]すると３本の\nツララが出現し、当たった敵にダメージを与える", @"[#FF0000]Toca repetidamente un espacio vacío[#000000] para formar tres carámbanos. Inflige daño al impactar.", @"[#FF0000]Tocca rapidamente uno spazio vuoto[#000000] per formare tre stalattiti. Infligge danno a contatto.", @"[#FF0000]Tippe schnell im leeren Raum[#000000], um drei Eiszapfen zu erschaffen. Verursacht bei Berührung Schaden.", @"[#FF0000]Touchez de manière répétitive un espace vide[#000000] pour créer trois stalactites. Inflige des dégâts au contact.", @"[#FF0000]連點空間[#000000]，\n就會出現３根冰柱，給予命中的敵人傷害。", @"[#FF0000]连点空间[#000000]，就会出现3根冰柱，\n给予命中的敌人伤害。") },
            { 281, new TwewyPin(281,  "badge_282", @"Corehog", @"ヘッジ", @"Puercoespín", @"Istrice", @"Corestachler", @"Héricore", @"豪豬", @"豪猪", @"[#FF0000]Press empty space[#000000] to launch a bullet in that direction which [#FF0000]fragments on enemy collision[#000000]. The fragments also inflict damage on contact.", @"[#FF0000]空間をホールド[#000000]することで\nその方向に[#FF0000]敵に当たると分裂する弾[#000000]を発射する\n分裂した弾も当たった敵にダメージを与える", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para disparar una bala en esa dirección que se [#FF0000]fragmenta al alcanzar al enemigo[#000000]. Los fragmentos también infligen daño al impactar.", @"[#FF0000]Premi su uno spazio vuoto[#000000] per lanciare un proiettile in quella direzione che [#FF0000]si frammenterà alla collisione col nemico[#000000]. I frammenti infliggono anche danno a contatto.", @"[#FF0000]Drücke im leeren Raum[#000000], um ein Geschoss in diese Richtung abzufeuern, [#FF0000]das bei Berührung mit einem Gegner zersplittert[#000000]. Die Splitter verursachen bei Berührung ebenfalls Schaden.", @"[#FF0000]Appuyez sur un espace vide[#000000] pour tirer une balle dans cette direction qui [#FF0000]explosera au moment de la collision avec l'ennemi[#000000]. Les éclats infligent également des dégâts au contact.", @"[#FF0000]長按空間[#000000]就會朝該方向\n發射[#FF0000]命中敵人後分裂的子彈[#000000]，\n分裂後的子彈也會給予命中的敵人傷害。", @"[#FF0000]长按空间[#000000]就会朝该方向\n发射[#FF0000]命中敌人后分裂的子弹[#000000]，\n分裂后的子弹也会给予命中的敌人伤害。") },
            { 282, new TwewyPin(282,  "badge_283", @"Jelly", @"ジェリ", @"Medusa", @"Medusa", @"Qualle", @"Méduse", @"水母", @"水母", @"[#FF0000]Scratch empty space[#000000] to generate electricity. Inflicts damage on contact. Keep scratching to [#FF0000]extend range[#000000].", @"[#FF0000]空間をこする[#000000]ことで雷を発生させ\n当たった敵にダメージを与える\nこすればこするほど[#FF0000]雷は大きく広がる[#000000]", @"[#FF0000]Rasca en un espacio vacío[#000000] para generar electricidad. Inflige daño al impactar. Sigue rascando para [#FF0000]ampliar su alcance[#000000].", @"[#FF0000]Gratta uno spazio vuoto[#000000] per generare elettricità. Infligge danno a contatto. Continua a grattare per [#FF0000]aumentare il raggio[#000000].", @"[#FF0000]Kratze im leeren Raum[#000000], um Elektrizität zu erzeugen. Verursacht bei Berührung Schaden. Kratze weiter, [#FF0000]um die Reichweite zu erhöhen[#000000].", @"[#FF0000]Grattez un espace vide[#000000] pour générer de l'électricité. Inflige des dégâts au contact. Continuez de gratter pour [#FF0000]augmenter la portée[#000000].", @"[#FF0000]摩擦空間[#000000]便會打雷，\n給予命中敵人傷害。\n增加摩擦時間即可[#FF0000]擴大雷電範圍[#000000]。", @"[#FF0000]摩擦空间[#000000]便会打雷，\n给予被击中的敌人伤害。\n增加摩擦时间即可[#FF0000]扩大雷电范围[#000000]。") },
            { 283, new TwewyPin(283,  "badge_284", @"Shark", @"シャーク", @"Tiburón", @"Squalo", @"Hai", @"Requin", @"鯊魚", @"鲨鱼", @"[#FF0000]Draw a circle in empty space[#000000] to form a black hole that [#FF0000]sucks enemies in[#000000]. No EXP received. (Some enemies may not be affected.)", @"[#FF0000]空間に円を描く[#000000]ことで、その位置に\n[#FF0000]敵を吸い込む[#000000]ブラックホールを作り出す\nただしＥＸＰはゲットできない(一部の敵には無効)", @"[#FF0000]Traza un círculo en un espacio vacío[#000000] para formar un agujero negro que [#FF0000]succionará a los enemigos[#000000] (algunos podrían no verse afectados). No recibes EXP.", @"[#FF0000]Traccia un cerchio in uno spazio vuoto[#000000] per formare un buco nero che [#FF0000]risucchia i nemici al proprio interno[#000000]. Non si riceve ESP. (Potrebbe non avere effetto su alcuni nemici).", @"[#FF0000]Ziehe einen Kreis im leeren Raum[#000000], um ein schwarzes Loch zu erschaffen, das [#FF0000]Gegner einsaugt[#000000]. Für diese Gegner erhältst du keine EP (Manche Gegner sind möglicherweise immun).", @"[#FF0000]Tracez un cercle dans un espace vide[#000000] pour créer un trou noir qui [#FF0000]aspirera les ennemis[#000000]. Ne génère aucun point d'XP. (Certains ennemis ne seront peut-être pas affectés).", @"[#FF0000]在空間畫圓[#000000]就會在該位置製造出\n[#FF0000]吸進敵人[#000000]的黑洞。\n但無法獲得ＥＸＰ（對部分敵人無效）。", @"[#FF0000]在空间画圆[#000000]就会在该位置制造出\n[#FF0000]吸进敌人[#000000]的黑洞。\n但无法获得EXP（对部分敌人无效）。") },
            { 284, new TwewyPin(284,  "badge_285", @"Leo", @"レオ", @"Leo", @"Leone", @"Leo", @"Leo", @"獅子", @"狮子", @"[#FF0000]Tap empty space[#000000] and Neku will [#FF0000]teleport[#000000] to that location.", @"[#FF0000]空間をタップ[#000000]すると\nその位置にネクが[#FF0000]テレポート[#000000]する", @"[#FF0000]Toca un espacio vacío[#000000] para que Neku se [#FF0000]teletransporte[#000000] a ese lugar.", @"[#FF0000]Tocca uno spazio vuoto[#000000] e Neku si [#FF0000]teletrasporterà[#000000] in quel punto.", @"[#FF0000]Tippe im leeren Raum[#000000], damit Neku sich an diese Position [#FF0000]teleportiert[#000000].", @"[#FF0000]Touchez un espace vide[#000000] et Neku [#FF0000]se téléportera[#000000] à cet endroit.", @"[#FF0000]點擊空間[#000000]\n便會將音操[#FF0000]傳送[#000000]到該位置。", @"[#FF0000]点击空间[#000000]\n便会将音操[#FF0000]瞬移[#000000]到该位置。") },
            { 285, new TwewyPin(285,  "badge_286", @"Ovis", @"オウィス", @"Ovis", @"Ovis", @"Ovis", @"Ovis", @"羊", @"野羊", @"[#FF0000]Tap an enemy[#000000] to strike it with lightning. [#FF0000]Tap additional enemies[#000000] while the lightning flashes for a [#FF0000]combo[#000000].", @"[#FF0000]敵をタップ[#000000]することでその敵に雷を落とし攻撃する\n雷が出ている間に[#FF0000]さらに別の敵をタップ[#000000]することで\n複数の敵に[#FF0000]連続攻撃[#000000]が可能", @"[#FF0000]Toca a un enemigo[#000000] para que le parta un rayo. [#FF0000]Toca a más enemigos[#000000] mientras el rayo destella para hacer un [#FF0000]combo[#000000].", @"[#FF0000]Tocca un nemico[#000000] per colpirlo con una saetta. [#FF0000]Tocca altri nemici[#000000] mentre la saetta lampeggia per ottenere una [#FF0000]combo[#000000].", @"[#FF0000]Tippe auf einen Gegner[#000000], um ihn mit einem Blitz anzugreifen. [#FF0000]Tippe auf zusätzliche Gegner[#000000], während der Blitz aktiv ist, um eine [#FF0000]Kombo[#000000] durchzuführen.", @"[#FF0000]Touchez un ennemi[#000000] pour le foudroyer. [#FF0000]Touchez d'autres ennemis[#000000] pendant que l'éclair s'abat pour faire un [#FF0000]combo[#000000].", @"[#FF0000]點擊敵人[#000000]便會對其使出落雷攻擊。\n若在雷電降下的期間[#FF0000]點擊其他敵人[#000000]，\n便可[#FF0000]連續攻擊[#000000]複數敵人。", @"[#FF0000]点击敌人[#000000]便会对其使出落雷攻击。\n若在雷电降下的期间[#FF0000]点击其他敌人[#000000]，\n便可[#FF0000]连续攻击[#000000]多名敌人。") },
            { 286, new TwewyPin(286,  "badge_287", @"Cornix", @"コルニクス", @"Cornix", @"Cornacchia", @"Cornix", @"Cornix", @"烏鴉", @"巨鸦", @"[#FF0000]Tap empty space[#000000] to drop [#FF0000]five boulders[#000000] on that position. Inflicts damage on contact. Rapidly tap to rain more stones down.", @"[#FF0000]空間をタップ[#000000]すると、その位置に[#FF0000]石が５つ落下[#000000]し\n当たった敵にダメージを与える\n石はゲージの続く限り連続で落とすことができる", @"[#FF0000]Toca un espacio vacío[#000000] para que caigan [#FF0000]cinco rocas[#000000] en esa posición. Inflige daño al impactar. Toca repetidamente para provocar un aluvión de rocas.", @"[#FF0000]Tocca uno spazio vuoto[#000000] per rilasciare [#FF0000]cinque macigni[#000000] in quella posizione. Infligge danno a contatto. Tocca rapidamente per far piovere più pietre.", @"[#FF0000]Tippe im leeren Raum[#000000], um [#FF0000]fünf Felsbrocken[#000000] auf diese Position zu werfen. Verursacht bei Berührung Schaden. Tippe schnell, damit mehr Steine fallen.", @"[#FF0000]Touchez un espace vide[#000000] pour y abattre [#FF0000]cinq rochers[#000000]. Inflige des dégâts au contact. Touchez de manière répétitive pour faire pleuvoir plus de pierres.", @"[#FF0000]點擊空間[#000000]，該位置便會[#FF0000]掉落５顆石塊[#000000]，\n給予命中敵人傷害。\n可使石塊連續落下直至計量表耗盡。", @"[#FF0000]点击空间[#000000]，该位置便会[#FF0000]掉落5颗石块[#000000]，\n给予被击中的敌人伤害。\n可使石块连续落下直至计量表耗尽。") },
            { 287, new TwewyPin(287,  "badge_288", @"Popguin", @"ペンギ", @"Popgüino", @"Popguino", @"Popguin", @"Pingouin pop", @"企鵝", @"企鹅", @"[#FF0000]Tap empty space[#000000] to fire a [#FF0000]penetrating bullet[#000000] in that direction. Inflicts damage on contact.", @"[#FF0000]空間をタップ[#000000]することで\nその方向に[#FF0000]貫通弾[#000000]を飛ばし\n当たった敵にダメージを与える", @"[#FF0000]Toca un espacio vacío[#000000] para disparar una [#FF0000]bala penetrante[#000000] en esa dirección. Inflige daño al impactar.", @"[#FF0000]Tocca uno spazio vuoto[#000000] per sparare un [#FF0000]proiettile penetrante[#000000] in quella direzione. Infligge danno a contatto.", @"[#FF0000]Tippe im leeren Raum[#000000], um ein [#FF0000]durchdringendes Geschoss[#000000] in diese Richtung abzufeuern. Verursacht bei Berührung Schaden.", @"[#FF0000]Touchez un espace vide[#000000] pour tirer une [#FF0000]balle pénétrante[#000000] dans cette direction. Inflige des dégâts au contact.", @"[#FF0000]點擊空間[#000000]就會朝該方向\n射出[#FF0000]貫穿彈[#000000]，\n給予命中的敵人傷害。", @"[#FF0000]点击空间[#000000]就会朝该方向\n射出[#FF0000]贯穿弹[#000000]，\n给予命中的敌人伤害。") },
            { 288, new TwewyPin(288,  "badge_289", @"Pteropus", @"プテロプス", @"Pteropus", @"Volpe volante", @"Pteropus", @"Pteropus", @"狐蝠", @"狐蝠", @"[#FF0000]Tap empty space[#000000] to fire a [#FF0000]penetrating boomerang[#000000] in that direction. Inflicts damage on contact.", @"[#FF0000]空間をタップ[#000000]することで\nその方向に[#FF0000]貫通ブーメラン弾[#000000]を飛ばし\n当たった敵にダメージを与える", @"[#FF0000]Toca un espacio vacío[#000000] para lanzar un [#FF0000]bumerán penetrante[#000000] en esa dirección. Inflige daño al impactar.", @"[#FF0000]Tocca uno spazio vuoto[#000000] per sparare un [#FF0000]boomerang penetrante[#000000] in quella direzione. Infligge danno a contatto.", @"[#FF0000]Tippe im leeren Raum[#000000], um einen [#FF0000]durchdringenden Bumerang[#000000] in diese Richtung abzufeuern. Verursacht bei Berührung Schaden.", @"[#FF0000]Touchez un espace vide[#000000] pour tirer un [#FF0000]boomerang pénétrant[#000000] dans cette direction. Inflige des dégâts au contact.", @"[#FF0000]點擊空間[#000000]就會朝該方向\n射出[#FF0000]貫穿迴力彈[#000000]，\n給予命中的敵人傷害。", @"[#FF0000]点击空间[#000000]就会朝该方向\n射出[#FF0000]贯穿回力弹[#000000]，给予命中的敌人\n伤害。") },
            { 289, new TwewyPin(289,  "badge_290", @"Mink", @"ミンク", @"Visón", @"Visone", @"Nerz", @"Vison", @"鼬鼠", @"鼬鼠", @"[#FF0000]Scratch empty space[#000000] to start a whirlwind. Inflicts damage on all enemies and always [#FF0000]Immobilizes[#000000] them. (Some enemies may be immune.)", @"[#FF0000]空間をこする[#000000]と竜巻が発生し\nすべての敵にダメージを与えると\n同時に確実に状態異常[#FF0000]行動不能[#000000]にする\n(一部の敵をのぞく)", @"[#FF0000]Rasca en un espacio vacío[#000000] para provocar un torbellino. Inflige daño en todos los enemigos y siempre los [#FF0000]inmoviliza[#000000] (algunos podrían ser inmunes).", @"[#FF0000]Gratta su uno spazio vuoto[#000000] per creare una tromba d'aria. Infligge danno a tutti i nemici e li [#FF0000]immobilizza[#000000] sempre. (Alcuni nemici potrebbero esserne immuni).", @"[#FF0000]Kratze im leeren Raum[#000000], um einen Wirbelsturm zu erzeugen. Verursacht Schaden und [#FF0000]Unbeweglichkeit[#000000] bei allen Gegnern (Manche Gegner sind möglicherweise immun).", @"[#FF0000]Grattez un espace vide[#000000] pour créer un tourbillon. Inflige des dégâts à tous les ennemis et les [#FF0000]immobilise[#000000] systématiquement. (Certains ennemis peuvent être immunisés).", @"[#FF0000]摩擦空間[#000000]就會發生龍捲風，\n給予所有敵人傷害，\n同時一定會使之陷入異常狀態\n[#FF0000]無法行動[#000000]\n（部分敵人除外）。", @"[#FF0000]摩擦空间[#000000]就会发生龙卷风，\n给予所有敌人伤害，\n同时一定会使之陷入状态异常\n[#FF0000]无法行动[#000000]（部分敌人除外）。") },
            { 290, new TwewyPin(290,  "badge_291", @"Boomer", @"ブーマー", @"Cangu", @"Canguro", @"Boomer", @"Kangourou", @"袋鼠", @"袋鼠", @"[#FF0000]Slash vertically down on an enemy[#000000] and Neku will teleport above it and attack with a [#FF0000]downward stab[#000000].", @"[#FF0000]敵を上から下にスラッシュ[#000000]することで\nその敵の頭上にテレポートし[#FF0000]下突き攻撃[#000000]を行う", @"[#FF0000]Corta verticalmente hacia abajo a un enemigo[#000000] para que Neku se teletransporte sobre él y le ataque con una [#FF0000]puñalada descendente[#000000].", @"[#FF0000]Colpisci un nemico con un fendente verticale verso il basso[#000000] e Neku si teletrasporterà su di lui e attaccherà con un [#FF0000]fendente verso il basso[#000000].", @"Führe einen [#FF0000]Hieb auf einen Gegner von oben nach unten[#000000] aus, damit Neku sich über ihn teleportiert und mit einem [#FF0000]Hieb nach unten[#000000] angreift.", @"[#FF0000]Balayez un ennemi vers le bas[#000000] et Neku se téléportera au-dessus de lui avant de lui asséner un [#FF0000]coup de couteau vers le bas[#000000].", @"[#FF0000]由上往下劃過敵人[#000000]，\n便能傳送至該敵人上方使出[#FF0000]向下戳刺攻擊[#000000]。", @"[#FF0000]由上往下划过敌人[#000000]，\n便能瞬移至该敌人上方使出[#FF0000]向下戳刺攻击[#000000]。") },
            { 291, new TwewyPin(291,  "badge_292", @"Sprog", @"タッド", @"Renacuajo", @"Girino", @"Spross", @"Têtard", @"蝌蚪", @"蝌蚪", @"[#FF0000]Press an enemy[#000000] to encase it in ice and stop it from moving. (Some enemies may not be affected.)", @"[#FF0000]敵をホールド[#000000]することで氷づけにし\nその敵の動きを止める(一部の敵をのぞく)", @"[#FF0000]Pulsa sobre un enemigo[#000000] para encerrarlo entre hielo e impedir que se mueva (algunos enemigos podrían no verse afectados).", @"[#FF0000]Premi su un nemico[#000000] per ricoprirlo di ghiaccio e impedirgli di muoversi. (Potrebbe non avere effetto su alcuni nemici).", @"[#FF0000]Drücke auf einen Gegner[#000000], um ihn in Eis einzuschließen, damit er sich nicht mehr bewegen kann (Manche Gegner sind möglicherweise immun).", @"[#FF0000]Appuyez sur un ennemi[#000000] pour l'immobiliser dans la glace. (Certains ennemis ne seront peut-être pas affectés).", @"[#FF0000]長按敵人[#000000]便會使其冰凍，\n停止動作（部分敵人除外）。", @"[#FF0000]长按敌人[#000000]便会使其冰冻，\n停止动作（部分敌人除外）。") },
            { 292, new TwewyPin(292,  "badge_293", @"Fox", @"フォックス", @"Zorro", @"Volpe", @"Fuchs", @"Renard", @"狐狸", @"狐狸", @"[#FF0000]Slash across Neku[#000000] to launch a small flame orb in that direction. Inflicts damage on contact. Orbs [#FF0000]rebound off walls and enemies[#000000].", @"[#FF0000]ネクをスラッシュ[#000000]することで\nその方向に小さな炎の球を飛ばす\n炎の球は[#FF0000]敵や壁に当たると反射[#000000]する", @"[#FF0000]Corta sobre Neku[#000000] para lanzar una pequeña esfera de fuego en esa dirección. Inflige daño al impactar. Las esferas [#FF0000]rebotan en las paredes y los enemigos[#000000].", @"[#FF0000]Colpisci Neku con un fendente[#000000] per lanciare una piccola sfera di fuoco in quella direzione. Infligge danno a contatto. Le sfere [#FF0000]rimbalzano sui muri e sui nemici[#000000].", @"Führe einen [#FF0000]Hieb auf Neku[#000000] aus, um eine kleine Flammenkugel in diese Richtung abzufeuern. Verursacht bei Berührung Schaden. Kugeln [#FF0000]prallen von Mauern und Gegnern ab[#000000].", @"[#FF0000]Balayez Neku[#000000] pour lancer un petit orbe de feu dans cette direction. Inflige des dégâts au contact. Les orbes [#FF0000]rebondissent sur les murs et les ennemis[#000000].", @"[#FF0000]劃過音操[#000000]\n就會朝該方向射出小火球。\n火球[#FF0000]碰到敵人或牆壁就會反彈[#000000]。", @"[#FF0000]划过音操[#000000]就会朝\n该方向射出小火球。\n火球[#FF0000]碰到敌人或墙壁就会反弹[#000000]。") },
            { 293, new TwewyPin(293,  "badge_294", @"Bat", @"バット", @"Murciélago", @"Pipistrello", @"Fledermaus", @"Chauve-souris", @"蝙蝠", @"蝙蝠", @"[#FF0000]Slash across Neku[#000000] to fire a [#FF0000]two-way penetrating boomerang[#000000] in that direction. Inflicts damage on contact.", @"[#FF0000]ネクをスラッシュ[#000000]することで\nその方向に[#FF0000]２方向貫通ブーメラン弾[#000000]を飛ばし\n当たった敵にダメージを与える", @"[#FF0000]Corta sobre Neku[#000000] para lanzar un [#FF0000]bumerán penetrante doble[#000000] en esa dirección. Inflige daño al impactar.", @"[#FF0000]Colpisci Neku con un fendente[#000000] per sparare un [#FF0000]boomerang penetrante doppio[#000000] in quella direzione. Infligge danno a contatto.", @"Führe einen [#FF0000]Hieb auf Neku[#000000] aus, um einen [#FF0000]durchdringenden Doppelbumerang[#000000] in diese Richtung abzufeuern. Verursacht bei Berührung Schaden.", @"[#FF0000]Balayez Neku[#000000] pour lancer un [#FF0000]boomerang pénétrant double[#000000] dans cette direction. Inflige des dégâts au contact.", @"[#FF0000]劃過音操[#000000]\n就會朝該方向射出[#FF0000]２方向貫穿迴力彈[#000000]，\n給予命中的敵人傷害。", @"[#FF0000]划过音操[#000000]就会朝\n该方向射出[#FF0000]2方向贯穿回力弹[#000000]，\n给予命中的敌人伤害。") },
            { 294, new TwewyPin(294,  "badge_295", @"Rhino", @"ライノ", @"Rinoceronte", @"Rinoceronte", @"Nashorn", @"Rhinocéros", @"犀牛", @"犀牛", @"[#FF0000]Press Neku and release[#000000] to unleash a [#FF0000]vicious slicing attack[#000000]. Neku will be unable to move mid-press, but [#FF0000]longer presses yield more power[#000000].", @"[#FF0000]ネクをホールドしてから離す[#000000]ことで\n[#FF0000]強力な斬り攻撃[#000000]を出すことができる\nホールド中は移動不可だが[#FF0000]時間に応じて\n威力アップ[#000000]", @"[#FF0000]Pulsa sobre Neku y levanta el dedo[#000000] para lanzar un [#FF0000]violento ataque cortante[#000000]. Neku no podrá moverse mientras lo pulsas, pero [#FF0000]cuanto más tiempo lo tengas pulsado, más potente será el ataque[#000000].", @"[#FF0000]Premi Neku e rilascia[#000000] per lanciare un [#FF0000]feroce fendente[#000000]. Neku non potrà muoversi mentre tieni premuto, ma la potenza aumenta [#FF0000]all'aumentare della durata della pressione[#000000].", @"[#FF0000]Drücke auf Neku und lasse los[#000000], um einen [#FF0000]wilden Schnetzelangriff[#000000] zu entfesseln. Neku kann sich nicht bewegen, während du gedrückt hältst, aber [#FF0000]je länger du drückst[#000000], [#FF0000]desto stärker ist der Angriff[#000000].", @"[#FF0000]Appuyez sur Neku et relâchez[#000000] pour lancer une [#FF0000]attaque tranchante brutale[#000000]. Neku ne pourra pas se déplacer pendant que vous appuyez, mais les [#FF0000]pressions plus longues généreront plus de puissance[#000000].", @"[#FF0000]長按音操後放開[#000000]便可使出\n[#FF0000]強力斬擊[#000000]，\n長按時雖然無法移動，[#FF0000]但時間越久，\n威力越大[#000000]。", @"[#FF0000]长按音操后放开[#000000]便可使出\n[#FF0000]强力斩击[#000000]，\n长按时虽然无法移动，[#FF0000]但时间越久，\n威力越大[#000000]。") },
            { 295, new TwewyPin(295,  "badge_296", @"Shrew", @"モル", @"Musaraña", @"Toporagno", @"Spitzmaus", @"Musaraigne", @"鼴鼠", @"鼹鼠", @"[#FF0000]Tap empty space[#000000] to place a bomb in that location which [#FF0000]explodes after a set amount of time[#000000].", @"[#FF0000]空間をタップ[#000000]すると、その位置に\n[#FF0000]一定時間後に爆発する爆弾[#000000]を設置する", @"[#FF0000]Toca un espacio vacío[#000000] para colocar en ese lugar una bomba que [#FF0000]estalla transcurrido un tiempo[#000000].", @"[#FF0000]Tocca uno spazio vuoto[#000000] per piazzarci una bomba che [#FF0000]esploderà dopo un dato lasso di tempo[#000000].", @"[#FF0000]Tippe im leeren Raum[#000000], um eine Bombe an dieser Position zu platzieren, die [#FF0000]nach einer bestimmten Zeit explodiert[#000000].", @"[#FF0000]Touchez un espace vide[#000000] pour placer une bombe à cet endroit qui [#FF0000]explosera après une durée déterminée[#000000].", @"[#FF0000]點擊空間[#000000]便會在該位置設置\n[#FF0000]一段時間後爆炸的炸彈[#000000]。", @"[#FF0000]点击空间[#000000]便会在该位置设置\n[#FF0000]一段时间后爆炸的炸弹[#000000]。") },
            { 296, new TwewyPin(296,  "badge_297", @"Woolly", @"ステゴ", @"Mamut", @"Elefante", @"Mammut", @"Laineux", @"劍乳齒象", @"剑乳齿象", @"[#FF0000]Scratch empty space[#000000] to cause a tremor. Inflicts damage and sometimes [#FF0000]Immobilizes[#000000] enemies.", @"[#FF0000]空間をこする[#000000]と地面が振動し\n地上にいる敵にダメージを与えると同時に\n一定の確率で状態異常[#FF0000]行動不能[#000000]にする", @"[#FF0000]Rasca en un espacio vacío[#000000] para provocar un temblor. Inflige daño y a veces [#FF0000]inmoviliza[#000000] a los enemigos.", @"[#FF0000]Gratta su uno spazio vuoto[#000000] per causare una scossa. Infligge danno e a volte [#FF0000]immobilizza[#000000] i nemici.", @"[#FF0000]Kratze im leeren Raum[#000000], um ein Beben zu verursachen. Verursacht Schaden und manchmal [#FF0000]Unbeweglichkeit[#000000] bei Gegnern.", @"[#FF0000]Grattez un espace vide[#000000] pour causer une secousse. Inflige des dégâts et [#FF0000]immobilise[#000000] parfois des ennemis.", @"[#FF0000]摩擦空間[#000000]使地面震動，\n給予地面上的敵人傷害，\n同時以一定機率施加異常狀態[#FF0000]無法行動[#000000]。", @"[#FF0000]摩擦空间[#000000]使地面震动，\n给予地面上的敌人伤害，\n同时以一定机率使其陷入状态异常[#FF0000]无法行动[#000000]。") },
            { 297, new TwewyPin(297,  "badge_298", @"Raven", @"レイブン", @"Cuervo", @"Corvo", @"Rabe", @"Corbeau", @"鴉", @"鸦", @"[#FF0000]Drag obstacles[#000000] like cars and signs around. Inflicts damage on contact.", @"車や看板等の[#FF0000]障害物をドラッグ[#000000]で振り回し\n敵に当てるとダメージを与えられる", @"[#FF0000]Arrastra obstáculos[#000000], como coches y señales. Inflige daño al impactar.", @"[#FF0000]Trascina ostacoli[#000000] come auto e insegne. Infligge danno a contatto.", @"[#FF0000]Ziehe Hindernisse[#000000] wie Autos und Schilder herum. Verursacht bei Berührung Schaden.", @"[#FF0000]Faites glisser des obstacles[#000000] comme des voitures et des panneaux. Inflige des dégâts au contact.", @"[#FF0000]拖曳障礙物[#000000]如車子或招牌再進行投擲，\n若擊中敵人便會給予傷害。", @"[#FF0000]拖拽障碍物[#000000]如车子或招牌再进行投掷，\n若击中敌人便会给予伤害。") },
            { 298, new TwewyPin(298,  "badge_299", @"Drake", @"ドラゴ", @"Draco", @"Drago", @"Drache", @"Dragon", @"龍", @"龙", @"[#FF0000]Press empty space[#000000] to create a pillar of fire. Inflicts damage and sometimes [#FF0000]HP Drain[#000000] on contact.", @"[#FF0000]空間をホールド[#000000]することで、その位置に炎の柱を\n発生させ、当たった敵にダメージを与えると\n同時に一定の確率で状態異常[#FF0000]ＨＰ減少[#000000]にする", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para crear una columna de fuego. Inflige daño y a veces provoca la [#FF0000]reducción de PV[#000000] al impactar.", @"[#FF0000]Premi su uno spazio vuoto[#000000] per creare una colonna di fuoco. Infligge danno e a volte [#FF0000]Risucchio di PF[#000000] a contatto.", @"[#FF0000]Drücke im leeren Raum[#000000], um eine Flammensäule zu erschaffen. Verursacht bei Berührung Schaden und manchmal [#FF0000]LP-Entzug[#000000].", @"[#FF0000]Appuyez sur un espace vide[#000000] pour créer une colonne de feu. Inflige des dégâts et parfois un [#FF0000]Drain de PV[#000000] au contact.", @"[#FF0000]長按空間[#000000]該位置就會出現火柱，\n給予命中的敵人傷害，\n並以一定機率施加異常狀態[#FF0000]ＨＰ減少[#000000]。", @"[#FF0000]长按空间[#000000]该位置就会出现火柱，\n给予命中的敌人伤害，\n并以一定几率使其陷入状态异常[#FF0000]HP减少[#000000]。") },
            { 299, new TwewyPin(299,  "badge_300", @"Anguis", @"アングイス", @"Anguis", @"Anguis", @"Anguis", @"Orvet", @"蛇", @"蛇", @"[#FF0000]Press empty space[#000000] to fire a [#FF0000]powerful, penetrating beam[#000000] in that direction. Inflicts heavy damage on contact.", @"[#FF0000]空間をホールド[#000000]するとその方向に\n[#FF0000]強力な貫通ビーム[#000000]を発射し\n当たった敵に大ダメージを与える", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para disparar un [#FF0000]haz poderoso y penetrante[#000000] en esa dirección. Inflige daños de consideración al impactar.", @"[#FF0000]Premi su uno spazio vuoto[#000000] per sparare un [#FF0000]potente raggio penetrante[#000000] in quella direzione. Infligge gravi danni a contatto.", @"[#FF0000]Drücke im leeren Raum[#000000], um einen [#FF0000]mächtigen durchdringenden Strahl[#000000] in diese Richtung abzufeuern. Verursacht bei Berührung hohen Schaden.", @"[#FF0000]Appuyez sur un espace vide[#000000] pour tirer un [#FF0000]rayon pénétrant puissant[#000000] dans cette direction. Inflige des dégâts au contact.", @"[#FF0000]長按空間[#000000]就會朝該方向發射\n[#FF0000]強力貫穿光束[#000000]，\n給予命中的敵人大幅傷害。", @"[#FF0000]长按空间[#000000]就会朝该方向发射\n[#FF0000]强力贯穿光束[#000000]，\n给予命中的敌人大幅伤害。") },
            { 300, new TwewyPin(300,  "badge_301", @"Pig", @"ピグ", @"Cerdo", @"Maiale", @"Schwein", @"Cochon", @"豬", @"猪", @"[#FF0000]Greatly increases your drop rate[#000000], but in exchange you stop receiving EXP and PP.", @"[#FF0000]ドロップレートが大幅にアップ[#000000]する代わりに\nＥＸＰとＢＰがゲットできなくなる", @"[#FF0000]Aumenta considerablemente tu tasa de botín[#000000], pero a cambio dejas de recibir EXP y PP.", @"[#FF0000]Aumenta notevolmente il tuo tasso di ritrovamenti[#000000], ma in cambio smetti di ricevere ESP e PS.", @"[#FF0000]Erhöht deutlich deine Fundrate[#000000], aber dafür erhältst du weder EP noch PP.", @"[#FF0000]Augmente considérablement votre taux de butin[#000000] mais, en contrepartie, vous ne recevrez plus d'XP et de PB.", @"[#FF0000]掉落率大幅提升[#000000]，\n但卻無法獲得ＥＸＰ與ＰＰ。", @"[#FF0000]掉落率大幅提升[#000000]，\n但却无法获得EXP与PP。") },
            { 301, new TwewyPin(301,  "badge_302", @"Carcin", @"キャンサ", @"Cangrejo", @"Granchio", @"Karzin", @"Crabe", @"蟹", @"蟹", @"[#FF0000]Press Neku[#000000] and remain stationary to create a flame barrier that [#FF0000]wards off enemy attacks[#000000] and [#FF0000]harms enemies[#000000] on contact.", @"[#FF0000]ネクをホールド[#000000]すると炎バリアが発生し\n[#FF0000]攻撃を防ぐと共に接触した敵にダメージ[#000000]を与える\nバリアを出している間は移動できない", @"[#FF0000]Pulsa sobre Neku[#000000] y quédate quieto para formar una barrera de llamas que te [#FF0000]protege de los ataques rivales[#000000] y [#FF0000]daña a los enemigos[#000000] que entran en contacto con ella.", @"[#FF0000]Premi Neku[#000000] e rimani fermo per creare una barriera di fiamme che [#FF0000]respinge gli attacchi nemici[#000000] e [#FF0000]danneggia i nemici[#000000] a contatto.", @"[#FF0000]Drücke auf Neku[#000000] und halte, um eine Flammenbarriere zu erschaffen, die [#FF0000]gegnerische Angriffe abwehrt[#000000] und [#FF0000]Gegnern bei Berührung Schaden zufügt[#000000].", @"[#FF0000]Appuyez sur Neku[#000000] et restez immobile pour créer une barrière de flammes qui [#FF0000]repoussera les attaques ennemies[#000000] et [#FF0000]blessera les ennemis[#000000] au contact.", @"[#FF0000]長按音操[#000000]便會出現火護盾，\n[#FF0000]防禦攻擊的同時還給予接觸的敵人傷害[#000000]，\n護盾出現期間無法移動。", @"[#FF0000]长按音操[#000000]便会出现火护盾，\n[#FF0000]防御攻击的同时还给予接触的敌人伤害[#000000]，\n护盾出现期间无法移动。") },
            { 302, new TwewyPin(302,  "badge_303", @"Grizzly", @"グリズ", @"Grizzly", @"Grizzly", @"Grizzly", @"Grizzly", @"熊", @"熊", @"[#FF0000]Scratch empty space[#000000] to create a shock wave. Inflicts continuous damage on all enemies and sometimes [#FF0000]HP Drain[#000000].", @"[#FF0000]空間をこする[#000000]と衝撃波が発生し\nすべての敵に連続でダメージを与えると\n同時に状態異常[#FF0000]ＨＰ減少[#000000]にすることもある", @"[#FF0000]Rasca en un espacio vacío[#000000] para generar una onda de choque. Inflige daño continuo en todos los enemigos y a veces provoca la [#FF0000]reducción de PV[#000000].", @"[#FF0000]Gratta su uno spazio vuoto[#000000] per creare un'onda d'urto. Infligge danno continuo a tutti nemici e a volte [#FF0000]Risucchio di PF[#000000].", @"[#FF0000]Kratze im leeren Raum[#000000], um eine Schockwelle zu erzeugen. Verursacht kontinuierlich Schaden und manchmal [#FF0000]LP-Entzug[#000000] bei allen Gegnern.", @"[#FF0000]Grattez un espace vide[#000000] pour créer une onde de choc. Inflige des dégâts continus à tous les ennemis et parfois un [#FF0000]Drain de PV[#000000].", @"[#FF0000]摩擦空間[#000000]就會發生衝擊波，\n給予所有敵人連續傷害，\n同時有可能施加異常狀態[#FF0000]ＨＰ減少[#000000]。", @"[#FF0000]摩擦空间[#000000]就会发生冲击波，\n给予所有敌人连续伤害，\n同时有可能使其陷入状态异常[#FF0000]HP减少[#000000]。") },
            { 303, new TwewyPin(303,  "badge_304", @"Wolf", @"ウルフ", @"Lobo", @"Lupo", @"Wolf", @"Loup", @"狼", @"狼", @"[#FF0000]Drag Neku[#000000] into a dash and [#FF0000]smash[#000000] him into enemies. Inflicts damage.", @"[#FF0000]ネクをドラッグ[#000000]してダッシュさせると\n[#FF0000]体当たり[#000000]で敵にダメージを与えることができる", @"[#FF0000]Arrastra a Neku[#000000] hasta que acelere y [#FF0000]choque[#000000] contra los enemigos. Inflige daño.", @"[#FF0000]Trascina Neku[#000000] in uno scatto e [#FF0000]scaraventalo[#000000] sui nemici. Infligge danno.", @"[#FF0000]Ziehe Neku[#000000], damit er sprintet, und [#FF0000]schleudere[#000000] ihn in Gegner hinein. Verursacht Schaden.", @"[#FF0000]Faites glisser Neku[#000000] pour le faire sprinter et il [#FF0000]percutera[#000000] ses ennemis. Inflige des dégâts.", @"[#FF0000]拖曳音操[#000000]使其衝刺，\n便可藉由[#FF0000]碰撞[#000000]給予敵人傷害。", @"[#FF0000]拖拽音操[#000000]使其冲刺，\n便可借由[#FF0000]碰撞[#000000]给予敌人伤害。") },
            { 304, new TwewyPin(304,  "badge_305", @"Frog", @"フログ", @"Rana", @"Rana", @"Frosch", @"Grenouille", @"蛙", @"蛙", @"[#FF0000]Tap empty space[#000000] to create a small, stationary orb of water. Orbs inflict damage on contact and then [#FF0000]rebound a good distance[#000000].", @"[#FF0000]空間をタップ[#000000]することでその位置に動かない\n小水球を出し、当たった敵にダメージを与える\n敵が当たると水球は[#FF0000]反動で大きく移動[#000000]する", @"[#FF0000]Toca un espacio vacío[#000000] para formar una pequeña esfera estática de agua. Las esferas infligen daño al impactar y después [#FF0000]rebotan a una distancia considerable[#000000].", @"[#FF0000]Tocca uno spazio vuoto[#000000] per creare una piccola sfera d'acqua immobile. Le sfere infliggono danno a contatto e [#FF0000]rimbalzano a lunga distanza[#000000].", @"[#FF0000]Tippe im leeren Raum[#000000], um eine kleine, stationäre Wasserkugel zu erschaffen. Kugeln verursachen bei Berührung Schaden und [#FF0000]prallen dann ab[#000000].", @"[#FF0000]Touchez un espace vide[#000000] pour créer un petit orbe d'eau stationnaire. Les orbes infligent des dégâts au contact, puis [#FF0000]rebondissent sur une longue distance[#000000].", @"[#FF0000]點擊空間[#000000]就會朝那位置射出\n不會動的小水球，給予命中的敵人傷害。\n命中敵人後，水球會朝[#FF0000]反方向大幅移動[#000000]。", @"[#FF0000]点击空间[#000000]就会朝那位置射出\n不会动的小水球，给予命中的敌人伤害。\n命中敌人后，水球会朝[#FF0000]反方向大幅移动[#000000]。") },
            { 305, new TwewyPin(305,  "badge_306", @"Green Dragon", @"グリーンドラゴン", @"Dragón Verde", @"Drago Verde", @"Grüner Drache", @"Dragon vert", @"青綠龍", @"翠绿巨龙", @"[#FF0000]Drag empty space[#000000] to ignite a wall of fire that inflicts damage on any enemies it touches. Afterward, it [#FF0000]generates a tornado that knocks enemies into the air[#000000].", @"[#FF0000]空間をドラッグ[#000000]することでドラッグした線上に\n炎を走らせ、当たった敵にダメージを与える\n炎の後には[#FF0000]竜巻が発生し、敵を打ち上げる[#000000]", @"[#FF0000]Arrastra por un espacio vacío[#000000] para prender un muro de fuego que inflige daño a cualquier enemigo con el que entre en contacto. Después, [#FF0000]genera un tornado que derriba a los enemigos en el aire[#000000].", @"[#FF0000]Trascina uno spazio vuoto[#000000] per accendere un muro di fuoco che infligge danni a tutti i nemici che tocca. Dopodiché, [#FF0000]genera un tornado che lancia i nemici in aria[#000000].", @"[#FF0000]Ziehe im leeren Raum[#000000], um eine Mauer aus Feuer zu entzünden, die allen Gegnern, die sie berührt, Schaden zufügt. Danach [#FF0000]erschafft sie einen Tornado[#000000], [#FF0000]der Gegner in die Luft schleudert.[#000000]", @"[#FF0000]Faites glisser un espace vide[#000000] pour allumer un rempart de feu qui inflige des dégâts aux ennemis qu'il touche. Il laisse ensuite [#FF0000]place à une tornade qui propulse les ennemis en l'air[#000000].", @"[#FF0000]拖曳空間[#000000]會使拖曳過的路線\n起火，給予命中敵人傷害。\n起火後會產生[#FF0000]龍捲風，將敵人打飛至空中[#000000]。", @"[#FF0000]拖曳空间[#000000]会使拖曳过的路线\n起火，给予命中敌人伤害。\n起火后会产生[#FF0000]龙卷风，将敌人打飞至空中[#000000]。") },
            { 306, new TwewyPin(306,  "badge_307", @"Vinyl Record", @"アナログレコード", @"Disco de Vinilo", @"Disco Vinile", @"Schallplatte", @"Disque Vinyl", @"黑膠唱片", @"黑胶唱片", @"[#FF0000]Scratch empty space[#000000] to attack with a [#FF0000]spinning slash[#000000] and create a [#FF0000]shock wave[#000000] that damages any enemies it touches.", @"[#FF0000]空間をこする[#000000]ことで[#FF0000]回転斬り[#000000]と[#FF0000]衝撃波[#000000]を出し\n当たった敵にダメージを与える", @"[#FF0000]Rasca en un espacio vacío[#000000] para atacar con un [#FF0000]tajo giratorio[#000000] y crear además una [#FF0000]onda de choque[#000000] que daña a los enemigos que alcance.", @"[#FF0000]Gratta uno spazio vuoto[#000000] per attaccare con un [#FF0000]fendente rotante[#000000] e creare un'[#FF0000]onda d'urto[#000000] che danneggia tutti i nemici che tocca.", @"[#FF0000]Kratze im leeren Raum[#000000], um mit einem [#FF0000]Wirbelschlag[#000000] anzugreifen und dabei eine [#FF0000]Schockwelle[#000000] zu erschaffen, die allen Gegnern Schaden zufügt, die sie berühren.", @"[#FF0000]Grattez un espace vide[#000000] pour attaquer avec une [#FF0000]entaille tournante[#000000] tout en créant une [#FF0000]onde de choc[#000000] qui blesse les ennemis qu'elle touche.", @"[#FF0000]摩擦空間[#000000]，就會使出[#FF0000]迴轉斬擊[#000000]與[#FF0000]衝擊波[#000000]，\n給予命中的敵人傷害。", @"[#FF0000]摩擦空间[#000000]，就会使出[#FF0000]回转斩击[#000000]与[#FF0000]冲击波[#000000]，\n给予命中的敌人伤害。") },
            { 307, new TwewyPin(307,  "badge_308", @"Downhill Buffalo", @"ダウンヒルバッファロー", @"Downhill Buffalo", @"Downhill Buffalo", @"Downhill Buffalo", @"Downhill Buffalo", @"Downhill Buffalo", @"Downhill Buffalo", @"[#FF0000]Slash Neku[#000000] to unleash [#FF0000]three columns of fire[#000000] in that direction that damage any enemies they touch.", @"[#FF0000]ネクをスラッシュ[#000000]することで\nその方向に[#FF0000]炎を３本[#000000]走らせ\n当たった敵にダメージを与える", @"[#FF0000]Corta a Neku[#000000] para generar [#FF0000]tres columnas de fuego[#000000] en esa dirección y herir a los enemigos que alcancen.", @"[#FF0000]Colpisci Neku con un fendente[#000000] per scatenare [#FF0000]tre colonne di fuoco[#000000] in quella direzione, che danneggeranno tutti i nemici che toccano.", @"Führe einen [#FF0000]Hieb auf Neku[#000000] aus, um [#FF0000]drei Feuersäulen[#000000] in diese Richtung loszulassen, die allen Gegnern Schaden zufügen, die sie berühren.", @"[#FF0000]Balayez Neku[#000000] pour invoquer [#FF0000]trois colonnes de feu[#000000] dans cette direction, qui infligent des dégâts à tous les ennemis qu'elles touchent.", @"[#FF0000]劃過音操[#000000]就會朝\n該方向[#FF0000]燃起３道火焰[#000000]，\n給予命中的敵人傷害。", @"[#FF0000]划过音操[#000000]就会朝\n该方向[#FF0000]燃起３道火焰[#000000]，\n给予命中的敌人伤害。") },
            { 308, new TwewyPin(308,  "badge_309", @"Hermit Crab Feather", @"ヤドカリフェザー", @"Pluma de Cangrejo Ermitaño", @"Granchio Eremita", @"Eremit Krabben Feder", @"Plume de Bernard- l'Ermite ", @"寄蟹之羽", @"寄居蟹的羽毛", @"[#FF0000]Slash Neku[#000000] to [#FF0000]hurl his body[#000000] in that direction, damaging any enemies he touches. He will continue charging until the gauge is emptied (can be interrupted).", @"[#FF0000]ネクをスラッシュ[#000000]することでその方向に\n[#FF0000]体当たり[#000000]を開始し、当たった敵にダメージを与える\nゲージがなくなるまで体当たりし続ける（中断可能）", @"[#FF0000]Corta a Neku[#000000] para [#FF0000]lanzar su cuerpo[#000000] en esa dirección y herir a los enemigos que toque. Seguirá cargando hasta que se vacíe el indicador (se puede interrumpir).", @"[#FF0000]Colpisci Neku con un fendente[#000000] per [#FF0000]scagliare il suo corpo[#000000] in quella direzione, danneggiando tutti i nemici che tocca. Continuerà ad attaccare finché l'indicatore non si sarà svuotato (può essere interrotto).", @"Führe einen [#FF0000]Hieb auf Neku[#000000] aus, um [#FF0000]seinen Körper[#000000] in diese Richtung zu schleudern; dabei fügt er allen Gegnern, die er berührt, Schaden zu. Er greift weiter an, bis die Anzeige leer ist (Unterbrechen möglich).", @"[#FF0000]Balayez Neku[#000000] pour [#FF0000]le projeter physiquement[#000000] dans cette direction, en infligeant des dégâts à tous les ennemis qu'il touche. Il continuera à charger jusqu'à ce que la jauge soit vide ou que vous interrompiez l'action.", @"[#FF0000]劃過音操[#000000]就會朝該方向\n進行[#FF0000]身體衝撞[#000000]，給予命中的敵人傷害。\n在計量表耗盡前會不斷進行衝撞。（可以中斷）", @"[#FF0000]划过音操[#000000]就会朝该方向\n进行[#FF0000]身体冲撞[#000000]，给予命中的敌人伤害。\n在计量表耗尽前会不断进行冲撞。（可以中断）") },
            { 309, new TwewyPin(309,  "badge_310", @"Great Physical Power", @"グレートフィジカルパワー", @"Gran Poder Físico", @"Gran Potere Fisico", @"Große Physische Kraft", @"Grande Force Physique", @"體魄強健", @"强身健体", @"[#FF0000]Slash vertically up on empty space[#000000] to cause multiple swords to appear and damage any enemies they touch.", @"[#FF0000]空間を下から上にスラッシュ[#000000]すると\n剣が大量に出現し、当たった敵にダメージを与える", @"[#FF0000]Corta sobre un espacio vacío de abajo arriba[#000000] para que aparezcan varias espadas que alcanzan y dañan al enemigo.", @"[#FF0000]Colpisci uno spazio vuoto con un fendente dal basso all'alto[#000000] per far apparire delle spade e danneggiare tutti i nemici che toccano.", @"Führe einen [#FF0000]Hieb im leeren Raum von unten nach oben[#000000] aus, damit mehrere Schwerter erscheinen und allen Gegnern Schaden zufügen, die sie berühren.", @"[#FF0000]Balayez un espace vide de bas en haut[#000000] pour faire apparaître plusieurs épées et infliger des dégâts à tous les ennemis qu'elles touchent.", @"[#FF0000]由下往上劃過空間[#000000]，\n就會出現大量劍刃，給予命中的敵人傷害。", @"[#FF0000]由下往上划过空间[#000000]，\n就会出现大量剑刃，给予命中的敌人伤害。") },
            { 310, new TwewyPin(310,  "badge_311", @"Dove Actually", @"ハナヨメデート", @"Dove Actually", @"Incontro Amoroso", @"Dove Actually", @"Dove Actually", @"花嫁之約", @"准新娘之约", @"[#FF0000]Tap empty space[#000000] to \nfire a [#FF0000]large, slow-moving projectile[#000000]. Afterward, [#FF0000]you can change the direction by tapping on empty space again[#000000].", @"[#FF0000]空間をタップ[#000000]することで\nその方向にゆっくり飛ぶ[#FF0000]大きな弾[#000000]を発射する\n発射後、[#FF0000]空間をタップすることで方向を変えられる[#000000]", @"[#FF0000]Toca un espacio vacío[#000000] para \nsaltar lentamente en esa dirección y lanzar un [#FF0000]gran proyectil[#000000]. Después, [#FF0000]puedes cambiar de dirección volviendo a tocar el espacio vacío[#000000].", @"[#FF0000]Tocca uno spazio vuoto[#000000] per saltare lentamente in quella direzione e sparare un [#FF0000]grande proiettile[#000000]. Dopodiché, [#FF0000]potrai cambiare direzione toccando nuovamente uno spazio vuoto[#000000].", @"[#FF0000]Tippe im leeren Raum[#000000], um \nlangsam in diese Richtung zu springen und ein [#FF0000]großes Geschoss[#000000] abzufeuern. Danach [#FF0000]kannst du die Richtung ändern[#000000], [#FF0000]indem du nochmals im leeren Raum tippst[#000000].", @"[#FF0000]Touchez un espace vide[#000000] pour \nsauter lentement dans cette direction et tirer un [#FF0000]grand projectile[#000000]. Ensuite, [#FF0000]vous pouvez changer de direction en touchant à nouveau un espace vide[#000000].", @"[#FF0000]點擊空間[#000000]就會朝\n該方向發射緩慢前進的[#FF0000]巨大子彈[#000000]，\n[#FF0000]點擊空間即改變其方向[#000000]。", @"[#FF0000]点击空间[#000000]就会朝\n该方向发射缓慢前进的[#FF0000]巨大子弹[#000000]，\n[#FF0000]点击空间即改变其方向[#000000]。") },
            { 311, new TwewyPin(311,  "badge_312", @"Zipzap Zipper", @"じわじわジッパー", @"Cremallera Zipzap ", @"Zipzap Zipper", @"Zipzap Reißverschluss", @"Fermeture Éclair Zipzap", @"穩確拉鍊", @"缓慢拉链", @"[#FF0000]Slash empty space[#000000] to cause a chain to appear that [#FF0000]freezes[#000000] any enemies it touches. (Some enemies may be immune.)", @"[#FF0000]空間をスラッシュ[#000000]するとその位置にクサリが発生し\n当たった敵を[#FF0000]凍らせる[#000000](一部の敵のぞく)", @"[#FF0000]Corta sobre un espacio vacío[#000000] para que aparezca un cadena que [#FF0000]congela[#000000] a los enemigos que toca (Algunos enemigos podrían ser inmunes).", @"[#FF0000]Colpisci uno spazio vuoto con un fendente[#000000] per far apparire una catena che [#FF0000]blocca[#000000] tutti i nemici che tocca. (Alcuni nemici potrebbero esserne immuni).", @"Führe einen [#FF0000]Hieb im leeren Raum[#000000] aus, damit eine Kette erscheint, die alle Gegner [#FF0000]einfrieren[#000000] lässt, die sie berührt (Manche Gegner sind möglicherweise immun).", @"[#FF0000]Balayez un espace vide[#000000] pour faire apparaître une chaîne qui [#FF0000]fige[#000000] tous les ennemis qu'elle touche. (Certains ennemis peuvent être immunisés).", @"[#FF0000]於空間中劃線[#000000]就會於該位置出現鎖鏈，\n[#FF0000]凍結[#000000]命中的敵人。（部分敵人除外）", @"[#FF0000]在空间中划线[#000000]就会于该位置出现锁链，\n[#FF0000]冻结[#000000]命中的敌人。（部分敌人除外）") },
            { 312, new TwewyPin(312,  "badge_313", @"Unfortune Teller", @"残酷な恋占い", @"Desafortunada Adivinación", @"Chiromante Sfortunato", @"Unheilvolle Prophezeiung", @"Fâcheuse Divination", @"殘酷的戀愛占卜", @"残酷的恋爱占卜", @"[#FF0000]Press Neku[#000000] to conjure swords that fly outward, damaging enemies. [#FF0000]Keep pressing Neku to continue conjuring swords[#000000].", @"[#FF0000]ネクをホールド[#000000]すると周囲に剣が飛んでいき\n当たった敵にダメージを与える\n発動後、[#FF0000]ホールドし続けると連続で飛んで行く[#000000]", @"[#FF0000]Pulsa sobre Neku[#000000] para que salga una espada volando y hiera a los enemigos de alrededor. Después, [#FF0000]si sigues pulsando sobre Neku aparecerán varias espadas voladoras[#000000].", @"[#FF0000]Premi Neku[#000000] per far volare una rosa di spade che danneggia i nemici. [#FF0000]Continua a premere su Neku per lanciare altre spade[#000000].", @"[#FF0000]Drücke auf Neku[#000000], um Schwerter zu beschwören, die von Neku ausgehend nach außen fliegen und Gegnern schaden. [#FF0000]Wenn du danach weiter auf Neku drückst[#000000], [#FF0000]beschwörst du weitere Schwerter[#000000].", @"[#FF0000]Appuyez sur Neku[#000000] pour faire voler des épées qui infligent des dégâts aux ennemis environnants. Ensuite, [#FF0000]plusieurs autres épées apparaissent si vous continuez à appuyer sur Neku[#000000].", @"[#FF0000]長按音操[#000000]後，周圍會飛出劍刃，\n給予命中的敵人傷害。\n發動後，[#FF0000]持續長按可使劍刃連續飛出[#000000]。", @"[#FF0000]长按音操[#000000]后，周围会飞出剑刃，\n给予命中的敌人伤害。\n发动后，[#FF0000]持续长按可使剑刃连续飞出[#000000]。") },
            { 313, new TwewyPin(313,  "badge_314", @"Brain Beam", @"ブレーンリフレッシュ", @"Haz Cerebral", @"Raggio celebrale", @"Hirnstrahl", @"Rayon cérébral", @"清新醒腦", @"提神醒脑", @"[#FF0000]Slash Neku[#000000] to fire a [#FF0000]heat ray[#000000] in that direction that damages any enemies it touches.", @"[#FF0000]ネクをスラッシュ[#000000]することで\nその方向に[#FF0000]熱線[#000000]を放ち\n当たった敵にダメージを与える", @"[#FF0000]Corta a Neku[#000000] para lanzar un [#FF0000]rayo de calor[#000000] en esa dirección que hiere a los enemigos que toca.", @"[#FF0000]Colpisci Neku con un fendente[#000000] per lanciare un [#FF0000]raggio di calore[#000000] in quella direzione, che danneggerà tutti i nemici che tocca.", @"Führe einen [#FF0000]Hieb auf Neku[#000000] aus, um einen [#FF0000]Hitzestrahl[#000000] in diese Richtung abzuschießen, der allen Gegnern Schaden zufügt, die er berührt.", @"[#FF0000]Balayez Neku[#000000] pour tirer un [#FF0000]rayon thermique[#000000] dans cette direction, qui inflige des dégâts à tous les ennemis qu'il touche.", @"[#FF0000]劃過音操[#000000]就會朝\n該方向[#FF0000]發射熱線[#000000]，\n給予命中的敵人傷害。", @"[#FF0000]划过音操[#000000]就会朝\n该方向[#FF0000]发射热线[#000000]，\n给予命中的敌人伤害。") },
            { 314, new TwewyPin(314,  "badge_315", @"WITCHCRAFT", @"WITCHCRAFT", @"Brujería", @"Stregoneria", @"HEXEREI", @"Sorcellerie", @"魔幻之術", @"妖巫魔法", @"[#FF0000]Slash vertically down on an enemy[#000000] to teleport above their head and unleash a [#FF0000]devastating fire attack[#000000]. \x22[#FF0000]An age when three kingdoms drowned in crimson[#000000] come together...\x22 is inscribed on the pin.", @"[#FF0000]敵を上から下にスラッシュ[#000000]することで\nその敵の頭上にテレポートし[#FF0000]下突き炎攻撃[#000000]を行う\n「[#FF0000]紅に染まる三国[#000000]が揃いし刻…」と刻まれている", @"[#FF0000]Corta a un enemigo de abajo arriba[#000000] para teletransportarte sobre su cabeza y lanzar un [#FF0000]devastador ataque de fuego[#000000]. El pin lleva la inscripción «[#FF0000]Una época en la que se unen tres reinos[#000000] teñidos de carmesí...».", @"[#FF0000]Colpisci un nemico con un fendente dal basso all'alto[#000000] per trasportarti sopra la testa del nemico e scatenare un [#FF0000]devastante attacco di fuoco[#000000]. Sulla spilla c'è scritto \x22[#FF0000]Un'epoca in cui tre regni tinti di rosso[#000000] si uniscono...\x22", @"Führe einen [#FF0000]Hieb auf einen Gegner von unten nach oben[#000000] aus, um dich über den Kopf des Gegners zu teleportieren und einen [#FF0000]verheerenden Feuerangriff[#000000] loszulassen. \x22Ein [#FF0000]Zeitalter, in dem drei Königreiche, die im Rot untergingen,[#000000] zusammenkommen ...\x22, steht auf dem Pin.", @"[#FF0000]Balayez un ennemi de bas en haut[#000000] pour vous téléporter au-dessus de sa tête et asséner une [#FF0000]attaque de feu dévastatrice[#000000]. \x22[#FF0000]Enfin s'allient trois royaumes noyés de vermeil[#000000]...\x22 est inscrit sur le badge.", @"[#FF0000]由上往下劃過敵人[#000000]，\n便能傳送至該敵人上方使出[#FF0000]向下戳刺的火焰攻擊[#000000]。\n刻著「[#FF0000]沾染鮮紅之三國[#000000]匯聚之時……」。", @"[#FF0000]由上往下划过敌人[#000000]，\n便能传送至该敌人上方使出[#FF0000]向下戳刺的火焰攻击[#000000]。\n刻着「[#FF0000]沾染鲜红之三国[#000000]汇聚之时……」。") },
            { 315, new TwewyPin(315,  "badge_316", @"METTAZASHI", @"METTAZASHI", @"METTAZASHI", @"METTAZASHI", @"METTAZASHI", @"METTAZASHI", @"Meta刺擊", @"灭多刺杀", @"[#FF0000]Slash an enemy[#000000] and Neku will move in to strike. The [#FF0000]flames launched will change in shape[#000000] depending on the direction. [#FF0000]An age when three kingdoms drowned in crimson[#000000] come together...\x22 is inscribed on the pin.", @"[#FF0000]敵をスラッシュ[#000000]することで移動して斬りつける\n斬りつける方向によって[#FF0000]出る炎の形が変わる[#000000]\n「[#FF0000]紅に染まる三国[#000000]が揃いし刻…」と刻まれている", @"[#FF0000]Corta a un enemigo[#000000] para desplazarte mientras cortas. Las [#FF0000]llamas cambiarán de forma[#000000] dependiendo de la dirección de corte. El pin lleva la inscripción [#FF0000]«Una época en la que se unen tres reinos[#000000] teñidos de carmesí...».", @"[#FF0000]Colpisci un nemico[#000000] per spostati mentre colpisci. Le [#FF0000]fiamme cambieranno forma[#000000] a seconda della direzione del fendente. Sulla spilla c'è scritto \x22[#FF0000]Un'epoca in cui tre regni tinti di rosso[#000000] si uniscono...\x22", @"Führe einen [#FF0000]Hieb auf einen Gegner von unten nach oben[#000000] aus, um dich während des Hiebs zu bewegen. Die [#FF0000]Flammen verändern ihre Form[#000000], je nachdem, in welche Richtung zu schlägst. \x22Ein [#FF0000]Zeitalter, in dem drei Königreiche, die im Rot untergingen[#000000] zusammenkommen ...\x22, steht auf dem Pin.", @"[#FF0000]Balayez un ennemi[#000000] pour vous déplacer pendant le balayage. Les [#FF0000]flammes changent de forme[#000000] selon la direction du balayage. Une inscription figure sur le badge : \x22[#FF0000]Enfin s'allient trois royaumes noyés de vermeil[#000000]...\x22", @"[#FF0000]劃過敵人[#000000]，便能移動並使出斬擊。\n根據斬擊的方向不同，[#FF0000]冒出的火焰形狀也不同[#000000]。\n刻著「[#FF0000]沾染鮮紅之三國[#000000]匯聚之時……」。", @"[#FF0000]划过敌人[#000000]，便能移动并使出斩击。\n根据斩击的方向不同，[#FF0000]冒出的火焰形状也不同[#000000]。\n刻着「[#FF0000]沾染鲜红之三国[#000000]汇聚之时……」。") },
            { 316, new TwewyPin(316,  "badge_317", @"KATON NO JUTSU", @"KATONNOJUTSU", @"KATON NO JUTSU", @"KATON NO JUTSU", @"KATON NO JUTSU", @"KATON NO JUTSU", @"火遁", @"火遁", @"[#FF0000]Slash vertically up on an enemy[#000000] to move next to them and perform a fiery jumping slash. [#FF0000]An age when three kingdoms drowned in crimson[#000000] come together...\x22 is inscribed on the pin.", @"[#FF0000]敵を下から上にスラッシュ[#000000]することで\n敵の側へ移動して[#FF0000]炎ジャンプ斬り[#000000]を出す\n「[#FF0000]紅に染まる三国[#000000]が揃いし刻…」と刻まれている", @"[#FF0000]Corta a un enemigo de abajo arriba[#000000] para pasar al siguiente enemigo y lanzar un feroz corte con salto. El pin lleva la inscripción «[#FF0000]Una época en la que se unen tres reinos[#000000] teñidos de carmesí...».", @"[#FF0000]Colpisci un nemico con un fendente dal basso all'alto[#000000] per spostarti vicino a un nemico ed eseguire un devastante attacco con salto. Sulla spilla c'è scritto \x22[#FF0000]Un'epoca in cui tre regni tinti di rosso[#000000] si uniscono...\x22", @"Führe einen [#FF0000]Hieb auf einen Gegner von unten nach oben[#000000] aus, um dich neben einen Gegner zu bewegen und einen feurigen Sprunghieb auszuführen. \x22Ein [#FF0000]Zeitalter, in dem drei Königreiche, die im Rot untergingen[#000000], zusammenkommen ...\x22, steht auf dem Pin.", @"[#FF0000]Balayez un ennemi de bas en haut[#000000] pour vous téléporter au-dessus de sa tête et asséner une attaque de feu dévastatrice. Une inscription figure sur le badge : \x22[#FF0000]Enfin s'allient trois royaumes noyés de vermeil[#000000]...\x22", @"[#FF0000]由下往上劃過敵人[#000000]\n便可移動到敵人身旁使出[#FF0000]跳躍火焰斬擊[#000000]。\n刻著「[#FF0000]沾染鮮紅之三國[#000000]匯聚之時……」。", @"[#FF0000]由下往上划过敌人[#000000]\n便可移动到敌人身旁使出[#FF0000]跳跃火焰斩击[#000000]。\n刻着「[#FF0000]沾染鲜红之三国[#000000]汇聚之时……」。") },
            { 317, new TwewyPin(317,  "badge_318", @"Rakshasa the Tyrant", @"暴君羅刹", @"Rakshasa el Tirano", @"Rakshasa il Tiranno", @"Rakshasa der Tyrann", @"Rakshasa le Tyrant", @"惡鬼暴君", @"暴君罗刹", @"[#FF0000]Press empty space[#000000] to [#FF0000]send multiple swords[#000000] in that direction, damaging any enemies they touch. Afterward, you can drag to change the swords' direction.", @"[#FF0000]空間をホールド[#000000]することでその方向に\n[#FF0000]剣を大量に発射[#000000]し、当たった敵にダメージを与える\n[#FF0000]発動後、ドラッグ[#000000]することで発射方向を変えられる", @"[#FF0000]Pulsa sobre un espacio vacío[#000000] para [#FF0000]lanzar varias espadas[#000000] en esa dirección y dañar a los enemigos que alcancen. Después puedes arrastrar para cambiar la dirección de las espadas.", @"[#FF0000]Premi uno spazio vuoto[#000000] per [#FF0000]sparare delle spade[#000000] in quella direzione, danneggiando tutti i nemici che toccano. Dopodiché, potrai trascinare per cambiare la direzione delle spade.", @"[#FF0000]Drücke im leeren Raum[#000000], um [#FF0000]mehrere Schwerter[#000000] in diese Richtung abzufeuern, die allen Gegnern Schaden zufügen, die sie berühren. Danach kannst du die Richtung der Schwerter durch Ziehen ändern.", @"[#FF0000]Appuyez sur un espace vide[#000000] pour [#FF0000]décocher plusieurs épées[#000000] dans cette direction, qui infligent des dégâts à tous les ennemis qu'elles touchent. Ensuite, vous pouvez les faire changer de direction en glissant le doigt.", @"[#FF0000]長按空間[#000000]就會朝該方向發射\n[#FF0000]大量劍刃[#000000]，給予命中的敵人傷害。\n[#FF0000]發動後，可以藉由拖曳[#000000]改變發射方向。", @"[#FF0000]长按空间[#000000]就会朝该方向发射\n[#FF0000]大量剑刃[#000000]，给予命中的敌人伤害。\n[#FF0000]发动后，可以藉由拖曳[#000000]改变发射方向。") },
