            { 319, new TwewyPin(319,  "badge_320", @"Papillon Rouge", @"パピヨン・ルージュ", @"Pabellón Rojo", @"Farfallino", @"Pavillon Rouge", @"Papillon Rouge", @"蝴蝶犬口紅", @"猩红蝴蝶犬", @"[#FF0000]Slash empty space[#000000] to cause a chain to appear that [#FF0000]damages any enemy it touches while also restoring your HP[#000000].", @"[#FF0000]空間をスラッシュ[#000000]するとその位置にクサリが発生し\n[#FF0000]当たった敵にダメージを与えると同時に\nＨＰを回復[#000000]できる", @"[#FF0000]Corta sobre un espacio vacío[#000000] para que aparezca un cadena que [#FF0000]daña a los enemigos que toca y, al mismo tiempo, restablece tus PV[#000000].", @"[#FF0000]Colpisci uno spazio vuoto con un fendente[#000000] per far apparire una catena che [#FF0000]danneggia tutti i nemici toccati mentre ripristina i tuoi PF[#000000].", @"Führe einen [#FF0000]Hieb im leeren Raum[#000000] aus, damit eine Kette erscheint, die allen Gegnern [#FF0000]Schaden zufügt[#000000], [#FF0000]die sie berührt und dabei deine LP wiederherstellt[#000000].", @"[#FF0000]Balayez un espace vide[#000000] pour faire apparaître une chaîne qui [#FF0000]inflige des dégâts à tous les ennemis qu'elle touche tout en vous rendant des PV[#000000].", @"[#FF0000]於空間中劃線[#000000]就會於該位置出現鎖鏈，\n[#FF0000]給予命中的敵人傷害，\n同時恢復ＨＰ[#000000]。", @"[#FF0000]在空间中划线[#000000]就会于该位置出现锁链，\n[#FF0000]给予命中的敌人伤害，\n同时恢复ＨＰ[#000000]。") },
            { 320, new TwewyPin(320,  "badge_321", @"Rubellite", @"ルベライト", @"Rubellita", @"Rubellite", @"Rubellit", @"Rubellite", @"朱紅碧璽", @"绯红碧玺", @"A pin inlaid with pink gemstones. Certain shop quests let you trade this in for a [#FF0000]useful item[#000000].", @"ピンクの宝石を一つ埋め込んだバッジ\nどこかのショップのクエストで\n[#FF0000]使えるアイテム[#000000]と交換できそうだ", @"Pin que lleva gemas rosas incrustadas. Algunas tiendas te permiten hacer un trueque por un [#FF0000]objeto útil[#000000].", @"Una spilla intarsiata con gemme rosa. Alcune missioni dei negozi te la lasciano scambiare con un [#FF0000]oggetto utile[#000000].", @"Ein Pin, der mit rosafarbenen Edelsteinen besetzt ist. Bei bestimmten Ladenquests kannst du ihn gegen ein [#FF0000]nützliches Objekt[#000000] eintauschen.", @"Un badge incrusté de gemmes roses. Dans certaines quêtes de boutique, vous pouvez l'échanger contre un [#FF0000]objet utile[#000000].", @"嵌入一個粉紅色寶石的徽章，\n似乎可在某間店的委託中\n換取[#FF0000]實用的道具[#000000]。", @"嵌入一个粉红色宝石的徽章，\n似乎可在某间店的委托中\n换取[#FF0000]实用的道具[#000000]。") },
            { 321, new TwewyPin(321,  "badge_322", @"Morganite", @"モルガナイト", @"Morganita", @"Morganite", @"Morganit", @"Morganite", @"摩根石", @"摩根石", @"A pin inlaid with double pink gemstones. Certain shop quests let you trade this in for a [#FF0000]pretty good item[#000000].", @"ピンクの宝石を二つ埋め込んだバッジ\nどこかのショップのクエストで\n[#FF0000]かなりのアイテム[#000000]と交換できそうだ", @"Pin que lleva gemas rosas dobles incrustadas. Algunas tiendas te permiten hacer un trueque por un [#FF0000]objeto bastante bueno[#000000].", @"Una spilla intarsiata con una doppia gemma rosa. Alcune missioni dei negozi te la lasciano scambiare con un [#FF0000]oggetto piuttosto buoni[#000000].", @"Ein Pin, der mit zwei rosafarbenen Edelsteinen besetzt ist. Bei bestimmten Ladenquests kannst du ihn gegen ein [#FF0000]ziemlich gutes Objekt[#000000] eintauschen.", @"Un badge incrusté de gemmes roses doubles. Dans certaines quêtes de boutique, vous pouvez l'échanger contre un [#FF0000]assez bon objet[#000000].", @"嵌入兩個粉紅色寶石的徽章，\n似乎可在某間店的委託中\n換取[#FF0000]不錯的道具[#000000]。", @"嵌入两个粉红色宝石的徽章，\n似乎可在某间店的委托中\n换取[#FF0000]不错的道具[#000000]。") },
            { 322, new TwewyPin(322,  "badge_323", @"Taaffeite", @"ターフェアイト", @"Taafeeite", @"Taafeeite", @"Taaffeite", @"Taafeeite", @"塔菲石", @"塔菲石", @"A pin inlaid with triple pink gemstones. Certain shop quests let you trade this in for an [#FF0000]awesome item[#000000].", @"ピンクの宝石を三つ埋め込んだバッジ\nどこかのショップのクエストで\n[#FF0000]イケてるアイテム[#000000]と交換できそうだ", @"Pin que lleva gemas rosas triples incrustadas. Algunas tiendas te permiten hacer un trueque por un [#FF0000]objeto alucinante[#000000].", @"Una spilla intarsiata con una tripla gemma rosa. Alcune missioni dei negozi te la lasciano scambiare con un [#FF0000]oggetto fantastico[#000000].", @"Ein Pin, der mit drei rosafarbenen Edelsteinen besetzt ist. Bei bestimmten Ladenquests kannst du ihn gegen ein [#FF0000]tolles Objekt[#000000] eintauschen.", @"Un badge incrusté de gemmes roses triples. Dans certaines quêtes de boutique, vous pouvez l'échanger contre un [#FF0000]super objet[#000000].", @"嵌入三個粉紅色寶石的徽章，\n似乎可在某間店的委託中\n換取[#FF0000]帥氣的道具[#000000]。", @"嵌入三个粉红色宝石的徽章，\n似乎可在某间店的委托中\n换取[#FF0000]帅气的道具[#000000]。") }
