        #endregion

        public Dictionary<ushort, TwewyItem> GetItems()
        {
            return GameItems;
        }

        public Dictionary<ushort, TwewyPin> GetPins()
        {
            return Pins;
        }

        public TwewyItem GetItem(ushort Id)
        {
            if (GameItems.ContainsKey(Id))
            {
                return GameItems[Id];
            }

            return null;
        }

        public TwewyItem GetItemWithIndex(int Index, byte Type)
        {
            ushort Id = (ushort)(Index + 10000);

            if (Type == 2)
            {
                Id += 10000;
            }
            else if (Type == 3)
            {
                Id += 20000;
            }

            return GetItem(Id);
        }

        public TwewyPin GetPin(ushort Id)
        {
            if (Pins.ContainsKey(Id))
            {
                return Pins[Id];
            }

            return null;
        }
    }
